INSERT INTO `article` VALUES (16, '111.txt', '1995/03/30', 'The World\n', 'DRILLING TECHNIQUE BANNED IN TETHYS\n', 'The World\nDRILLING TECHNIQUE BANNED IN TETHYS\n30 March 1995\nCENTRUM, Tethys - GAStech International\'s Hyper Acidic Substrate Removal (HASR) has officially been banned by the Tethys government due to the high probability of water contamination. \nGAStech developed the innovative drilling technique in 1974 proved quite successful for the extraction of gas, but the technique\'s environmental impact is deemed unacceptable by the Tethys government due to the high probability of water table contamination from waste products produced during the HASR process.\nSten Sanjorge, Jr. responded to the ban saying, \"So be it. Tethys\' loss will be another country\'s gain.\"\n');
