INSERT INTO `article` VALUES (29, '123.txt', '2011/07/28', 'Central Bulletin\n', 'GOVERNMENT LABELS POK \'PUBLIC THREAT\'  \n', 'Central Bulletin\nGOVERNMENT LABELS POK \'PUBLIC THREAT\'  \n2011/07/28\nABILA, Kronos - The Kronos Government has labeled the Protectors of Kronos (POK) as a threat to the public. In a statement by government spokesman Rufus Drymiau the POK are described as \"justifiably a public threat due to violent demonstrations, opportunistic vandalism, and clashes with the police.\" \nA shop owner in the Siopa district, who declined to be named, responded to the government labeling the POK a public threat: \"I agree they are a public threat. Every time they come around they bring their signs and then they smash windows. \nOfficer Emilio Haber, who patrols the Siopa district, said of the POK, \"They smash the windows. They make themselves look stupid and then we arrest them and put them in jail where they belong.\"\n');
INSERT INTO `article` VALUES (30, '124.txt', '2013/02/08', 'News Online Today \n', 'Abila Hospitals Seeing Influx of Designer Drug Users \n', 'News Online Today \nAbila Hospitals Seeing Influx of Designer Drug Users \n2013/02/08\nThe Emergency Department at Abila General Hospital in Kronos has been swamped in the last month by people suffering medical complications from designer drugs such as \"cotton candy\" and synthetic marijuana, a hospital official said. Citywide, several deaths have been attributed to \"Cotton Candy\" according to the Kronos National Poison Center. \nDesigner drugs are chemical compounds synthesized to resemble the active ingredient in often illegal drugs. Cotton candy mimics the drug khat, a stimulant. Manufacturers frequently change the designer drug\'s chemical composition and its name to stay one step ahead of authorities, Biance said. \nThe term cotton candy, for example, is a nickname of the drug and has nothing to do with the carnival treat.  \nThe Kronos government has placed three of the chemicals commonly used in the creation of cotton candy on its controlled substance list, criminalizing their use and possession. Still, the government cannot outright ban cotton candy because manufacturers can alter the recipe and skirt the law, Bianca said. She said a gram of cotton candy costs about K18 while a gram of cocaine costs K166. The crash\'s ill-effects often prompt people to binge on cotton candy to the point where they consume the drug for days. The Asterian People\'s Army has traditionally been involved with drug trafficking throughout the region, and enforcement agencies are closely examining possible cooperation between drug trafficking organizations and political insurgent groups.\n');
