INSERT INTO `article` VALUES (37, '130.txt', '2013/06/20', 'Kronos Star\n', 'Annual POK Rally Ends in Riot, Again\n', 'Kronos Star\nAnnual POK Rally Ends in Riot, Again\nMarcella Trapani\n20 June 2013\nABILA, Kronos - POK members held their annual demonstration in Abila yesterday.  A larger than usual crowd gathered in front of the Capitol building, waving signs holding pictures of Elian Karel and Juliana Vann, who were painted as POK \"martyrs\".  The crowds chanted about government corruption and called for President Dorel Kapelou to step down.  Several protestors carried signs calling for an end to the \"exploitive Tethys corporate capitalism\" and alleging, \"GAStech poisoned our kids\".  \nPolice and government security forces set up between the protestors and the Capitol building in a show of force, hoping to prevent the kind of chaos that occurred during last year\'s riot.  However, after several hours of chanting and speeches, tempers in the crowd flared and protestors rushed the police line.  The police forces were forced to use tear gas, pepper spray, water cannons, and rubber bullets to subdue the crowd and protect property.  In spite of their heroic efforts, the protestors managed to break some windows, damage several police vehicles, and injure three officers.  \n');
INSERT INTO `article` VALUES (38, '131.txt', '2000/01/17', 'The General Post\n', 'GDP OF KRONOS IN THE ASCENT\n', 'The General Post\nGDP OF KRONOS IN THE ASCENT\n2000/01/17\nAVILA, Kronos - the true gross internal product - the exit of merchandize and services produced by the work and the characteristic located in Kronos - increasing in an annual index of 5,4% in the fourth trimester of 1999, according to the estimation anticipated sent in the office of the economy.\nThis mark 5to year in a row with the positive growth of the GDP for the developing country. Most of this growth can be contributed to the relation between the government of Kronos and international GAStech.\n');
INSERT INTO `article` VALUES (39, '132.txt', '2012/06/20', 'World Source \n', 'Abila police break up sit-in turned violent at the presidential manor  \n', 'World Source \nAbila police break up sit-in turned violent at the presidential manor  \n2012/06/20\nTraffic snarled around the city as Abilians struggle to get to work amid vandalism and looting \nEarly on Tuesday police stormed the front of the presidential mansion and the capital building, breaking up a sit in by the Protectors of Kronos. \nThe conservative Kronos government used an emergency law to threaten the protestors with arrest unless they dispersed and returned to work.  The row is over environmental issues the POK holds the government and the gas giant GAStech international responsible.  \nSigns among the protester called for government change and social equality.  Images of Juliana Vann, the 10 year old girl who dies from illnesses attributed to the industrial giant GAStech international served as rallying points.   \nTuesday was the third anniversary of the mysterious death of Elian Karel, a popular leader of the POK who died in prison.  \nLater in the day, what had been a largely peaceful demonstration turned violent when the crowd started vandalizing government buildings and the presidential homestead.  \nPolice reinforcements were sent to the area and blocked roads, and skirmishes between the police and protestors broke out.  \nPolice used tear gas to break up the unruly crowd.  Government spokesmen complemented the security forces for their handling of the \"gangs of criminals\" disrupting the peace.\n');
