INSERT INTO `article` VALUES (41, '134.txt', '2001/03/22', 'Homeland Illumination\n', 'TAX MEASURE DEFEATED, POK EFFORTS STALLED\n', 'Homeland Illumination\nTAX MEASURE DEFEATED, POK EFFORTS STALLED\nMaha Salo\n22 March 2001\nAbila, Kronos - A measure to increase taxes on foreign oil and gas development proposed by Minister of Health Cesare Nespola was defeated by a wide margin last week in the General Assembly.\nThis defeat is a harsh blow to the Protectors of Kronos, an Elodis group that was counting on this funding to provide healthcare and environment cleanup of their drinking and irrigation water.\n\"We have a meeting planned with the Minister,\" Protectors of Kronos leader Henk Bodrogi told the Homeland Illumination.  \"Don\'t count us out yet.  We plan to improve the measure and Minister Nespola will reintroduce it later this year.\"\nBodrogi is the leader of the Protectors of Kronos, a grassroots environmental group with a mission to reverse the pollution caused by gas drilling in his hometown.\n');
INSERT INTO `article` VALUES (42, '135.txt', '2012/04/09', 'All News Today\n', 'RALLY SCHEDULED IN SUPPORT OF INCREASED GOVERNMENT ACCOUNTABILITY \n', 'All News Today\nRALLY SCHEDULED IN SUPPORT OF INCREASED GOVERNMENT ACCOUNTABILITY \n2012/04/09\nABILA, Kronos - Silvia Marek, leader of the Protectors of Kronos social action organization is appealing to the citizens of Kronos to join her for a day of peaceful protest tomorrow.  Marek asks all concerned citizens to join her to bring awareness to the problem of political corruption and favoritism pervasive in the offices of the government of Kronos. \n\"I\'m calling for an end to the heinous corruption, the nepotism and the favoritism displayed by our elected officials.\n');
INSERT INTO `article` VALUES (43, '136.txt', '1997/04/23', 'Central Bulletin\n', 'POSSIBLE CONTAMINATION IN ELODIS  \n', 'Central Bulletin\nPOSSIBLE CONTAMINATION IN ELODIS  \n1997/04/23\nELODIS, Kronos - About 25 km West of Abila is the small rural township of Elodis, situated on the Tiskele River. Roughly 20 km upstream is the Tiskele Bend site operated by GAStech International on government-owned land. Townspeople claim the site is contaminating the land and water making their people sick. \nIn a statement the government of Kronos has denied that the Tiskele Bend site is the source of any contamination insisting that both \"natural gas and the drilling process are clean.\" The statement continued, \"If our people are sick we will help them get well. That is the duty of government: to protect its people.\"\n');
INSERT INTO `article` VALUES (44, '137.txt', '1994/02/18', 'Who What News\n', 'PROMINENT BUSINESS, CIVIC LEADER DIES AT 65 \n', 'Who What News\nPROMINENT BUSINESS, CIVIC LEADER DIES AT 65 \n1994/02/18\nCENTRUM, Tethys - After four years of diminishing health following a major heart attack, Sten Sanjorge, Sr.  \nSanjorge, Sr., 65, of Centrum, Tethys was President Emeritus of GAStech International having founded the company in 1961. In addition to his role at GAStech International was the chairman of the Centrum Chamber board of directors and member of the Centrum Children\'s Hospital Board of Trustees.  \n\"Sten has always been a champion for the children of Tethys,\" said Hospital President Willem Gracias. Sten will truly be missed and we ask that everyone keep the Sanjorge family in their thoughts and prayers.\" is survived by his wife Ingrid Sanjorge and his son Sten Sanjorge, Jr. \n\"A great light in this world has been extinguished, yet he still casts a shadow,\" said Sanjorge, Jr.\n');
