INSERT INTO `article` VALUES (46, '139.txt', '2014/01/20', 'The Abila Post\n', 'ON THE SCENE BLOG\n', 'The Abila Post\nON THE SCENE BLOG\nBy Haneson Ngohebo\n20 January 2014\n1947 UPDATE - From the Abila Police news conference: \"There are approximately fourteen individuals unaccounted for among the GAStech staff. It has not yet been determined if all of these individuals are in fact missing.\"\nThough it was confirmed that over a dozen individuals were unaccounted for, the Abila Police said that that does not mean they are necessarily missing. Nor does it mean that they have been abducted. At this point the case is under investigation and more information will be released as facts are learned.\nThe Abila Police stressed that anyone seeing any unusual activity should immediately report it.');
INSERT INTO `article` VALUES (47, '14.txt', '2009/06/21', 'News Online Today\n', 'Protest Turns Violent in Abila \n', 'News Online Today\nProtest Turns Violent in Abila \n2009/06/21\nABILA, Kronos - A rally of hundreds of protestors allied with the \"Protectors of Kronos\" movement turned to violence today as angry activists vented their displeasure on the innocent citizens of Abila after hearing the news of POK leader Elian Karel\'s death.   \nThe POK assembly began peacefully enough with the usual chanted slogans and waving of protest signs, but then one young rabble-rouser grabbed a bullhorn and began inciting the crowd to violence.\n');
