INSERT INTO `article` VALUES (59, '150.txt', '2013/02/22', 'International Times\n', 'GAStech \n', 'International Times\nGAStech \n22 February 2013\nIt is the biggest company in Kronos, the third largest gas company on the planet, and it is fifty-three years old. In the past it has had a reputation as corrupt and environmentally harmful, but nowadays GAStech, the former Tethys-only business, is trying to earn the trust of international investors. This forms part of its ambitions to expand its profitable business supplying gas outside of the Mediterranean region.\nIt is an uphill task, and there is no certainty that Gastech has the ability to convince potential investors it has mended its ways, and is no longer rooted in the eco-hostile past.\nGAStech\'s pipeline operations are based in eastern Kronos, and there is close relationship with the Kronosian government. This is the heart of Kronos\'s pipeline business, where gas from the eastern gas fields is piped west towards the rest of Kronos, Tethys and Europe.\nGAStech does more than just pump gas. It has created towns and cities to service its operations, which it manages and runs almost single-handed.\nThe head of GAStech, Sten Sanjorge, Jr, whose photo stares out from calendars and picture frames everywhere in the country, acknowledges the \"state within a state\" accusations, but argues that the company simply needs to look after its workers and the communities around them.\nOf course, people need good reasons to come and work in the hostile remote Kronosian regions. They are provided with medical care, entertainment, and food. The GAStech empire owns 2 thousand cows and 3 thousand pigs in its company farms, runs gyms, and offers subsidised holidays in Black Sea resorts for key employees. For executives, it runs a state of the art, marble-lined medical and therapy centre.\nIn addition to all of these perks, there is also the GAStech TV station, which doesn\'t even pretend to be unbiased. It\'s there to serve the company\'s will.\nIt hardly seems the picture of a modern global company, as most of those have unceremoniously dumped their \"non-core activities\". There is an argument, however, that the energy business is different from other industries, requiring energy corporations to operate in distinct ways.\nWorking in far-off places with no previous infrastructure means oil and gas sites will always be, to some extent, company towns. GAStech certainly strives to ensure its employees can move in and out of these locations by operating a private fleet of four planes to ferry its staff the huge distances between sites.\n');
INSERT INTO `article` VALUES (60, '151.txt', '1997/10/16', 'Central Bulletin\n', 'GOVERNMENT CITES \'MINOR\' CONTAMINATION NEAR ELODIS \n', 'Central Bulletin\nGOVERNMENT CITES \'MINOR\' CONTAMINATION NEAR ELODIS \n1997/10/16\nABILA, Kronos - After continued complaints and appeals from the people of Elodis government officials acknowledge minor contamination in and around the rural township in a report on their investigation into the townspeople\'s health issues. However, the government report stops short of blaming GAStech International and its Tiskele Bend site 20 km upstream as the people of Elodis assert.  \nThe government report cites no root cause or causes can be determined at this time with more research and investigations needed. \nThough the report admits some contamination it goes on the qualify the level stating, \"The minor level of contamination is well within international health standards agreed upon by the Government of Kronos and GAStech International as negotiated in the Tiskele Bend site contract.\"\n');
INSERT INTO `article` VALUES (61, '152.txt', '1993/02/02', 'All News Today\n', 'LACK OF DETAILS MARS GOVERNMENT INTENTIONS \n', 'All News Today\nLACK OF DETAILS MARS GOVERNMENT INTENTIONS \n1993/02/02\nABILA, Kronos - In a glitzy press conference late last year President Luis Araullo announced a historic set of tax incentives intended to bring foreign investment to Kronos under the guise creating jobs, providing cheap energy and building infrastructure.  Following the 86-14 vote last month the Minister of the Interior Tomas Sarto lauded the decision as \"landmark\" and \"bettering the people\".  The crafters of these revolutionary measures neglected to include a detailed plan about how this windfall would benefit everyday Kronosians.  When the first payment from these foreign company lands in the state coffers, how will these funds be dispersed?\n');
INSERT INTO `article` VALUES (62, '153.txt', '1995/03/30', 'Who What News\n', 'DRILLING TECHNIQUE BANNED IN TETHYS \n', 'Who What News\nDRILLING TECHNIQUE BANNED IN TETHYS \n1995/03/30\nCENTRUM, Tethys - GAStech International\'s Hyper Acidic Substrate Removal (HASR) has officially been banned by the Tethys government due to the high probability of water contamination.  \nGAStech developed the innovative drilling technique in 1974 proved quite successful for the extraction of gas, but the technique\'s environmental impact is deemed unacceptable by the Tethys government due to the high probability of water table contamination from waste products produced during the HASR process.\n');
INSERT INTO `article` VALUES (63, '154.txt', '1998/03/20', 'All News Today\n', 'ELODIS, KRONOS:  A TOWN IN NEED, Part One \n', 'All News Today\nELODIS, KRONOS:  A TOWN IN NEED, Part One \nPetrus Gerhard \n1998/03/20\nNOTE: This article is the first in a series, reprinted with permission from the Homeland Illumination. \nThis article is the first installment of a three-part series addressing the growing problem of one community\'s anguish, government malfeasance, and the alarming influence of multinational corporations on the country of Kronos. \nELODIS, Kronos - Nestled in the bend of the Tiskele River, the sun rises over the farming town of Elodis,  chasing away the shadows cloaking nearby Mt.  Today, as they have every day for over 250 years, residents will rise to tend the rich floodplain land that provides nourishment for the People of Kronos. \nTwo weeks prior I received an email from an old friend, Pondo Reese, now the editor of the Elodis Weekly Journal, an agriculture paper serving the community around Tiskele Bend.  \"The gas company had been built a few years back in \'94, and our problems didn\'t start right away. \nThe change turned out to be GAStech International, an international corporation run by Sten Sanjorge Jr, a business tycoon out of Tethys. \nEstablished in 1961, the GAStech corporation began as a family-owned business providing local trucking services in Tethys.  The two founders - Sten Sanjorge Sr and Hank Fluss - found wildcat drilling to be more lucrative, and thus began a series of environmental disasters and financial scandals that eventually ran Sanjorge Sr into an early grave and drove Fluss into a marginal role in his own company.  With the death of Sanjorge Sr, the son took the helm of GAStech firmly in his grasp and broadened its influence further afield, eventually landing at the doorstep of the small peaceful township of Elodis. \nWith a population of 6500, most residents of Elodis live in one- and two-story houses on small farms.  A smaller number of families live in the township along a main street with two markets, two hardware stores, one gas station and a caf√ø¬ø¬ø¬ø¬ø¬øhere you can buy lunch, pick up your mail and purchase a litre of milk to bring home.  Families have lived in Elodis for generations. \n\"We\'ve made a good living for a long time,\" Reese tells me. \nI asked Reese to help me meet the people whose lives have been impacted by GAStech\'s operations.   \nI caught up with Henk Bodrogi in town making purchases at the Osvaldo hardware store to repair a broken tractor.  Bodrogi has farmed soybeans his entire life, as did his father and their fathers.\n');
INSERT INTO `article` VALUES (64, '155.txt', '2009/06/22', 'News Online Today \n', 'Profile:  Elian Karel  \n', 'News Online Today \nProfile:  Elian Karel  \n2009/06/22\n<<deleted image of Elian Karel speaking at a rally in Abila>> \nVoice of protest for some, popularist demagogue for others, Protectors of Kronos leader Elian Karel became a martyr and a rallying point for some; \nResurrecting the embers of the Juliana Vann campaign, the 10 year old girl who died from illnesses attributed to the government-favored GASTech corporation\'s industrial waste streams in 1998, Karel was arrested and thrown in jail following a POK-initiated human roadblock in front of GAStech headquarters in May. Karel died Wednesday while serving time in jail.\n');
