INSERT INTO `article` VALUES (66, '157.txt', '2009/03/13', 'Daily Pegasus\n', 'ARRESTED LEADER KAREL OF POK\n', 'Daily Pegasus\nARRESTED LEADER KAREL OF POK\n2009/03/13\nABILA, Kronos - in another unconscionable movement against the citizens of Kronos, the previous police of today arrested leader Elian Karel of POK in false loads of the fiscal evasion.  They lead it - manacled - of a meeting of the protectors of Kronos in Elodis, a rural municipality outer Abila.\nDemonstrating its humor of the registered tradename, Karel raised its wrists and joked to its those in favor as they lead far it, ¬ìI conjecture who I must not have sent the president those water boxes in bottle for its birthday.¬î\nKarel is the leader of the protectors of Kronos, an alliance of the citizens of Kronos de Elodis that has demanded ascending clean of the government the contaminated water caused by the gas that it perforated in his community.\n¬ìWe did not request GAStech to come to our community,¬î ray of Karel in a meeting a few months ago.  ¬ì\'We did not request our water to make undrinkable, so that our children get to be ill.  Neither Elodis nor the people of Kronos has received any advantage of the great extraordinary amount of money that GAStech clears every year.  I request:  Where it is the money that goes¬î\nThose in favor assured representative the police who formed outside the police station of police that Karel would be treated humanly, but declined to answer questions or to allow that the visitors see Karel.\n¬ìHe is a solved man,¬î the lawyer of Karel that Michale Kraft said to me on the telephone. ¬ìIt will fight these false loads and will be towards outside in some days.  It will probably complain about the food of the jail in the following meeting of POK.¬î \nKraft glides to solve with the morning of Karel Saturday.\nThe calls to the president and the minister of the offices of justice were not returned immediately.\n');
