INSERT INTO `article` VALUES (71, '161.txt', '2011/06/20', 'Homeland Illumination\n', 'A LOOK BACK AT A LIFE CUT TRAGICAL SHORT: ELIAN KAREL\n', 'Homeland Illumination\nA LOOK BACK AT A LIFE CUT TRAGICAL SHORT: ELIAN KAREL\nPetrus Gerhard\n20 June 2011\nABILA, Kronos ¬ñ Two years ago yesterday Elian Karel died at age 28 in an Abila jail cell, purportedly of cardiac arrest.  He had been arrested three months prior for spurious charges of tax evasion and left to linger in a jail cell without further legal action.  His attorney, Michale Kraft made several appearances in court demanding that the government outline their specific charges, and release Karel.  Kraft had reached an agreement with the government that charges would be reduced and the Karel be released pending a trial, but Karel died two days before he was to go free.\nQuestions linger, however, about the manner of Karel¬ís death.  Requests for information were met with assurances that the police ¬ñwhose custody Karel was in at the time of his death ¬ñ would do everything possible to perform an exhaustive investigation.\nThis ¬ìthorough investigation¬î lasted all of two weeks, including the time it took the Abila City Coroner to lose the original autopsy files.  After Karel¬ís body was cremated and sent to his family in Elodis, the Abila Chief of Police closed the case and has declined to answer questions about Karel¬ís death stating that ¬ìwe are satisfied the death was of natural causes and will no longer be entertaining inquiries.¬î\nAs reported at the time of Karel¬ís death, several people close to the investigation reported that Karel¬ís body showed signs of blunt force trauma, abrasions and lacerations which were not consistent with the cause of death reported by the police.  These confidential sources have since moved from the area and have been unavailable for contact.\nPolice have denied anything unusual happened in Karel¬ís death and city officials claim the accusations of murder and wrongful death are asserted by POK rabble-rousers attempting to incite instability and violence.\nYesterday on the morning of June 19th, a small group of POK supporters gathered in front of the Abila Police Station, holding photographs of Elian, and of another young martyr, Juliana Vann, the ten-year old girl who died in 1998 from cancer caused by benzene toxins in her drinking water.  \n¬ìBoth of them died because of government lies and corruption,¬î one man told me who asked that his name be withheld because of concerns of police retaliation.  ¬ìJuliana died because Kronos allowed GAStech to poison our water, and Elian died because he tried to bring Juliana justice.  When will it end?¬î\nAnother, larger crowd had gathered the day before in a nearby city park to bring public awareness about these same issues.  Amid the speeches and music, I heard the same message from the year before:  ¬ìRemember Juliana! Remember Elian!¬î\n');
INSERT INTO `article` VALUES (72, '162.txt', '2009/06/21', 'The Guide\n', 'The protest gives violent return in Abila\n', 'The Guide\nThe protest gives violent return in Abila\n2009/06/21\nABILA, Kronos - a meeting of hundreds of protestors allied with \"protectors the movement of Kronos\" given return to the violence today as the angry activists expressed their displeasure in the innocent citizens of Abila after hearing the news of the death of Elian Karel of the POK leader.  Karel, that was been waiting the test for the fiscal evasion, was found dead in its cell of the jail yesterday in the morning.  \nThe POK assembly began enough Pacific with the mottos and to shake sung generally of the samples of the protest, but then a young person shakes-rouser grasped bullhorn and began to urge the crowd to the violence.  The crowd broke windows and destroyed stores in the area of Siopa, it fixed fires to the streets, and clashed with police.  The additional forces of the police responded to contain the chaos and were forced to use the bullets and the tear gas of rubber to disperse to the crowds.\nThe office of president Kapelou sent a declaration on the meeting, indicating, \"this class of violence will not be pardoned.  The destruction and the violence are not no way to reach peace and the change - these things are in the opposition the one to the other.  The protectors of Kronos must reassume pacific means; the rest of the approaches is unjustifiable.\"\n');
