INSERT INTO `article` VALUES (74, '164.txt', '2003/05/19', 'The Light of Truth\n', 'THE ROUCOULEMENT OF HANK FLUSS GASTECH DIES IN 73\n', 'The Light of Truth\nTHE ROUCOULEMENT OF HANK FLUSS GASTECH DIES IN 73\n2003/05/19\nCENTRUM, Tethys - the hank Fluss, ROUCOULEMENT of international GAStech, died of a heart attack at its office in the registered offices of the center of the centrum of the company. Although Fluss was 73 years, its death came like shock.\nThe Fluss hank spent 40 years with GAStech, treating as a friend Sten Sanjorge, Sr. in 1963 when both started outside all alone. Like wildcatters, they started to drill in the sectors not previously known to be gas layers. After much failed of the wells and on the point of the financial ruin, of Fluss and Sanjorge, Sr. tightened on finding thereafter one of the largest layers of gases unexploited in Tethys.\nAs a leader of operation in chief, Fluss making supervised the expansion of GAStech, really him a company international and growing it in an operation billionaire of the dollar. Always a champion of the environmental causes, Fluss had become increasingly disillusioned with the operation of GAStech - of Kronos tightening his relationship with PRESIDENT Sten Sanjorge, Jr. \nThe Fluss hank is survived by his 54 year old wife, Beatriz Fluss, its 5 children, and 12 children.\n');
INSERT INTO `article` VALUES (75, '165.txt', '2009/02/19', 'The Truth\n', 'Protest POK on the ends of the Hoofdkwartier GAStech in arrests\n', 'The Truth\nProtest POK on the ends of the Hoofdkwartier GAStech in arrests\n2009/02/19\nABILA, Kronos - Dozens protesters which guards of the collection Kronos (of POK became) attend for the regional hoofdkwartier GAStech in Abila arrested for violating vanochtend.  The collection POK had been meant the attention on their requirements of environment damage which is caused to establish by the development of gas and oil areas around Kronos by foreign companies such as GAStech.  Approximately two hundred people collected themselves for the GAStech construction chanting slogans and the undulating signs which loved visages people that according to reports because of environment pollution have died.  Ten of protestors chained themselves to the doors of the bldg. in a attempt employees prevent GAStech will work.\nSpokesman Adrien aforesaid Carman of the police force, we permitted the group one or other breadth with their collection, but when GAStech complained that protestors entrance to their construction blocked, we had demonstrate.  The last thing which we have wanted to happen were for become to be hurt employee GAStech who by the mob only because he tried will work.\nPOK, once a small political activist group citizens of the area Elodis, stimulation under the charismatic control of Elian Karel has been.  The spokesman Rufus Drymiau of the government aforesaid of the collection POK of today, we have been already some time concerned by a pattern of more and more aggressive tactic by the guards of Kronos. Given the incident of today, to president to Kapelou to the police force to offer rallies extra protection has commissioned POK future for public at.\n');
INSERT INTO `article` VALUES (76, '166.txt', '1998/11/10', 'The Truth\n', 'The ministry of health examines the complaints of pollution\n', 'The Truth\nThe ministry of health examines the complaints of pollution\n1998/11/10\nABILA, Kronos - the minister of health Cesare Nespola kondigde today to that its organization require of abnormal health questions in areas researches those boorplaats would surround of bending Tiskele.  Minister aforesaid Nespola, we have to no reason believe that drilling has resulted at bending Tiskele in any pollution of surface or source water in the area.  However, I believe it if minister of health is important appropriate do zeal and the reports of sickness Elodis to examine near the municipality.  Treating our people is my number one priority.\nIn related news, a press communication of the office of Nespola declared that its office a license to practice medicine to a oncoloog Tethys who has granted, turns into him the first license given oncoloog in history Kronos.  Dr. Ronald Gerard a resident will be at the general hospital Abila.\n');
INSERT INTO `article` VALUES (77, '167.txt', '2014/01/21', 'International Times\n', 'GASTech Employees Kidnapped in Kronos\n', 'International Times\nGASTech Employees Kidnapped in Kronos\n21 January 2014  1405\nFourteen employees feared kidnapped in Kronos by a radical environmental terrorist group during a corporate gathering. \nFourteen employees, including possibly five executive officers, are feared kidnapped yesterday by the \"Protectors of Kronos\".  Reported missing includes: GAStech President and CEO Sten Sanjorge Jr,CFO Ingrid Barranco, CIO Ada Campo-Corrente, COO Orhan Strum, and Environmental Officer Willem Vasco-Pais.\nLocal news organizations have received a ransom note from the POK claiming responsibility and demanding $20 Million from the company.  It is possible additional demands are forthcoming.\nSanjorge and the others disappeared following a board meeting at GASTech headquarters.  A fire alarm went off, and the execs were discovered missing shortly after that.  The complete list of all the unaccounted-for employees has not been released. \nJohn Rathburn, an American expert on executive kidnappings who is living in Tethys, says that Kronos has not been known as an archetypal country for kidnapping. \"However, increased activity by POK, APA [Asterian People\'s Army], and others in the region have significantly increased the risk.\"\nThe Times\'s correspondent in Abila says GASTech offices are closed, and phone calls are being answered but referred to local authorities.  \nGASTech\'s corporate headquarters in Tethys have refused to comment. However, other news sources have reported Tethys federal law enforcement officials and staff from the Tethan Ministry of Foreign Affairs have arrived in Kronos to assist police in the investigation.\n');
INSERT INTO `article` VALUES (78, '168.txt', '2009/02/18', 'Kronos Star\n', 'POK Protest at GAStech Headquarters Ends in Arrests\n', 'Kronos Star\nPOK Protest at GAStech Headquarters Ends in Arrests\nMarcella Trapani\n18 February 2009\nABILA, Kronos - Dozens of protesters attending a Protectors of Kronos (POK) rally in front of the GAStech regional headquarters in Abila were arrested for trespassing this morning.  The POK rally was intended to draw attention to their claims of environmental damage being caused by the development of gas and oil fields around Kronos by foreign corporations like GAStech.  About two hundred people gathered in front of the GAStech building chanting slogans and waving signs that held the visages of people who have allegedly died due to environmental contamination.  Ten of the protestors chained themselves to the doors of the building in an attempt to prevent GAStech employees from going to work.\nPolice spokesman Adrien Carman said, \"We allowed the group some latitude with their rally, but when GAStech complained that the protestors were blocking entrance to their building, we had to take action.  The last thing we wanted to happen was for a GAStech employee to get hurt by the crowd just because he was trying to go to work.\"\nThe POK, once a small political activist group of citizens from the Elodis area, has been revitalization under the charismatic leadership of Elian Karel.  Government spokesman Rufus Drymiau said of today\'s POK rally, \"We have been concerned by a pattern of increasingly aggressive tactics by the Protectors of Kronos for some time now. In light of today\'s incident, President Kapelou has ordered the police to provide additional protection for the public at future POK rallys.\"\n');
INSERT INTO `article` VALUES (79, '169.txt', '2014/01/20', 'The Abila Post\n', 'ON THE SCENE BLOG\n', 'The Abila Post\nON THE SCENE BLOG\nBy Haneson Ngohebo\n20 January 2014\n2021 UPDATE - A Kronos Government official who asked not to be identified but was present at the government reception has gone on the record stating, \"Investigators are working around the clock to ensure that the kidnapped GAStech employees are found and that the perpetrators are brought to justice.\"\nThis is the first confirmation that today\'s events surrounding GAStech - Kronos are in fact a kidnapping. With fourteen individuals still unaccounted for, at this point, the assumption is that all are the victims of a kidnapping.\nNo group has come forward yet to claim responsibility nor have any demands been made.');
INSERT INTO `article` VALUES (80, '17.txt', '2005/04/06', 'The Wrap\n', 'THE END OF PROTESTS POK IN ARRESTS\n', 'The Wrap\nTHE END OF PROTESTS POK IN ARRESTS\n2005/04/06\nELODIS, Kronos - fifteen members of the guards of Kronos the activist organization (of POK) was arrested Kronos federal police force yesterday after a dispute at the poorten of the facility of GAStech of bending Tiskele.\nProtesters came close weapons to paddlepaddle paddle and movement to stop that and the facility leaves enters.  By 8 am had the local time, movement security copy on both sides of the poorten.  Swinging, sang protesters confessed protest songs, are including this ounce country, songs of the farmer and the weavers of our birth country\nThen arresting protesters POK started the federal police force, moved themselves they in a neat manner in waiting police force van, which sings the complete time.\n');
INSERT INTO `article` VALUES (81, '170.txt', '2014/01/20', 'Central Bulletin\n', 'GASTECH LEADERSHIP CONFIRMED MISSING \n', 'Central Bulletin\nGASTECH LEADERSHIP CONFIRMED MISSING \n2014/01/20\nABILA, Kronos - Miriam Avila, an administrative assistant at GAStech International, has confirmed that members of the GAStech leadership are in fact missing. The group was expected to arrive at the Government reception following this morning\'s meeting at GAStech - Kronos headquarters, but never showed up. Avila denied that any GAStech employee has been abducted.  \nThe GAStech - Kronos leadership was also handsomely rewarded. The IPO filings show that the executive group earned a collective $327.25 million from the newly vested shares including $96.25 million each for CFO Ingrid Barranco, CIO Ada Campo-Corrente, and COO Orhan Strum. maintains an office in Centrum, the capital of Tethys, most of GAStech International\'s operations take place on Kronos including production of about 5 million cubic meters of gas daily. Avila works in GAStech\'s Centrum headquarters.\n');
