INSERT INTO `article` VALUES (83, '172.txt', '2014/01/20', 'Homeland Illumination\n', 'VOICES - a blog about what is important to the people\n', 'Homeland Illumination\nVOICES - a blog about what is important to the people\nMaha Salo\n20 January 2014\n2020 - Media outlets are reporting that a government spokesman who asked not to be named because he was not authorized to speak to the press stated that the GAStech employees had been kidnapped and the Kronos government was working hard to identify the lawbreakers.  One wonders if they are also working hard to recover the GAStech people as well, or if this is an opportunity to profit from the misfortunate of others. 20 Jan 2014');
