INSERT INTO `article` VALUES (88, '177.txt', '2000/08/18', 'The Explainer\n', 'EXPLOSION AND FIRE OF THE TISKELE CURVE\n', 'The Explainer\nEXPLOSION AND FIRE OF THE TISKELE CURVE\n2000/08/18\nABILA, Kronos - a spark in the GAStech International-had well in the site of the curve of Tiskele ignited the methane gas several hundreds of underground feet, causing a fire ball and the fire that was burned by around one hour is the results of a dual GAStech - investigation of the government of in the morning subsequent explosion and of Sunday of the fire. \nFour employees of GAStech suffered broken injuries including burns of smaller importance and bones. In contrast to previous information there were deaths and no that lacked the incident as resulting from. He was also not damaged any local residents and although they evacuated to some residents of Elodis of his homes the investigation indicates that the evacuation was unnecessary. \nWhereas the official cause of the explosion still is under investigation, the problem could have come from a defect in the spring itself. The springs of GAStech are fastened with rings with the necklaces that have fixed per to us that they worked through them. One of per could have blown outside the necklace, sending the gas to us, that then made contact with enemy with a spark.\n');
INSERT INTO `article` VALUES (89, '178.txt', '2014/01/21', 'The Tulip\n', 'THE REQUIREMENTS OF THE RANSOM WHICH ARE MADE IN REMOVAL GASTECH\n', 'The Tulip\nTHE REQUIREMENTS OF THE RANSOM WHICH ARE MADE IN REMOVAL GASTECH\n2014/01/21\nABILA, Kronos - the guards of Kronos have not only also the taken responsibility for the removal of international employees GAStech, but the ransom question of $20M of the President and CEO Sten Sanjorge, Jr. made.\nReported like yesterday, one speculated that Sanjorge were, Jr. the aim of removal; however, Sanjorge, Jr. are safely in Tethys.\nThe removal group, the guards of Kronos, were established in 1998, in Elodis, a rural municipality hoofdAbila. They for clean water, human rights have protested, and against the corruption of the government of international Kronos and GAStech. They have become more and more violent with their protests which babble in, fire bomb attacks, vandalism, and plundering transfer to. \n');
INSERT INTO `article` VALUES (90, '179.txt', '2005/04/06', 'News Online Today\n', 'Protestors Block Traffic to Tiskele Bend Fields \n', 'News Online Today\nProtestors Block Traffic to Tiskele Bend Fields \n2005/04/06\nABILA, Kronos - More than a dozen POK protesters were handcuffed and taken into custody by police Tuesday for blocking access to the Tiskele Bend fields.  \nThe protesters arrived at the entrance to the Tiskele Bend site about 5:30 a.m. and locked arms across the road for about three hours, despite being asked to leave by police.\n');
INSERT INTO `article` VALUES (91, '18.txt', '2012/06/20', 'Homeland Illumination\n', 'POK REMEMBERS MARTYRED LEADER\n', 'Homeland Illumination\nPOK REMEMBERS MARTYRED LEADER\nPetrus Gerhard\n20 June 2012\nABILA, Kronos - In a touching ceremony Wednesday leaders of the activist group Protectors of Kronos paid tribute to their fallen leader, Elian Karel, who was murdered on 19 June 2009 while being illegally detained in a Kronos jail.\n\"Today we gather to remember Elian Karel,\" Silvia Marek told the rapt assembly, many of whom held up white candles in Karel\'s honor.\n\"Elian was born on an Elodis farm not 40 minutes from here, to Jeroen and Antaura Karel.  He grew up with the specter of death all around him.   By the time Elian was 17 many of his family members and friends were battling constant illness, including his neighbor 10-year old Juliana Vann.\"\nMarek paused a moment to allow the cries of \"Remember Juliana!\" to fade.\n\"Elian devoted his life to the people of Elodis as well as all citizens of Kronos, as did his father before him.  Elian knew his would be a difficult journey.  He had watched his father, Jeroen and the founder of the POK, Henk Bodrogi walk the very path he would tread.  Elian knew the course would not be easy, and would leave little time for a personal life.  Yet he chose to take those steps despite the challenges he knew he would face.\"\n\"Elian\'s journey ended three years ago today.  But his dream did not die with him.  And it is that vision of a healthy and prosperous future for all we are here today to honor.\"\nOver the course of the afternoon several other speakers paid tribute to not only Elian, but all who have been victims of the environmental catastrophe brought about by greed and corruption of public officials. \nThe gathering was marred only by the aggravating presence of Abila police in riot gear.  The police agitated many of the crowd, causing them to have to leave the assembly rather than be assailed with batons and pepper spray.\n');
INSERT INTO `article` VALUES (92, '180.txt', '2010/03/05', 'World Journal\n', 'The race of boat stopped before starting \n', 'World Journal\nThe race of boat stopped before starting \n2010/03/05\n10th Kapalou cup was given to later less than one hour before it was due to the beginning after the capsized presidential ship and is descended.\nIt is the first incident of its kind in the history of the famous race of boat of the world, in which the yachts of around the Mediterranean coast compete with for the gold cup coveted.\nThe presidential boat, had by the family of the President running Karel Kapelou II of Kronos, started to take water and slowly disappeared in the sea.\nCold\nBefore an assistance of the hundreds of spectators met in the point of Abila, to be used it as team-member was forced to jump in the life raft and to observe their ship go down until it was almost submerged.\nThe major part of being used as team-member entered the boats of delivery, whereas others which decided to swim with the shore described it as \"a cold\".\nLittle time after the presidential ship was appreciably afflicted, a small boat of engine dispatched in the two directions between the boat and to undulate crowd of shore the \"guards of Kronos\" mark to comprise their white emblem of hand.  It is not known if the group were implied incident of boat, although the group is largely recognized like becoming increasingly violent in their protests against the government.\nTo be used as team-member refused to blame the captain of the boat, 41 years Petra Hohimae, which knows well about water in addition to littoral of Kronos.\nOne expects that the race is countermanded although there was no official word. Investigations at the presidential office were not answered.  \nIt is reported that to be used it as team-member suffers only from the minor damage during their abandonment and avoids the contact of pressure. One expects that the ball of official reception of cup of Kapalou is countermande