INSERT INTO `article` VALUES (96, '184.txt', '2012/08/22', 'News Online Today\n', 'WHO ARE THE PROTESTERS  \n', 'News Online Today\nWHO ARE THE PROTESTERS  \n2012/08/22\nABILA, Kronos - With the third anniversary of Elian Karel\'s death approaching - former member of the Protectors of Kronos - the question is: who are the protesters? The POK was initiated to bring attention to the clean water issues surrounding Elodis to the Government of Kronos and the world. The POK asserts he was arrested on trumped up charges while the Government of Kronos contends he was a radical and violent activist engaged in tax evasion.  \nThe POK has evolved from peaceful protests and demonstrations demanding government action to more violent activities including riots as they claim that the government has done little to nothing in addressing the contamination, poisonings, and deaths suffered by their people.\n');
INSERT INTO `article` VALUES (97, '185.txt', '2009/06/20', 'The Abila Post\n', 'SPONTANEOUS PROTESTS ERUPT AROUND ABILA\n', 'The Abila Post\nSPONTANEOUS PROTESTS ERUPT AROUND ABILA\n20 June 2009\nABILA, Kronos - Protests erupted around the Kronos government buildings, downtown, and elsewhere around Abila eventually escalating into riots and violence. \nThe activists are protesting the death yesterday of Elian Karel, a Protector of Kronos (POK) activist who died in jail after being arrested for tax evasion. However, the protests have turned violent with smashed windows and vandalized shops.\nCountless shop windows smashed in and around Siopa, the downtown shopping area. A general sense of chaos broke out with chanting protesters, fires, and fleeing citizens. \nA unifying theme of the protesters was the chanted slogans including \"Justice for Elian\" in reference to previously mentioned activist Elian Karel and \"Remember Juliana\", a young girl from Elodis who died in 1998 allegedly from the effects of water contamination. Several buildings were defaced with the above mentioned slogans as well.\nThe Kronos government issued a statement, \"This sort of violence will not be condoned. Destruction and violence is no way to achieve peace and change - these things are in opposition to each other. The Protectors of Kronos must resume peaceful means; all other approaches are unjustifiable.\"\n');
INSERT INTO `article` VALUES (98, '186.txt', '1997/10/15', 'News Online Today\n', 'GOVERNMENT CITES \'MINOR\' CONTAMINATION NEAR ELODIS \n', 'News Online Today\nGOVERNMENT CITES \'MINOR\' CONTAMINATION NEAR ELODIS \n1997/10/15\nABILA, Kronos - After continued complaints and appeals from the people of Elodis government officials acknowledge minor contamination in and around the rural township in a report on their investigation into the townspeople\'s health issues. However, the government report stops short of blaming GAStech International and its Tiskele Bend site 20 km upstream as the people of Elodis assert.\n');
