INSERT INTO `article` VALUES (107, '194.txt', '2012/06/23', 'The Guide\n', 'Kapelou calls POK \"one group of criminals\"\n', 'The Guide\nKapelou calls POK \"one group of criminals\"\n2012/06/23\nABILA, Kronos - in a press launching today, president Kapelou today called the POK \"one group of criminals, the gamberros, and malcontents that has done pestilence to our way of the pacific life.\"  The commentaries of president Kapelou come after a given demonstration of POK return in a great uproar in through sector from government from the capital Tuesday.  President Kapelou has called for the increasing patrols of the police of the area of Elodis and has said that all the demonstrations of the future POK \"will be solved with the maximum force of the police.\"\n');
INSERT INTO `article` VALUES (108, '195.txt', '2009/05/15', 'The World\n', 'GASTECH ADOPTS NEW LOGO\n', 'The World\nGASTECH ADOPTS NEW LOGO\n15 May 2009\nCENTRUM, Tethys - With great fanfare GAStech International\'s President and CEO Sten Sanjorge, Jr. revealed the company\'s new logo, part of the company\'s rebranding process. \nDuring the press conference Sanjorge, Jr. spoke of the new logo - a tri-part blue flame - that is reminiscent of a leaf to \"help position GAStech and its products as a clean fuel alternative.\" He also referenced that the tri-part flame represents the past, present, and future of the company in that by keeping \"one eye on the past we know from where we came - our humble beginnings; one eye on the future we will know where we are going - our coming success; and both feet planted in the present we will be proactive in an ever-changing, competitive industry.\"\nFinally, Sanjorge, Jr. asserted GAStech International\'s \"blue flame is an enduring beacon of environmental responsibility, and a symbol of a clean energy business moving forward.\" \nThis rebranding process and new logo seem to be in response to recent trouble the multi-national gas giant has been struggling with in Kronos including the February 19 protest at GAStech - Kronos\' headquarters of 200 people who blocked entrance to the building, resulting in several arrests. The protest and others in and around Abila, the capital of Kronos, have been in response to alleged water contamination issues and a lack of Government and GAStech response.\nSten Sanjorge, Jr. declined to comment directly on questions regarding protests and environmental contamination. He deflected, \"Today is a great day for GAStech. I won\'t let the day be derailed by unfounded, borderline libelous, allegations.\" \n');
INSERT INTO `article` VALUES (109, '196.txt', '1998/01/19', 'Worldwise\n', 'Advantages of Kronos of foreign investment\n', 'Worldwise\nAdvantages of Kronos of foreign investment\n1998/01/19\nABILA, Kronos - is today the fifth birthday of the visionary plan of the President Araullo\' S to bring the foreign investment to Kronos, a daring act which derived the enormous advantages for our country right.  Abila of today is a metropolis activating new cars completely, of new construction, brilliant buildings of office, and modern suitabilities.  Went potholed of the streets, weak factories, front of store tired, and sad markets of the past.  Abila of today is a town of industry, a place of trade and investment, of a place of occasion and success.  Prosperity came in Kronos, and we are very better for him.\nHowever, there remain those which think incorrectly that prosperity is bad for us.  These people claim that the foreign investment is bad for our country, that which it dilutes our culture and undermines our values.  They claim that the foreigners exploit us for their own profit and that our government makes consider little for the wellbeing of our people.  They are so militant in their false-directed belief which they manufactured claims that the alien companies poison our children with their technology.  They even went as much as to have brought the foreign \"experts\" who it complaint \"have our best interests in the middle\" helping to draw aside their agenda against progress and prosperity for our people.  Hypocrisy to bring the foreigners to say to us that the opening of our country the abroads is bad for us is laughable and is obviously a sign of psychosis in those which are opposed to our modernization. \n');
