INSERT INTO `article` VALUES (111, '198.txt', '1994/02/18', 'The Light of Truth\n', 'THE BUSINESSES AHEAD, CIVIC CHIEF DIE IN 65\n', 'The Light of Truth\nTHE BUSINESSES AHEAD, CIVIC CHIEF DIE IN 65\n1994/02/18\nCENTRUM, Tethys - after four years of health decreasing according to an important heart attack, Sten Sanjorge, Sr. Friday morning early dead. \nSanjorge, Sr., 65, of the centrum, Tethys was President Emeritus of international of GAStech having founded the company in 1961. In addition to its role at international GAStech was the Chairman of the board of room of centrum and the member of the management committee of the hospital of the children of centrum. \n\"Sten was always a champion for the children of Tethys,\" said President Willem Gracias of hospital. \"He was a true chief of servant and without end worked to lead our establishment ahead. Sten will be really missed and we ask that each one subsistence the family of Sanjorge in their thoughts and prayers.\"\nSanjorge, Sr. is survived by its wife Ingrid Sanjorge and her son Sten Sanjorge, Jr.\n\"A great light in this world was extinct, however it always moulds a shade,\" said Sanjorge, Jr. \"that I dedicate myself to carry out our company ahead with a replaced vision and a dignity which will honor the life with my father and will function.\"\n');
