Kronos the state nor Kronos.\"\nKronos would notify Tethys that had signed a treaty 1998 of the against-terrorism of the decision, he added.\nThose in favor of POK\nThe POK has denied the being responsible for the attack, and has accused the government of Kronos to carry out mark-for above silencing the preoccupations of the groups by people.\nA member of POK said to times that the decision of the government was \"ileg√≠tima\".\nHe added: \"The protests will continue, certainly.\"\n');
INSERT INTO `article` VALUES (117, '202.txt', '2014/01/20', 'Athena Speaks\n', 'The AIRPORT Of ABILA CONFIRMS TWO PRIVATE TRAVELS OUT OF LEFT JET TODAY\n', 'Athena Speaks\nThe AIRPORT Of ABILA CONFIRMS TWO PRIVATE TRAVELS OUT OF LEFT JET TODAY\n2014/01/20\nABILA, Kronos - the fueler Ravi Danisliau of airport of Abila confirmed that two deprived voyage out of jet separated today after being filled with fuel. \nAccording to Danisliau, the seven or eight passengers of the first plane were \"businesses types\" and seemed to be in a hurry. It was not exactly clear where they were directed. The plane took off about local time of Kronos 12:30. \nThe second plane also carried seven or eight \"of the businesses type\", but seemed \"more slackened much than the first group of passengers\". Danisliau indicated the second group of passengers \"seemed to celebrate something.\" The second plane left towards 14:30 around two hours after the first plane.\nDanisliau confirmed that the second destination of the plane was Rome, Italy.\nBetween the two private ones travels out of jet that left the people the airport of Abila fourteen to sixteen could have been of the momentary ones. This easily could explain the control of GAStech - Kronos. \nOnce asked whether the two planes had anything to make with GAStech Danisliau international answered, \"I do not pose many the questions. I filled of fuel right planes.\" \n');
