INSERT INTO `article` VALUES (126, '210.txt', '1993/02/03', 'The Orb\n', 'MISS INTENTIONS OF GOVERNMENT OF MARCH OF DETAILS\n', 'The Orb\nMISS INTENTIONS OF GOVERNMENT OF MARCH OF DETAILS\n1993/02/03\nABILA, Kronos - in a President √©tincelant Luis Araullo of press conference late last year a historical whole of tax tax incentives designed announced to bring the foreign investment to Kronos under the appearance creating of employment, providing cheap energy and establishing the infrastructure.  After the voice 86-14 month last the Minister of Interior Department Tomas Sarto glorifi√© the decision as the \"limiting terminal\" and \"improving the people\".\nWe will see.  The crafters of these revolutionary measurements neglected to include a plan detailed about the way in which these ventis would profit daily Kronosians.  When the first payment as of these alien company in the trunks of state, how these funds unload do will be dispersed?\nOne wonders:  Did the 14 which was opposed to measurement feel the same manner?  Did they wonder also exactly how this money would be directed in education, the improvements in roads, the utilities and the care of health?\nCalls to the offices of the president were not turned over.\n');
INSERT INTO `article` VALUES (127, '211.txt', '1998/11/16', 'The Orb\n', 'TO MEET REPRESENTATIVES OF POK THE MINISTER OF KRONOS OF HEALTH\n', 'The Orb\nTO MEET REPRESENTATIVES OF POK THE MINISTER OF KRONOS OF HEALTH\n1998/11/16\nABILA, Kronos - the representatives of the social activist group guards of Kronos (POK) met earlier this week with Cesare Nespola, minister of health to discuss the resolutions to the contamination of the water which infested Elodis since the Nineties late.\n\"It was a productive meeting,\" the Chief of POK that Henk Bodrogi indicated.  \"I am encouraged considerably by the interest which the government shows in the pain of the people of Elodis.  It seemed to be very sensitive to our request to establish the health improved in Elodis, and reverses the contamination responsible so much for several of our diseases.\"\nThe POK formed into 1997 of a group of action of bases in response to the pollution of the supply water of Elodis and disease resulting and to the deaths from the residents above the following several years.  \n');
