INSERT INTO `article` VALUES (132, '216.txt', '2000/01/16', 'The Light of Truth\n', 'GDP OF KRONOS ON RISE\n', 'The Light of Truth\nGDP OF KRONOS ON RISE\n2000/01/16\nABILA, Kronos - the interior product gross real - the production of goods and the services produced by the work and the property located in Kronos - increased atan annual rate of 5.4% in the fourth quarter of 1999, according to the anticipated evaluation released by the office of economic sciences.\nThis marks the 5th year in a line with the positive growth of GDP for the country in the process of development. The major part of this growth can be contributed to the relationship between the government of Kronos and international GAStech.\n');
