INSERT INTO `article` VALUES (135, '219.txt', '2014/01/21', 'News Online Today\n', 'RANSOM DEMANDS MADE IN GASTECH KIDNAPPING \n', 'News Online Today\nRANSOM DEMANDS MADE IN GASTECH KIDNAPPING \n2014/01/21\nABILA, Kronos - The Protectors of Kronos have not only taken responsibility for the kidnapping of GAStech International employees, but have also made a ransom demand of $20M from the President and CEO Sten Sanjorge, Jr.\n');
INSERT INTO `article` VALUES (136, '22.txt', '2001/09/02', 'Daily Pegasus\n', 'THE MEMBERS OF POK ARRESTED\n', 'Daily Pegasus\nTHE MEMBERS OF POK ARRESTED\n2001/09/02\nELODIS, Kronos - heavies of the government obstructed the free speech - yet again - of the members of the protectors of the group of the activist of Kronos yesterday in a legal demonstration in the fields of the curve of Tiskele.  The five activists of POK had collected in front of the doors to the facility of the operations of the gas of GAStech that he perforated to cause to public conscience the contaminated river of Tiskele that has caused problems of health to the residents of Elodis.\nThe present people disclose that the demonstration had begun Pacific with the five members of POK that walked forwards and backwards through way, singing \"remembers Julian\" and \"not more of poison\"  \nAn eyewitness said that when the doors were opened to allow that the vehicles of the company of GAStech leave the facility the moved demonstrators to a side.  The witnesses apparently agree that at the same time the vehicles with the government of the seal of Kronos lead to the doors, gliding to incorporate the facility. \n\"Era all the very civil one for above until then,\" Griffith Mabel, resident of Elodis that had left to support the POK said.   \"The opened doors, the POK people moved and the cars expelled.  That one is when stranger obtained.  The cars stopped in means of the way for no reason.\"\nAnother eyewitness, farmer Charley Normand de Elodis adds, \"yes, the POK individuals requested that the conductors moved pleasant, but the conductors of GAStech did not pay attention to them.  They had his windows down, so he was not as they could not hear them.\"\nThe renters of the vehicles of the government left and assembled of altercation.  The event sequence gets to be confused at this point.  Some witnesses indicate the instigadas discussions the conductors of GAStech with protestors, and others think that the officials of the government began to intimidate the demonstrators of the way.\n\"It is to people in the cars of the government were police,\" Mabel says.  \"He used the uniforms and had currencies.\"\nThe Onlookers says that the three parties began to shout, and in a certain point the police of Kronos - of Abila- it arrested five activists it probably transported and them to a jail of Elodis.\nIn spite of the repeated orders an interview, has not granted the access those arrested.\n');
INSERT INTO `article` VALUES (137, '220.txt', '1997/10/17', 'Athena Speaks\n', 'GOVERNMENT ISCED \"MINOR\" CONTAMINATION CLOSE TO ELODIS\n', 'Athena Speaks\nGOVERNMENT ISCED \"MINOR\" CONTAMINATION CLOSE TO ELODIS\n1997/10/17\nABILA, Kronos - after complaints and the continuous calls of the people of the civils servant of government of Elodis recognize the minor contamination in and around the rural black suburbs in a report/ratio on their research on the questions of the health of the townsmen. However, the report/ratio of government stops before blaming international GAStech and its site of curve of Tiskele 20 kilometers of ascending as the people of Elodis affirm. \nThe report/ratio of government does not quote any cause of root or of the causes can be given at this time with more necessary research and investigations. Indeed, the \"pointing of a finger of blame currently would be precipitated and most probably harmful with research.\"\nAlthough the report/ratio admits contamination which it goes on the qualification the statement of level, \"the minor level of the contamination is completely in conformity with international standards of health agreed by the government of international Kronos and GAStech as negotiated in the contract of site of curve of Tiskele.\"\nThe government of Kronos continues to offer to determine well the interested residents of Elodis like plans to study more far the causes from root of the diseases in and around the black suburbs. \n');
INSERT INTO `article` VALUES (138, '221.txt', '2005/04/05', 'Homeland Illumination\n', 'POK PROTESTS END IN ARRESTS\n', 'Homeland Illumination\nPOK PROTESTS END IN ARRESTS\nMaha Salo\n05 April 2005\nELODIS, Kronos - Fifteen members of the Protectors of Kronos (POK) activist organization were arrested by Kronos federal police yesterday following an dispute at the gates of the Tiskele Bend GAStech facility.\nProtesters arrived pre-dawn to lock arms and halt traffic leaving and entering the facility.  By 8 am local time, traffic had back up on both sides of the gates.  Swaying, the protesters sang well-known protest songs, including \"This is Our Land\", \"Songs of the Farmer\" and \"The Weavers of our Homeland\"\nWhen the federal police began arresting the POK protesters, they moved in an orderly fashion into the waiting police van, singing the entire time.\n');
INSERT INTO `article` VALUES (139, '222.txt', '1998/05/17', 'The Orb\n', 'DOCUMENTARY CARD OF PUBLIC HEALTH Of ELODIS\n', 'The Orb\nDOCUMENTARY CARD OF PUBLIC HEALTH Of ELODIS\n1998/05/17\nELODIS, Kronos - on request of the citizens of Elodis, health for all published a report/ratio on the impact of the operations of gas drilling on the quality of water and the public health.  The detailed report/ratio will be soon available on health for all the Web site.  Comparative data before 1998 were obtained starting from a complete investigation of the medical disc provided by the center of health of Elodis Community.\nTo bring back the climaxes\n* High quantities of toxic chemicals were found in the supply water, including arsenic, the acetic anhydride, the benzene, and the chlorine dioxide.\n* The people young person than 30 seem to suffer a rate exceptionally high from chronic disease related to toxins produced by operations of gas drilling.\n');
INSERT INTO `article` VALUES (140, '223.txt', '2013/12/18', 'The General Post\n', 'ENORMOUS IPO MAKES MULTIMILLIONAIRE OF SANJORGE\n', 'The General Post\nENORMOUS IPO MAKES MULTIMILLIONAIRE OF SANJORGE\n2013/12/18\nCENTER, Tethys - president and CEO of GAStech international Sten Sanjorge, Jr can add another description to their name: multimillionaire. And not only a multimillionaire, almost multimillionaire excessive of like parts twice sold international of GAStech in an initial public offer.\nInternational GAStech, founded on 1961 like Sanjorge that carries by Sten Sanjorge, Mr., produces near 5 million cubic meters of newspaper gas in curve of Tiskele of its site that it perforates of GAStech - of Kronos. \nAs far as the details of the limadura: Stake of s 51% of the Jr of Sanjorge \"in the company is worth $1,96 billion; The stake of Beatriz Fluss\" (widow of the Fluss hank of the Co-founder of the company) 33% is worth $1,27 billion. \nOne does not feel grieved for the executives of GAStech - of Kronos. The limaduras demonstrate that the GAStech - the executives of Kronos gained $327,25 million collective of the parts granted including $96,25 million by each one for the rasgueo of CFO Ingrid Precipice again, Field-Corrente of Ada of I BACK WATER, and Orhan of the COO. The adviser of environmental security Willem Basoue-Country also gained $38,5 million. \n');
INSERT INTO `article` VALUES (141, '224.txt', '2011/07/28', 'The Guide\n', 'Labeled POK a \"public threat\"\n', 'The Guide\nLabeled POK a \"public threat\"\n2011/07/28\nABILA, Kronos - in a declaration to the press today, the spokesman Rufus Drymiau of the government said of the POK: \"a public threat due to the violent demonstrations, vandalism opportunistic, and shocks with the police are justifiable.\"  The violence and the vandalism have become a registered tradename of the POK meetings lately.  \"They have caused the thousands of dollars in damage to the buildings and to the businesses, demonstrating they have little well-taken care of for the hardship of people.  President Kapelou will not let his mutilation continue undisputed,\" said Drymiau.  \n');
INSERT INTO `article` VALUES (142, '225.txt', '2011/06/20', 'Homeland Illumination\n', 'A LOOK BACK AT A LIFE CUT TRAGICAL SHORT: ELIAN KAREL\n', 'Homeland Illumination\nA LOOK BACK AT A LIFE CUT TRAGICAL SHORT: ELIAN KAREL\nPetrus Gerhard\n20 June 2011\nABILA, Kronos - Two years ago yesterday Elian Karel died at age 28 in an Abila jail cell, purportedly of cardiac arrest.  He had been arrested three months prior for spurious charges of tax evasion and left to linger in a jail cell without further legal action.  His attorney, Michale Kraft made several appearances in court demanding that the government outline their specific charges, and release Karel.  Kraft had reached an agreement with the government that charges would be reduced and the Karel be released pending a trial, but Karel died two days before he was to go free.\nQuestions linger, however, about the manner of Karel\'s death.  Requests for information were met with assurances that the police -whose custody Karel was in at the time of his death - would do everything possible to perform an exhaustive investigation.\nThis \"thorough investigation\" lasted all of two weeks, including the time it took the Abila City Coroner to lose the original autopsy files.  After Karel\'s body was cremated and sent to his family in Elodis, the Abila Chief of Police closed the case and has declined to answer questions about Karel\'s death stating that \"we are satisfied the death was of natural causes and will no longer be entertaining inquiries.\"\nAs reported at the time of Karel\'s death, several people close to the investigation reported that Karel\'s body showed signs of blunt force trauma, abrasions and lacerations which were not consistent with the cause of death reported by the police.  These confidential sources have since moved from the area and have been unavailable for contact.\nPolice have denied anything unusual happened in Karel\'s death and city officials claim the accusations of murder and wrongful death are asserted by POK rabble-rousers attempting to incite instability and violence.\nYesterday on the morning of June 19th, a small group of POK supporters gathered in front of the Abila Police Station, holding photographs of Elian, and of another young martyr, Juliana Vann, the ten-year old girl who died in 1998 from cancer caused by benzene toxins in her drinking water.  \n\"Both of them died because of government lies and corruption,\" one man told me who asked that his name be withheld because of concerns of police retaliation.  \"Juliana died because Kronos allowed GAStech to poison our water, and Elian died because he tried to bring Juliana justice.  When will it end?\"\nAnother, larger crowd had gathered the day before in a nearby city park to bring public awareness about these same issues.  Amid the speeches and music, I heard the same message from the year before:  \"Remember Juliana! Remember Elian!\"\n');
INSERT INTO `article` VALUES (143, '226.txt', '1993/01/19', 'International News\n', 'Government Announces Tax Incentives For Foreign Investment \n', 'International News\nGovernment Announces Tax Incentives For Foreign Investment \n1993/01/19\nABILA, Kronos - Today the Parliament voted 86 to 14 in favor of President Araullo\'s package of tax incentives designed to lure foreign investment to our fair country.   \nThe tax incentives specifically target energy development companies, which the government hopes to lure to Kronos\' rich, but yet undeveloped, gas fields.  Ministry of the Interior projections show that development of just the Tiskele Bend fields could bring in as many as 5,000 high paying jobs and yield billions of dollars of infrastructure development over the next 20 years.\n');
INSERT INTO `article` VALUES (144, '227.txt', '1984/05/04', 'News Online Today \n', 'Shale gas pioneer plans world\'s first offshore wells in Mediterranean Sea  \n', 'News Online Today \nShale gas pioneer plans world\'s first offshore wells in Mediterranean Sea  \n1984/05/04\n<<Deleted Image: Anti-offshore drilling protester.  Exploration has proved a controversial issue in Kronos>> \nContinue reading the main story  \nThe son of the founder of gas firm GAStech is planning a venture to drill in the Mediterranean Sea, the Times has learned. believes there are large volumes of offshore gas that could be extracted. \n\"Certainly offshore gas isn\'t a new concept, but there\'s no reason with the Kronosian history of offshore development that we can\'t develop these resources offshore,\" he told the Times. \nShale gas is extracted using the controversial technique of hyper-acidic substrate removal which involves injecting acidic chemicals shale layers, to break them up and release the natural gas trapped within. \nGAStech has estimated that the Kronos total offshore shale gas resources could be between five and 10 times the size of the resources available onshore. But using the process on the large numbers of wells needed to extract offshore shale gas commercially has never been done.\n');
INSERT INTO `article` VALUES (145, '228.txt', '2012/03/08', 'Worldwise\n', 'The Minister for health receives threats of POK\n', 'Worldwise\nThe Minister for health receives threats of POK\n2012/03/08\nABILA, Kronos - the sources of police force informed that Kronos hold the first role this Vincent Kapelou, minister of health, received several letters mena√ßantes applicant to come from the POK.  \"I guess that they become desperate for the attention,\" Vincent Kapelou called in an interview of telephone.  The \"chances are this is not nothing, but we will not take any chance. I doubled the size of my force of safety and sent my family far from the prolonged holidays.\"\nKapelou, 39, were named with the position of the Minister for health in 2001 after the death of Cesare Nespola.  Kapelou is the oldest son of the brother of the President Kaeplou\' S, Andreas.\n');
INSERT INTO `article` VALUES (146, '229.txt', '2009/03/13', 'The Guide\n', 'Karel leader of the activist arrested for the fiscal evasion\n', 'The Guide\nKarel leader of the activist arrested for the fiscal evasion\n2009/03/13\nABILA, Kronos - the police of Kronos arrested Elian Karel in loads of fiscal evasion today.  Karel, the protective leader of the group \"of the activist of Kronos\", lead a meeting with its those in favor they arrested when it.  Tried Karel to make the light of the situation, but their followers were referred clearly on the seriousness of the loads made level against him.  The lawyer of Karel, Michale Kraft, sent a declaration declaring that the loads against their client were false and that he hoped to have sent Karel of safekeeping of the police by the end of the week.  About answer to the declaration of Kraft, Carman de Adrien of the spokesman of the said police, \"I think that Mr. Kraft has underestimated the seriousness of the situation of his client.\"  It is clear that Elian Karel, that professes to have the interests of the people of Kronos in the heart, must explain us because he rejects to contribute to the well-being of his nation.\n');
INSERT INTO `article` VALUES (147, '23.txt', '2009/02/22', 'The General Post\n', 'SANJORGE JR CONDEMNS POK LIKE TERRORISTS\n', 'The General Post\nSANJORGE JR CONDEMNS POK LIKE TERRORISTS\n2009/02/22\nCENTER, Tethys - an official declaration sent by Sten Sanjorge, president of the Jr and the CEO of international GASTech, condemns the protectors of Kronos like \"ileg√≠timo\" and organization of the \"terrorist\". The declaration came in answer to the meeting of the protest of Wednesday by the POK in the headquarters of GAStech - of Kronos.\nRough 200 people collected in front of the mottos singing of the building of GAStech and the samples that shook that they alleged people have died the debt the results of the contamination of a site that it perforated of GAStech. Sanjorge, Jr responded to the demands of will refr√°n of the contamination of GAStech, \"[GAStech] we have worked untiring to solve - if it did not exc√©dase - the international standards of the health been suitable upon with the government of Kronos before nobodies and everything being perforated.\"\nTen demonstrators of POK were chained to the door of GAStech - Kronos except for entrance to the building. \nIn very long Sanjorge of the declaration a Jr presents/displays to his discussion, \"if a person is arranged to violate in deprived characteristic, if a person is arranged to be chained to a door to avoid that a business works, if a person is arranged to break windows and to burn the cars in her own city, then that person is arranged to make any thing. And if a person is arranged to make any thing to obtain her goal of the end who presses fear in the common citizen. I fear what he will do later because I fear which he is able. When a people group uses fear and the violence to obtain its goals of the end is only one word for them there and that word is terrorist.\"\nThe declaration concludes with Sanjorge, Jr who demands that the government of the system of Kronos until assures \"not only the security my employees, only all the citizens of Kronos.\"\n');
INSERT INTO `article` VALUES (148, '230.txt', '1995/11/23', 'The Truth\n', 'Araullo announce the new construction of the hospital\n', 'The Truth\nAraullo announce the new construction of the hospital\n1995/11/23\nABILA, Kronos - president Araullo kondigde today to that its government the construction of new, in a modern way general hospital plants Abila.  The old general hospital Abila, which is built in 1930, out-of-date health care facilities have in the past suffered and from many elektrobranden the decade.  The administrator hauled Trucco of the hospital praised government action saying, we have tried get financing to update our facilities many years\', uselessly.  We have now lived on lent time for rather tijdje with the old boiler.  It pure luck has been none that the old little girl on our. has been lacking entirely\nNew general Abila 350 beds, will have a substantial improvement of the pure 100 beds of the current old-fashioned facility.  Moreover, it complete help lines area, traumatism and burn care entities, one psychiatric care wing, and have four ultra-modern surgical ranges.  In its notice of new construction, aforesaid is Araullo, our strategy for foreign investment strive large profitable.  This new hospital is first of a lot of projects which we are ijn= pursue to help our standard of living to promote and our life style to modernize.\n');
INSERT INTO `article` VALUES (149, '231.txt', '2013/12/17', 'Athena Speaks\n', 'BRONZE ATTACK OF TIME OF DAY BY POK\n', 'Athena Speaks\nBRONZE ATTACK OF TIME OF DAY BY POK\n2013/12/17\nABILA, Kronos - the bronze attack of time of day on two leaders of peace by the POK is right another act violate and terrorist in a long cord of such acts. The two leaders were left bloody and beaten, and attach upwards in the trunk of the their vandalized the vehicle.\nTo maintain the order Carman d\' Adrien of spokesman known as of the attack, \"to attack police force property of government of leader and to destroy are serious crimes. I want to ensure the public which these men will be caught and brought to justice soon.\" \nOther worsening the situation, the two criminals disfigured the car of the leaders by the spraying the logo of POK. \nIf they can attack two leaders of police force in broad day, which is next?\n');
