INSERT INTO `article` VALUES (151, '233.txt', '2010/10/2', 'The Abila Post\n', 'PRESIDENT KAPELOU II ELECTED BY RECORD MARGIN\n', 'The Abila Post\nPRESIDENT KAPELOU II ELECTED BY RECORD MARGIN\n2 October 2010\nABILA, Kronos - President Dorel Kapelou II has won re-election with the largest margin ever in a Kronesian election. The people of Kronos have stood together and announced a bright new day with a resounding vote of confidence for the President.\nPresident Kapelou II of the Democratic Party of Kronos captured 98.7% of the vote with Ren Touvi of the Organization of Business and Unions Party a distant second with a mere 1.0% of the vote. \nWith all the votes counted the President\'s Democratic Party of Kronos now holds 85 seats in the General Assembly, 13 for the Organization of Business and Unions Party, and 2 for the Party of Kronos Industrialists. \nFrom every corner of Kronos could be heard a chorus of Kronos, Be Ever True to Thee.\n');
INSERT INTO `article` VALUES (152, '234.txt', '2014/03/26', 'Everyday News\n', '2014/03/26\n', 'Everyday News\n2014/03/26\n21 of October of 2013\nInterpol has announced the formation of a detachment of forces of the new multi-country to fight the more and more ample distribution of cathinone of methyldimethyl of the drug (MDMC).  To direct the detachment of forces is inspector greater Loblaw Robert, official of the veteran who lead very to guessed right equipment of Tethys Counterdrug.  He is optimist who he can identify the source.\n\"These drugs of designer have certain tracks as far as their origin,\" Loblaw these times in an interview.  \"Whenever the prescription changes, it leaves tracks as far as it did whom it.  It is like a pedigr√≠.\"\nThis particular mixture of drug MDMC, also known by its street names the \"caramel of cotton\", the \"spice so√±a\" and the \"flower of tulip√°n\", was found previously only in Asteria but it has made his way to the streets of Tethys and other international countries.\n\"I will hardly watch the activities of the army of people of Asterian,\" Loblaw this.  \"Our previous investigations indicated to them like the source of this particular formulation.\"\nThe army of people of Asterian (APA) is an organization paramilitary that has been contracted the financed activities of the terrorist with its criminal companies, that include drug traffic.  These last years the APA has tried to construct to their trade name with Web site and the publication of a professional compartment, of high called quality \"Arise\".\nInspector greater Loblaw says the public statistic of Tethys indicates that MDMC is a problem every greater time with the youth of the country.  \"An increase in mental problems of health, including the hallucinations and the paranoia, accompanied by violent behavior and an increase marked in tariffs of the suicide are only some of the indicators of the use of this drug of designer.\"\n\"In the first place we have alerted t