INSERT INTO `article` VALUES (174, '254.txt', '2000/05/31', 'Homeland Illumination\n', 'ELODIS PUBLIC HEALTH FACT SHEET - UPDATE\n', 'Homeland Illumination\nELODIS PUBLIC HEALTH FACT SHEET - UPDATE\nMaha Salo\n31 May 2000\nELODIS, Kronos -The environmental consequences of Hyper Acidic Substrate Removal (HASR), a controversial drilling technique have taken a huge toll on the health of Elodis residents.  An update to the 1998 Wellness for All report will soon be posted on the Elodis municipal website.\nHighlights\n* Unprecedented levels of toxins were found in the water supply, including phenol, acetic anhydride, lead, and ethylene glycol.\n* The incidence of chronic illness increased  over 89% from prior years\n* The unusually high incidence of cancer became so concerning that Minister of Health Nespola appointed an oncology specialist to Abila General Hospital\n');
