INSERT INTO `article` VALUES (197, '275.txt', '1998/08/20', 'The Orb\n', 'FROM TEN YEARS - OLD WOMEN MATRICES OF GIRL Of ELODIS OF POISONING\n', 'The Orb\nFROM TEN YEARS - OLD WOMEN MATRICES OF GIRL Of ELODIS OF POISONING\n1998/08/20\nELODIS, Kronos - ten years - old man Juliana Vann died yesterday afternoon, surrounded by its family and friends.  The cause of death was leukemia due to the benzene poisoning.\nJuliana had been sick during more than one year.  At the beginning its family did not realize that the benzene poisoning was the cause of the problems of Juliana.  After visits with much of hospital, a doctor joined the international health of organization of assistance for all Juliana recommended is tests for the benzene poisoning.  At this point, however, small system girl was damaged too much to recover.\nThe residents of Elodis had spoken in favor with the government of Kronos to act against the pollution caused by the operation of gas drilling of GAStech right 20 kilometers upstream of Elodis.\nThe death of Juliana is but one several deaths that these rural black suburbs suffered because of the toxic loss being emptied in the river of Tiskele by company GAStech de Tethys.\nPrivate funeral services will be judged on August 21 in the family at the house.\n');
INSERT INTO `article` VALUES (198, '276.txt', '2014/01/21', 'International News\n', 'Police Hold News Conference on GAStech Kidnapping \n', 'International News\nPolice Hold News Conference on GAStech Kidnapping \n2014/01/21\nABILA, Kronos - The Abila police held a press conference at nine this morning on the kidnapping GAStech headquarters.  Police informed reporters that four of the GAStech employees whose whereabouts were unconfirmed yesterday were found overnight, leaving ten people who are presumed missing. \nPolice spokesman Adrien Carman said Tethyn federal law enforcement agencies are assisting in the investigation.  The POK rhetoric has become increasingly anarchist and their actions more criminal and violent over the past several years.\n');
INSERT INTO `article` VALUES (199, '277.txt', '2000/08/16', 'The Light of Truth\n', 'SITE OF CURVE OF TISKELE OF ROCKS GASTECH Of EXPLOSION\n', 'The Light of Truth\nSITE OF CURVE OF TISKELE OF ROCKS GASTECH Of EXPLOSION\n2000/08/16\nABILA, Kronos - an explosion with a trimming close to well of gas drilling awoke Rebecca Cato around 3 hours the morning Sunday morning. When it left its house in Elodis, Kronos - rural black suburbs apart from capital Abila - to study the noise it noted a large fire to come from the international site of curve of GAStech Tiskele.\nElodis GAStech-had good near fired the methane gas underground causing a fire which lasted during around one hour. At least four employees of GAStech seemed to be carried by the ambulance; however, GAStech refused to present its observations on the width and the nature of their damage. \nJr. of Sten Sanjorge of PRESIDENT de GAStech reduced the value of the stating event, \"this event could be hardly described like explosion,\" but like simply practical current indicated under the widening name. It continued, \"I will not annoy you with the details, but a provisional rocket is often used during the good production examining.\" \nMrs. Cato and other people of the country of Elodis were turned part by employees of GAStech and civils servant of government. Thereafter, the downriver people of the country were evacuated. Rebecca Cato indicated, \"after us to have sent far without answered simple question, they came to our doors and said to us to leave our houses. It was the middle of the night when was I with going.\" \n');
INSERT INTO `article` VALUES (200, '278.txt', '2000/01/15', 'The World\n', 'KRONOS GDP ON THE RISE\n', 'The World\nKRONOS GDP ON THE RISE\n15 January 2000\nABILA, Kronos - The real gross domestic product - the output of goods and services produced by labor and property located in Kronos - increased at an annual rate of 5.4% in the fourth quarter of 1999, according to the advance estimate released by the Bureau of Economics.\nThis marks the 5th year in a row with positive GDP growth for the developing country. Most of this growth can be contributed to the relationship between the Government of Kronos and GAStech International.\n');
INSERT INTO `article` VALUES (201, '279.txt', '2014/03/26', 'World Journal\n', 'The perspicacity of an expert: prosperity as foreign PRESIDENT in Kronos \n', 'World Journal\nThe perspicacity of an expert: prosperity as foreign PRESIDENT in Kronos \n2014/03/26\nJanuary 17, 1995\nThe Fluss hank is PRESIDENT de GAStech, the principal industry of Krono during more than 15 years, after its discovery of its immense gas layers close to the town of Elodis.\nFluss, functioned with dozen foreign Presidents during years. However, it has humble beginnings as a gas and oil prospector in Tethys. \nIt spoke at times about the features about a chief successful in Kronos and which foreign Presidents can envisage in the market. \nQ: What the foreign Presidents can they wait when they come in Kronos?\nA: the economic environment changed since the Eighties. It is much more difficult to succeed today. The foreign Presidents must play in bottom of their hopes. There is no easy victory in Kronos. Competition among Kronosian and foreign companies is hard. It is difficult to gain the hearts and the spirits of the population.\nBut there is less of difference than people think between the culture of Kronosian and, culture of Tethian of word. The personnel of Kronos function just like hard, they are respectful of their work and have the same desire for success. They can also appreciate the effective communication and a gifted chief.\nWhich foreign chief must make is to learn how to communicate the \"manner of Kronosian\" and to take time to include/understand their personnel.\nQ: Can you work out?\nA: There are many cultural differences while communicating. [To consider] notes. The foreign Presidents are always confused and frustrated when they send a note [with somebody in Kronos] and expect a simple response of yes/No Instead of that they obtain a very long answer which does not answer their initial question.\nThe people of Kronos do not like to take the responsability. They are frightened to lose their work and do not like to be forced in saying something which they do not want with. The foreign Presidents must take account of this and have to take time to include/understand how to communicate.\nPatience is key. Transparency can be an excellent manner of coming to end this. It is a European value which Kronosians are very sensitive to. To impose on a company can transform with the voyage of a foreign President into Kronos an experiment much more pleasant.\nQ: What the challenges of force are they a foreign PRESIDENT can they face on the arrival in Kronos?\nA: Sometimes in fact the simplest things can be most provocative, like obtaining from A with B in a taxi. To be able to obtain around easily is taken for granted and not being able to make thus creates a great direction of the insecurity. In Kronos you are never sure if your driver drops to you to far with the address envisaged. This can seem as a small question but daily it is very tiring.\nAnother ends up knowing your team and with which you work. Just often foreign of stage of Presidents in addition to plane and in an office completely of the colleagues of Kronos. They do not have any idea which they are, how they work or as they qualified are. This can be muddling. \nThe Presidents must take time to speak with their personnel, of the administrators to the drivers of truck and to include/understand their new environment before they test them and control.\nQ: Can you give some ends on the way in which a foreign PRESIDENT can prepare?\nA: the first thing that I would say is to prepare your family. They can find it difficult to adapt to the new environment of operation. This can affect the personal life. The family and the work of mixture are practical very current here. The people of Kronos work of overtime and socializes with their colleagues. It is very different from Tethys where there is a clear border between work and the family.\nThe foreign Presidents should also carry out how hard competition is and how much hard work must be put inside to succeed -- often much more than in their countries of origin. The language is a great question.\n[But] anyhow much prepare you, the true experiment to work and to live in Kronos will always astonish you.\nQ: How much difficult - or easy - is it to be a foreign PRESIDENT in Kronos?\nA: Generally, I think that being a PRESIDENT is hard. There is much pressure, the environment is hard and it is difficult to find a balance with your personal life.\nWhen a team of Kronos hears them that a PRESIDENT comes from overseas suppose it is a problem. But, culturelement they do not have a question with foreigners. \nQ: Are there situations in which to be a foreign director is really an advantage?\nA: This question really depends on the person and how much they invest to include/understand the country and the culture. If they do not make any effort locate then it is a Net handicap. But in certain negotiations or certain questions such as the goods of luxury, the foreign Presidents can be an advantage. They can bring another point of view, facilitate the process.\nSometimes the foreign PRESIDENT with the best knowledge of an industry and can bring the access to the markets of overseas. This can be a tangible asset.\n');
INSERT INTO `article` VALUES (202, '28.txt', '2011/06/20', 'Kronos Star\n', 'POK Protesters Vandalize Siopa District\n', 'Kronos Star\nPOK Protesters Vandalize Siopa District\nMarcella Trapani\n20 June 2011\nABILA, Kronos - A Protectors of Kronos demonstration in the streets of the Siopa district in downtown Abila resulted in numerous incidents of vandalism and opportunistic looting yesterday.  Crowd members spray painted the new POK logo on buildings and cars, broke shop windows, looted stores, and intimidated innocent bystanders.  The police were forced to use tear gas and water cannons to disperse the group of hooligans.\n');
INSERT INTO `article` VALUES (203, '280.txt', '2014/01/20', 'Centrum Sentinel\n', 'VOICES - a blog approximately that what is important to people\n', 'Centrum Sentinel\nVOICES - a blog approximately that what is important to people\n20 January 2014\n1232 - There is the speculation that the pictures of GAStech and the civil employees of Kronos have escaped the country with their fortune and the moneies from the cowlings of Kronos. 20 gen. 2014');
INSERT INTO `article` VALUES (204, '281.txt', '2014/01/20', 'Kronos Star\n', 'Breaking: Emergency at GAStech Headquarters Building [Updates]\n', 'Kronos Star\nBreaking: Emergency at GAStech Headquarters Building [Updates]\nCato Rossini, Marcella Trapani\n20 January 2014\nUpdate, 6:40 PM:  There is speculation that the GAStech personnel who have arrived from Tethys are security experts who are assisting police with the investigation.');
INSERT INTO `article` VALUES (205, '282.txt', '2012/06/20', 'International Times\n', 'Abila police break up sit-in turned violent at the presidential manor \n', 'International Times\nAbila police break up sit-in turned violent at the presidential manor \n20 June 2012\nTraffic snarled around the city as Abilians struggle to get to work amid vandalism and looting\nEarly on Tuesday police stormed the front of the presidential mansion and the capital building, breaking up a sit in by the Protectors of Kronos.\nOther activist groups have joined the protesting faction in solidarity and a bigger rally was predicted for later in the day.\nThe conservative Kronos government used an emergency law to threaten the protestors with arrest unless they dispersed and returned to work.  The row is over environmental issues the POK holds the government and the gas giant GAStech international responsible.\nThe rallies had begun peacefully, however more destructive activities have escalated as the crowds became more restless. \nSigns among the protester called for government change and social equality.  Images of Juliana Vann, the 10 year old girl who died from illnesses attributed to the industrial giant GAStech international served as rallying points.\nPeople heading to a pro-government counter-rally were attacked by POK supporters, and later shots were fired.  \nTuesday was the third anniversary of the mysterious death of Elian Karel, a popular leader of the POK who died in prison. \nLater in the day, what had been a largely peaceful demonstration turned violent when the crowd started vandalizing government buildings and the presidential homestead.  \nA group of younger protestors attacked vehicles, smashing windows.  Minor injuries were reported. \nPolice reinforcements were sent to the area and blocked roads, and skirmishes between the police and protestors broke out. \nPolice used tear gas to break up the unruly crowd.  Government spokesmen complemented the security forces for their handling of the \"gangs of criminals\" disrupting the peace.  \n');
INSERT INTO `article` VALUES (206, '283.txt', '2014/01/20', 'Homeland Illumination\n', 'VOICES - a blog about what is important to the people\n', 'Homeland Illumination\nVOICES - a blog about what is important to the people\nMaha Salo\n20 January 2014\n1027 - There is speculation that this evacuation was caused due to a bomb threat. 20 Jan 2014');
INSERT INTO `article` VALUES (207, '284.txt', '1999/02/20', 'The General Post\n', 'GAINS OF THE FILE OF GASTECH INFORMATION\n', 'The General Post\nGAINS OF THE FILE OF GASTECH INFORMATION\n1999/02/20\nCENTER, Tethys - GAStech international, according to projected the previous east month, disclosed 1998 benefits fiscal of registry of $110 million.\nGAStech published a previous inspection the 4 of February of the gains of the full-year as it leaves from his last attempts to drown outside for the accusations of the contamination of the underground water in Kronos imposed by Wellness for all.\nThe company disclosed the net rent of $29,5 million for the fourth trimester.\n\"International GAStech has given another year of the superior financial operation reached with a constant execution of the vision and expert,\" Sten Sanjorge, Jr, executive of GAStech, said in a brief declaration.\nSanjorge, Jr could not mention the declaration of the 13 of November of the health everything to ruin the company and its relation with the government of Kronos. Nevertheless, he mentioned the opening of impianto new of the natural gas of GAStech is in step. \n');
INSERT INTO `article` VALUES (208, '285.txt', '2005/09/25', 'News Online Today\n', 'ELODIS PROTESTS TURN TO RIOTS AND ARRESTS  \n', 'News Online Today\nELODIS PROTESTS TURN TO RIOTS AND ARRESTS  \n2005/09/25\nELODIS, Kronos - The Protectors of Kronos (POK) continue to protest against the Kronos Government and GAStech International alleging pollution, water contamination and a lack of a government response. After the recent rioting, government officials had no choice, but to round up the protesters and arrest them for trespassing.\n');
INSERT INTO `article` VALUES (209, '286.txt', '2010/06/19', 'News Online Today\n', 'IN REMEMBRANCE:  THE DEATH OF ELIAN KAREL, A YEAR LATER \n', 'News Online Today\nIN REMEMBRANCE:  THE DEATH OF ELIAN KAREL, A YEAR LATER \n2010/06/19\nABILA, Kronos -One year ago today a young man in search of a brighter future for his countrymen died in a cold, cement prison.  Instead, sometime in the early morning hours of 19 June, Elian Karel died with injuries inexplicable with the official cause of death.  Unnamed sources close to the investigation, however, have provided witness testimony that Karel\'s body showed signs of blunt force trauma, abrasions and lacerations which occurred within hours before his death.\n');
INSERT INTO `article` VALUES (210, '287.txt', '2013/10/21', 'International Times\n', '21 October 2013\n', 'International Times\n21 October 2013\nInterpol has announced the formation of a new multi-country task force to combat the increasingly wide distribution of the drug methyldimethyl cathinone (MDMC).  Heading the task force is Senior Inspector Robert Loblaw, a veteran officer who led the very successful Tethys Counterdrug Team.  He is optimistic that he can identify the source.\n\"These designer drugs have certain clues as to their origin,\" Loblaw told the Times in an interview.  \"Every time the recipe is changed, it leaves clues as to who made it.  It\'s like a pedigree.\"\nThis particular blend of the drug MDMC, also known by its street names \"cotton candy\", \"spice dreams\" and \"Tulip Blossom\", was found previously only in Asteria but has made its way to the streets of Tethys and other international countries.\n\"I\'ll be looking hard at the activities of the Asterian People\'s Army,\" Loblaw said.  \"Our previous investigations pointed to them as the source of this particular formulation.\"\nThe Asterian People\'s Army (APA) is a paramilitary organization which has been engaged in terrorist activities funded through its criminal enterprises, which include drug trafficking.  In recent years the APA has sought to build their brand through websites and the publication of a professional, high-quality magazine called \"Arise\".\nSenior Inspector Loblaw says the Tethys public statistics indicate MDMC is a growing problem with the country\'s youth.  \"An increase in mental health problems, including hallucinations and paranoia, accompanied by violent behavior and a marked increase in suicide rates are only a few of the indicators of the usage of this designer drug.\"\n\"As a first step we have alerted port officials to be on the lookout for suspicious shipments of insecticides and detergent, both similar in appearance to MDMC.\"\n');
INSERT INTO `article` VALUES (211, '288.txt', '2011/06/21', 'News Online Today\n', 'A LOOK BACK AT A LIFE CUT TRAGICAL SHORT: ELIAN KAREL \n', 'News Online Today\nA LOOK BACK AT A LIFE CUT TRAGICAL SHORT: ELIAN KAREL \n2011/06/21\nABILA, Kronos √ø¬ø¬ø¬ø¬ø¬ø Two years ago yesterday Elian Karel died at age 28 in an Abila jail cell, purportedly of cardiac arrest.  After Karel√ø¬ø¬ø¬ø¬ø¬øs body was cremated and sent to his family in Elodis, the Abila Chief of Police closed the case and has declined to answer questions about Karel√ø¬ø¬ø¬ø¬ø¬øs death stating that √ø¬ø¬ø¬ø¬ø¬øwe are satisfied the death was of natural causes and will no longer be entertaining inquiries.√ø¬ø¬ø¬ø¬ø¬ø \nAs reported at the time of Karel√ø¬ø¬ø¬ø¬ø¬øs death, several people close to the investigation reported that Karel√ø¬ø¬ø¬ø¬ø¬øs body showed signs of blunt force trauma, abrasions and lacerations which were not consistent with the cause of death reported by the police. \nPolice have denied anything unusual happened in Karel√ø¬ø¬ø¬ø¬ø¬øs death and city officials claim the accusations of murder and wrongful death are asserted by POK rabble-rousers attempting to incite instability and violence.\n');
INSERT INTO `article` VALUES (212, '289.txt', '2014/01/20', 'Kronos Star\n', 'Breaking: Emergency at GAStech Headquarters Building [Updates]\n', 'Kronos Star\nBreaking: Emergency at GAStech Headquarters Building [Updates]\nCato Rossini, Marcella Trapani\n20 January 2014\nUpdate, 2:00 PM:  A government car was allowed through the police perimeter.  The occupant, who appears to be a security official, was let into the building.');
INSERT INTO `article` VALUES (213, '29.txt', '2014/01/20', 'International News\n', 'POK Kidnaps GAStech Employees \n', 'International News\nPOK Kidnaps GAStech Employees \n2014/01/20\nABILA, Kronos - The Protectors of Kronos (POK) are suspected of kidnapping up to fourteen GAStech employees from their headquarters building earlier today.  Abila police quickly secured the building and interviewed the remaining GAStech employees.  One employee, Edvard Vann of Abila, was questioned for hours because he shares a family name with several known POK members.  Vann denied involvement with the POK and claimed to have no knowledge of the kidnapping.  Tethyn federal law enforcement and representatives from the Tethyn Ministry of Foreign affairs flew to Kronos and were escorted to Abila police headquarters.\n');
INSERT INTO `article` VALUES (214, '290.txt', '2013/06/20', 'Homeland Illumination\n', 'WHO BRINGS A GUN TO A SIT IN?\n', 'Homeland Illumination\nWHO BRINGS A GUN TO A SIT IN?\nPetrus Gerhard\n20 June 2013\nABILA, Kronos - Yesterday, as they have each June 19th for the past three years supporters of Protectors of Kronos rallied demanding much the same as they have in the past fourteen years:  an end to the corruption of the Kronos government officials and the cleanup of the toxic waste dump that has become the Tiskele River near Elodis. \nThe rally which took place at several venues across the city, including in front of President Kapelou\'s publically-owned home and in front of the Abila capital building.  The citizens gathered hoping their voices would be heard by their elected officials. They handed out information on flyers printed and donated by local businesses about the lifestyle incongruities between today\'s elected officials and those of a few years ago. Demonstrators held posters of POK martyrs and chanted for social and economic parity, while black-clad members of the Abila Police formed faceless lines of shields, batons and side arms surrounding the crowds.\nOn everyone\'s mind was the question:  Who brings a gun to a peaceful sit in?  The rally had been publicized as a peaceful gathering of citizens to bring their concerns to the public consciousness.  The most dangerous item in their hands was a picture of a sweet-faced ten year dead old girl - Juliana Vann who died in 1998 of cancer caused by the benzene in her drinking water.  \nWhy did the Kronos government feel the need to send a police brute squad?\nDespite these heavy-handed efforts, as groups of people slipped through the barricades and moved through the streets to bring their message to the citizens of Kronos.  Flyers bringing messages of truth and justice were left on park benches, in coffee houses and on light poles.  \nHow can these officials - hypothetically getting by on public salaries - afford the second homes, large boats and luxury automobiles they flaunt?\n');
INSERT INTO `article` VALUES (215, '291.txt', '2014/01/20', 'News Online Today\n', 'KIDNAPPING AT GASTECH KRONOS  \n', 'News Online Today\nKIDNAPPING AT GASTECH KRONOS  \n2014/01/20\nABILA, Kronos - After a long day of conflicting and confusing information reports are still sketchy, but the story is beginning to come clear: a Kronos Government source has confirmed up to fourteen of GAStech International\'s employees may have been kidnapped at the company\'s headquarters in Abila. Abila Fire Department trucks were dispatched to GAStech - Kronos headquarters around 10:00 this morning local Kronos time to respond to a fire alarm.\n');
INSERT INTO `article` VALUES (216, '292.txt', '2014/01/20', 'The Abila Post\n', 'ON THE SCENE BLOG\n', 'The Abila Post\nON THE SCENE BLOG\nBy Haneson Ngohebo\n20 January 2014\n1158 UPDATE - The Abila Fire Department finished a thorough search of the GAStech building finding evidence of fire. At 11:45 AM they gave the all clear for the GAStech employees to re-enter the building. An AFD spokesman stated that the fire alarm appears to be a false alarm and that it was not a part of a planned fire drill.\nThe spokesman declined to answer whether or not the fire alarm was intentionally pulled.');
INSERT INTO `article` VALUES (217, '293.txt', '1998/08/19', 'Homeland Illumination\n', 'TEN-YEAR OLD ELODIS GIRL DIES OF POISONING\n', 'Homeland Illumination\nTEN-YEAR OLD ELODIS GIRL DIES OF POISONING\nPetrus Gerhard\n19 August 1998\nEarlier this year a series Homeland Illumination published a series of articles about groundwater contamination in Elodis, and how the locals are demanding a government response for what is essentially Government of Kronos-sponsored pollution and poisoning of citizens.  This article is an update.\nELODIS, Kronos - Ten-year old Juliana Vann died yesterday afternoon, surrounded by her family and friends.  The cause of death was leukemia due to benzene poisoning.\nJuliana had been sick for over a year.  Initially her family didn\'t realize that benzene poisoning was the cause of Juliana\'s problems.  After visits to many hospitals, a doctor associated with the international assistance organization Wellness For All recommended Juliana be tests for benzene poisoning.  At that point, however, the little girl\'s system was too damaged to recover.\nThe residents of Elodis have been pleading with the government of Kronos to take action against the pollution caused by the GAStech gas drilling operation just 20 km upstream from Elodis.\nJuliana\'s death is but one of several deaths this rural township has suffered because of toxic waste being dumped into the Tiskele River by Tethys corporation GAStech.\nPrivate funeral services will be held on August 21 in the family home.\n');
INSERT INTO `article` VALUES (218, '294.txt', '2009/03/12', 'Homeland Illumination\n', 'POK LEADER KAREL ARRESTED\n', 'Homeland Illumination\nPOK LEADER KAREL ARRESTED\nPetrus Gerhard\n12 March 2009\nABILA, Kronos ¬ñ In another unconscionable move against the citizens of Kronos, earlier today police arrested POK leader Elian Karel on spurious tax evasion charges.  He was led - manacled ¬ñ from a meeting of the Protectors of Kronos in Elodis, a rural township outside Abila.\nDemonstrating his trademark humor, Karel lifted his wrists and joked to his supporters as he is led away, ¬ìI guess I shouldn¬ít have sent the President those cases of bottled water for his birthday.¬î\nKarel is the leader of the Protectors of Kronos, an alliance of Kronos citizens from Elodis that has demanded the government clean up the contaminated water caused by gas drilling in their community.\n¬ìWe didn¬ít ask for GAStech to come to our community,¬î Karel spoke at a rally a few months ago.  ¬ìWe didn¬ít¬í ask for our water to become undrinkable, for our children to become sick.  Neither Elodis nor the people of Kronos have received any benefit from the extraordinarily large amount of money that GAStech clears every year.  I ask:  Where is the money going?¬î\nThe police representative assured supporters who massed outside the police station that Karel would be treated humanely, but declined to answer questions or allow visitors to see Karel.\n¬ìHe¬ís a determined man,¬î Karel¬ís attorney Michale Kraft told me over the phone. ¬ìHe¬íll fight these false charges and be out in a few days.  He¬íll probably complain about the jail food at the next POK rally.¬î \nKraft plans to meet with Karel Saturday morning.\nCalls to the President and Minister of Justice offices were not immediately returned.\n');
INSERT INTO `article` VALUES (219, '295.txt', '2000/08/18', 'Athena Speaks\n', 'EXPLOSION AND FIRE OF CURVE OF TISKELE\n', 'Athena Speaks\nEXPLOSION AND FIRE OF CURVE OF TISKELE\n2000/08/18\nABILA, Kronos - a spark at GAStech International-had well with the site of curve of Tiskele fired gas methane several hundreds of feet at the bottom, involving an aerolite and the fire which burned during approximately an hour is the results of GAStech duel - research of government on the explosion and fire Sunday next morning. \nFour employees of GAStech suffered from the damage including/understanding the minor burns and the broken bones. Contrary to the preceding reports/ratios there were no death and no lack because of the incident. No resident was as well wounded and although some residents of Elodis were evacuated their houses research indicates that the evacuation was useless. \nWhile the official cause of the explosion is always being studied, the problem could have come from a defect in the wellhead itself. The wellheads of GAStech are ringed with the collars which placed pins functioning by them. One of the pins could have blown out of the collar, releasing the gas, which then contacted a spark.\n');
INSERT INTO `article` VALUES (220, '296.txt', '2001/03/18', 'The Guide\n', 'The taxes added on the oil, development of the gas defeated in general to assembly \n', 'The Guide\nThe taxes added on the oil, development of the gas defeated in general to assembly \n2001/03/18\nABILA, Kronos - a movement to increase taxes on the development of the oil and the gas in an additional 10% was defeated today in the General Assembly by a vote from 77 to 23.  The proposed increase of the tax, defended by Minister of the health Will stop Nespola, was to provide the specific financing for the medical care, the clean projects of the water, and the education of health for the rural areas.  Ministrar Nespola said of the vote of the assembly, \"I am disappointed by the vote, but they treated the assembly that the increase in tax would discourage the foreign investment in our sector of energy.  This is a misfortune to my program to help our rural municipalities, but I am not nothing if nonpersistent.  My office will send a measurement added reviewed of the tax to the assembly at the end of this year.  In addition, I will work with the office of president Kapelou to reconstruct the allocation of bottoms of present taxes of the gas and the oil to anticipate rural projects of the health.\"\n');
INSERT INTO `article` VALUES (221, '297.txt', '2002/05/25', 'Homeland Illumination\n', 'ELODIS PUBLIC HEALTH FACT SHEET 2002\n', 'Homeland Illumination\nELODIS PUBLIC HEALTH FACT SHEET 2002\nMaha Salo\n25 May 2002\nELODIS, Kronos -The Elodis Community Health Center has published an update to the Wellness for All study performed in 1998.  The effects of Hyper Acidic Substrate Removal (HASR), a controversial drilling technique continue to ravage the health of Elodis residents.  The full report will soon be posted on the Elodis municipal website.\nHighlights\n* The mortality rate and incidence of chronic illness increased  over 178% from prior years\n* The unusually high incidence of cancer became so apparent that Minister of Health Nespola appointed an oncology specialist to Abila General Hospital\n');
INSERT INTO `article` VALUES (222, '298.txt', '2014/01/20', 'Kronos Star\n', 'Breaking: Emergency at GAStech Headquarters Building [Updates]\n', 'Kronos Star\nBreaking: Emergency at GAStech Headquarters Building [Updates]\nCato Rossini, Marcella Trapani\n20 January 2014\nUpdate, 5:50 PM:  According to a GAStech employee, the GAStech executives left the building after their meeting this morning and were headed to the reception at the capitol building.  When asked about why we were unable to reach them by phone, the employee replied that it was standard corporate security procedure for the executives to be rushed to a secure location in the event of a threat like the kidnapping.');
