INSERT INTO `article` VALUES (224, '3.txt', '1994/02/18', 'The Tulip\n', 'PROMINENT MATTER, BURGERMATRIJZEN OF THE LEADER AT 65\n', 'The Tulip\nPROMINENT MATTER, BURGERMATRIJZEN OF THE LEADER AT 65\n1994/02/18\nCENTER, Tethys - Friday early after four years of diminishing health after an important heart attack, Sten Sanjorge, SR. died morning. \nSanjorge, SR., 65, of center, Tethys were president Emeritus of international GAStech have opgerichtd the company in 1961. Beside its role in international GAStech the President of the Council of management of the chamber of the center and member was of the Council of the hospital of the children of the center of administrators. \nSten a champion for the children of Tethys, the aforesaid hospital president Willem Gracias has always been. He was a truth clerk LEADER and worked infinitely to float our forward institution. Sten will become really missed and we ask that the everyone Sanjorge family prayed in their ideas and. keeps\nSanjorge, SR. are survived by its woman Ingrid Sanjorge and its zoon Sten Sanjorge, Jr.\nLarge in this world has been extinguished slightly, still he pours still a shade, aforesaid Sanjorge, gelofte of Jr. I to lead ahead a renewed vision and a dignity to which living and the work my father. to our company with will honor\n');
INSERT INTO `article` VALUES (225, '30.txt', '2014/01/21', 'Modern Rubicon\n', 'ON SCENE BLOG\n', 'Modern Rubicon\nON SCENE BLOG\n21 January 2014\n850 MODERNIZATION 21 January 2014 - DAY TWO of the event of GAStech - we are attending the news conference of unit of the police of Abila previewed for the 9:00.');
INSERT INTO `article` VALUES (226, '300.txt', '2012/08/24', 'The Explainer\n', 'THE WHO IS THE DEMONSTRATORS \n', 'The Explainer\nTHE WHO IS THE DEMONSTRATORS \n2012/08/24\nABILA, Kronos - with the third anniversary to approach of the death of Elian Karel - previous member of the protectors of Kronos - the question is:  who are the demonstrators?  But not only who are they, which and because they are protesting? \nThe protectors of Kronos or POK were founded on 1997 by the residents of rural Elodis in agreement with the opinion of the now late health for all (WFA), an international group of the security of the water. The POK was initiated to bring the attention to the clean editions of the water that surrounded Elodis to the government by Kronos and the world. The POK affirms that the site that it perforates international of the natural gas of the curve of GAStech Tiskele is the source of both the contamination of the potable water as well as the destruction of the traditional territories of labrant√≠o that surround Elodis. \nIn 1998, WFA made test in the water of Elodis that finds stops levels of the benzene, arsenic of the tolueno and xylene, barium, chromium, lead and selenium. The test of a subsequent declaration sent by the attention and the pressure in the international government and GAStech brought WFA to the act. Nevertheless, with making fragments of WFA due to financing editions, the demands of the POK were not done case and downplayed to a great extent. \nAlso in 1998, Julian Vann, of a ten years previously healthy one - the old girl died of a persistent disease, that WFA-financed demanded doctors was caused by the contamination of the water. The government of Kronos officially refuted the demand that mentioned the fragmentation of the WFA organization as it demonstrates of a nontrustworthy source that will not trust. He costs what costs, Julian he felt well to martyr of the first POK and has used the image of Julian in the Literature of the campaign since. \nMartyr secondly main of POK is Elian Karel, that died in 2009 whereas incarcerated of indetermine causes. Trumped upon loads affirms it to the POK was arrested ignition whereas the government of affirms it to Kronos was a radical and violent activist contracted the fiscal evasion. Karel been had implied with the POK from its beginning since his father, Jeroen Karel, were an original member.  The death of Elian Karel in 2009 was marked by spontaneous cases of the protest around Abila. The anniversary of its death, the 19 of June, has considered additional protests, demonstrations, uproars, and violence. \nThe POK has been developed of pacific protests and demonstrations that demanded the action from the government to more violent activities including uproars whereas he demands that the government has done little nothing in the direction of the contamination, the envenenamientos, and the deaths undergone by his people. In date 2011, the government of Kronos has labeled the POK as \"he threatens public\".\n');
