INSERT INTO `article` VALUES (229, '303.txt', '2013/02/22', 'News Online Today \n', 'GAStech Profile \n', 'News Online Today \nGAStech Profile \n2013/02/22\nIt is the biggest company in Kronos, the third largest gas company on the planet, and it is fifty-three years old. This is the heart of Kronos\'s pipeline business, where gas from the eastern gas fields is piped west towards the rest of Kronos, Tethys and Europe. \nThe head of GAStech, Sten Sanjorge, Jr, whose photo stares out from calendars and picture frames everywhere in the country, acknowledges the \"state within a state\" accusations, but argues that the company simply needs to look after its workers and the communities around them. The GAStech empire owns 2 thousand cows and 3 thousand pigs in its company farms, runs gyms, and offers subsidised holidays in Black Sea resorts for key employees. GAStech certainly strives to ensure its employees can move in and out of these locations by operating a private fleet of four planes to ferry its staff the huge distances between sites.\n');
INSERT INTO `article` VALUES (230, '304.txt', '1997/10/15', 'The Abila Post\n', 'GOVERNMENT CITES \'MINOR\' CONTAMINATION NEAR ELODIS\n', 'The Abila Post\nGOVERNMENT CITES \'MINOR\' CONTAMINATION NEAR ELODIS\n15 October 1997\nABILA, Kronos - After continued complaints and appeals from the people of Elodis government officials acknowledge minor contamination in and around the rural township in a report on their investigation into the townspeople\'s health issues. However, the government report stops short of blaming GAStech International and its Tiskele Bend site 20 km upstream as the people of Elodis assert. \nThe government report cites no root cause or causes can be determined at this time with more research and investigations needed. Indeed, \"pointing a finger of blame at this time would be hasty and most likely detrimental to the investigation.\"\nThough the report admits some contamination it goes on the qualify the level stating, \"The minor level of contamination is well within international health standards agreed upon by the Government of Kronos and GAStech International as negotiated in the Tiskele Bend site contract.\"\nThe Government of Kronos continues to offer well testing for concerned residents of Elodis as well as plans to further investigate the root causes of the illnesses in and around the township. \n');
INSERT INTO `article` VALUES (231, '305.txt', '1998/11/13', 'The World\n', 'WELLNESS FOR ALL (WFA) BLASTS GASTECH AND KRONOS GOVT\n', 'The World\nWELLNESS FOR ALL (WFA) BLASTS GASTECH AND KRONOS GOVT\n13 November 1998\nABILA, Kronos - The healthy water awareness group, Wellness for All (WFA), has condemned both GAStech International and the Government of Kronos. WFA\'s statement claims widespread groundwater contamination, a lack of adequate safeguards, clean-up demands being ignored and no government oversight.\nThe Government of Kronos, when contacted, declined to comment. \nHowever, GAStech International\'s Environmental Safety Advisor Ingmar Casablancas responded to the claims, \"The alleged charges levied against GAStech International are unfounded. GAStech International and the Government of Kronos cooperate tirelessly to ensure a clean, safe, and prosperous work place. We are both devoted to the preservation of the environment.\"\n');
INSERT INTO `article` VALUES (232, '306.txt', '2001/06/14', 'Kronos Star\n', 'Minister of Health Dies Suddenly\n', 'Kronos Star\nMinister of Health Dies Suddenly\nEva Thayer\n14 June 2001\nABILA, Kronos - It is with great sorrow that we announce the death of Minister of Health Cesare Nespola.  Minister Nespola, 62, died peacefully in his sleep yesterday of a suspected heart attack.  A tireless champion for the welfare of our people, Nespola was a physician who had been picked to lead the Ministry of Health in 1995 by former president Araullo.  He was popular enough that President Kapelou retained him when he formed his cabinet in 2000.\nShortly after hearing of Nespola\'s death, President Kapelou announced that his nephew Vincent Kapelou would serve as his administration\'s new Minister of Health.  Vincent Kapelou, 28, has a Bachelor\'s of Science in chemistry and a Master\'s of Science in biochemistry from Tethys Central University. \n');
