INSERT INTO `article` VALUES (254, '326.txt', '2014/01/20', 'The Abila Post\n', 'WRAP UP OF EVENTS AT GASTECH\n', 'The Abila Post\nWRAP UP OF EVENTS AT GASTECH\n20 January 2014\nABILA, Kronos - A long tense day of conflicting reports and confusing information has come to an end. What we know for certain is that 14 GAStech employees are not only missing, but kidnapped as confirmed by a Kronos Government source. At this time it is unclear who the missing are and whether they are citizens of Kronos of Tethys, as many GAStech employees are Tethan.\nThere is still speculation regarding who was taken in the kidnapping and whether GAStech President and CEO Sten Sanjorge Jr. was the target, given that GAStech International has yet to make a statement to the press. Speculation about the motives of the kidnappers has been rampant due to the recent news of the GAStech Initial Public Offering only a month ago.\nAt this time no one has claimed responsibility for the kidnapping. Edvard Vann, a GAStech - Kronos security guard who was interrogated and released after 6 hours, gave the indication that the Protectors of Kronos were involved or at least suspected as being the perpetrators behind today\'s events.\nA GAStech International senior security executive has been on site to support the investigation aiding the Abila Police Department and Kronos Government officials.\nJanuary 20th was GAStech\'s annual corporate meeting with a Kronos Government reception to follow. Shortly after the morning meeting ended at 10:00, Abila Fire Department trucks responded to reports of a fire at the GAStech office.\n');
INSERT INTO `article` VALUES (255, '327.txt', '1999/07/04', 'The Guide\n', 'Minister Nespola Champions Added Tax Oil , Gas Development\n', 'The Guide\nMinister Nespola Champions Added Tax Oil , Gas Development\n1999/07/04\nABILA , Kronos - Health Minister Cesare Nespola announced he would sponsor a bill to raise taxes on the oil and gas in an additional 10% . Increasing taxes on the exploitation of gas and foreign oil is specifically designed for health care , clean water projects and health education in rural areas . Nespola Minster has been a strong advocate for the health and welfare of our citizens , and its support for this measure adds to a long list of actions undertaken on our behalf. Last year , the Minister of Nespola created a financial incentive program designed to bring qualified to practice medicine in medical Abila . This program has added more than a dozen highly trained physicians and specialists from around the world to the staff of the General Hospital of Abila .\n');
INSERT INTO `article` VALUES (256, '328.txt', '2001/09/01', 'The Guide\n', 'The activists interrupt traffic near fields of the curve of Tiskele\n', 'The Guide\nThe activists interrupt traffic near fields of the curve of Tiskele\n2001/09/01\nABILA, Kronos - they arrested five young people to protest yesterday near the entrance to the fields of the curve of Tiskele whereas they called for the action of the government to treat its environmental preoccupations by the operations about GAStech in the site.  Protestors, members of the activist group \"protectors of Kronos\", celebrated reading of the samples: \"To perforate it poisoned our water\" and \"to remember Julian\", referring 10 years Julian Vann, that have become an icon for the protectors of Kronos from their death in 1998.  Protestors was arrested after a young man sent to his sample in a vehicle of the government, cracking his window and having scared the renters.    They obtained enough animated towards outside there. \"\n\"These \"protectors of Kronos\" are really a minority of the strip of people against the extraction of fossil fuels in our country,\" said the carmine Gurganus of the spokesman of the government.  \"The people of Kronos have been of overwhelming form for the development of our natural resources and everything has benefitted from the resulting economic development.  These activists do not understand the whole picture clearly.\"\n');
INSERT INTO `article` VALUES (257, '329.txt', '2014/01/20', 'Kronos Star\n', 'Breaking: Emergency at GAStech Headquarters Building [Updates]\n', 'Kronos Star\nBreaking: Emergency at GAStech Headquarters Building [Updates]\nCato Rossini, Marcella Trapani\n20 January 2014\nUpdate, 8:15 PM:  A government official, who declined to be identified, says that police and government investigators are working around the clock to ensure the GAStech employees are found and that the kidnappers are brought to justice.');
INSERT INTO `article` VALUES (258, '33.txt', '2012/09/7', 'Homeland Illumination\n', 'Maha Salo\n', 'Homeland Illumination\nMaha Salo\n7 September 2012\nPROTESTS SWELL IN ABILA IN RESPONSE TO CALLS TO ACTION\nABILA, Kronos - Thousands of people lined the roads on Thursday in a display of antigovernment solidarity.\nAmong the demonstrators was Mestache Vardshvna, 23, from the west coast of Kronos.   \"We\'re trying to get the attention of our government,\" he told the Homeland Illumination.  \"This is important, so I took time off from work to be a part of this important event.\"\nHe was one of many who wielded their power of free speech to voice their concern with the current lack of government transparency with public monies.\n \"They need to be aware that we know what they\'re doing,\" added Vardshvna.  \"You can\'t just steal our money and think you can get away with it.\"\nPosters with colorful images of Elian Karel and Juliana Vann were reminders of the heavy toll already paid by leaders and innocents.  Karel was the prior leader of the Protectors of Kronos before his premature death in 2009.  His death, thought to be a murder by many, prompted annul rallies to bring the message of the Protectors of Kronos to the public.  Juliana Vann died in 1998 of cancer caused by environmental toxins in her drinking water.  She had just turned ten years old.\n');
INSERT INTO `article` VALUES (259, '330.txt', '1998/11/10', 'The Guide\n', 'The ministry of the health investigates complaints of the contamination\n', 'The Guide\nThe ministry of the health investigates complaints of the contamination\n1998/11/10\nABILA, Kronos - the minister of the health Will stop Nespola announced today that her organization would be investigating demands of abnormal editions of the health in the areas that surround the site by drill of the curve of Tiskele.  Ministrar said Nespola, \"we are not any right to think that perforating in the curve of Tiskele it has given rise to any contamination of the superficial water or in the region.  Nevertheless, I believe that it is important like minister of the health to run errand due and to investigate the information of the disease near the municipality of Elodis.  To take well-taken care of from our people is my priority of number one.\"\nIn the related news, a launching of press of the office of Nespola proclaimed that its office has granted a license to practice the medicine to oncologist of Tethys, doing to him to first oncologist licensed in history of Kronos.  The Dr Ronald Gerard will be a resident in the general hospital of Abila.\n');
