INSERT INTO `article` VALUES (261, '332.txt', '2007/03/19', 'Everyday News\n', 'Four people have died in an ardent collapse of the way near Elodis \n', 'Everyday News\nFour people have died in an ardent collapse of the way near Elodis \n2007/03/19\nOf nine years - the old boy survived initially the collapse and had been flown to the hospital of the children of Abila, but he was declared absolutely in arrival. \nThe police says that it has a driver of the car of 25 years in safekeeping in the jail of Elodis.\nThe officials say a car exploded in the flames after hitting a car of GAStech in the way of Calistermi moments before 9AM (KDT).\nAn equipment of the identification of the victim of the disaster of Kronos was sent to examine the rest.\nAuxiliary commission Fixes Koppolis of the police described the scene like \"horrific\".\nHe said the one of nine years - they found to the old boy vagar around the site of the accident.\n\"He is tragic that survived nobody in last instance.  The ways towards outside can here be treasonous when you are not constantly watchman whereas she leads,\" he said.\nIt observed that the car happened in the intersection when the car had the right of the way.  \n');
INSERT INTO `article` VALUES (262, '333.txt', '2013/12/16', 'International News\n', 'POK Assault Police in Abila \n', 'International News\nPOK Assault Police in Abila \n2013/12/16\nABILA, Kronos - Police spokesman Adrien Carmen informed the media today that members of the POK assaulted a police patrol in Abila early this morning.  The POK thugs crept up on two patrol officers who were sitting in their vehicle and ambushed the men, bashing the windows of their car and dragging them out of the vehicle into the street.  The criminals then proceeded to deface the car with spray-painted POK logos. \n\"Assaulting a police officer and destroying government property are serious crimes,\" Carmen said.\n');
INSERT INTO `article` VALUES (263, '334.txt', '2010/06/14', 'The Explainer\n', 'ANNIVERSARY OF PROTESTS\n', 'The Explainer\nANNIVERSARY OF PROTESTS\n2010/06/14\nABILA, Kronos - the spontaneous protests and uproars the last year exploded around Abila in answer to the death of Elian Karel, the protectors of the activist of Kronos (POK). The civil employees fear a repetition of the violent activities of the year last around the city in the next anniversary of the death of Karel the 19 of June. \nThe officials of the government published a brief declaration who assured people Abila that its \"security is fundamental. To go as usual on its business. The groups as the protectors of Kronos work by fear, trying to change to lives and the government with fear. His government will not move down fear-mongering backwards.\"\nThe brief declaration of the government finished there with a promise of not moving down backwards to the demonstrators, if there are in fact protests. Hagar Awelon, to make buy-owner in districto of Siopa de Abila affected heavy by the events of the last year, responded to the declaration of the government: \"[Government of Kronos] must do more than they made the year last. My windows were broken, my destroyed merchandize or were robbed, and attacked my son when he defended the warehouse. They must do more.\"\n');
INSERT INTO `article` VALUES (264, '335.txt', '2009/02/19', 'News Online Today\n', 'POK Protest at GAStech Headquarters Ends in Arrests \n', 'News Online Today\nPOK Protest at GAStech Headquarters Ends in Arrests \n2009/02/19\nABILA, Kronos - Dozens of protesters attending a Protectors of Kronos (POK) rally in front of the GAStech regional headquarters in Abila were arrested for trespassing this morning.  The POK rally was intended to draw attention to their claims of environmental damage being caused by the development of gas and oil fields around Kronos by foreign corporations like GAStech.  Government spokesman Rufus Drymiau said of today\'s POK rally, \"We have been concerned by a pattern of increasingly aggressive tactics by the Protectors of Kronos for some time now.\n');
