INSERT INTO `article` VALUES (266, '337.txt', '2012/06/22', 'News Online Today\n', 'Kapelou Calls POK \"A Gang of Criminals\" \n', 'News Online Today\nKapelou Calls POK \"A Gang of Criminals\" \n2012/06/22\nABILA, Kronos - In a press release today, President Kapelou today called the POK \"a gang of criminals, thugs, and malcontents who have become a pestilence to our peaceful way of life.\"\n');
INSERT INTO `article` VALUES (267, '338.txt', '2014/01/20', 'The Abila Post\n', 'ON THE SCENE BLOG\n', 'The Abila Post\nON THE SCENE BLOG\nBy Haneson Ngohebo\n20 January 2014\n1853 UPDATE - Speculation that the 2:00 PM arrival of Kronos Government official was in fact the arrival of a senior security executive and other officials from GAStech\'s Tethys office including President and CEO Sten Sanjorge, Jr.\nThis speculation is based on information concerning the arrival, refueling and immediate departure of Sanjorge Jr.\'s private jet from the Tethys airport.');
