INSERT INTO `article` VALUES (269, '34.txt', '2010/06/14', 'Central Bulletin\n', 'ANNIVERSARY OF PROTESTS \n', 'Central Bulletin\nANNIVERSARY OF PROTESTS \n2010/06/14\nABILA, Kronos - Last year spontaneous protests and riots broke out around Abila in response to the death of Elian Karel, a Protectors of Kronos (POK) activist. Officials fear a repeat of last year\'s violent activities around the city on the upcoming anniversary of Karel\'s death on June 19.  \nGovernment officials issued a brief statement assuring the people of Abila that their \"safety is of the utmost importance. Groups like the Protectors of Kronos operate by fear, attempting to change lives and government through fear. \nThe brief government statement ended there with a promise not to back down to protesters, if there are indeed protests. Hagar Awelon, a shop-owner in Siopa district of Abila heavily impacted by last year\'s events, responded to the government statement: \"They [Government of Kronos] must do more than they did last year.\n');
INSERT INTO `article` VALUES (270, '340.txt', '2009/02/20', 'The Explainer\n', 'HEADQUARTERS OF GASTECH BLOCKED BY POK\n', 'The Explainer\nHEADQUARTERS OF GASTECH BLOCKED BY POK\n2009/02/20\nABILA, Kronos - a designed meeting of POK to bring the attention to the demands of the environmental damage has made more damage to its image. The meeting outside the international headquarters of GAStech gave rise to the multiple haltings to violate.\nNear two hundred people they collected in front of the samples of the mottos and shaking singing of the building of GAStech that maintained visages of the people who alleged have died due to the contamination of environment.  Ten of protestors were chained to the doors of the building in an attempt to avoid that the employees of GAStech go to the work.\nTo clean to Carman de Adrien of spokesman said, \"not we prohibited to group certain latitude with his meeting, but that when GAStech complained which protestors blocked the entrance to their building, we had to take the action.  The last thing that we wished to happen was so that an employee of GAStech obtains damage of the right crowd because he tried to go to work.\"\nThe officials of the government have expressed the preoccupation by the \"pattern of tactics more and more aggressive by the protectors of Kronos.\" In answer to the increasing aggression of the POK, the additional security will be provided to assure the public security for all the future meetings.\nThey will publish the civil employees of GAStech declined to comment in this time that indicates an official declaration in the incident.\n');
INSERT INTO `article` VALUES (271, '341.txt', '2013/06/21', 'All News Today\n', 'WHO BRINGS A GUN TO A SIT IN? \n', 'All News Today\nWHO BRINGS A GUN TO A SIT IN? \n2013/06/21\nABILA, Kronos - Yesterday, as they have each June 19th for the past three years supporters of Protectors of Kronos rallied demanding much the same as they have in the past fourteen years:  an end to the corruption of the Kronos government officials and the cleanup of the toxic waste dump that has become the Tiskele River near Elodis. They handed out information on flyers printed and donated by local businesses about the lifestyle incongruities between today\'s elected officials and those of a few years ago. Demonstrators held posters of POK martyrs and chanted for social and economic parity, while black-clad members of the Abila Police formed faceless lines of shields, batons and side arms surrounding the crowds.  The rally had been publicized as a peaceful gathering of citizens to bring their concerns to the public consciousness.  The most dangerous item in their hands was a picture of a sweet-faced ten year dead old girl - Juliana Vann who died in 1998 of cancer caused by the benzene in her drinking water. \nDespite these heavy-handed efforts, as groups of people slipped through the barricades and moved through the streets to bring their message to the citizens of Kronos.   \nHow can these officials - hypothetically getting by on public salaries - afford the second homes, large boats and luxury automobiles they flaunt?\n');
INSERT INTO `article` VALUES (272, '342.txt', '1998/03/20', 'News Online Today\n', 'ELODIS, KRONOS:  A TOWN IN NEED, Part One \n', 'News Online Today\nELODIS, KRONOS:  A TOWN IN NEED, Part One \nPetrus Gerhard \n1998/03/20\nNOTE: This article is the first in a series, reprinted with permission from the Homeland Illumination. \nELODIS, Kronos - Nestled in the bend of the Tiskele River, the sun rises over the farming town of Elodis,  chasing away the shadows cloaking nearby Mt.  The two founders - Sten Sanjorge Sr and Hank Fluss - found wildcat drilling to be more lucrative, and thus began a series of environmental disasters and financial scandals that eventually ran Sanjorge Sr into an early grave and drove Fluss into a marginal role in his own company.  With the death of Sanjorge Sr, the son took the helm of GAStech firmly in his grasp and broadened its influence further afield, eventually landing at the doorstep of the small peaceful township of Elodis.  A smaller number of families live in the township along a main street with two markets, two hardware stores, one gas station and a caf√ø¬ø¬ø¬ø¬ø¬øhere you can buy lunch, pick up your mail and purchase a litre of milk to bring home.  Families have lived in Elodis for generations.\n');
INSERT INTO `article` VALUES (273, '343.txt', '2012/06/21', 'Everyday News\n', 'The police of Abila breaks itself for above will seat dice returned violent in se√±or√≠o presidential \n', 'Everyday News\nThe police of Abila breaks itself for above will seat dice returned violent in se√±or√≠o presidential \n2012/06/21\nThe traffic gruni√≥ around the city as fight of Abilians to be able to work in the middle of vandalism and of the sacking\nAt the beginning of the Tuesday police stormed the front of the presidential mansion and the capital building, breaking itself upon seating inside by the protectors of Kronos.\nOther groups of the activist have assembled the faction of protest in solidarity and one more a greater meeting was predicted for later inside the day.\nThe government of Kronos of the conservative used an emergency law to threaten protestors the halting unless they dispersed and they returned to the work.  The row is excessive environmental editions that the POK maintains to the government and the giant international person in charge of GAStech of the gas.\nThe meetings had begun Pacific, despite more destructive activities have extended as the crowds made more anxious. \nThe samples between the demonstrator called for the change of the government and the social equality.  The images of Julian Vann, the girl of 10 years who dies of diseases attributed to the international industrial giant of GAStech served like points of the meeting.\nThe people who direct to a favorable-government accountant-reunite was attacked by POK those in favor, and last shots were ignited.  \nTuesday was the third anniversary of the mysterious death of Elian Karel, popular leader of the POK that died in the prison. \nMore ahead in the day, which had been a pacific demonstration to a great extent given violent return when the crowd began to destroy to the buildings of the government and the presidential farm.  \nA group of protestors more young people attacked the vehicles, sensational windows.  Injuries of smaller importance were disclosed. \nThe reinforcements of the police were sent to the area and blocked the roads, and the skirmishes between the police and protestors exploded. \nThe police used the tear gas to break for above to the unmanageable crowd.  The spokesmen of the government complemented the forces of the security for their direction of the \"groups of the criminals\" who interrupted La Paz.  \n');
INSERT INTO `article` VALUES (274, '344.txt', '2014/01/21', 'News Online Today\n', 'GAStech\'s Sanjorge Escapes Kidnapping at GAStech HQ \n', 'News Online Today\nGAStech\'s Sanjorge Escapes Kidnapping at GAStech HQ \n2014/01/21\nABILA, Kronos - According to a press conference held at GAStech headquarters in Centrum, Tethys this morning, GAStech\'s President and CEO, Sten Sanjorge Jr.  Sanjorge, who had been attending a corporate meeting, was in transit from the GAStech building to the capitol when the kidnapping took place.\n');
