INSERT INTO `article` VALUES (277, '347.txt', '1982/10/4', 'International Times \n', 'Leadership   \n', 'International Times \nLeadership   \n4 October 1982 \nIn a Times article from 2 October, it was stated that GASTech president Sten Sanjorge was now less active in the day to day operations of the company.  GASTech representatives informed the Times that Sanjorge is as active as ever and providing daily \"inspirational guidance\" to the organization.  The Times stands by its original assertions.     \n');
INSERT INTO `article` VALUES (278, '348.txt', '2014/01/20', 'Homeland Illumination\n', 'VOICES - a blog about what is important to the people\n', 'Homeland Illumination\nVOICES - a blog about what is important to the people\nMaha Salo\n20 January 2014\n0926 - Welcome to our coverage of today\'s events.  I\'m standing outside the GAStech headquarters waiting for the GAStech executives who are expected to appear within the hour. GAStech CEO Sten Sanjorge is celebrating the successful initial public offering of his company, which took place last month.   When they leave here the GAStech executives will travel to the capital building where they will meet with President Kapelou and several of his Ministers and Council members.  A private celebration of their successful alliance is planned to take place later today.  One can\'t help but wonder how much healthcare could be provided with only half the funds used to orchestrate this spectacle. 20 Jan 2014');
INSERT INTO `article` VALUES (279, '349.txt', '2002/05/27', 'The Wrap\n', 'SHEET 2002 OF THE PUBLIC HEALTH ELODIS\n', 'The Wrap\nSHEET 2002 OF THE PUBLIC HEALTH ELODIS\n2002/05/27\nELODIS, Kronos - the Community center of health Elodis have already published update to Wellness for study which is carried out in 1998.  The impact of the Hyper Zuurrijke disposal of the substrate (HASR), controversial boring technique continues devastate the health of residents Elodis.  The elaborate report will shortly be posted concerning the municipal Internet site Elodis.\nPeaks\n* Raised the mortaliteitstarief and the by-effect of chronic sickness more than 178% of former years\n* The uncommon high frekwentie of cancer became this way clear that the minister of health Nespola a cancerology specialist to Abila appointed the general hospital\n');
INSERT INTO `article` VALUES (280, '35.txt', '1998/05/15', 'Homeland Illumination\n', 'ELODIS, KRONOS: WILL THE GOVERNMENT RESPOND IN TIME? Part Three\n', 'Homeland Illumination\nELODIS, KRONOS: WILL THE GOVERNMENT RESPOND IN TIME? Part Three\nPetrus Gerhard\n15 May 1998\nThis article is the last installment of a three-part series addressing the growing problem of one community\'s anguish, government malfeasance, and the alarming influence of multinational corporations on the country of Kronos.\nPondo Reese, editor of the Elodis Weekly Journal, stands at his window, looking out toward the sun setting on the Tiskele River.  I\'ve asked him to tell me about the involvement of the government of Kronos in the deeply troubling account of a community\'s struggle for protection from those who should help them the most: their elected officials, against those who would poison their children and the country\'s food.\n\"It took a long time for anyone to respond,\" Reese tells me of their struggle.  \"Henk Bodrogi - the man you met - didn\'t give up.  He called every department that could possibly be associated with our problem:  interior, justice, foreign affairs, health.    Henk and a few other residents made several trips to Abila trying to get someone to listen.  Finally, a sympathetic person from the Ministry of Health answered the door, so that\'s where we started.\"\nReese then describes months of meetings at which the government officials demanded documents proving their case:  health and crop yield statistics, the scientific test results from Wellness For All, and medical records.\n\"It\'s been frustrating.  We bring the documents they want, and then they want to confirm the results, or tell us to provide additional information or have closed door meetings.  We\'re currently in the process of negotiating a date for a hearing at the Ministry of Health to present our petition for assistance.\"\nHas it been worth it?\n\"You tell me,\" Reese nods out his window.  I look over his shoulder to see a group of children kicking a soccer ball in the dust.\n\"What choice do we have?\"\n');
