INSERT INTO `article` VALUES (287, '356.txt', '2014/01/20', 'The Abila Post\n', 'ON THE SCENE BLOG\n', 'The Abila Post\nON THE SCENE BLOG\nBy Haneson Ngohebo\n20 January 2014\n1245 UPDATE - Abila Police have cordoned off the GAStech headquarters with additional officers arriving to secure the perimeter and to investigate what can only be described as a crime scene though the crime has not be revealed. The police response seems out of proportion for a false fire alarm.\nPolice officials have declined to comment at this time.');
INSERT INTO `article` VALUES (288, '357.txt', '2009/06/21', 'The Orb\n', 'ELIAN KAREL DIED IN PRISON OF KRONOS\n', 'The Orb\nELIAN KAREL DIED IN PRISON OF KRONOS\n2009/06/21\nABILA, Kronos - Elian Karel, age 28, died Friday while illegally imprisoned with the prison of town of Abila.  Karel was held on the fraudulent expenses of tax avoidance after its arrest on March 12 earlier this year.\nIts agent, Michale Kraft made the advertisement Friday during a press conference of midday.\n\"We still do not know any detail.  What I can say you is that when I left Elian yesterday after meeting it in the prison it was in excellent health and the good spirits.  It hoped to be released in the days to come and the return to its work with the guards from Kronos, and was excited to continue the guards of the mission of Kronos to which it devoted its life.  I can ensure you that the death of Elian will be studied with all resources at our disposal and these persons in charge will be brought to justice.\"\nThe defenders of the POK and others started to collect apart from the police station like diffusion of news.\n\"I cannot believe it,\" Kriste Brontes called by his tears, \"we were with the gathering in March.  It looked at and seemed so good.  It was so optimistic that the changes came.  Who will be able to carry out POK now?\"\nKarel, of Elodis, had been implied mission of POK since it was young.  It was only a few years more than Juliana Vann, a friend who died in 1998 of the toxin poisoning caused by emptying illegal company GAStech de Tethyn. \nCalls at the office of the president, the office of the Minister for justice and the office of the chief of the police force were not immediately turned over.\n');
INSERT INTO `article` VALUES (289, '358.txt', '2012/04/9', 'Homeland Illumination\n', 'RALLY SCHEDULED IN SUPPORT OF INCREASED GOVERNMENT ACCOUNTABILITY\n', 'Homeland Illumination\nRALLY SCHEDULED IN SUPPORT OF INCREASED GOVERNMENT ACCOUNTABILITY\nMaha Salo\n9 April 2012\nABILA, Kronos - Silvia Marek, leader of the Protectors of Kronos social action organization is appealing to the citizens of Kronos to join her for a day of peaceful protest tomorrow.  Marek asks all concerned citizens to join her to bring awareness to the problem of political corruption and favoritism pervasive in the offices of the government of Kronos.\n\"I\'m calling for an end to the heinous corruption, the nepotism and the favoritism displayed by our elected officials.  They [the officials] need to hear our voice and know that we demand change now.\nThe rally will be held in the Elodis city park at noon.\n');
INSERT INTO `article` VALUES (290, '359.txt', '2014/01/20', 'Kronos Star\n', 'Breaking: Emergency at GAStech Headquarters Building [Updates]\n', 'Kronos Star\nBreaking: Emergency at GAStech Headquarters Building [Updates]\nCato Rossini, Marcella Trapani\n20 January 2014\nUpdate, 5:30 PM:  We have several reports from GAStech employees that confirm a kidnapping took place, but at this time there is no information on who was involved.  Unofficial reports from the police indicate that they believe the Protectors of Kronos (POK) are behind the kidnapping and that they requested government assistance with the investigation.  We have received no information which could confirm the POK\'s role in this alleged kidnapping, but note that they have grown increasingly violent over the past 5 years.');
