INSERT INTO `article` VALUES (295, '363.txt', '2001/06/16', 'The Guide\n', 'The minister of the health dies suddenly\n', 'The Guide\nThe minister of the health dies suddenly\n2001/06/16\nABILA, Kronos - it is with great pain that we announced the death of the minister of the health Will stop Nespola.  Ministrar Nespola, 62, died Pacific in its dream yesterday of an attack of the suspected heart.  An untiring champion for the well-being of our people, Nespola was a doctor who had been chosen to lead the ministry of the health in 1995 by previous president Araullo.  It was quite popular who president conserved it to Kapelou when he formed his cabinet in 2000.\nShortly after to hear speak of the death of Nespola, president Kapelou announced that his nephew Vincent Kapelou would serve like new minister of his administration of the health.  Vincent Kapelou, 28, have unmarried of science in chemistry and a master of science in biochemistry of the university of the power station of Tethys. \n');
INSERT INTO `article` VALUES (296, '364.txt', '2012/06/20', 'Kronos Star\n', 'POK Anniversary Rally Ends in Riot\n', 'Kronos Star\nPOK Anniversary Rally Ends in Riot\nMarcella Trapani\n20 June 2012\nABILA, Kronos - POK members held a large demonstration in Abila yesterday.  Several dozen of their supporters held sit-ins in front of the capitol building and the presidential manor, while others took to the streets with their signs and chants.  Protestors handed out flyers to bystanders that alleged that our government is corrupt and \"the rich get richer on the backs of the poor\".  Police called for the peaceful end to the sit-ins, but were answered with a barrage of rocks and bottles from the crowd.  The violence escalated into a full blown riot and police were forced to use tear gas, pepper spray, water cannons, and beanbags shot from shotguns to control the crowd.  \nBy the time the crowds finally dispersed, several government buildings had been vandalized, two police vehicles were ablaze, and the streets were littered with trash and broken glass.  Several protestors and police were injured, including one heroic police officer who was stabbed by a crazed protestor.  The officer, whose name has been withheld for security reasons, is in critical condition at Abila General Hospital.\n');
