INSERT INTO `article` VALUES (304, '371.txt', '2003/05/17', 'News Online Today\n', 'HANK FLUSS GASTECH COO DIES AT 73 \n', 'News Online Today\nHANK FLUSS GASTECH COO DIES AT 73 \n2003/05/17\nCENTRUM, Tethys - Hank Fluss, COO of GAStech International, died of a heart attack at his desk in the company\'s downtown Centrum headquarters.  \nHank Fluss is survived by his wife of 54 years, Beatriz Fluss, his 5 children, and 12 grandchildren.\n');
