INSERT INTO `article` VALUES (306, '373.txt', '2012/03/09', 'The Guide\n', 'The minister of the health receives POK threats\n', 'The Guide\nThe minister of the health receives POK threats\n2012/03/09\nABILA, Kronos - the sources of the police have informed to the star of Kronos that Vincent Kapelou, minister of the health, has received several threatening letters that they tried to come from the POK.  \"I conjecture that they are obtaining desperate for the attention,\" Vincent Kapelou said in an interview of the telephone.  The \"occasions are this one are not nothing, but we are not going to take no occasions. I have doubled the size of my force of the security and have sent to my family in vacations far extended.\"\nKapelou, 39, were designated to the position of the minister of the health in 2001 after the death of Will stop Nespola.  Kapelou is the oldest son of the brother of president Kaeplou, Andreas.\n');
INSERT INTO `article` VALUES (307, '374.txt', '2013/06/20', 'International News\n', 'Annual POK Rally Ends in Riot, Again \n', 'International News\nAnnual POK Rally Ends in Riot, Again \n2013/06/20\nABILA, Kronos - POK members held their annual demonstration in Abila yesterday.  A larger than usual crowd gathered in front of the Capitol building, waving signs holding pictures of Elian Karel and Juliana Vann, who were painted as POK \"martyrs\".   \nPolice and government security forces set up between the protestors and the Capitol building in a show of force, hoping to prevent the kind of chaos that occurred during last year\'s riot.  However, after several hours of chanting and speeches, tempers in the crowd flared and protestors rushed the police line.  The police forces were forced to use tear gas, pepper spray, water cannons, and rubber bullets to subdue the crowd and protect property.  In spite of their heroic efforts, the protestors managed to break some windows, damage several police vehicles, and injure three officers.\n');
INSERT INTO `article` VALUES (308, '375.txt', '2013/12/17', 'Who What News\n', 'HUGE IPO MAKES SANJORGE BILLIONAIRE \n', 'Who What News\nHUGE IPO MAKES SANJORGE BILLIONAIRE \n2013/12/17\nCENTRUM, Tethys - President and CEO of GAStech International Sten Sanjorge, Jr. And not only a billionaire, nearly a billionaire two times over as GAStech International sold shares in an initial public offering. \nGAStech International, founded in 1961 as Sanjorge Trucking by Sten Sanjorge, Sr., produces about 5 million cubic meters of gas daily at its GAStech - Kronos drilling site Tiskele Bend.  \nDon\'t feel sorry for the GAStech - Kronos executives. The filings show that the GAStech - Kronos executives earned a collective $327.25 million from the newly vested shares including $96.25 million each for CFO Ingrid Barranco, CIO Ada Campo-Corrente, and COO Orhan Strum.\n');
