INSERT INTO `article` VALUES (310, '377.txt', '2007/04/11', 'The Explainer\n', 'TRAFFIC ACCIDENT NEAR ELODIS \n', 'The Explainer\nTRAFFIC ACCIDENT NEAR ELODIS \n2007/04/11\nABILA, Kronos - an investigation of the government has concluded a traffic accident that implied an international vehicle of GAStech and the vehicle of a family of Elodis giving by result the deaths of the four members of the family was the result of the error of the conductor from the conductor of Elodisian.\nThe spokesman Rufus Drymiau of the government said that the investigation found the fatal accident was driven when the conductor of Elodis crossed itself above in next traffic. Three passengers - Valeria Edris, Celia Edris, and Marcellus Edris - died in the scene.  \nThe carmine Edris, 9, were found vagar around the site of the accident. He succumbed to his injuries advanced more in the hospital of Abila. \nThe driver of the car of GAStech received injuries of smaller importance and was taken the hospital for the observations.\nIn a demonstration of the international votes of GAStech of largesse corporative to donate the money to the remaining members of the family.\n');
INSERT INTO `article` VALUES (311, '378.txt', '2010/06/14', 'News Online Today\n', 'ANNIVERSARY OF PROTESTS \n', 'News Online Today\nANNIVERSARY OF PROTESTS \n2010/06/14\nABILA, Kronos - Last year spontaneous protests and riots broke out around Abila in response to the death of Elian Karel, a Protectors of Kronos (POK) activist. Hagar Awelon, a shop-owner in Siopa district of Abila heavily impacted by last year\'s events, responded to the government statement: \"They [Government of Kronos] must do more than they did last year.\n');
INSERT INTO `article` VALUES (312, '379.txt', '2012/03/7', 'Kronos Star\n', 'Minister of Health Receives Threats from POK\n', 'Kronos Star\nMinister of Health Receives Threats from POK\nMarcella Trapani\n7 March 2012\nABILA, Kronos - Police sources have informed the Kronos Star that Vincent Kapelou, Minister of Health, has received several threatening letters purporting to come from the POK.  \"I guess they\'re getting desperate for attention,\" Vincent Kapelou said in a phone interview.  \"Chances are this is nothing, but we\'re not going to take any chances. I have doubled the size of my security force and sent my family away on an extended vacation.\"\nKapelou, 39, was appointed to the position of Minister of Health in 2001 after the death of Cesare Nespola.  Kapelou is the oldest son of President Kaeplou\'s brother, Andreas.\n');
INSERT INTO `article` VALUES (313, '38.txt', '1998/01/18', 'Kronos Star\n', 'Kronos Benefits from Foreign Investment\n', 'Kronos Star\nKronos Benefits from Foreign Investment\nLelio Masin\n18 January 1998\nABILA, Kronos - Today is the fifth anniversary of President Araullo\'s visionary plan to bring foreign investment to Kronos, a bold act that has reaped tremendous benefits for our fair country.  Today\'s Abila is a bustling metropolis full of new cars, new construction, gleaming office buildings, and modern conveniences.  Gone are the potholed streets, run-down factories, tired storefronts, and sad marketplaces of the past.  Today\'s Abila is a city of industry, a place of commerce and investment, a place of opportunity and success.  Prosperity has come to Kronos, and we are all the better for it.\nHowever, there are still those who wrongly think that prosperity is bad for us.  These people claim that foreign investment is bad for our country, that it is diluting our culture and undermining our values.  They claim that the foreigners are exploiting us for their own gain and that our government has little regard for the welfare of our people.  They are so militant in their wrong-headed beliefs that they have fabricated claims that the foreign companies are poisoning our children with their technology.  They have even gone so far as to have brought in foreign \"experts\" who claim to \"have our best interests at heart\" to help spread their agenda against progress and prosperity for our people.  The hypocrisy of bringing in foreigners to tell us that opening our country to foreigners is bad for us is ludicrous and is obviously a sign of mental illness in those who oppose our modernization. \n');
INSERT INTO `article` VALUES (314, '380.txt', '1992/12/12', 'News Online Today\n', 'KRONOS GOVERNMENT PLANS TAX BREAKS TO ENCOURAGE FOREIGN INVESTMENT \n', 'News Online Today\nKRONOS GOVERNMENT PLANS TAX BREAKS TO ENCOURAGE FOREIGN INVESTMENT \n1992/12/12\nABILA, Kronos - The Government of Kronos is currently planning some of the world\'s most generous tax breaks for gas investments. \nThe Government of Kronos is pitching the plan as a win-win situation given that the high-income countries will be struggling to discover and exploit ever-dwindling supplies of fossil-fuels and the developing Kronos needs income, infrastructure, and cheap energy.\n');
