INSERT INTO `article` VALUES (316, '382.txt', '2010/10/04', 'The Explainer\n', 'PRESIDENT KAPELOU II CHOSE BY THE REGISTRY MARGIN\n', 'The Explainer\nPRESIDENT KAPELOU II CHOSE BY THE REGISTRY MARGIN\n2010/10/04\nABILA, Kronos - president Dorel Kapelou II has gained the re-election with the greatest margin always of an election of Kronesian. The people of Kronos been have stopped together and have announced a new day shining with a vote resounding of the confidence for the president.\nPresident Kapelou II of the democratic party of Kronos captured 98,7% of the vote with Ren Touvi of the organization of the business and the party of the unions a second distant one with a 1,0% mere one of the vote. \nWith all the votes counted the democratic party of the president of Kronos now maintains 85 seats in the General Assembly, 13 for the organization of the business and the party of the unions, and 2 for the party of the industrialists of Kronos. \nOf each corner of Kronos a refrain of Kronos could be heard, is always truth to Thee.\n');
INSERT INTO `article` VALUES (317, '383.txt', '2005/09/26', 'Athena Speaks\n', 'TURN OF PROTESTS Of ELODIS TO the RIOTS AND the ARRESTS \n', 'Athena Speaks\nTURN OF PROTESTS Of ELODIS TO the RIOTS AND the ARRESTS \n2005/09/26\nELODIS, Kronos - the guards of Kronos (POK) continue to protest against the pollution of international allegation of government and GAStech de Kronos, the contamination of water and a lack of a response of government. Recently the protests transformed the violent climbing into being assembled mainly directed to the site of curve of Tiskele.\nThe last event made take part protesters of POK forming a human chain to block the entry of the site of curve of Tiskele de GAStech. After assembling itself recent, the civils servant of government did not have any choice, but with high round the protesters and stop them for the infringement.\nThe spokesman Rufus Drymiau of government commented on, \"that those the kind of actions force by members of the guards of Kronos are counterproductive. We narrowly work - the government and GAStech - to assure us that all the environmental questions are solved.\"\nSeveral examples to assemble itself in and around Elodis were reported including/understanding trashing buildings of government, the launching of rock, and the burnings of tire. The police force answered quickly and decisively. The various skirmishes with the police force finished in the arrests.  \n');
INSERT INTO `article` VALUES (318, '384.txt', '2014/01/20', 'Modern Rubicon\n', 'ON SCENE BLOG\n', 'Modern Rubicon\nON SCENE BLOG\n20 January 2014\nMODERNIZATION 2021 - a civil employee of government of Kronos that has asked not to be identified but was present to the government reception has gone on declaring record, \"the investigators are working around to the clock in order assessing that she employs it to you robs to you of GAStech are finds to you and that the perpetrators they are capacities to justice.\"\nThat is the first confirmation that odierni events that encircle GAStech - Kronos is in effects a kidnapping. With fourteen still inspiegati individuals, to this point, the presupposed one is that all are the victims of a kidnapping.\nNo group has come in ahead still demanding the responsibility neither to have all the demands made.');
INSERT INTO `article` VALUES (319, '385.txt', '2009/06/22', 'The Explainer\n', 'THE SPONTANEOUS PROTESTS ENTER ERUPTION AROUND ABILA\n', 'The Explainer\nTHE SPONTANEOUS PROTESTS ENTER ERUPTION AROUND ABILA\n2009/06/22\nABILA, Kronos - the protests entered eruption around the buildings of the government of Kronos, towards downtown, and another part around Abila that extended possible in uproars and violence. \nThe activists are protesting the death yesterday of Elian Karel, protector of the activist of Kronos (POK) that died in jail after being arrested for the fiscal evasion. Nevertheless, the protests have given to violent return with the broken windows and the destroyed stores.\nThe countless windows of the store broke in and around Siopa, the centric area of purchases. A general sense of the chaos exploded with the demonstrators who sang, fires, and the citizens who fled. \nA subject of the unification of the demonstrators was the mottos sung including \"justice for Elian\" in reference to the activist previously mentioned Elian Karel and \"to remember Julian\", a young girl of Elodis that died in 1998 alleged of the effects of the contamination of the water. Several buildings were disfigured with the aforesaid mottos also.\nThe government of Kronos published a declaration, \"this class of violence will not be pardoned. The destruction and the violence are not no way to reach peace and the change - these things are in the opposition the one to the other. The protectors of Kronos must reassume pacific means; the rest of the approaches is unjustifiable.\"\n');
