INSERT INTO `article` VALUES (325, '390.txt', '2007/03/22', 'The Orb\n', 'The TRUCK OF GASTECH RUNS UP AGAINST the CAR CLOSE To ELODIS, FAMILY OF FOUR DEAD \n', 'The Orb\nThe TRUCK OF GASTECH RUNS UP AGAINST the CAR CLOSE To ELODIS, FAMILY OF FOUR DEAD \n2007/03/22\nELODIS, Kronos - a collision of vehicle claimed the lives of a family of Elodis, including two children Tuesday afternoon.  The family travelled to the house of a program of school where one of the children had carried out in spring the program at the primary school of Elodis.\nAuxiliary police chief Adian Koppolis of police force of Elodis brought back three of the victims died to the scene of the accident.  Marcellus Edris, 33, his Valeria wife, 30, their Celia daughter, 7 died in the scene of the accident.  A son, carmine, survived the initial collision but died later in a hospital of Abila.\n25 years not identified - the old driver of the truck of GAStech was judged during the night in prison of town of Elodis, and then released.\nThe initial reports/ratios of the investigators state that the driver of truck had illegally entered the intersection where it had does not stop with a sign of stop, whereas the other vehicle had the right of the manner.\nThe Koppolis police force of Elodis police chief would undertake a full research.\n');
INSERT INTO `article` VALUES (326, '391.txt', '2001/03/22', 'All News Today\n', 'TAX MEASURE DEFEATED, POK EFFORTS STALLED \n', 'All News Today\nTAX MEASURE DEFEATED, POK EFFORTS STALLED \n2001/03/22\nAbila, Kronos - A measure to increase taxes on foreign oil and gas development proposed by Minister of Health Cesare Nespola was defeated by a wide margin last week in the General Assembly. \nThis defeat is a harsh blow to the Protectors of Kronos, an Elodis group that was counting on this funding to provide healthcare and environment cleanup of their drinking and irrigation water. \n\"We have a meeting planned with the Minister,\" Protectors of Kronos leader Henk Bodrogi told the Homeland Illumination. \nBodrogi is the leader of the Protectors of Kronos, a grassroots environmental group with a mission to reverse the pollution caused by gas drilling in his hometown.\n');
