INSERT INTO `article` VALUES (328, '393.txt', '2013/02/22', 'World Source \n', 'GAStech Profile \n', 'World Source \nGAStech Profile \n2013/02/22\nIt is the biggest company in Kronos, the third largest gas company on the planet, and it is fifty-three years old. In the past it has had a reputation as corrupt and environmentally harmful, but nowadays GAStech, the former Tethys-only business, is trying to earn the trust of international investors. \nIt is an uphill task, and there is no certainty that Gastech has the ability to convince potential investors it has mended its ways, and is no longer rooted in the eco-hostile past. \nGAStech\'s pipeline operations are based in eastern Kronos, and there is close relationship with the Kronosian government. This is the heart of Kronos\'s pipeline business, where gas from the eastern gas fields is piped west towards the rest of Kronos, Tethys and Europe. \nGAStech does more than just pump gas. \nThe head of GAStech, Sten Sanjorge, Jr, whose photo stares out from calendars and picture frames everywhere in the country, acknowledges the \"state within a state\" accusations, but argues that the company simply needs to look after its workers and the communities around them. The GAStech empire owns 2 thousand cows and 3 thousand pigs in its company farms, runs gyms, and offers subsidised holidays in Black Sea resorts for key employees. There is an argument, however, that the energy business is different from other industries, requiring energy corporations to operate in distinct ways. \nWorking in far-off places with no previous infrastructure means oil and gas sites will always be, to some extent, company towns. GAStech certainly strives to ensure its employees can move in and out of these locations by operating a private fleet of four planes to ferry its staff the huge distances between sites.\n');
INSERT INTO `article` VALUES (329, '394.txt', '2013/06/21', 'The Truth\n', 'The annual ends of the collection POK in babble, again\n', 'The Truth\nThe annual ends of the collection POK in babble, again\n2013/06/21\nABILA, Kronos - the members POK kept their annual demonstration yesterday in Abila.  Larger than usual mob which is collected for the Capitol bldg., undulating holdingsbeelden of Elian Karel and Juliana Vann, which was painted as POK martyrs, sign.  The mob chanted concerning government corruption and requested Dorel Kapelou to step to president -.  Different protestors behave an end request to the exploitive to collective capitalism Tethys and signs which, GAStech poisoned our young young she-goats claim.  \nThe security strengths of the police force and of the government prevented set up between protestors and the bldg. Capitol in a show which effective, the type chaos hopes prevent that during babble of previous year.  However, the mob flickered after different hours of the chanting and adressed, makes in to and protestors dragged the police force line.  The politiekrachten were forced traangas, pepernevel, water guns, and use rubber balls to submit the mob and have to protect.  In spite of their heldhaftige efforts, protestors succeeded to some windows break, different police force vehicles, and damage three wound civil servants.  \n');
