INSERT INTO `article` VALUES (331, '396.txt', '2014/01/21', 'World Journal\n', 'Employees of GASTech removed in Kronos\n', 'World Journal\nEmployees of GASTech removed in Kronos\n2014/01/21\nFourteen employees have fears removed in Kronos by a radical environmental group of terrorist during a meeting of corporation. \nOne fears fourteen employees, probably including five executive leaders, removed yesterday by the \"guards of Kronos\".  Disappeared paid include: President and PRESIDENT Sten Sanjorge Jr, CFO Ingrid Barranco, Campo-Corrente of ADA of CIO, ROUCOULEMENT Orhan de GAStech pianotent, and environmental leader Willem Vasco-Feed.\nThe local organizations of news received a note of ransom of the claiming responsibility and to require POK $20 million the company.  They is possible additional requests are received.\nSanjorge and the others disappeared according to a meeting from council to the registered offices from GASTech.  A signal of fire went to far, and the execs the were disappeared little discovered ones from time after that.  The list supplements of all employed unexplained was not released. \nJohn Rathburn, an American expert in executive kidnappings who lives in Tethys, known as that Kronos was not known like archetypal country for removal. \"However, the activity increased by POK, the APA [the popular army of Asterian], and others in the area appreciably increased the risk.\"\nCorresponding times in Abila indicate that offices of GASTech are closed, and of the calls of telephone are answered but of the local authorities concerned.  \nThe registered offices of corporation of GASTech in Tethys refused to comment on. However, other sources of news brought back to Tethys the federal civils servant of application of law and the personnel of the ministry of Tethan of the Foreign Affairs arrived in Kronos to help the police force in research.\n');
INSERT INTO `article` VALUES (332, '397.txt', '2014/01/20', 'The Explainer\n', 'TO BECOME INVOLVED FOR ABOVE OF EVENTS IN GASTECH\n', 'The Explainer\nTO BECOME INVOLVED FOR ABOVE OF EVENTS IN GASTECH\n2014/01/20\nABILA, Kronos - a long tense day of information that were in conflict and of the confused information has finished. What we know for insurance that 14 employees of GAStech lack not only, but are kidnapped according to the confirmed thing by a source of the government of Kronos. In this time it is confused who the disappear are and if they are citizen of Kronos de Tethys, so many employees of GAStech are Tethan.\nThere is the immovable speculation with respect who was taken in the kidnapping and if president of GAStech and jr. of the CEO Sten Sanjorge were the target, since international GAStech has had still to make a declaration to the speculation of the pressure on the reasons for the kidnappers has been wild due to the recent news of the initial public offer of GAStech only for a month.\nIn this time nobody has demanded the responsibility of the kidnapping. Edvard Vann, a GAStech - the protector of security of Kronos that was interrogated and sent after 6 hours, gave the instructions that the protectors of Kronos were implied or at least suspected like being the authors behind today events.\nAn international executive of the greater security of GAStech has been in the site to support the investigation that helped to the department of the police of Abila and the officials of the government of Kronos.\nThe 20 of January were annual corporative meeting of GAStech with a reception of the government of Kronos to follow. Shortly after tomorrow the meeting finished in the 10:00, Abila that the cars of the body of firemen responded to the information of a fire in the office of GAStech.\n');
INSERT INTO `article` VALUES (333, '398.txt', '2009/03/12', 'The Abila Post\n', 'POK LEADER ARRESTED\n', 'The Abila Post\nPOK LEADER ARRESTED\n12 March 2009\nABILA, Kronos - Elian Karel, the charismatic leader of the Protectors of Kronos, was arrested today on charges of tax evasion. Michale Kraft, Karel\'s lawyer, released a statement asserting that the charges leveled against his client were \"false\" and that he hoped his client \"would be released [from police custody] by week\'s end.\"\nPolice spokesman Adrien Carman responded the statement by Kraft, stating, \"I think Mr. Kraft has underestimated the seriousness of his client\'s situation. We have been following his group closely for some time.\"\nJust last month, Karel\'s group was responsible for the trespassing incident that blocked entrance to the GAStech - Kronos headquarters. GAStech President and CEO Sten Sanjorge, Jr. condemned the POK as terrorists.\n');
INSERT INTO `article` VALUES (334, '399.txt', '1998/11/14', 'Homeland Illumination\n', 'POK REPRESENTATIVES MEET WITH KRONOS MINISTER OF HEALTH\n', 'Homeland Illumination\nPOK REPRESENTATIVES MEET WITH KRONOS MINISTER OF HEALTH\nMaha Salo\n14 November 1998\nABILA, Kronos - Representatives from the social activist group Protectors of Kronos (POK) met earlier this week with Cesare Nespola, Minister of Health to discuss resolutions to the water contamination that has plagued Elodis since the late 1990s.\n\"This was a productive meeting,\" POK leader Henk Bodrogi told the Homeland Illumination.  \"I am greatly heartened by the interest the government is showing in suffering of the people of Elodis.  He seemed to be very responsive to our request to establish improved health care in Elodis, and reverse the contamination responsible for so many of our illnesses.\"\nThe POK formed in 1997 from a grassroots action group in response to the pollution of the Elodis water supply and the resultant sickness and deaths of local residents over the subsequent several years.  \n');
INSERT INTO `article` VALUES (335, '4.txt', '1998/04/26', 'News Online Today\n', 'ELODIS, KRONOS:  HELP FROM AN UNEXPECTED SOURCE Part Two \n', 'News Online Today\nELODIS, KRONOS:  HELP FROM AN UNEXPECTED SOURCE Part Two \nPetrus Gerhard \n1998/04/26\nNOTE: This article is the second in a series, reprinted with permission from the Homeland Illumination.  Bodrogi has farmed soybeans his entire life, as did his father and their fathers. \n \"We\'ve worked the land for a long time - maybe 200 years, maybe a bit more,\" Henk Bodrogi told me as he picked over a container of bolts, searching for the right size.  It took a while to figure out, then one of the city officers figured out to call in a water specialist.  When they tested it they said the water was contaminated.\" \nThe water specialist turned out to be the international agency \"Wellness For All\", an international agency with a mission to bring healthy water to communities distressed by natural disasters, draught and - coincidentally - oil and gas development. Reynolds agreed to speak to me for a few minutes between meetings about their work in Elodis.  The Elodis drinking water comes from the Tiskele River, as does all the water for farming, so we looked for a source upstream.  The toxins are forming a subsurface plume that seeps into the Tiskele River from which the residents of Elodis draw their drinking water and irrigation for the crops.\" \n\"When we didn\'t make headway with GAStech,\" Reynolds continued, \"the community leaders decided to approach the government of Kronos for assistance.   Per our policy -and with permission from the Elodis leaders - we published the test results in an official public document.  The Elodis leaders then approached the government officials as citizens of a Kronesian community armed with the scientific analysis.\n');
INSERT INTO `article` VALUES (336, '40.txt', '2014/01/19', 'News Online Today\n', 'GAStech and Kronos Celebrate Partnership \n', 'News Online Today\nGAStech and Kronos Celebrate Partnership \n2014/01/19\nABILA, Kronos - Local GAStech executives Ingrid Barranco, Ada Campo-Corrente, Orhan Strum, and Willem Vasco-Pais will attend a reception with government officials tomorrow following a business meeting at their headquarters building.\n');
