INSERT INTO `article` VALUES (358, '42.txt', '1996/03/13', 'Kronos Star\n', 'Tiskele Bend Gas Fields Larger Than First Thought\n', 'Kronos Star\nTiskele Bend Gas Fields Larger Than First Thought\nDonato Petri\n13 March 1996\nABILA, Kronos - A press release from the Ministry of Interior today announced that the Tiskele Bend gas fields could be as much as 5 times larger than originally estimated.  When we contacted Minister Sarto\'s office for comment, he said, \"We were astounded by the results of GAStech\'s recent survey of Tiskele Bend.  I mean, this is just huge for the people of Kronos.  We have already undertaken several large improvement projects like the port expansion and the new hospital that we would not otherwise have been able to do because of the taxes we are seeing from our foreign investments.  This news almost assures we\'ll be able to reap those same dividends for decades to come!\"\nIt goes without saying that President Araullo\'s plan to lure foreign investment has been a defining moment in our history.  One hopes that those who had been so shortsighted as to oppose his plan have finally come to their senses.  We will say what they are too proud to say: Thank you, Mr. President. \n');
INSERT INTO `article` VALUES (359, '420.txt', '1998/11/15', 'All News Today\n', 'POK REPRESENTATIVES MEET WITH KRONOS MINISTER OF HEALTH \n', 'All News Today\nPOK REPRESENTATIVES MEET WITH KRONOS MINISTER OF HEALTH \n1998/11/15\nABILA, Kronos - Representatives from the social activist group Protectors of Kronos (POK) met earlier this week with Cesare Nespola, Minister of Health to discuss resolutions to the water contamination that has plagued Elodis since the late 1990s.  He seemed to be very responsive to our request to establish improved health care in Elodis, and reverse the contamination responsible for so many of our illnesses.\" \nThe POK formed in 1997 from a grassroots action group in response to the pollution of the Elodis water supply and the resultant sickness and deaths of local residents over the subsequent several years.\n');
INSERT INTO `article` VALUES (360, '421.txt', '1995/11/21', 'Kronos Star\n', 'Araullo Announces New Hospital Construction\n', 'Kronos Star\nAraullo Announces New Hospital Construction\nDonato Petri\n21 November 1995\nABILA, Kronos - President Araullo announced today that his government is planning the construction of a new, modern Abila General Hospital.  The old Abila General Hospital, built in 1930, has outdated health care facilities and has suffered numerous electrical fires in the past decade.  Hospital Administrator Torsten Trucco lauded the government\'s action saying, \"We\'ve been trying to get funding to update our facilities for years, to no avail.  We have been living on borrowed time for quite a while now with the old boiler.  It\'s been pure luck that the old girl hasn\'t failed on us completely.\"\nThe new Abila General will have 350 beds, a substantial upgrade from the mere 100 beds of the current antiquated facility.  Additionally, it will have a full emergency services area, trauma and burn care units, a psychiatric care wing, and four ultra-modern surgical suites.  In his announcement of the new construction, Araullo said, \"Our strategy of courting foreign investment is paying great dividends.  This new hospital is the first of many projects we plan to pursue to help upgrade our standard of living and modernize our lifestyle.\"\n');
INSERT INTO `article` VALUES (361, '422.txt', '2009/05/16', 'Who What News\n', 'GASTECH ADOPTS NEW LOGO \n', 'Who What News\nGASTECH ADOPTS NEW LOGO \n2009/05/16\nCENTRUM, Tethys - With great fanfare GAStech International\'s President and CEO Sten Sanjorge, Jr. spoke of the new logo - a tri-part blue flame - that is reminiscent of a leaf to \"help position GAStech and its products as a clean fuel alternative.\" He also referenced that the tri-part flame represents the past, present, and future of the company in that by keeping \"one eye on the past we know from where we came - our humble beginnings; asserted GAStech International\'s \"blue flame is an enduring beacon of environmental responsibility, and a symbol of a clean energy business moving forward.\"  \nThis rebranding process and new logo seem to be in response to recent trouble the multi-national gas giant has been struggling with in Kronos including the February 19 protest at GAStech - Kronos\' headquarters of 200 people who blocked entrance to the building, resulting in several arrests. The protest and others in and around Abila, the capital of Kronos, have been in response to alleged water contamination issues and a lack of Government and GAStech response. He deflected, \"Today is a great day for GAStech.\n');
INSERT INTO `article` VALUES (362, '423.txt', '2005/04/06', 'International News\n', 'Protestors Block Traffic to Tiskele Bend Fields \n', 'International News\nProtestors Block Traffic to Tiskele Bend Fields \n2005/04/06\nABILA, Kronos - More than a dozen POK protesters were handcuffed and taken into custody by police Tuesday for blocking access to the Tiskele Bend fields.  Before police made the arrests shortly after 9 a.m., the protesters were told they were breaking the law for trespassing on government property, blocking access to government-owned land, and impeding lawful commercial traffic.  \nThe protesters arrived at the entrance to the Tiskele Bend site about 5:30 a.m. and locked arms across the road for about three hours, despite being asked to leave by police.  As traffic on the road began to back up, several truck drivers began to leave their vehicles and congregate near the protesters.  Tempers began to flare as the blockade persisted into the second hour, and the drivers started shouting and cursing at the protesters to move out of the road.  Police officers quickly moved in and arrested the POK protesters before the situation could escalate to violence.\n');
