INSERT INTO `article` VALUES (376, '436.txt', '2014/01/19', 'International News\n', 'GAStech and Kronos Celebrate Partnership \n', 'International News\nGAStech and Kronos Celebrate Partnership \n2014/01/19\nABILA, Kronos - Local GAStech executives Ingrid Barranco, Ada Campo-Corrente, Orhan Strum, and Willem Vasco-Pais will attend a reception with government officials tomorrow following a business meeting at their headquarters building.  Government spokesman Rufus Drymiau informed The Star that Sten Sanjorge Jr., President and CEO of GAStech, has traveled from Tethys to attend the events.  The reception, hosted by President Kapelou at the Capitol Building, is being held to celebrate the 20th year of cooperation between the corporation and our country. Taxes paid by GAStech have funded many infrastructure improvements including projects such as the modernization of Abila General Hospital, numerous schools, and hundreds of miles of paved highways.\n');
INSERT INTO `article` VALUES (377, '437.txt', '2009/03/12', 'Homeland Illumination\n', 'POK LEADER KAREL ARRESTED\n', 'Homeland Illumination\nPOK LEADER KAREL ARRESTED\nPetrus Gerhard\n12 March 2009\nABILA, Kronos - In another unconscionable move against the citizens of Kronos, earlier today police arrested POK leader Elian Karel on spurious tax evasion charges.  He was led - manacled - from a meeting of the Protectors of Kronos in Elodis, a rural township west of Abila.\nDemonstrating his trademark humor, Karel lifted his wrists and joked to his supporters as he is led away, \"I guess I shouldn\'t have sent the President those cases of bottled water for his birthday.\"\nKarel is the leader of the Protectors of Kronos, an alliance of Kronos citizens from Elodis that has demanded the government clean up the contaminated water caused by gas drilling in their community.\n\"We didn\'t ask for GAStech to come to our community,\" Karel spoke at a rally a few months ago.  \"We didn\'t ask for our water to become undrinkable, for our children to become sick.  Neither Elodis nor the people of Kronos have received any benefit from the extraordinarily large amount of money that GAStech clears every year.  I ask:  Where is the money going?\"\nThe police representative assured supporters who massed outside the police station that Karel would be treated humanely, but declined to answer questions or allow visitors to see Karel.\n\"He\'s a determined man,\" Karel\'s attorney Michale Kraft told me over the phone. \"He\'ll fight these false charges and be out in a few days.  He\'ll probably complain about the jail food at the next POK rally.\" \nKraft plans to meet with Karel Saturday morning.\nCalls to the President and Minister of Justice offices were not immediately returned.\n');
INSERT INTO `article` VALUES (378, '438.txt', '2014/01/20', 'The Abila Post\n', 'ON THE SCENE BLOG\n', 'The Abila Post\nON THE SCENE BLOG\nBy Haneson Ngohebo\n20 January 2014\n1915 UPDATE - GAStech employee Edvard Vann was \"allowed to leave\" after nearly six hours of interrogation by police, government, and GAStech officials. Vann was questioned and released about fifteen minutes ago and instructed not to leave town. Vann was visibly angry about the confusion, which apparently stemmed from the similarity of his name and known members of the Protectors of Kronos.\nVann said he was \"instructed not to communicate with the press, but I feel I have to stress my innocence. I have nothing to do whatsoever with any members of the terrorist group POK.\"');
INSERT INTO `article` VALUES (379, '439.txt', '2005/09/24', 'The Abila Post\n', 'ELODIS PROTESTS TURN TO RIOTS AND ARRESTS \n', 'The Abila Post\nELODIS PROTESTS TURN TO RIOTS AND ARRESTS \n24 September 2005\nELODIS, Kronos - The Protectors of Kronos (POK) continue to protest against the Kronos Government and GAStech International alleging pollution, water contamination and a lack of a government response. Lately the protests have turned violent escalating into rioting largely directed at the Tiskele Bend site.\nThe latest event involved POK protesters forming a human chain to block the entrance of GAStech\'s Tiskele Bend site. After the recent rioting, government officials had no choice, but to round up the protesters and arrest them for trespassing.\nGovernment spokesman Rufus Drymiau commented, \"These sort of violent actions by members of the Protectors of Kronos are counterproductive. We are working closely - the government and GAStech - to ensure that all environmental issues are resolved.\"\nSeveral instances of rioting in and around Elodis have been reported including the trashing of government buildings, rock throwing, and tire burnings. Police have responded swiftly and decisively. The various skirmishes with police have ended in arrests.  \n');
INSERT INTO `article` VALUES (380, '44.txt', '2014/01/20', 'Tethys News\n', 'To break off itself: The emergency to GAStech quarters the construction [modernizations]\n', 'Tethys News\nTo break off itself: The emergency to GAStech quarters the construction [modernizations]\n20 January 2014\nModernization, 2:00 PM:  A government automobile has been allowed with the perimeter of the police.  The occupant, that she seems to be an emergency civil employee, has been left in the construction.');
INSERT INTO `article` VALUES (381, '440.txt', '2014/01/20', 'News Online Today\n', 'GASTECH EMPLOYEE INTERROGATED, RELEASED \n', 'News Online Today\nGASTECH EMPLOYEE INTERROGATED, RELEASED \n2014/01/20\nABILA, Kronos - For roughly 6 hours GAStech - Kronos employee Edvard Vann was interrogated by Kronos Police and Government officials before being released at 17:00 this evening. With some 14 GAStech employees still unaccounted for, one cannot blame the police or the government for not leaving any stone unturned.\n');
INSERT INTO `article` VALUES (382, '441.txt', '2014/01/20', 'Kronos Star\n', 'Breaking: Emergency at GAStech Headquarters Building [Updates]\n', 'Kronos Star\nBreaking: Emergency at GAStech Headquarters Building [Updates]\nCato Rossini, Marcella Trapani\n20 January 2014\nUpdate, 6:10 PM:  The GAStech executive jet reportedly arrived in Tethys a few hours ago bearing Sten Sanjorge Jr.  The jet was quickly refueled and then departed for Abila International Airport with six GAStech officials onboard.');
INSERT INTO `article` VALUES (383, '442.txt', '1998/11/17', 'The Explainer\n', 'HEALTH FOR ALL THE DECLARATION OF EDITIONS ON ELODIS\n', 'The Explainer\nHEALTH FOR ALL THE DECLARATION OF EDITIONS ON ELODIS\n1998/11/17\nELODIS, Kronos - the health heals international of the group of the knowledge of the water for all (WFA) has made the test in the local water in Elodis that found of high level of dangerous residential water well materials. \nIn a declaration sent by WFA, the group it directs fault to the government of international Kronos and GAStech, company of the natural gas of Tethys. Besides to direct the two fault WFA also it demands that ascending clean the contamination, that includes stops levels of the benzene, arsenic of the tolueno and xylene, barium, chromium, lead and selenium.\nBringing the attention to the contamination in and around Elodis, WFA hopes that the international community will exert pressure on the government of Kronos in the action. In addition, WFA has been working with the protectors of the group of the activist of Kronos to lobby the government to apply the pressure.\n');
INSERT INTO `article` VALUES (384, '443.txt', '1999/11/14', 'International Times\n', 'Global disasters drain charity coffers\n', 'International Times\nGlobal disasters drain charity coffers\n14 November 1999\nNew appeals campaigns on the horizon to maintain liquidity.\nAid agencies have warned that the monetary and food needs have increased worldwide and that they may not be able to meet basic needs.\nThe UN Office for Coordination of Humanitarian Affairs says that 15 million people remain in need of vital goods and services, because the number and severity of crises has resulted in a lack of \"food, healthcare, and access to livelihoods.\"\nOne new aid group, CARING Singapore has been recently formed In response to the conflict in Kosovo.  Dr. Jayala Mahmed was unable to find an existing organization to sponsor her to volunteer her medical services there.  CARING Singapore has sent five missions to Kosovo to provide mobile medical care.  They have also launched a fundraising effort in collaboration with the governments of Malaysia.  \"We stand ready to help, but funding is difficult to find,\" stated Dr. Mahmed. \"So much is needed but so much has already been spent.\"\nThirteen people were injured on Tuesday in Izmit, Turkey, as people mobbed a government relief convoy, officials said.  Some 20,000 people are feared dead in the two earthquakes that have occurred this year.  CARING Singapore has dispatched relief teams to Turkey.\nYet, aid organizations are stretched to their limits.  Wellness for All assisted ad-hoc emergency medical teams during the September earthquake in central Taiwan that measured 7.3 on the Richter scale.  \"The response from the Emergency Teams was impressive, but uncoordinated,\" stated a Wellness for All spokesperson.  \"We were never sure if we were headed to locations most desperate.  We soon ran out of medicines and funds to support our aid teams and had to return home.\"  While the global press reported over 2500 people were killed and 100,000 buildings were destroyed, local press reported people felt they were being properly cared for and declined relief aid. \nThe Global Emergency Disaster Organization report their members are doing all they can to get aid through to earthquake victims, but they need a huge injections of funds to do so.  \nJim Cordon, from the disaster relief charity FoodSupport told the times \"I think that the lack of funds are responsible for an increase of attacks on food convoys, consequently deterring a lot of aid agencies from getting in there.\"\n');
INSERT INTO `article` VALUES (385, '444.txt', '1995/10/11', 'International News\n', 'Grand Opening of the New GAStech Offices \n', 'International News\nGrand Opening of the New GAStech Offices \n1995/10/11\nABILA, Kronos - President Sten Sanjorge Jr.  The gleaming steel and glass building provides ample office space for regional managers, geologists, engineers, and support staff, and sports state-of-the art conference facilities.  Minister Sarto, who attended the celebration, said, \"This beautiful facility is a monument to Sanjorge\'s commitment to Kronos and should be seen by the citizens as a sign of a prosperous future for all.\"\n');
