INSERT INTO `article` VALUES (387, '446.txt', '2013/11/13', 'News Online Today \n', 'Kronos protests break out in violence  \n', 'News Online Today \nKronos protests break out in violence  \n2013/11/13\nJournalist Shawn Pastorini says \"lack of respect\" is fuelling the protests \n<< Continue reading the main story >>  \nDemonstrators in Abilia, Kronos have set fire to government buildings, in another round of unrest in this torn city \nDozens of people have been injured in protests over perceived government corruption and perceived inability of politicians to improve the situation. Hundreds of rural citizens are suffering major illnesses apparently caused by exposure to GAStech waste streams, although this has not been official substantiated or acknowledge by either the company or government.  \nThat is what sparked the initial protests in Abila - but empathy with their cause brought demonstrators out in towns across Kronos.\n');
INSERT INTO `article` VALUES (388, '447.txt', '2009/03/08', 'News Online Today\n', 'POK RALLY DRAWS THOUSANDS OF SUPPORTERS \n', 'News Online Today\nPOK RALLY DRAWS THOUSANDS OF SUPPORTERS \n2009/03/08\nABILA, Kronos - Thousands of protesters carrying banners reading \"Remember Juliana!\" rallied in front of the Kronos government offices Saturday morning. She has become the heart-rending icon of a movement that has gained support from one end of Kronos to the other.  Karel took over POK leadership from Henk Bodrogi, whose ill health forced him down from the position.  Karel spoke eloquently about the beginnings of the POK campaign as a grassroots effort for clean water, to the dynamic movement it has become demanding improved government transparency and accountability.  We know these corporations are generating records profits at the expense of Kronos, but we see none of the promised improvements.\n');
