INSERT INTO `article` VALUES (390, '449.txt', '1999/02/19', 'Who What News\n', 'GASTECH REPORTS RECORD EARNINGS \n', 'Who What News\nGASTECH REPORTS RECORD EARNINGS \n1999/02/19\nCENTRUM, Tethys - GAStech International, as projected earlier this month, reported record fiscal 1998 profit of $110 million. \nGAStech issued a full-year earnings preview February 4 as part of its latest attempts to drown out the accusations of groundwater contamination in Kronos levied by Wellness for All. \n\"GAStech International has delivered another year of superior financial performance achieved through a consistent vision and expert execution,\" Sten Sanjorge, Jr., GAStech\'s Chief Executive, said in a brief statement. However, he did mention the opening of GAStech\'s new natural gas processing plant is on pace.\n');
INSERT INTO `article` VALUES (391, '45.txt', '2011/07/28', 'News Online Today\n', 'POK Labeled a \"Public Threat\" \n', 'News Online Today\nPOK Labeled a \"Public Threat\" \n2011/07/28\nABILA, Kronos - In a statement to the press today, government spokesman Rufus Drymiau said of the POK: \"they are justifiably a public threat due to violent demonstrations, opportunistic vandalism, and clashes with the police.\"\n');
INSERT INTO `article` VALUES (392, '450.txt', '2014/01/20', 'The Abila Post\n', 'ON THE SCENE BLOG\n', 'The Abila Post\nON THE SCENE BLOG\nBy Haneson Ngohebo\n20 January 2014\n1330 UPDATE - At 1315 we placed a call to GAStech headquarters. A hesitant administrative assistant to Orhan Strum, Chief Operating Officer of GAStech claimed Mr. Strum was unavailable. Linda Lagos the assistant to Mr. Strum declined to answer any further questions about the incident, whether or not there was a fire, a false alarm, a bomb threat, or whether or not anyone is missing.\nUneasy throughout the call, Ms. Lagos repeated that Orhan Strum was unavailable at this time, said good bye and hung up. Additional calls were placed with no answer on the GAStech end of the line.');
