INSERT INTO `article` VALUES (401, '459.txt', '2001/03/24', 'The Orb\n', 'The MEASUREMENT Of TAXES DEMOLISHED, EFFORTS OF FIXED POK A\n', 'The Orb\nThe MEASUREMENT Of TAXES DEMOLISHED, EFFORTS OF FIXED POK A\n2001/03/24\nAbila, Kronos - a measurement to increase taxes on the foreign development of oil and gas proposed by Minister of health Cesare Nespola was demolished by a broad margin last week in the General meeting.\nThis defeat is a hard blow with the guards of Kronos, a group of Elodis which counted on this placing to provide the cleaning of care of health and environment of their water of drinks and irrigation.\n\"We hold a meeting envisaged with the minister,\" of the guards of the Chief of Kronos that Henk Bodrogi indicated.  \"Not to still count to us outside.  We project to improve measurement and the Nespola minister will reintroduce it at the end of this year.\"\nBodrogi is the chief of the guards of Kronos, an environmental group of bases with a mission to reverse the pollution caused by gas drilling at its birthplace.\n');
INSERT INTO `article` VALUES (402, '46.txt', '2013/09/03', 'News Online Today\n', 'SANJORGE JR. TAKING GASTECH INTERNATIONAL PUBLIC \n', 'News Online Today\nSANJORGE JR. TAKING GASTECH INTERNATIONAL PUBLIC \n2013/09/03\nCENTRUM, Tethys - After 52 years of being privately owned, Sten Sanjorge, Jr.  \nThe company, founded in 1961 by Sten Sanjorge, Sr., said Monday it plans a stock offering that could place its value in the neighborhood of $3.75 billion.\n');
INSERT INTO `article` VALUES (403, '460.txt', '2014/01/21', 'Everyday News\n', 'Kidnapped employees of GASTech in Kronos\n', 'Everyday News\nKidnapped employees of GASTech in Kronos\n2014/01/21\nFourteen employees feared kidnapped in Kronos for radical an environmental group of the terrorist during a corporative meeting. \nThey fear fourteen employees, including possibly to five executive officials, kidnapped yesterday by the \"protectors of Kronos\".  The disclosed disappear include: President and CEO Sten Sanjorge Jr, CFO Ingrid Precipice, Field-Corrente of Ada of I BACK WATER, rasgueo of Orhan de GAStech of the COO, and environmental official Willem Basoue-Country.\nThe local organizations of the news have received a note of the rescue of the responsibility that she demanded and to demand of POK $20 million of the company.  It is possible additional demands is next.\nSanjorge and the others disappeared following a meeting of the Council in the headquarters of GASTech.  A fire alarm was extinguished, and execs lacked shortly after discovered that one.  The complete list of all the inexplicable employees has not been sent. \nJuan Rathburn, American expert in the executive kidnappings that are living in Tethys, says that Kronos has not been known as country archetype for the kidnapping. \"Nevertheless, the increasing activity by POK, APA [army of people of Asterian], and others in the region have increased perceivably the risk.\"\nThe corresponding times in Abila say that the offices of GASTech are closed, and the telephone calls are only answering the referred local authorities.  \nThe corporative headquarters of GASTech in Tethys have rejected to comment. Nevertheless, other sources of the news have disclosed to Tethys federal civil employees of the application of law and the personnel of the ministry of Tethan of outer subjects has arrived in Kronos to attend police in the investigation.\n');
INSERT INTO `article` VALUES (404, '461.txt', '2014/01/20', 'Kronos Star\n', 'POK Kidnaps GAStech Employees\n', 'Kronos Star\nPOK Kidnaps GAStech Employees\nMarcella Trapani\n20 January 2014\nABILA, Kronos - The Protectors of Kronos (POK) are suspected of kidnapping up to fourteen GAStech employees from their headquarters building earlier today.  Abila police quickly secured the building and interviewed the remaining GAStech employees.  One employee, Edvard Vann of Abila, was questioned for hours because he shares a family name with several known POK members.  Vann denied involvement with the POK and claimed to have no knowledge of the kidnapping.  The POK has made no statements regarding the kidnapping.\nGAStech sent officials from its home office in Centrum, Tethys to help police handle the incident.  Tethyn federal law enforcement and representatives from the Tethyn Ministry of Foreign affairs flew to Kronos and were escorted to Abila police headquarters.\n');
INSERT INTO `article` VALUES (405, '462.txt', '2014/01/20', 'Kronos Star\n', 'Breaking: Emergency at GAStech Headquarters Building [Updates]\n', 'Kronos Star\nBreaking: Emergency at GAStech Headquarters Building [Updates]\nCato Rossini, Marcella Trapani\n20 January 2014\nUpdate, 1:35 PM:  We called the office of Ingrid Barranco, the GSAtech Chief Financial Officer.  Her administrator, who was very uneasy during the conversation, informed us that Ms. Barranco is unavailable for comment.');
