INSERT INTO `article` VALUES (408, '465.txt', '2001/03/23', 'Daily Pegasus\n', 'THE DEFEATED MEASUREMENT, EFFORTS OF THE TAX OF POK WAS CLOGGED\n', 'Daily Pegasus\nTHE DEFEATED MEASUREMENT, EFFORTS OF THE TAX OF POK WAS CLOGGED\n2001/03/23\nAbila, Kronos - a measurement to increase taxes on the foreign development of the oil and the gas proposed in Minister of the health Will stop Nespola was defeated by a wide margin the week last in the General Assembly.\nThis defeat is a rough blowing to the protectors of Kronos, group of Elodis that counted in that it financed to provide cleaning of healthcare and of the atmosphere of its water drinking and of the irrigation.\n\"We have a meeting anticipated with the minister,\" the protectors of the leader of Kronos that Henk Bodrogi said.  \"Not to tell us towards outside still.  We glide to improve the measurement and minister will reintroducir√° it to Nespola at the end of this year.\"\nBodrogi is the leader of the protectors of Kronos, an environmental group of the towns with a mission to invest the contamination caused by the gas that it perforates in his native city.\n');
INSERT INTO `article` VALUES (409, '466.txt', '2014/01/20', 'Athena Speaks\n', 'EMPLOYEE OF QUESTIONED GASTECH, RELEASED\n', 'Athena Speaks\nEMPLOYEE OF QUESTIONED GASTECH, RELEASED\n2014/01/20\nABILA, Kronos - during roughly 6 hours employed Edvard Vann de GAStech - of Kronos was questioned by Kronos Police and civils servant of government before being released with 17:00 this evening. Apparent confusion comes from the similarity between its name and that from a guard from member from Kronos.\nVann, a guard of safety for GAStech, was furious, stating, \"I do not have anything to make some with any member of group POK of terrorist. I do not know anybody of Elodis. I was born here in Abila and I support my government and my president. Is being marked and being questioned during 6 hours as a member of terrorist POK one of the worst days of my life. Just because a person has the same name as a criminal does not make him with a criminal.\"\nAlthough it was charged not to communicate with the pressure that Vann was determined to subject to a constraint its innocence. With approximately 14 still unexplained employees of GAStech, one cannot blame the police force or the government not to leave any stone unturned. \n');
INSERT INTO `article` VALUES (410, '467.txt', '1998/11/10', 'News Online Today\n', 'Ministry of Health Investigates Contamination Complaints \n', 'News Online Today\nMinistry of Health Investigates Contamination Complaints \n1998/11/10\nABILA, Kronos - Minister of Health Cesare Nespola announced today that his organization would be investigating claims of abnormal health issues in areas surrounding the Tiskele Bend drill site.  However, I believe it is important as Minister of Health to do due diligence and investigate the reports of sickness near the Elodis township.\n');
INSERT INTO `article` VALUES (411, '468.txt', '1999/07/7', 'Homeland Illumination\n', 'MINISTER OF HEALTH TO PROPOSE SOLUTION TO TOWN POISONING\n', 'Homeland Illumination\nMINISTER OF HEALTH TO PROPOSE SOLUTION TO TOWN POISONING\nMaha Salo\n7 July 1999\nABILA, Kronos - Prime Minister of Health Cesare Nespola announced he would sponsor a bill to increase taxes on foreign energy development in Kronos intended to fund environmental cleanup and improved healthcare for rural towns.  Following a series of meetings with members of the activist group Protectors of Kronos (POK) the announcement was made last week.\n\"Our path forward is clear,\" POK co-leader Carmine Osvaldo told the Homeland Illumination.  \"We fight for clean water, good health and now we will have the funds to make this happen.  Thanks to Minister Nespola no more children will have to die.\"\nOsvaldo refers to Juliana Vann, a 10-year old girl who died last year from leukemia due to with benzene poisoning from gas drilling operations upstream from her home.\nThe POK formed in 1997 in response to the pollution of the Elodis water supply and the resultant sickness and subsequent deaths of local residents.  \n');
INSERT INTO `article` VALUES (412, '469.txt', '2014/01/20', 'Who What News\n', 'KIDNAPPING AT GASTECH KRONOS  \n', 'Who What News\nKIDNAPPING AT GASTECH KRONOS  \n2014/01/20\nABILA, Kronos - After a long day of conflicting and confusing information reports are still sketchy, but the story is beginning to come clear: a Kronos Government source has confirmed up to fourteen of GAStech International\'s employees may have been kidnapped at the company\'s headquarters in Abila. Speculation includes whether or not GAStech International President and CEO Sten Sanjorge Jr. was the target given that GAStech International has yet to make a statement to the press. Speculation about the motivation behind the kidnapping has also been rampant due to the recent GAStech IPO. Edvard Vann, a GAStech - Kronos security guard who was interrogated and released after 6 hours, indicated the Protectors of Kronos were suspected as being the perpetrators behind today\'s events. \nA GAStech International senior security executive has been on site to support the investigation, aiding the Abila Police Department and Kronos Government officials. At some point while company officers were transitioning from the main office to a Kronos Government reception the abductions took place. Abila Fire Department trucks were dispatched to GAStech - Kronos headquarters around 10:00 this morning local Kronos time to respond to a fire alarm.\n');
INSERT INTO `article` VALUES (413, '47.txt', '1993/03/13', 'The Guide\n', 'Distribution of strikes of the government with international GAStech\n', 'The Guide\nDistribution of strikes of the government with international GAStech\n1993/03/13\nABILA, Kronos - president Araullo today announced the company/signature in an agreement between his government and the GAStech Tethys-based international for the development of the gas fields of the curve of Tiskele.  GAStech, under direction of the visionary Jr of Sten Sanjorge, was granted the rights exclusive to perforate inside the governmental fields after being suitable the request of the government who 50% or more of the manual labor are citizen of Kronosian.  President Araullo hailed the distribution of the signal like \"the principle of a new one was for our great country, of an era of the opportunity and the fortune for all.\"  Our sources in the Department of the Interior say us that the tax of 50% tax in the new exploration of the oil and the gas could render superior to $1 billion in fiscal income per year.  This will allow that the government makes investments without precedents in the infrastructure, the medical care, and the education.\n');
INSERT INTO `article` VALUES (414, '470.txt', '2014/01/20', 'Homeland Illumination\n', 'VOICES - a blog about what is important to the people\n', 'Homeland Illumination\nVOICES - a blog about what is important to the people\nMaha Salo\n20 January 2014\n1025 - The building is being searched for signs of trouble by the fire department.  There has been no confirmation of a bomb threat, but I haven\'t seen a bomb squad appear. 20 Jan 2014');
INSERT INTO `article` VALUES (415, '471.txt', '2000/01/16', 'Who What News\n', 'KRONOS GDP ON THE RISE \n', 'Who What News\nKRONOS GDP ON THE RISE \n2000/01/16\nABILA, Kronos - The real gross domestic product - the output of goods and services produced by labor and property located in Kronos - increased at an annual rate of 5.4% in the fourth quarter of 1999, according to the advance estimate released by the Bureau of Economics. Most of this growth can be contributed to the relationship between the Government of Kronos and GAStech International.\n');
INSERT INTO `article` VALUES (416, '472.txt', '1996/07/7', 'The World\n', 'GASTECH SHIFTS FOCUS TO KRONOS\n', 'The World\nGASTECH SHIFTS FOCUS TO KRONOS\n7 July 1996\nCENTRUM, Tethys - GAStech International has shifted its focus from Tethys to the small Mediterranean island of Kronos and the vast gas deposits beneath the ground.\nRecent charges of groundwater contamination against GAStech International and tightening environmental regulations lead by the Tethan Interior Minister, Ivar Blanes, certainly play into the shifting focus. \nWith environmental regulation lax to nonexistent in Kronos and a friendly local government, GAStech\'s move feels inevitable in hindsight. \n');
INSERT INTO `article` VALUES (417, '473.txt', '1992/12/12', 'Who What News\n', 'KRONOS GOVERNMENT PLANS TAX BREAKS TO ENCOURAGE FOREIGN INVESTMENT \n', 'Who What News\nKRONOS GOVERNMENT PLANS TAX BREAKS TO ENCOURAGE FOREIGN INVESTMENT \n1992/12/12\nABILA, Kronos - The Government of Kronos is currently planning some of the world\'s most generous tax breaks for gas investments. \nAs high-income countries from Europe and the United States race to take advantage of existing and potential gas deposits, Kronos is planning to provide incentives such as reducing corporate and individual tax, preferential tariffs, and derogations from regulations as well as cheap, but eager work force. \nThe Government of Kronos is pitching the plan as a win-win situation given that the high-income countries will be struggling to discover and exploit ever-dwindling supplies of fossil-fuels and the developing Kronos needs income, infrastructure, and cheap energy.\n');
INSERT INTO `article` VALUES (418, '474.txt', '1995/10/12', 'The Truth\n', 'Large opening the new offices GAStech\n', 'The Truth\nLarge opening the new offices GAStech\n1995/10/12\nABILA, Kronos - international president Sten Sanjorge Jr. one of GAStech kept today the large opening ceramics for the new hoofdkwartier gAStech-Kronos construction.  The gleaming steel and glass bldg. supply wide office space for regional managers, geologists, engineers, and support staff, and the conference facilities of the sport overview.  The minister Sarto, who attended the celebration, said, this beautiful facility a monument to Sanjorge obligation to Kronos is and by the citizens as a sign of a future thriving for all must be seen.  \n');
INSERT INTO `article` VALUES (419, '475.txt', '2010/06/20', 'The Abila Post\n', 'GOVERNMENT RESPONDS TO ANOTHER ROUND OF PROTESTS \n', 'The Abila Post\nGOVERNMENT RESPONDS TO ANOTHER ROUND OF PROTESTS \n20 June 2010 \nABILA, Kronos - Protesters aligned with the Protectors of Kronos (POK) activist group surrounded government buildings chanting and carry images of their so-called martyrs. Kronos government security forces in concert with Abila police suppressed the protest with an impressive show of force.\nDressed in black the authorities donning helmets and gasmasks and brandishing riot shields, fired tear gas canisters as the protesters refused to disperse after several warnings. The group gathered proved reluctant to disperse even after the tear gas and the authorities pressed into the group protecting themselves with their shields and freely swinging their batons.\nIn the face of overwhelming force, most of the protesters fled; however, a hard core group stood their ground suffering the consequences. The remaining protesters were surrounded by the riot police and after repeated baton blows many were dragged away under arrest. \nWhen the smoke cleared amongst the discarded and trampled banners and signs, blood was clearly visible on the plaza.\n');
INSERT INTO `article` VALUES (420, '476.txt', '2009/02/19', 'News Online Today\n', 'GASTECH HEADQUARTERS BLOCKED BY POK \n', 'News Online Today\nGASTECH HEADQUARTERS BLOCKED BY POK \n2009/02/19\nABILA, Kronos - A POK rally designed to bring attention to claims of environmental damage have done more damage to their image. The rally outside of GAStech International\'s headquarters resulted in multiple arrests for trespassing.  Ten of the protestors chained themselves to the doors of the building in an attempt to prevent GAStech employees from going to work.\n');
INSERT INTO `article` VALUES (421, '477.txt', '2000/10/2', 'The Abila Post\n', 'LANDSLIDE VICTORY FOR PRESIDENT KAPELOU\n', 'The Abila Post\nLANDSLIDE VICTORY FOR PRESIDENT KAPELOU\n2 October 2000\nABILA, Kronos - The people of Kronos have overwhelmingly elected new President Dorel Kapelou II. Former President Luis Araullo conceded defeat yesterday when early returns came in strong for Kapelou II. Today marks a new dawn for the people of Kronos and a bright path forward for the country.\nThe results for the 1 October election are as follows: Dorel Kapelou II elected with 62% of the vote and Luis Araullo receiving just 36% of the vote. A resounding victory for the new elected President and a clear mandate for Kapelou\'s vision for the country.\n');
