INSERT INTO `article` VALUES (433, '488.txt', '1999/07/3', 'Kronos Star\n', 'Minister Nespola Champions Added Taxes on Oil, Gas Development\n', 'Kronos Star\nMinister Nespola Champions Added Taxes on Oil, Gas Development\nDonato Petri\n3 July 1999\nABILA, Kronos - Minister of Health Cesare Nespola announced that he would sponsor a bill to increase taxes on oil and gas development by an additional 10%.  The raise in taxes on foreign gas and oil development is earmarked specifically for health care, clean water projects, and health education for rural areas.  Minster Nespola has long been a strong advocate of the health and well-being of our citizens, and his support for this measure adds to a long list of the actions he has undertaken on our behalf.  Last year, Minister Nespola created a program of financial incentives designed to bring qualified physicians to practice medicine in Abila.  This program has added over a dozen highly trained doctors and specialists from all over the world to Abila General Hospital staff.\n');
INSERT INTO `article` VALUES (434, '489.txt', '2010/10/03', 'News Online Today\n', 'PRESIDENT KAPELOU II ELECTED BY RECORD MARGIN \n', 'News Online Today\nPRESIDENT KAPELOU II ELECTED BY RECORD MARGIN \n2010/10/03\nABILA, Kronos - President Dorel Kapelou II has won re-election with the largest margin ever in a Kronesian election.  \nWith all the votes counted the President\'s Democratic Party of Kronos now holds 85 seats in the General Assembly, 13 for the Organization of Business and Unions Party, and 2 for the Party of Kronos Industrialists.\n');
INSERT INTO `article` VALUES (435, '49.txt', '2014/01/20', 'The World\n', 'KIDNAPPING AT GASTECH KRONOS \n', 'The World\nKIDNAPPING AT GASTECH KRONOS \n20 January 2014\nABILA, Kronos - After a long day of conflicting and confusing information reports are still sketchy, but the story is beginning to come clear: a Kronos Government source has confirmed up to fourteen of GAStech International\'s employees may have been kidnapped at the company\'s headquarters in Abila. \nMuch speculation remains regarding who was taken in the kidnapping. Speculation includes whether or not GAStech International President and CEO Sten Sanjorge Jr. was the target given that GAStech International has yet to make a statement to the press. Speculation about the motivation behind the kidnapping has also been rampant due to the recent GAStech IPO.\nAt this time no one has claimed responsibility for the kidnapping. Edvard Vann, a GAStech - Kronos security guard who was interrogated and released after 6 hours, indicated the Protectors of Kronos were suspected as being the perpetrators behind today\'s events.\nA GAStech International senior security executive has been on site to support the investigation, aiding the Abila Police Department and Kronos Government officials.\nJanuary 20th was GAStech\'s annual corporate meeting. At some point while company officers were transitioning from the main office to a Kronos Government reception the abductions took place. \nUnconfirmed reports of a fire at the office may have served as a distraction for the kidnappers or at least contributed to the confusion during the event. Abila Fire Department trucks were dispatched to GAStech - Kronos headquarters around 10:00 this morning local Kronos time to respond to a fire alarm.\n');
INSERT INTO `article` VALUES (436, '490.txt', '2014/01/20', 'Centrum Sentinel\n', 'VOICES - a blog approximately that what is important to people\n', 'Centrum Sentinel\nVOICES - a blog approximately that what is important to people\n20 January 2014\n1247 - Interesting developments - two automobiles of the squad of the police have arrived with the lights and the sirene. 20 gen. 2014');
INSERT INTO `article` VALUES (437, '491.txt', '2005/09/26', 'The Explainer\n', 'RETURN OF THE PROTESTS OF ELODIS TO THE UPROARS AND THE HALTINGS \n', 'The Explainer\nRETURN OF THE PROTESTS OF ELODIS TO THE UPROARS AND THE HALTINGS \n2005/09/26\nELODIS, Kronos - the protectors of Kronos (POK) continue protesting against the contamination that alleges international of the government and GAStech de Kronos, the contamination of the water and a deficiency of an answer of the government. The protests have given violent return lately to extension in releasing the brakes itself to a great extent directed in the site of the curve of Tiskele.\nThe last event implied demonstrators of POK that formed a human chain to block the entrance of the site of the curve of Tiskele de GAStech. After releasing the brakes itself recent, the officials of the government did not have any option, but to ascending round the demonstrators they arrest and it to violate.\nThe spokesman Rufus Drymiau of the government commented, \"who these the class of violent actions of the members of the protectors of Kronos is ineffective. We are working close by - the government and the GAStech - assuring to us that all the environmental editions are resolute.\"\nSeveral cases of releasing the brakes itself in and around Elodis have been disclosed including trashing of the buildings of the government, to send of the rock, and burnings of the tire. The police has responded quickly and decisive. The several skirmishes with police have finished in haltings.  \n');
INSERT INTO `article` VALUES (438, '492.txt', '1998/05/17', 'The Wrap\n', 'THE SHEET OF THE PUBLIC HEALTH ELODIS\n', 'The Wrap\nTHE SHEET OF THE PUBLIC HEALTH ELODIS\n1998/05/17\nELODIS, Kronos - at the request of the citizens of Elodis, Wellness for all a report concerning the impact of gas boring verrichtingen on has published water quality and public health.  The elaborate report will be shortly on Wellness for already Internet site available.  Comparing given before 1998 it was obtained from thorough examining medical report that Elodis are supplied the Community center of health.\nThe peaks of the report\n* The raised quantities toxic chemical products were found in water supplies, including arsenic, vinegar anhydride, benzene, and chlorine dioxide.\n* The persons younger than 30 seem from an uncommon high tariff of chronic sickness suffer linked from toxin which by gas boring verrichtingen is produced.\n');
INSERT INTO `article` VALUES (439, '493.txt', '2003/05/19', 'The General Post\n', 'THE COO OF DIES IN 73\n', 'The General Post\nTHE COO OF DIES IN 73\n2003/05/19\nCENTER, Tethys - Sten Sanjorge Jr, COO of international GAStech, died of an attack of the heart in its writing-desk in the centric headquarters of the center of the company. Although Sanjorge was 73 years, its death came like shock.\nThe Sanjorge spent 40 years with GAStech, befriending Hank Fluss in 1963 in which both began towards outside in his the own ones. Like wildcatters, they began to perforate in the known areas not previously to be gas fields. After many it failed wells and on the verge of the financial ruin, of Fluss and Sanjorge, Mr. pressed in possible finding one of the gas fields without taking advantage of greater Tethys.\nLike main official of operation, Fluss has supervised to the extension of GAStech, truth doing to him to an international company and growing it in a multibillonaria operation of the dollar. Always a champion of environmental causes, Sanjorge had disillusioned more and more with the operation of GAStech - of Kronos that filtered its relation with the CEO Hank Fluss, Jr. \nSten Sanjorge Jr is survived by its wife of 54 years, Beatriz, its 5 children, and 12 grandsons.\n');
INSERT INTO `article` VALUES (440, '494.txt', '2014/01/20', 'The Light of Truth\n', 'KIDNAPPING WITH GASTECH KRONOS \n', 'The Light of Truth\nKIDNAPPING WITH GASTECH KRONOS \n2014/01/20\nABILA, Kronos - after a long day of the conflict and the muddling information papers are still not very precise, but the history starts to come clearly: a source of government of Kronos confirmed up to fourteen of GAStech of the employees that international could be removed with the registered offices of the company in Abila. \nMuch speculation remains concerning which was taken in kidnapping. The speculation includes if the international president of GAStech and Jr. of Sten Sanjorge of PRESIDENT was the target since international GAStech has to still submit a report/ratio with the speculation of pressure about the motivation behind kidnapping was also due unrestrained to recent GAStech IPO.\nCurrently nobody claimed the responsibility for kidnapping. Edvard Vann, GAStech - the guard of safety of Kronos which was questioned and released after 6 a.m., indicated the guards of Kronos were suspect√©s as being the criminals behind events of today.\nAn international director of elder safety of GAStech was on the building site to support research, helping the department of police force of Abila and the civils servant of government of Kronos.\nOn January 20 was the meeting of the annual company of GAStech. At a certain point while the leaders of company transitioning of the main office to a reception of government of Kronos abductions took place. \nThe not confirmed reports/ratios of a fire at the office could have been used as distraction to the kidnappers or to have at least contributed to confusion during the event. Trucks of department of fire of Abila were dispatched with the registered offices of GAStech - of Kronos towards 10:00 this time local of Kronos of morning to answer a signal of fire.\n');
INSERT INTO `article` VALUES (441, '495.txt', '2014/01/20', 'Kronos Star\n', 'Breaking: Emergency at GAStech Headquarters Building [Updates]\n', 'Kronos Star\nBreaking: Emergency at GAStech Headquarters Building [Updates]\nCato Rossini, Marcella Trapani\n20 January 2014\nUpdate, 3:05 PM:  Some police have left the scene, but others remain to outside to secure the building while others are still in the building.  There is much speculation about their activities, but police have yet to respond to our queries for information.');
INSERT INTO `article` VALUES (442, '496.txt', '1984/05/05', 'Everyday News\n', 'The pioneer of the gas of the slate plans first wells outside coast of the world in the Mediterranean Sea \n', 'Everyday News\nThe pioneer of the gas of the slate plans first wells outside coast of the world in the Mediterranean Sea \n1984/05/05\n<<Deleted image: Demonstrator whom it perforates of Anti-offshore.  The exploration has proven an controversial edition in Kronos>>\nTo continue reading main history	\nThe son of the founder of the company/signature of the gas that GAStech is planning a company to perforate inside the Mediterranean Sea, the times has learned.\nSten Sanjorge, Jr thinks that there are the great volumes of gas coast outside that could be extracted.\nSanjorge and GAStech were granted to three licenses by the government of Kronos the month last through the ministry of the energy and the development and hopes to begin the exploration soon.\n\"The gas certainly coast outside is not a new concept, but there is no reason with the history of Kronosian of the development coast outside that we cannot develop to these resources coast outside,\" he said the times.\nThe gas of the slate is extracted using the controversial technique of the hyperacid retirement of the substratum that implies injecting of acid layers of the slate of chemical agents, to break them for above and sending the catched natural gas inside.\nThe hyperacid retirement of the substratum has produced the extensive amounts of gas and oil in the one of the west, having transformed the market of the energy. But the projects in Europe have been slow to remove, surrounded with the opposition of the government and local communities.\nMany ecologists think that the hyperacid retirement of the substratum can damage marine atmospheres, and oppose the extraction of the new resources of the fossil fuel. But perforating coast outside avoids the necessity of the difficult negotiations with the local advice, communities and landholders.\nIn agreement with existing geologic data, SanJorge thinks that a considerable amount of gas is in the place - up to 100 cubical feet trill√≥n, that would be more than the estimations of GAStech for their terrestrial resources. There is also the possibility of finding the oil.\nGAStech has considered that the resources coast outside of the gas of the slate of the total of Kronos could be between five and 10 times the terrestrial size of the available one of the resources.\n\"We are that the resource is there and the numbers are absolutely ginormous,\" said very comfortable SanJorge.  \"Is anyone of that one explotable? That one is billion questions of the dollar, and GAStech wiling to invest in the answer.\"\nAlthough it has gotten to be only recently controversial, the hyperacid retirement of the substratum has been used in one more a smaller scale by many years, to improve the gas and conventional well flow of the oil. But to use the process in a great amount of needed wells to extract the gas coast outside of the slate never has been made commercially.\nProfessor Oskar Wertz of the university of Tethys is skeptical around if the gas coast outside of the slate could be a great contribuidor to the European energy in the next decade, but says that he could have potential in the one of more long term.\n\"GAStech is being optimistic is its estimations of how long will take to explore the slate outside coast. He is perfectly reasonable that in 20, 30 or 40 years, the hyperacid technology of the retirement of the substratum will have so advanced and the way of which we took care outside of the ambient coast we will have so advanced that this could be a really great industry. The task in the 10 next years is to try these things towards outside, considers if they work.\" \n');
INSERT INTO `article` VALUES (443, '497.txt', '1995/10/10', 'The World\n', 'GRAND OPENING GASTECH-KRONOS\n', 'The World\nGRAND OPENING GASTECH-KRONOS\n10 October 1995\nABILA, Kronos - With his trademark flash, Sten Sanjorge, Jr. President of GAStech International opened the new GAStech-Kronos headquarters. The ribbon was cut with a huge pair of scissors, matched in size only by Sanjorge Jr.\'s smile. \nThe 50 million dollar price tag for the new headquarters is just a drop in the bucket for GAStech. The gas field in production outside of Abila has exceeded even Sanjorge\'s oversized expectations, paying for the building many times over. \nPresent at the ribbon cutting ceremony were several representatives from the Kronos Government. \n');
INSERT INTO `article` VALUES (444, '498.txt', '2000/08/15', 'The World\n', 'EXPLOSION ROCKS GASTECH\'S TISKELE BEND SITE\n', 'The World\nEXPLOSION ROCKS GASTECH\'S TISKELE BEND SITE\n15 August 2000\nABILA, Kronos - An explosion at a nearby gas drilling well pad woke Rebecca Cato around 3 a.m. on Sunday morning. When she left her home in Elodis, Kronos - a rural township outside the capital Abila - to investigate the noise she noticed a large fire coming from GAStech International\'s Tiskele Bend site.\nThe GAStech-owned well near Elodis ignited methane gas underground causing a fire that lasted for around an hour. At least four GAStech employees appeared to have been taken away by ambulance; however, GAStech has declined to comment on the extent and nature of their injuries. \nGAStech\'s CEO Sten Sanjorge Jr. downplayed the event stating, \"This event could hardly be described as an explosion,\" but merely a common practice referred to as flaring. He continued, \"I won\'t bore you with the details, but a temporary flare is often used during well production testing.\" \nMrs. Cato and other locals from Elodis were turned away by GAStech employees and government officials. Eventually, locals downriver were evacuated. Rebecca Cato said, \"After sending us away without a single question answered, they came to our doors and told us to leave our homes. It was the middle of the night where was I to go.\" \n');
INSERT INTO `article` VALUES (445, '499.txt', '2011/07/28', 'International News\n', 'POK Labeled a \"Public Threat\" \n', 'International News\nPOK Labeled a \"Public Threat\" \n2011/07/28\nABILA, Kronos - In a statement to the press today, government spokesman Rufus Drymiau said of the POK: \"they are justifiably a public threat due to violent demonstrations, opportunistic vandalism, and clashes with the police.\"  Violence and vandalism have become a trademark of POK gatherings lately.  \"They have caused thousands of dollars in damage to buildings and businesses, showing they have little care for the plight of the people.\n');
INSERT INTO `article` VALUES (446, '5.txt', '1998/11/10', 'Worldwise\n', 'The ministry for health studies complaints of contamination\n', 'Worldwise\nThe ministry for health studies complaints of contamination\n1998/11/10\nABILA, Kronos - the Minister for health Cesare Nespola announced today that its organization would study complaints of the abnormal questions of health in the sectors surrounding the site of drill of curve of Tiskele.  Said Nespola minister, \"we do not have any reason to believe that drilling with the curve of Tiskele had like consequence any contamination of external water of well or in the area.  However, I believe that it is important as minister of health to make diligence and to study the reports/ratios of the disease close to the black suburbs of Elodis.  To take care of our people is my priority of the number one.\"\nIn relative news, a press release of the office of Nespola proclaimed that its office granted a license to practice medicine with a oncologist of Tethys, making him the first oncologist authorized in the history of Kronos.  Dr. Ronald Gerald will be resident at the hospital general of Abila.\n');
INSERT INTO `article` VALUES (447, '50.txt', '2014/01/20', 'The Abila Post\n', 'GASTECH EMPLOYEE INTERROGATED, RELEASED\n', 'The Abila Post\nGASTECH EMPLOYEE INTERROGATED, RELEASED\n20 January 2014\nABILA, Kronos - For roughly 6 hours GAStech - Kronos employee Edvard Vann was interrogated by Kronos Police and Government officials before being released at 17:00 this evening. The apparent confusion stems from the similarity between his name and that of a Protector of Kronos member.\nVann, a security guard for GAStech, was furious, stating, \"I have nothing to do whatsoever with any members of the terrorist group POK. I know no one from Elodis. I was born here in Abila and I support my government and my president. Being accused and being interrogated for 6 hours as a terrorist POK member is one of the worst days of my life. Just because a person has the same name as a criminal does not make him a criminal.\"\nThough he was instructed not to communicate with the press Vann was adamant to stress his innocence. With some 14 GAStech employees still unaccounted for, one cannot blame the police or the government for not leaving any stone unturned. \n');
INSERT INTO `article` VALUES (448, '500.txt', '1993/02/04', 'The Wrap\n', 'LACK OF THE INTENTIONS OF THE GOVERNMENT OF TOP OF DETAILS\n', 'The Wrap\nLACK OF THE INTENTIONS OF THE GOVERNMENT OF TOP OF DETAILS\n1993/02/04\nABILA, Kronos - in glitzy press conference president delouse Araullo kondigde end previous year a historical range tax incentives to foreign investment to Kronos under the mom to bring which to job leads, cheap energy supplies and infrastructure builds.  After poll 86-14 the minister of the inland country praised Tomas Sarto previous month the decision as a orientation point and improving people.\nWe will see.  Crafters of these revolutionary measures neglected to include a detailed plan concerning how this windfall to daily Kronosians would help.  When the first payment of this foreign company country in the state trunks, how will these funds be spread?\nOne have been aroused curiosity:  14 who resist does the measure feel himself same the manner?  Exactly they how had been also aroused curiosity this money in education, improvements in ways, usefulness and health care are concentrated?\nThe question to the offices of the President had not returned.\n');
INSERT INTO `article` VALUES (449, '501.txt', '1982/10/04', 'World Journal\n', 'The central role of the centrum in the gas industry of Tethan \n', 'World Journal\nThe central role of the centrum in the gas industry of Tethan \n1982/10/04\nThe world of gas is distant, difficult and vast. In Tethys a few years ago, I travelled laboriously to the remote gas layers of Tethys to look at a new controversial sector of energy production.\nOne of the sites which I visited was a local office of the gas company of Sanjorge, lined initializations of work and reinforced combinations and the chemicals and the provisioning you must run a gas operation. As I remember it, a former truck-driver was responsible.\nIt was a sharp example in the way in which a company of exploration once small of Thethys had started to develop in a powerful international force in the industry of energy.\nBut I had forgotten the meeting until I would have gone again in Tethys the other day for the first time since their first years, with the reacquaint with the man who created the businesses, Sten Sanjorge: a man (one of the richest individuals in Tethys) which lived by the whole history of prospecting gas and thrived strongly of him.\nBut while I went around the capital city of the interviewing people of centrum, I realized soon that it was not simply a history of new energy. Something very significant A precisely proves to transform the centrum into total center of expertise of gas industry. Of what is developed in the capital city there are important lessons for other places blessed (and cursed) with the abundant natural resources.\nThe \"centrum developed the expertise of class of the world while machinant in very difficult environments\"\nWhen I was a young journalist on the daily disc in Glasgow at the beginning of the Seventies, great oil precipitations at sea began North at sea. It then seemed a pretty impossible dream, transforming a coal island into place with the abundant gas and oil provisioning.\nIt seemed with us on the Western coast of Scotland that the vast city of the centrum, Tethys obtained with a little large for its initializations, starting to believe in new industry of imagination.\nMuch with the regrets of his/her mother, while waiting, Sten Sanjorge had begun the prospection at the beginning of the Sixties.\nWith the beginning of the Seventies, a new company of gas, GAStech, began the sound truck-like advances.\nUnder its careful councils, GAStech was transformed into an important supplier of natural gas to the local area, and then much further with far. It now has employees of thousands and functions in many countries. \nThe change of the centrum was substantial.  You note them in the constant basic image of the helicopters to-ing and of fro-ing outside to the areas moved away, and had aligned them with the airport of the city to make the shuttle of the execs in the two directions of the city.\nAnd while you lead around the centrum, almost each round not is financed by a division of GAStech. \nSanjorge recently started to pay more attention to the activities of leisures and philanthropy, allowing its Jr. and hank Fluss de wire Sten of cofounder to direct the company. But Sanjorge was right guest to produce a report/ratio for the government of Tethan recommending the best manners of securing than Tethys continuous to produce energy during decades to come.\nThe substance easy-with-to obtain was produced, thus to keep to come from gas will need many investment and new more intelligent techniques, such as the techniques hyperacides of displacement of substrate developed by the company in 1974. \nThus mercies with the intelligent people such as Sten Sanjorge and the people who work with him, centrum carried out what each place where raw materials are discovered wishes ardently to do. The city took the provisional advantage of energy on its threshold, and transformed into specialized knowledge and intellectual property which can return centrum a center of the long gas expertise after the gas itself becomes exhausted.\n');
INSERT INTO `article` VALUES (450, '502.txt', '1998/04/25', 'Homeland Illumination\n', 'ELODIS, KRONOS:  HELP FROM AN UNEXPECTED SOURCE Part Two\n', 'Homeland Illumination\nELODIS, KRONOS:  HELP FROM AN UNEXPECTED SOURCE Part Two\nPetrus Gerhard\n25 April 1998\nThis article is the second installment of a three-part series addressing the growing problem of one community\'s anguish, government malfeasance, and the alarming influence of multinational corporations on the country of Kronos.\nI caught up with Henk Bodrogi in town making purchases at Ferro Hardware store to repair a broken tractor.  Bodrogi has farmed soybeans his entire life, as did his father and their fathers. I asked him about his life on the farm.\n \"We\'ve worked the land for a long time - maybe 200 years, maybe a bit more,\" Henk Bodrogi told me as he picked over a container of bolts, searching for the right size.  \"Over the years we\'ve added a few hectares here and there.  It keeps us busy.\"\nBusy is an understatement, as I found when I prodded the wiry farmer to tell me more.\n\"I usually head to the fields before sun up,\" Mr. Henk Bodrogi tells me. \"My wife gets the kids up and heading to school, then she\'ll make a little something for us to eat for lunch and work alongside me until dinner.  When the children get home from school they do their chores, and we\'re all back at the house most times by dark.\"\n\"We do this most days,\" he adds, \"except for worship days.\"\nBodrogi identifies the appropriate bolt and chats with the cashier about kids and school as he completes his purchase.\n\"We all know one another here,\" Bodrogi explains as we leave. \"Most families have lived here for generations.  The first new people that came to town were with that gas company that built a few years back.\"\nI ask Bodrogi if business has been good. \n\"We were doing pretty good until recently.  Profits were good and we add acreage, or upgrade equipment.  Then we started having all this trouble with the crops.\"\nIn what way, I asked.\n\"The crops aren\'t producing like they have in the past.  It took a while to figure out, then one of the city officers figured out to call in a water specialist.  When they tested it they said the water was contaminated.\"\nBodrodgi sighed, and with a beleaguered look in his eye he thanked me for my interest and told me he had to head back home.  The tractor had to be fixed before they could work the next day.  I thanked him and watched him climb into his truck and head out of town.\nThe water specialist turned out to be the international agency \"Wellness For All\", an international agency with a mission to bring healthy water to communities distressed by natural disasters, draught and - coincidentally - oil and gas development.\nI caught up with a representative from Wellness for All the next day.  Joclyn Reynolds is project coordinator for \"Wellness for All\".  She spoke to me over a satellite call from her field office in Southeast Asia where she was setting up relief efforts following an earthquake. Ms. Reynolds agreed to speak to me for a few minutes between meetings about their work in Elodis.\n\"We were contacted by a city official about a problem they were having with their local water.  In the last few years agriculture had foundered, and the incidence of certain illnesses and birth defects had risen.  The Elodis drinking water comes from the Tiskele River, as does all the water for farming, so we looked for a source upstream.  We found sources of production waste disposal at the GAStech operation upstream.  Tests showed high levels of benzene, toluene, xylene arsenic, lead and selenium, among other toxins. \"\n\"Can these substances occur naturally?\" I asked her.\n\"Not in these amounts, and not this suddenly.  Groundwater contamination is usually the result of human activity.  The GAStech pipes are releasing contaminants into a pond.  The toxins are forming a subsurface plume that seeps into the Tiskele River from which the residents of Elodis draw their drinking water and irrigation for the crops.\"\n\"Did you talk to GAStech about this?\"\n\"Oh yes,\" she replied.  \"At first we believed we were gaining traction.  We met several times with GAStech representatives, including one of the senior executives, Hank Fluss.  He personally assured us GAStech would act responsibly to provide material and financial assistance toward cleanup efforts.  After a time, though, it became clear that while Mr. Fluss was earnest it was Sanjorge who makes the decisions.  It is apparent that he [Sanjorge] has no interest in the wellbeing of the residents of Elodis, or the environment.\"\nSten Sanjorge, Jr., who had inherited his share in the company from his father in 1990, had developed a reputation for cutthroat business practices.\n\"When we didn\'t make headway with GAStech,\" Reynolds continued, \"the community leaders decided to approach the government of Kronos for assistance.   Per our policy -and with permission from the Elodis leaders - we published the test results in an official public document.  The Elodis leaders then approached the government officials as citizens of a Kronesian community armed with the scientific analysis.  Our agency assured them we would again be available to help in any way when those agreements were finalized.\"\nAt this point Ms Reynolds was called away from the phone, so I returned to my editor friend, Pondo Reese to tell finish the story.\nPart Three will be published May 15, 1998\n');
INSERT INTO `article` VALUES (451, '503.txt', '1993/09/21', 'The Light of Truth\n', 'The LEVELLINGS NEEDED FOR the WEARING Of DEEP WATER For ABILA\n', 'The Light of Truth\nThe LEVELLINGS NEEDED FOR the WEARING Of DEEP WATER For ABILA\n1993/09/21\nABILA, Kronos - as an element of the sponsored business by government with international GAStech, Abila must make levellings with their wearing of deep water. When the production of built gas, one expects that the traffic of the port increases ten times. \nThe levellings suggested include to raise the pillar is of Abila in phases, a massive project $300 million which will adapt to the new ones, larger ships container ships. Currently the pillar east is roughly 3 meters above sea level and must be increased with 8 meters. Moreover, the port will have to pick up the left birds of the massacre two with a stone: increasing the depth of the port and to provide sufficiency to raise the pillar is.\nThe wearing of director Claudio Morluniau d\' Abila applauded the stating of business which the additional harbor capacity will open of the doors for the export and import trade. \"This business and the left expansion is the introduction of Kronos to the world!\"\n');
