INSERT INTO `article` VALUES (460, '511.txt', '2001/09/01', 'News Online Today\n', 'POK MEMBERS ARRESTED \n', 'News Online Today\nPOK MEMBERS ARRESTED \n2001/09/01\nELODIS, Kronos - Government heavies obstructed the free speech - yet again - of members of the activist group Protectors of Kronos yesterday at a lawful demonstration at the Tiskele Bend fields.  The five POK activists had gathered in front of the gates to GAStech gas drilling operations facility to bring public awareness about the polluted Tiskele River which has caused health problems to the residents of Elodis.   \nAn eyewitness told the Homeland Illumination that when the gates opened to allow GAStech company vehicles to exit the facility the protesters moved aside.  \n\"It was all very civil up till then,\" Griffith Mabel, an Elodis resident who had come out to support the POK told reporters.\n');
