INSERT INTO `article` VALUES (462, '513.txt', '2013/10/22', 'The Continent\n', '2013/10/22\n', 'The Continent\n2013/10/22\nInterpol has announced the shaping of new multi-country a working party to fight the more and more broad distribution of cathinone of drug methyl dimethyl (MDMC).  The heading the working party is higher inspector Robert Loblaw, a veteran civil servant who led the very successful team of Tethys Counterdrug.  He is optimistic that he can identify the source.\nThese designer drugs have certain indications concerning their origin, Loblaw told The Times in a conversation.  Each time the recipe is changed, it leaves indications concerning which it made.  It is as a pedigree.\nThis certain mixture of the drug MDMC, which also by its street names are known cotton suikergoed, kruiddromen and the Bloesem of the Tulp, was found in Asteria but its manner to the streets of Tethys and other international countries has earlier only made.\nI rapidly the activities of the army of people will examine Asterian, aforesaid Loblaw.  Our previous researches aimed to them as a source of this certain formulation.\nThe army of people Asterian (APA) is paramilitary organization which has been busy with terrorist activities which are financed by its criminal ventures, which include drug trafficking.  The last years their mark has had APA by Internet sites and publication of professional, hoogstaand illustrated magazine to build called Arise.\nThe higher inspector Loblaw says to public statistics Tethys indicates on MDMC a growing problem with the youth of the country is.  An increase of mental health problems, including hallucinations and paranoia, which has been accompanied of violent behavior and a clear increase of suicide tariffs is only some of the indicators of the use of this designer drug.\nAs first step we have port civil servants for on the expectancy for suspected sendings of insecticides and detergens, both similar in verschijning to have alarmed to MDMC.\n');
INSERT INTO `article` VALUES (463, '514.txt', '2009/02/22', 'International Times\n', 'Kronos\'s Protectors of Kronos declared \'terrorist group\'\n', 'International Times\nKronos\'s Protectors of Kronos declared \'terrorist group\'\n22 February 2009\n<<Deleted image: POK has held numerous demonstrations in Kronos\'s capital of Abila>>\nContinue reading the main story	\nThe government of Kronos has declared the Protectors of Kronos a terrorist group after blaming it for a deadly attack on police headquarters earlier this week.\nSeveral of its supporters have been arrested in a crackdown.\nA POK leader vowed that protests would continue.\nGovernment spokesman Rufus Drymiau announced the move, which will give the authorities more power to crack down on the POK.\nHe said that those who belonged to the group, financed it or promoted its activities would face punishment.\nContinue reading the main story	\nThe Protectors of Kronos\n    Kronos\'s oldest and largest environmental activist organization\n    Founded in 1997.\n    Influenced by international groups such as Wellness for All\n    Mixes political activism with environmental work\n    Rejects use of violence and supports democratic principles\n    Slogan: \"Justice for Juliana\", a reference to a 10-year old Kronosian girl who died as a result of government sponsored environmental contamination \nThe decision was in response to Tuesday\'s bombing of a police headquarters in Abila, he said.\n\"Kronos was horrified from north to south by the hideous crime committed by the POK,\" Mr. Drymiau said.\n\"This was in context of dangerous escalation to violence against Kronos and Kronosians and a clear declaration by the POK that it knows nothing but violence.\n\"It\'s not possible for Kronos the state nor Kronos the people to submit to the POK terrorism.\"\nKronos would notify Tethys who had signed a 1998 anti-terrorism treaty of the decision, he added.\nPOK supporters\nThe POK has denied being responsible for the attack, and accused the Kronos government of staging a frame-up to silence the groups concerns for the people.\nA POK member told the Times that the government\'s decision was \"illegitimate\".\nHe added: \"The protests will continue, certainly.\"\n');
