INSERT INTO `article` VALUES (485, '534.txt', '1994/09/24', 'News Online Today\n', 'GASTECH\'S EXPANSION REACHES THE SHORES OF KRONOS \n', 'News Online Today\nGASTECH\'S EXPANSION REACHES THE SHORES OF KRONOS \n1994/09/24\nABILA, Kronos - The groundbreaking today at the Tiskele Bend site marks another flag planted in foreign soil by GAStech International. Conservative estimates of preliminary test well results place the Tiskele Bend field at least on par with the largest of GAStech\'s Tethan fields.\n');
INSERT INTO `article` VALUES (486, '535.txt', '2014/03/26', 'The Continent\n', 'The insight of an expert: thriving as foreign CEO in Kronos \n', 'The Continent\nThe insight of an expert: thriving as foreign CEO in Kronos \n2014/03/26\n17 January 1995\nThe strict Fluss are CEO of GAStech, the important industry of Krono more than 15 years, after its discovery of its immense gasvelden near the city of Elodis.\nFluss, have worked with dozens of foreign CEOs in the course of the years. However, he has records beginning as oil and gasprospector in Tethys. \nHe spoke to The Times concerning the appetites of a successful LEADER in Kronos and which foreign CEOs in the market can expect. \nQ: What is possible foreign CEOs when they to Kronos expects come?\nA: The economic environment has changed for the eighties. It is succeed much today more with difficulty. Foreign need CEOs their minimize expectations. There are easily none wins in Kronos. The competition under Kronosian and foreign firma\'s is tough. It is difficult the harten and win the opinions of the population.\nBut there is less difference than people between culture Kronosian think and, culture says Tethian. The staff work of Kronos like only hard, is they respectful of their work and has same the wish for success. They know also it how at to appreciate efficient communication and a gifted LEADER.\nWhat a foreign LEADER must do is learns how at to communicate Kronosian to the manner and time to demand to understand their staff.\nQ: Can you develop?\nA: There are a lot of cultural differences in communicating. [Think] after memoranda. Foreign CEOs have been always confused and frustrated when they send a memorandum [to someone in Kronos] and simple ja/nee expect answer. In place of it they become a very long answer to that their initial question does not answer.\nPeople of Kronos love the no responsibility to take. They are do be scared to lose their job and do not love in saying something are forced they to wants. Foreign need CEOs this take into account and the time to have demand to understand how at to communicate.\nPatience is very important. Transparency can be an excellent get manner around this. It is a European value that Kronosians to very receptive is. Imposing in a company can turn foreign CEO into the travel in Kronos a more pleasant experience.\nQ: What are the most important challenges foreign CEO can on arrival in Kronos under eyes see?\nA: Sometimes it is the simple things that can be the challenge, such as getting A to B in a taxi. Are able round to be easily taken for granted and cannot do cre√´rt this a large meaning of uncertainty. In Kronos are you never certainly as your driver you on the planned address sale. This is possible if a small question seems but on a daily basis it is very tiring.\nAnother get to know your team and which you work with. Frequently foreign CEOs staprecht of the plane and in an office peak of employees Kronos. They have no idea that they are, how they work or how qualified they are. This can be confusing. \nThe need of CEOs demand the time to speak for their staff, of the administrators for the truck drivers and their new environment to understand before they try and them lead.\nQ: Can you give a couple ends on how foreign CEO can preparations make?\nA: The first thing which I am your prepare family would say. They can find it difficult to adapt to the new work surroundings. This can influence it personal life. Mixing family and the work is here very common practice. People of Kronos work overtime and socialiseren with their colleagues it is very differing from Tethys where there is a clear border between the work and family.\nForeign CEOs also must realize how tough are the competition and how much hard work must be introduced to succeed -- frequently much more than in their birth country. The language is a large question.\n[But] no question how much you prepare, real experience will surprise in Kronos to work and live you always.\nQ: How difficult - or easy - is it for foreign CEO in Kronos to be?\nA: Generally, think I am CEO hard am. There is a lot very, is the environment tough and it is difficult find a balance with your personal life.\nWhen a team hears Kronos that CEO come assume from overseas she is it a problem. But culturally they have no question with aliens. \nQ: There are situations in which it are a foreign staff employee in fact an advantage is?\nA: This question depends really on the person and how much they invest to understand the country and culture. If they make no effort then to localize is it a net disadvantage. But in certain negotiations or certain questions such as luxegoederen, foreign CEOs can be an advantage. They can bring to a another view, the process to facilitate.\nSometimes foreign CEO better knowledge of the industry have and can access to markets overseas bring. This can be real assets.\n');
INSERT INTO `article` VALUES (487, '536.txt', '2014/01/21', 'The General Post\n', 'DEMANDS OF THE RESCUE DONE IN THE KIDNAPPING OF GASTECH\n', 'The General Post\nDEMANDS OF THE RESCUE DONE IN THE KIDNAPPING OF GASTECH\n2014/01/21\nAVILA, Kronos - the protectors of Kronos not only have taken the responsibility from the kidnapping of the international employees of GAStech, but also they have made a demand of the rescue of $20M of the president and the CEO Sten Sanjorge, Jr.\nAccording to the disclosed thing yesterday, it was speculated that Sanjorge, Jr was the target of the kidnapping; nevertheless, Sanjorge, Jr are safe posteriora part in Tethys.\nThey founded the group of the kidnapping, the protectors of Kronos, in 1998 in Elodis, a rural municipality outside capital Avila. They have been protesting for the clean water, human rights, and against the corruption of the government of international Kronos and GAStech. They have done more and more does violence to with its protests that were incumbent in the uproars, bombings of the fire, vandalism, and sacking. \n');
INSERT INTO `article` VALUES (488, '537.txt', '2014/01/20', 'Homeland Illumination\n', 'VOICES - a blog about what is important to the people\n', 'Homeland Illumination\nVOICES - a blog about what is important to the people\nMaha Salo\n20 January 2014\n1049 - We still have no information about the evacuation of the GAStech building.  There are no signs of smoke or flame, and officials are not answering questions.  Firemen have entered the building - as many as a dozen in full turnout gear. 20 Jan 2014');
INSERT INTO `article` VALUES (489, '538.txt', '2013/06/22', 'Worldwise\n', 'Annual ends of gathering of POK in the riot, still\n', 'Worldwise\nAnnual ends of gathering of POK in the riot, still\n2013/06/22\nABILA, Kronos - the members of POK held their annual demonstration in Abila yesterday.  A crowd larger than usual met in front of the building of capitol, undulating of the signs holding the images of Elian Karel and Juliana Vann, which were painted like POK \"martyrdoms\".  Crowd sang about the corruption of government and claimed President Dorel Kapelou to bring back.  Several protestateurs carried signs claiming an end \"to the capitalism of exploitive corporation of Tethys\" and pleading, \"GAStech poisoned our children\".  \nThe police force and the forces of safety of government established between the protestateurs and the building of capitol in an exposure of the force, hoping to prevent the kind of chaos which occurred during the riot of last year.  However, after several hours of the song and the speeches, hardenings in crowd widened and the protestateurs precipitated the line of police force.  The police force was forced to employ teargas, the pepper jet, the guns of water, and the rubber balls to subject crowd and to protect the property.  In spite of their heroic efforts, the protestateurs managed to break some windows, damage several vehicles of police force, and wound three leaders.  \n');
INSERT INTO `article` VALUES (490, '539.txt', '2014/01/20', 'Tethys News\n', 'To break off itself: The emergency to GAStech quarters the construction [modernizations]\n', 'Tethys News\nTo break off itself: The emergency to GAStech quarters the construction [modernizations]\n20 January 2014\nModernization, 10:30:  The fire unit of Abila answers to the alarm.  The National Fire Departments are seen to enter in the construction.');
INSERT INTO `article` VALUES (491, '54.txt', '2012/08/22', 'The Abila Post\n', 'WHO ARE THE PROTESTERS \n', 'The Abila Post\nWHO ARE THE PROTESTERS \n22 August 2012 \nABILA, Kronos - With the third anniversary of Elian Karel\'s death approaching - former member of the Protectors of Kronos - the question is: who are the protesters? But not only who are they, what and why are they protesting? \nThe Protectors of Kronos or POK were founded in 1997 by residents of rural Elodis on the advice of the now defunct Wellness for All (WFA), an international water safety group. The POK was initiated to bring attention to the clean water issues surrounding Elodis to the Government of Kronos and the world. The POK asserts that GAStech International\'s Tiskele Bend natural gas drilling site is the source of both the contamination of drinking water as well as the destruction of the traditional farmland surrounding Elodis. \nIn 1998, WFA performed testing on the water of Elodis finding high levels of benzene, toluene and xylene arsenic, barium, chromium, lead and selenium. The testing a subsequent statement released by WFA brought international attention and pressure on the government and GAStech to act. However, with the fragmenting of WFA due to funding issues, the POK\'s demands were largely ignored and downplayed. \nAlso in 1998, Juliana Vann, a previously healthy ten-year old girl died of a lingering illness, which WFA-funded doctors claimed was caused by water contamination. The Government of Kronos officially refuted the claim citing the fragmentation of the WFA organization as evidence of an unreliable source not to be trusted. Regardless, Juliana became the POK\'s first martyr and has used Juliana\'s image on campaign literature ever since. \nThe POK\'s second major martyr is Elian Karel, who died in 2009 while incarcerated of undetermined causes. The POK asserts he was arrested on trumped up charges while the Government of Kronos contends he was a radical and violent activist engaged in tax evasion. Karel had been involved with the POK since its inception given that his father, Jeroen Karel, was an original member.  Elian Karel\'s death in 2009 was marked by spontaneous instances of protest around Abila. The anniversary of his death, June 19, has seen additional protests, demonstrations, riots, and violence. \nThe POK has evolved from peaceful protests and demonstrations demanding government action to more violent activities including riots as they claim that the government has done little to nothing in addressing the contamination, poisonings, and deaths suffered by their people. As of 2011, the Government of Kronos has labeled the POK as a \"public threat\".\n');
INSERT INTO `article` VALUES (492, '540.txt', '2014/01/20', 'Kronos Star\n', 'Breaking: Emergency at GAStech Headquarters Building [Updates]\n', 'Kronos Star\nBreaking: Emergency at GAStech Headquarters Building [Updates]\nCato Rossini, Marcella Trapani\n20 January 2014\nUpdate, 11:55 PM:  Abila Fire Captain Federigo Accardi announces that it was a false alarm and the building is safe.  In response to reporter\'s questions, Captain Accardi says GAStech employees made no report of a bomb threat to his agency.');
INSERT INTO `article` VALUES (493, '541.txt', '2012/06/21', 'Kronos Star\n', 'Kapelou Calls POK \"A Gang of Criminals\"\n', 'Kronos Star\nKapelou Calls POK \"A Gang of Criminals\"\nEva Thayer\n21 June 2012\nABILA, Kronos - In a press release today, President Kapelou today called the POK \"a gang of criminals, thugs, and malcontents who have become a pestilence to our peaceful way of life.\"  President Kapelou\'s comments come after a POK demonstration turned into a large-scale riot throughout the government sector of the capital on Tuesday.  President Kapelou has called for increased police patrols of the Elodis area and has said that all future POK demonstrations will be \"met with maximum police force.\"\n');
INSERT INTO `article` VALUES (494, '542.txt', '1996/03/14', 'News Online Today\n', 'Tiskele Bend Gas Fields Larger Than First Thought \n', 'News Online Today\nTiskele Bend Gas Fields Larger Than First Thought \n1996/03/14\nABILA, Kronos - A press release from the Ministry of Interior today announced that the Tiskele Bend gas fields could be as much as 5 times larger than originally estimated.  When we contacted Minister Sarto\'s office for comment, he said, \"We were astounded by the results of GAStech\'s recent survey of Tiskele Bend.\n');
INSERT INTO `article` VALUES (495, '543.txt', '1995/10/12', 'The General Post\n', 'MAGNIFICENT OPENING GASTECH-KRONOS\n', 'The General Post\nMAGNIFICENT OPENING GASTECH-KRONOS\n1995/10/12\nAVILA, Kronos - with his flash of the registered tradename, Sten Sanjorge, president of the Jr of international GAStech it opened the new headquarters of GAStech-Kronos. The tape was cut with an enormous pair of the scissors, matched of size only by the smile of Sanjorge Jr \'s. \n50 million price tags in the Dollars for the new headquarters are right a drop in the bucket for GAStech. The gas field in the production outside Avila has exceeded even the expectations great size of Sanjorge, having paid the building often above. \nThe present in the ceremony of the cut of the tape was several representatives of the government of Kronos. \n');
INSERT INTO `article` VALUES (496, '544.txt', '2001/08/31', 'News Online Today\n', 'Activists Disrupt Traffic Near Tiskele Bend Fields \n', 'News Online Today\nActivists Disrupt Traffic Near Tiskele Bend Fields \n2001/08/31\nABILA, Kronos - Five young people were arrested yesterday for protesting near the entrance to the Tiskele Bend fields as they called for government action to address their environmental concerns about GAStech\'s operations at the site.  The protestors, members of the activist group \"Protectors of Kronos\", held signs reading: \"Drilling Poisoned Our Water\" and \"Remember Juliana\", referring to 10 year old Juliana Vann, who has become an icon for the Protectors of Kronos since her death in 1998.\n');
INSERT INTO `article` VALUES (497, '545.txt', '1997/04/24', 'News Online Today\n', 'POSSIBLE CONTAMINATION IN ELODIS  \n', 'News Online Today\nPOSSIBLE CONTAMINATION IN ELODIS  \n1997/04/24\nELODIS, Kronos - About 25 km West of Abila is the small rural township of Elodis, situated on the Tiskele River. Roughly 20 km upstream is the Tiskele Bend site operated by GAStech International on government-owned land.\n');
INSERT INTO `article` VALUES (498, '546.txt', '2004/05/31', 'The Orb\n', 'DOCUMENTARY CARD OF PUBLIC HEALTH Of ELODIS 2004\n', 'The Orb\nDOCUMENTARY CARD OF PUBLIC HEALTH Of ELODIS 2004\n2004/05/31\nELODIS, Kronos - the center of health of the Community of Elodis published an update with health for all the study carried out in 1998.  The death rate and the incidence of the chronic disease increased more than 252% of the former years.  The detailed report/ratio will be announced soon on the municipal Web site of Elodis.\n');
INSERT INTO `article` VALUES (499, '547.txt', '1995/11/21', 'International News\n', 'Araullo Announces New Hospital Construction \n', 'International News\nAraullo Announces New Hospital Construction \n1995/11/21\nABILA, Kronos - President Araullo announced today that his government is planning the construction of a new, modern Abila General Hospital.  The old Abila General Hospital, built in 1930, has outdated health care facilities and has suffered numerous electrical fires in the past decade.  Hospital Administrator Torsten Trucco lauded the government\'s action saying, \"We\'ve been trying to get funding to update our facilities for years, to no avail.  Additionally, it will have a full emergency services area, trauma and burn care units, a psychiatric care wing, and four ultra-modern surgical suites.  In his announcement of the new construction, Araullo said, \"Our strategy of courting foreign investment is paying great dividends.  This new hospital is the first of many projects we plan to pursue to help upgrade our standard of living and modernize our lifestyle.\"\n');
INSERT INTO `article` VALUES (500, '548.txt', '2011/07/27', 'Kronos Star\n', 'POK Labeled a \"Public Threat\"\n', 'Kronos Star\nPOK Labeled a \"Public Threat\"\nEva Thayer \n27 July 2011\nABILA, Kronos - In a statement to the press today, government spokesman Rufus Drymiau said of the POK: \"they are justifiably a public threat due to violent demonstrations, opportunistic vandalism, and clashes with the police.\"  Violence and vandalism have become a trademark of POK gatherings lately.  \"They have caused thousands of dollars in damage to buildings and businesses, showing they have little care for the plight of the people.  President Kapelou will not let their mayhem continue unchallenged,\" said Drymiau.  \n');
INSERT INTO `article` VALUES (501, '549.txt', '2012/03/09', 'News Online Today\n', 'THREATS ISSUED BY POK \n', 'News Online Today\nTHREATS ISSUED BY POK \n2012/03/09\nABILA, Kronos - Letters purported to be from the Protectors of Kronos (POK) have been received by Vincent Kapelou, Minister of Health and nephew of President Kapelou.\n');
INSERT INTO `article` VALUES (502, '55.txt', '2014/03/26', 'Daily Pegasus\n', 'INFLAMMATION OF THE PROTESTS IN ABILA IN ANSWER TO CALLS TO THE ACTION\n', 'Daily Pegasus\nINFLAMMATION OF THE PROTESTS IN ABILA IN ANSWER TO CALLS TO THE ACTION\n2014/03/26\n7 of September of 2012\nABILA, Kronos - the thousands of people aligned the ways Thursday in an exhibition of solidarity antigovernment.\nBetween the demonstrators it was Mestache Vardshvna, 23, of the coast of the west of Kronos.   \"We are trying to obtain the attention of our government,\" he said.  \"This is important, so I took time extinguished from the work to be a part of this important event.\"\nIt was one of whom they handled his energy of the free speech to express his preoccupation with the present deficiency of the transparency of the government with the money public.\n \"They need to be found out that we know what is doing,\" added Vardshvna.  \"You cannot as soon as to rob our money and to think she can obtain to him far with him.\"\nThe posters with colorful images of Elian Karel and Julian Vann were reminders of the heavy toll already paid by the leaders and innocents.    Its death, thought to be a murder by many, urged annul meetings to bring the message of the protectors of Kronos to the public.  Julian Vann died in 1998 of the cancer caused by environmental toxins in its potable water.  It finished giving return to ten years.\n');
INSERT INTO `article` VALUES (503, '550.txt', '2007/03/18', 'International Times\n', 'Four people have died in a fiery road crash near Elodis \n', 'International Times\nFour people have died in a fiery road crash near Elodis \n18 March 2007\nA nine-year old boy initially survived the crash and had been flown to Abila Children\'s Hospital, but was declared dead on arrival. \nPolice say they have a 25 year old truck driver in custody at the Elodis jail.\nOfficers say a car burst into flames after colliding with a GAStech truck on Calistermi Road just before 9AM (KDT).\nA Kronos disaster victim identification team was sent to examine the wreckage.\nAssistant Police Commissioner Adian Koppolis described the scene as \"horrific\".\nHe said the nine-year old boy was found wandering around the accident site.\n\"It\'s tragic that no one ultimately survived.  The roads out here can be treacherous when you are not constantly vigilant while driving,\" he said.\nHe noted that the truck passed into the intersection when the car had the right of way.  \n');
