INSERT INTO `article` VALUES (505, '552.txt', '1993/09/20', 'The Truth\n', 'The facilities to promote of the port\n', 'The Truth\nThe facilities to promote of the port\n1993/09/20\nABILA, Kronos - the minister of the inland country Sarto kondigde today to a government treats the Tethys company international GAStech of the energy development, brokered to promote Abila the port.  GAStech have corresponded $200 millions to the costs of the port improvements for preferential situating their gasterminal at the new port in ruil for that and suspended coughing up prices 100 contribution years.  The minister Sarto explained the agreement of the port extension to since be first of a lot of rewards which must be harvested by Kronos we our large country for foreign investment. have opened\nIn March, the government GAStech knew exclusive rights to the government had orders of bending to Tiskele, the largest undeveloped gasstorting in Europe. The company representatives of GAStech in Tethys explained this port agreement win-win for both us and Kronos were and very it is important to opening up the complete potential of the areas of bending Tiskele.\n');
INSERT INTO `article` VALUES (506, '553.txt', '2013/12/16', 'Worldwise\n', 'Attack of POK in Abila organizes\n', 'Worldwise\nAttack of POK in Abila organizes\n2013/12/16\nABILA, Kronos - to maintain to the order the spokesman that Adrien Carmen informed the media today that the members of the POK attacked police force early patrol in Abila this morning.  The gangsters of POK crawled upwards on two leaders of patrol who sat down in their vehicle and attracted in an ambush the men, striking the windows of their car and trailing them out of the vehicle in the street.  The leaders were beaten, then attached and left in the trunk of their vehicle.  The criminals then proceeded to disfigure the car with jet-painted logos of POK.\n\"To attack police force property of government of leader and to destroy are serious crimes,\" Carmen known as.  \"I want to ensure the public which these men will be caught and brought to justice soon.\"\n');
INSERT INTO `article` VALUES (507, '554.txt', '2009/06/20', 'All News Today\n', 'ELIAN KAREL DEAD IN KRONOS JAIL \n', 'All News Today\nELIAN KAREL DEAD IN KRONOS JAIL \n2009/06/20\nABILA, Kronos -Elian Karel, age 28, died Friday while unlawfully incarcerated at the Abila City Prison.  Karel was being held on fraudulent tax evasion charges after his arrest on March 12 earlier this year.  What I can tell you is that when I left Elian yesterday after meeting with him in the prison he was in excellent health and good spirits.  He was expecting to be released in the next few days and return to his work with the Protectors of Kronos, and was excited to continue the Protectors of Kronos mission to which he dedicated his life.  I can assure you that Elian\'s death will be investigated with all the resources at our disposal and those responsible will be brought to justice.\" \nKarel, from Elodis, had been involved with the POK mission since he was young.  He was only a few years older than Juliana Vann, a friend who died in 1998 of toxin poisoning caused by illegal dumping from the Tethyn company GAStech.  \nCalls to the President\'s office, the office of the Minister of Justice and the office of the Chief of Police were not immediately returned.\n');
INSERT INTO `article` VALUES (508, '555.txt', '2014/01/20', 'The Abila Post\n', 'ON THE SCENE BLOG\n', 'The Abila Post\nON THE SCENE BLOG\nBy Haneson Ngohebo\n20 January 2014\n1732 UPDATE - Much of the information gathered from the GAStech employees who have been allowed to leave by police investigators point to a kidnapping of several GAStech employees. However, officials still have not confirmed a kidnapping has taken place. The number of missing employees is undetermined at this time given the earlier confusion with the false fire alarm.\nThere is some indication that the Protectors of Kronos - an activist group responsible for many recent demonstrations and riots in and around Abila - are suspected of being responsible for the kidnapping. If true, this is an alarming escalation of violence for the activist group.');
INSERT INTO `article` VALUES (509, '556.txt', '2014/01/21', 'Homeland Illumination\n', 'VOICES - a blog about what is important to the people\n', 'Homeland Illumination\nVOICES - a blog about what is important to the people\nMaha Salo\n21 January 2014\n1016 - A GAStech spokesman just announced that CEO Sten Sanjorge is not among the missing GAStech employees, and has returned to Tethys.  We can assume that he was a passenger on one of the private jets that left Abila airport yesterday. 21 Jan 2014');
INSERT INTO `article` VALUES (510, '557.txt', '2014/01/20', 'The Abila Post\n', 'ON THE SCENE BLOG\n', 'The Abila Post\nON THE SCENE BLOG\nBy Haneson Ngohebo\n20 January 2014\n1020 UPDATE - People streamed out of the GAStech - Kronos headquarters about 5 minutes ago. There seemed to be much confusion and given the large corporate gathering today, this writer has doubts that it was a fire drill. Perhaps an actual fire or a bomb threat could have caused the evacuation.');
