INSERT INTO `article` VALUES (512, '559.txt', '2013/12/16', 'The World\n', 'HUGE IPO MAKES SANJORGE BILLIONAIRE\n', 'The World\nHUGE IPO MAKES SANJORGE BILLIONAIRE\n16 December 2013\nCENTRUM, Tethys - President and CEO of GAStech International Sten Sanjorge, Jr. can add another description to his name: billionaire. And not only a billionaire, nearly a billionaire two times over as GAStech International sold shares in an initial public offering.\nGAStech International, founded in 1961 as Sanjorge Trucking by Sten Sanjorge, Sr., produces about 5 million cubic meters of gas daily at its GAStech - Kronos drilling site Tiskele Bend. \nAs for the particulars of the filing: Sanjorge Jr.\'s 51% stake in the company is worth $1.96 billion; Beatriz Fluss\' (widow of company co-founder Hank Fluss) 33% stake is worth $1.27 billion. \nDon\'t feel sorry for the GAStech - Kronos executives. The filings show that the GAStech - Kronos executives earned a collective $327.25 million from the newly vested shares including $96.25 million each for CFO Ingrid Barranco, CIO Ada Campo-Corrente, and COO Orhan Strum. Environmental Safety Advisor Willem Vasco-Pais also earned $38.5 million. \n');
