INSERT INTO `article` VALUES (514, '560.txt', '2009/05/17', 'The Light of Truth\n', 'GASTECH ADOPTS THE NEW LOGO\n', 'The Light of Truth\nGASTECH ADOPTS THE NEW LOGO\n2009/05/17\nCENTRUM, Tethys - with international president and PRESIDENT Sten Sanjorge de GAStech of large brass band, Jr. the new logo of the company indicated, part of the process rebranding of the company. \nDuring, the spoke conference Sanjorge press of Jr. new logo - a non luminous flame of tripartite which east r√©miniscent of a sheet \"to help the GAStech position and its products like clean fuel alternative.\" It also put in reference that the flame of tripartite represents the past, present, and the future of the company in that by keeping \"an eye the past where we know where we came - our humble beginnings; an eye the future we will know where we go - our next success; and the two feet planted in the present we will be proactifs in never-changing, competing industry.\"\nIn conclusion, Sanjorge, Jr. GAStech \"the non luminous flame affirmed that international is a durable beacon of the environmental responsibility, and an advancing symbol of the clean businesses of energy.\" \nThis rebranding the logo of process and new seem to be in response to the recent trouble that the multinational gas giant had fought with in Kronos including/understanding the protest of February 19 to the registered offices of GAStech - of Kronos of 200 people who blocked the entry with the building, having for result several arrests. The protest and others in and around Abila, the capital of Kronos, were in response to the pled questions of contamination of water and to a lack of response of government and GAStech.\nSten Sanjorge, Jr. refused to directly present its observations on questions concerning of the protests and the contamination of the environment. It guided, \"is today a splendid day for GAStech. I will not let the day be run off the line by nonfounded, limits libelous, allegations.\" \n');
INSERT INTO `article` VALUES (515, '561.txt', '2009/03/14', 'The Truth\n', 'The LEADER Karel Arrested of the activist for Belastingontwijking\n', 'The Truth\nThe LEADER Karel Arrested of the activist for Belastingontwijking\n2009/03/14\nABILA, Kronos - the police force Kronos arrested today Elian Karel on charges of belastingontwijking.  Karel, the LEADER of the activist group guards Kronos, led a meeting with its verdedigers then he were arrested.  Karel tried slightly of the situation make, but are partisans had been clearly involved concerning the seriousness of the charges which are levelled against him.  Lawyer of Karel, Michale Kraft, released a declaration explanatory that the charges were against its customer false and that he hoped have Karel delivered of police force preservation at the end of the week.  In reply to the declaration of Kraft, the spokesman Adrien aforesaid Carman of the police force, I think M. Kraft the seriousness of the situation of its customer. has underestimated it is clear that Elian Karel, which claim have the interests of people of Kronos at heart must explain to our why he refuses contribution to the well-being of its nation.\n');
