INSERT INTO `article` VALUES (518, '564.txt', '1984/05/03', 'World Source \n', 'Shale gas pioneer plans world\'s first offshore wells in Mediterranean Sea  \n', 'World Source \nShale gas pioneer plans world\'s first offshore wells in Mediterranean Sea  \n1984/05/03\n<<Deleted Image: Anti-offshore drilling protester.  Exploration has proved a controversial issue in Kronos>> \nContinue reading the main story  \nThe son of the founder of gas firm GAStech is planning a venture to drill in the Mediterranean Sea, the Times has learned. believes there are large volumes of offshore gas that could be extracted. \n\"Certainly offshore gas isn\'t a new concept, but there\'s no reason with the Kronosian history of offshore development that we can\'t develop these resources offshore,\" he told the Times. \nShale gas is extracted using the controversial technique of hyper-acidic substrate removal which involves injecting acidic chemicals shale layers, to break them up and release the natural gas trapped within. \nHyper-acidic substrate removal has produced vast quantities of gas and oil in the West, transforming the energy market. \nSanjorge says it will be a short time before we know if offshore shale gas can be exploited. \nBased on existing geological data, SanJorge believes that a considerable quantity of gas is in place - up to 100 trillion cubic feet, which would be more than GAStech\'s estimates for its onshore resources. \nGAStech has estimated that the Kronos total offshore shale gas resources could be between five and 10 times the size of the resources available onshore. \nThough it has only recently become controversial, hyper-acidic substrate removal has been used on a smaller scale for many years, to improve the flow from conventional oil and gas wells. But using the process on the large numbers of wells needed to extract offshore shale gas commercially has never been done. \nProfessor Oskar Wertz of Tethys University is sceptical about whether offshore shale gas could be a big contributor to European energy in the next decade, but says that it could have potential in the longer term. \n\"GAStech is being optimistic is its estimates of how long it will take to explore offshore shale. It\'s perfectly plausible that in 20, 30 or 40 years, the hyper-acidic substrate removal technology will have so advanced and the way in which we deal with the offshore environment will have so advanced that this could be a really big industry.\n');
INSERT INTO `article` VALUES (519, '565.txt', '2009/02/19', 'Central Bulletin\n', 'GASTECH HEADQUARTERS BLOCKED BY POK \n', 'Central Bulletin\nGASTECH HEADQUARTERS BLOCKED BY POK \n2009/02/19\nABILA, Kronos - A POK rally designed to bring attention to claims of environmental damage have done more damage to their image. The rally outside of GAStech International\'s headquarters resulted in multiple arrests for trespassing. \nAbout two hundred people gathered in front of the GAStech building chanting slogans and waving signs that held the visages of people who have allegedly died due to environmental contamination.  Ten of the protestors chained themselves to the doors of the building in an attempt to prevent GAStech employees from going to work. \nPolice spokesman Adrien Carman said, \"We allowed the group some latitude with their rally, but when GAStech complained that the protestors were blocking entrance to their building, we had to take action.  The last thing we wanted to happen was for a GAStech employee to get hurt by the crowd just because he was trying to go to work.\"\n');
INSERT INTO `article` VALUES (520, '566.txt', '2009/08/12', 'News Online Today\n', 'NO PROGRESS ON INVESTIGATION OF POK LEADER DEATH\n', 'News Online Today\nNO PROGRESS ON INVESTIGATION OF POK LEADER DEATH\n12 August 2009 \nABILA, Kronos ¬ñ When the official coroner¬ís report was released last month about the death of POK leader Elian Karel there was no mention of the wounds observed on Karel¬ís body by eyewitnesses.  The official cause of death is sudden cardiac arrest.    It looks like the death of Karel will be swept under the same rug that hides the graft and corruption that has increasingly plagued our country for the last several years.\n');
INSERT INTO `article` VALUES (521, '567.txt', '2014/01/20', 'Homeland Illumination\n', 'VOICES - a blog about what is important to the people\n', 'Homeland Illumination\nVOICES - a blog about what is important to the people\nMaha Salo\n20 January 2014\n1937 - Kronos police spokesman has released a statement \"There is no indication that the missing individuals have left the island of Kronos.\"  When I asked if the caterers were considered persons of interest, the spokesman replied that the department was looking into all credible information and had no comment at this time. 20 Jan 2014');
INSERT INTO `article` VALUES (522, '568.txt', '1998/05/17', 'Daily Pegasus\n', 'LEAF OF THE FACT OF THE PUBLIC HEALTH OF ELODIS\n', 'Daily Pegasus\nLEAF OF THE FACT OF THE PUBLIC HEALTH OF ELODIS\n1998/05/17\nELODIS, Kronos - at the request of the citizens of Elodis, the health for everything has published a report on the impact of the operations that perforated of the gas in quality of the water and public health.  The report detailed soon will be available in the health for all the Web site.  The comparative data before 1998 were collected to investigate careful of the medical file provided by the center of the health of Elodis Community.\nTo disclose I am called on of light\n* The elevated amounts of chemical agents were found in the water supply, including arsenic, the acetic anhydride, the benzene, and dioxide of clorina.\n* The people youngest of 30 appear to undergo an unusually high index of the associated chronic disease to toxins produced by operations that they perforate of the gas.\n');
INSERT INTO `article` VALUES (523, '569.txt', '2014/01/20', 'Kronos Star\n', 'Breaking: Emergency at GAStech Headquarters Building [Updates]\n', 'Kronos Star\nBreaking: Emergency at GAStech Headquarters Building [Updates]\nCato Rossini, Marcella Trapani\n20 January 2014\nUpdate, 12:25 PM:  We have unconfirmed reports that the GAStech executives have not yet arrived at the scheduled reception at the capitol.  Kronos Star reporters covering the reception at the capitol report having seen GAStech President and CEO, Sten Sanjorge Jr., but they have not seen Ingrid Barranco, Ada Campo-Corrente, Orhan Strum, or Willem Vasco-Pais.');
INSERT INTO `article` VALUES (524, '57.txt', '2012/06/21', 'News Online Today \n', 'Abila police break up sit-in turned violent at the presidential manor  \n', 'News Online Today \nAbila police break up sit-in turned violent at the presidential manor  \n2012/06/21\nTraffic snarled around the city as Abilians struggle to get to work amid vandalism and looting \nEarly on Tuesday police stormed the front of the presidential mansion and the capital building, breaking up a sit in by the Protectors of Kronos.  \nLater in the day, what had been a largely peaceful demonstration turned violent when the crowd started vandalizing government buildings and the presidential homestead.  \nPolice reinforcements were sent to the area and blocked roads, and skirmishes between the police and protestors broke out.\n');
INSERT INTO `article` VALUES (525, '570.txt', '2012/06/20', 'News Online Today\n', 'POK REMEMBERS MARTYRED LEADER \n', 'News Online Today\nPOK REMEMBERS MARTYRED LEADER \n2012/06/20\nABILA, Kronos - In a touching ceremony Wednesday leaders of the activist group Protectors of Kronos paid tribute to their fallen leader, Elian Karel, who was murdered on 19 June 2009 while being illegally detained in a Kronos jail. \n\"Today we gather to remember Elian Karel,\" Silvia Marek told the rapt assembly, many of whom held up white candles in Karel\'s honor.   By the time Elian was 17 many of his family members and friends were battling constant illness, including his neighbor 10-year old Juliana Vann.\"  Elian knew his would be a difficult journey.  Elian knew the course would not be easy, and would leave little time for a personal life.\n');
INSERT INTO `article` VALUES (526, '571.txt', '2011/05/15', 'News Desk\n', 'DRUG RELATED ARRESTS ON THE INCREASE\n', 'News Desk\nDRUG RELATED ARRESTS ON THE INCREASE\n2011/05/15\nABILA, Kronos - an alarming new tendency sweeps Abila. The police force indicates related arrests which can be linked with violent activist groups on a dramatic increase of drug. \nThe port of Abila is have known for overschepingspunt for drugs which come from the Middle East and Africa that to the heroin and the hashish of Europe goes, as it happens. However, the drug related arrests had remained flat during the previous decade to the recent increase. \nThe care concerning the increase of drug related arrests is double: firstly, the violent activist groups such as the guards of Kronos drug sale as a means are able use to finance their activities; and second, with more drugs which appear on the coast, people of Kronos will suffer from raised drug related questions, namely addiction and violence.\n');
INSERT INTO `article` VALUES (527, '572.txt', '2012/06/22', 'Daily Pegasus\n', 'POK REMEMBERS MARTYRED LEADER\n', 'Daily Pegasus\nPOK REMEMBERS MARTYRED LEADER\n2012/06/22\nABILA, Kronos - in the stirring leaders of Wednesday of the ceremony of the protectors of the group of the activist of Kronos the tribute paid to its fallen leader, Elian Karel, that was assassinated the 19 of June of 2009 whereas illegal one being stopped in a jail of Kronos.\n\"We collected today to remember Elian Karel,\" Silvia Marek we said the assembly of rapt, many of whom supported the white candles in the honor of Karel.\n\"Elian was taken in a farm of Elodis not 40 minutes of here, to Jeroen and Antaura Karel.  It grew above for with the phantom of the death everything around him.   For the moment at which Elian was 17 many of their members of the family and the friends fought constant disease, including their neighbor 10 years - old Julian Vann. \"\nMarek stopped briefly a little while to allow the shouts of \"remembers Julian\" to descolorar itself.\n  Elian knew that his it would be a difficult trip.  He had watched his father, to Jeroen and founder of the POK, long walk of Henk Bodrogi the same trajectory that he would be above.  Elian knew that the course would not be easy, and that it would leave just a short time by a personal life.  He chose yet to take those measures in spite of the challenges that he knew that he would do in front. \"\nThe \"trip of Elian finished three years ago today.  But its dream did not die with him.  And it is that vision of a healthy one and future prosperous for all we are here today honoring.\"\nOn the course of afternoon several other loudspeakers they paid tribute not only to Elian, but all that have been victims of the environmental catastrophe caused by avarice and the corruption of civil employees. \nThe meeting was only spoiled by the aggravating presence of the police of Abila in gear of the uproar.  The police shook to many of the crowd, doin