INSERT INTO `article` VALUES (531, '576.txt', '2011/05/14', 'The Abila Post\n', 'DRUG RELATED ARRESTS ON THE RISE\n', 'The Abila Post\nDRUG RELATED ARRESTS ON THE RISE\n14 May 2011\nABILA, Kronos - An alarming new trend is sweeping Abila. Police point out a dramatic increase in drug related arrests that may be linked to violent activist groups. \nThe port of Abila is known to be a transshipment point for drugs coming from the Middle East and Africa going to Europe namely heroin and hashish. However, drug related arrests had remained flat over the past decade until the recent increase. \nThe concerns over the increase of drug related arrests are two-fold: first, violent activist groups such as the Protectors of Kronos could be using drug sales as a means to fund their activities; and second, with more drugs appearing on the shore, the people of Kronos will suffer increased drug related issues, namely addiction and violence.\n');
INSERT INTO `article` VALUES (532, '577.txt', '2009/03/13', 'News Online Today\n', 'POK LEADER KAREL ARRESTED \n', 'News Online Today\nPOK LEADER KAREL ARRESTED \n2009/03/13\nABILA, Kronos √ø¬ø¬ø¬ø¬ø¬ø In another unconscionable move against the citizens of Kronos, earlier today police arrested POK leader Elian Karel on spurious tax evasion charges. \nDemonstrating his trademark humor, Karel lifted his wrists and joked to his supporters as he is led away, √ø¬ø¬ø¬ø¬ø¬øI guess I shouldn√ø¬ø¬ø¬ø¬ø¬øt have sent the President those cases of bottled water for his birthday.√ø¬ø¬ø¬ø¬ø¬ø \nKarel is the leader of the Protectors of Kronos, an alliance of Kronos citizens from Elodis that has demanded the government clean up the contaminated water caused by gas drilling in their community.  I ask:  Where is the money going?√ø¬ø¬ø¬ø¬ø¬ø \nThe police representative assured supporters who massed outside the police station that Karel would be treated humanely, but declined to answer questions or allow visitors to see Karel.\n');
INSERT INTO `article` VALUES (533, '578.txt', '2007/04/11', 'Central Bulletin\n', 'TRAFFIC ACCIDENT NEAR ELODIS  \n', 'Central Bulletin\nTRAFFIC ACCIDENT NEAR ELODIS  \n2007/04/11\nABILA, Kronos - A government investigation has concluded a traffic accident involving a GAStech International vehicle and the vehicle of a family from Elodis resulting in the deaths of the four family members was the result of driver error on the part of the Elodisian driver. \nGovernment spokesman Rufus Drymiau said that the investigation found the deadly accident was triggered when the driver from Elodis crossed over into oncoming traffic. Three passengers - Valeria Edris, Celia Edris, and Marcellus Edris - died at the scene.   \nCarmine Edris, 9, was found wandering around the accident site.\n');
