INSERT INTO `article` VALUES (546, '59.txt', '2003/05/18', 'Who What News\n', 'HANK FLUSS GASTECH COO DIES AT 73 \n', 'Who What News\nHANK FLUSS GASTECH COO DIES AT 73 \n2003/05/18\nCENTRUM, Tethys - Hank Fluss, COO of GAStech International, died of a heart attack at his desk in the company\'s downtown Centrum headquarters. Though Fluss was 73 years old, his death came as a shock. \nHank Fluss spent 40 years with GAStech, befriending Sten Sanjorge, Sr. After many failed wells and on the brink of financial ruin, Fluss and Sanjorge, Sr. \nAs Chief Operating Officer, Fluss has overseen GAStech\'s expansion, truly making it an international company and growing it into a multi-billion dollar operation. Always a champion of environmental causes, Fluss had become increasingly disenchanted with the GAStech - Kronos operation straining his relationship with CEO Sten Sanjorge, Jr.  \nHank Fluss is survived by his wife of 54 years, Beatriz Fluss, his 5 children, and 12 grandchildren.\n');
INSERT INTO `article` VALUES (547, '590.txt', '2013/10/22', 'News Online Today \n', 'Multi-Country Task Force Formed \n', 'News Online Today \nMulti-Country Task Force Formed \n2013/10/22\nInterpol has announced the formation of a new multi-country task force to combat the increasingly wide distribution of the drug methyldimethyl cathinone (MDMC). \nThis particular blend of the drug MDMC, also known by its street names \"cotton candy\", \"spice dreams\" and \"Tulip Blossom\", was found previously only in Asteria but has made its way to the streets of Tethys and other international countries.  \"An increase in mental health problems, including hallucinations and paranoia, accompanied by violent behavior and a marked increase in suicide rates are only a few of the indicators of the usage of this designer drug.\"\n');
