INSERT INTO `article` VALUES (570, '610.txt', '2012/03/10', 'Athena Speaks\n', 'THE THREATS PUBLISHED BY POK\n', 'Athena Speaks\nTHE THREATS PUBLISHED BY POK\n2012/03/10\nABILA, Kronos - letters claimed to be guards of Kronos (POK) were received by Vincent Kapelou, minister of health and nephew of President Kapelou. The letters mena√ßantes seem to be the empty threats of a attention-seeking organization and nothing more.\nMr. said Kapelou, of the \"chances are this is not nothing, but we will not take any chance.\" Nevertheless it doubled the size of its personal force of safety in reply to the letters.\nThese kinds of threats reinforces only the fact that the POK are \"a public threat\" to quote President Kapelou.\n');
INSERT INTO `article` VALUES (571, '611.txt', '1992/12/11', 'The World\n', 'KRONOS GOVERNMENT PLANS TAX BREAKS TO ENCOURAGE FOREIGN INVESTMENT\n', 'The World\nKRONOS GOVERNMENT PLANS TAX BREAKS TO ENCOURAGE FOREIGN INVESTMENT\n11 December 1992 \nABILA, Kronos - The Government of Kronos is currently planning some of the world\'s most generous tax breaks for gas investments. This will help create \"cheap energy\" that can give the developing country a competitive advantage and a leg up in the government\'s push to modernize.\nAs high-income countries from Europe and the United States race to take advantage of existing and potential gas deposits, Kronos is planning to provide incentives such as reducing corporate and individual tax, preferential tariffs, and derogations from regulations as well as cheap, but eager work force.\nThe Government of Kronos is pitching the plan as a win-win situation given that the high-income countries will be struggling to discover and exploit ever-dwindling supplies of fossil-fuels and the developing Kronos needs income, infrastructure, and cheap energy.\nLook for energy companies to flock to Kronos.\n');
INSERT INTO `article` VALUES (572, '612.txt', '1999/07/08', 'All News Today\n', 'MINISTER OF HEALTH TO PROPOSE SOLUTION TO TOWN POISONING \n', 'All News Today\nMINISTER OF HEALTH TO PROPOSE SOLUTION TO TOWN POISONING \n1999/07/08\nABILA, Kronos - Prime Minister of Health Cesare Nespola announced he would sponsor a bill to increase taxes on foreign energy development in Kronos intended to fund environmental cleanup and improved healthcare for rural towns.  Following a series of meetings with members of the activist group Protectors of Kronos (POK) the announcement was made last week.  \"We fight for clean water, good health and now we will have the funds to make this happen. \nOsvaldo refers to Juliana Vann, a 10-year old girl who died last year from leukemia due to with benzene poisoning from gas drilling operations upstream from her home. \nThe POK formed in 1997 in response to the pollution of the Elodis water supply and the resultant sickness and subsequent deaths of local residents.\n');
