INSERT INTO `article` VALUES (577, '617.txt', '1998/05/16', 'All News Today\n', 'ELODIS PUBLIC HEALTH FACT SHEET \n', 'All News Today\nELODIS PUBLIC HEALTH FACT SHEET \n1998/05/16\nELODIS, Kronos - At the request of the citizens of Elodis, Wellness for All has published a report on the impact of gas drilling operations on water quality and public health.  Comparative data prior to 1998 was obtained from a thorough investigating of medical record provided by Elodis Community Health Center. \nReport Highlights \n* Elevated amounts of toxic chemicals were found in the water supply, including arsenic, acetic anhydride, benzene, and chlorine dioxide. \n* Persons younger than 30 appear to be suffering an unusually high rate of chronic illness associated with toxins produced by gas drilling operations.\n');
