INSERT INTO `article` VALUES (584, '623.txt', '2009/06/20', 'Kronos Star\n', 'Protest Turns Violent in Abila\n', 'Kronos Star\nProtest Turns Violent in Abila\nMarcella Trapani\n20 June 2009\nABILA, Kronos - A rally of hundreds of protestors allied with the \"Protectors of Kronos\" movement turned to violence today as angry activists vented their displeasure on the innocent citizens of Abila after hearing the news of POK leader Elian Karel\'s death.  Karel, who had been awaiting trial for tax evasion, was found dead in his jail cell yesterday morning.  \nThe POK assembly began peacefully enough with the usual chanted slogans and waving of protest signs, but then one young rabble-rouser grabbed a bullhorn and began inciting the crowd to violence.  The crowd smashed windows and vandalized shops in the Siopa area, set fires in the streets, and clashed with police.  Additional police forces responded to contain the chaos and they were forced to use rubber bullets and tear gas in order to disperse the crowds.\nPresident Kapelou\'s office released a statement about the rally, stating, \"This sort of violence will not be condoned.  Destruction and violence is no way to achieve peace and change - these things are in opposition to each other.  The Protectors of Kronos must resume peaceful means; all other approaches are unjustifiable.\"\n');
