INSERT INTO `article` VALUES (587, '626.txt', '2000/08/15', 'Who What News\n', 'EXPLOSION ROCKS GASTECH\'S TISKELE BEND SITE \n', 'Who What News\nEXPLOSION ROCKS GASTECH\'S TISKELE BEND SITE \n2000/08/15\nABILA, Kronos - An explosion at a nearby gas drilling well pad woke Rebecca Cato around 3 a.m. on Sunday morning. When she left her home in Elodis, Kronos - a rural township outside the capital Abila - to investigate the noise she noticed a large fire coming from GAStech International\'s Tiskele Bend site. At least four GAStech employees appeared to have been taken away by ambulance; however, GAStech has declined to comment on the extent and nature of their injuries.  \nGAStech\'s CEO Sten Sanjorge Jr. downplayed the event stating, \"This event could hardly be described as an explosion,\" but merely a common practice referred to as flaring.  \nMrs. Cato and other locals from Elodis were turned away by GAStech employees and government officials. Rebecca Cato said, \"After sending us away without a single question answered, they came to our doors and told us to leave our homes.\n');
