INSERT INTO `article` VALUES (595, '633.txt', '2014/01/20', 'News Online Today\n', 'ABILA AIRPORT CONFIRMS TWO PRIVATE JETS LEFT TODAY \n', 'News Online Today\nABILA AIRPORT CONFIRMS TWO PRIVATE JETS LEFT TODAY \n2014/01/20\nABILA, Kronos - Abila Airport fueler Ravi Danisliau confirmed that two private jets took off today after being fueled.  \nThe second plane also carried seven or eight \"business types\", but seemed \"much more relaxed than the first group of passengers\". The second plane departed around 14:30 around two hours after the first plane.\n');
