INSERT INTO `article` VALUES (610, '647.txt', '1998/04/27', 'Daily Pegasus\n', 'ELODIS, KRONOS:  AID of one divides two of the SOURCE UNEXPECTED\n', 'Daily Pegasus\nELODIS, KRONOS:  AID of one divides two of the SOURCE UNEXPECTED\n1998/04/27\nThis article is the second installation of a series of three parts that deals with the problem every greater time an anguish of the community, the criminal fact of the government, and the alarming influence of multinational corporations in the country of Kronos.\nI took for above with Henk Bodrogi in the city that made purchases in the warehouse of the hardware of Ferro to repair an broken tractor.  Bodrogi has cultivated the soybeans its whole life, like its father and his parents. I asked to him about its life in the farm.\n \"We have worked the Earth during long time - perhaps 200 years, perhaps a small piece more,\" Henk Bodrogi said to me as it chose on a package of per to us, looking for the right size.  \"On the years we have added some hectares here and there.  To us it maintains occupied.\"\nOccupied it is an underestimation, as I found when I punctured to farmer wiry to say to me more.\n \"My wife obtains the ascending cabritos and title to teach, then she will do a little something so that we eat for the lunch and we work next to me until supper.  When the children obtain school caretakers make their tasks, and we are all buttocks in the house most of the times by darkness.\"\n\"We do this most of the days,\" he we added, \"with the exception of days of the adoration.\"\nBodrogi identifies the appropriate bolt and to char it with the teller on cabritos and school whereas it finishes his purchase.\n\"All we know one another one here,\" Bodrogi we explained whereas we go away. \"Most of the families they have lived here for the generations.  The first new people who came to the city were with that company of the gas that constructed the posteriora part of some years.\"\nI request Bodrogi if the business has been good. \n\"We made quite good recently until time.  The benefits were good and added cultivated area, or increased the equipment.  Then we began to have all this hardship with the harvests.\"\nHow, I it requested.\n\"The harvests are not producing as they have in the past.  It awhile took the figure towards, outside then one of the calculated officials of the city towards outside calling in a specialist of the water.  They proved when it they said that the water was contaminated.\"\nBodrodgi sighed, and with a glance surrounded in its eye thanked for he me by my interest and this it had to me to direct it the back home.    I thanked for it I watched and to raise it in its car and head outside city.\nThe specialist of the water turned out to be the international agency \"health for all\", an international agency with a mission to bring the healthy water to the communities caused sorrow by natural disasters, sketch and - coincidently - oil and development of the gas.\nI took for above with a representative of the health for all the following day.  Joclyn Reynolds is coordinating of the project for the \"health for all\".  She spoke to me on a call based on the satellites of her office of the field in Asia South-Eastern where she was efforts of the relevaci√≥n of the creation which they followed an earthquake. Ms Reynolds decided to speak me by some minutes between the meetings on its work in Elodis.\n\"A civil employee of the city on a problem we made contact with enemy whereupon they had with its local water.  In years of last agriculture one had collapsed, and the incidence of certain diseases and defects of birth had risen.  The potable water of Elodis comes from the river of Tiskele, like all the water to cultivate, so we looked for a source against the current.  We above find sources of the useless disposition of the production in <km> of the operation of GAStech by waters.  The tests demonstrated to stops levels of the benzene, the tolueno, arsenic of xylene, the lead and the selenium, among other toxins. \"\n\"These substances Can happen naturally\" I asked to him.\n\"Not in these amounts, and not this one suddenly.  The contamination of the underground water is generally the result of the human activity.  The pipes of GAStech are sending the polluting agents in a pool.  The toxins are forming plume subsurface that leaks in the river of Tiskele of which the residents of the drainage of Elodis its potable water and irrigation for the harvests.\"\n\"You spoke with GAStech on this\"\n\"Oh yes,\" she answered.  \"We thought at the outset that we gained the traction.  We solved several times with the representatives of GAStech, including one of \"the senior\" executives, Fluss hank.  It assured personally to us that GAStech would act responsible to provide material and financial aid towards efforts of the cleaning.  After a time, although, got to be clear that whereas Mr. Fluss was serious it was Sanjorge that makes the decisions.  It is evident that it [Sanjorge] does not have any interest in the well-being of the residents of Elodis, or the atmosphere.\"\nSten Sanjorge, the Jr, who had inherited his part in the company of his father in 1990, had developed a reputation for the practices of business of cutthroat.\n\"When we did not make progress with GAStech,\" Reynolds continued, \"the leaders of the community decided to approach the government of Kronos for the aid.   By our policy - and with the permission of the leaders of Elodis - we published the test resultses in an official public document.  The leaders of then Elodis approached the officials of the government like citizens of a community of Kronesian armed with the scientific analysis.  To our he assured them agency that we would be again available to help anyway when those agreements were concluded. \"\nTo this point the Reynolds far from the telephone called ms, so I returned to my friend of the editor, Pondo Reese to tell to end history.\nPart three will be published the 15 of May of 1998\n');
INSERT INTO `article` VALUES (611, '648.txt', '2013/02/24', 'World Journal\n', 'GAStech \n', 'World Journal\nGAStech \n2013/02/24\nIt is the largest company in Kronos, the third larger company of gas on planet, and they is years of fifty-three. In the past it had a reputation as corrupted and ambient harmful, but nowadays GAStech, the old businesses of Tethys-only, tries to gain the confidence of the international investors. This belonged to its ambitions to increase its gas of provisioning of profitable businesses apart from Mediterranean area.\nIt is ascending charge, and there is no certainty but Gastech with the capacity to convince the potential investors whom it repaired its manners, and is not enracin√© any more in the eco-hostile past.\nOperations of the drain of GAStech are based in Eastern Kronos, and there is close relationship with the government of Kronosian. It is the heart of the businesses of the drain of Kronos, where the gas of the Eastern gas layers is whistled in the west towards the remainder of Kronos, Tethys and Europe.\nGAStech makes more than just gas of pump. It created cities and cities to maintain its operations, which it controls and runs almost simple-given.\nThe chief of GAStech, Sten Sanjorge, Jr, whose photograph fixedly looks at outside calendars and executives of table everywhere in the country, recognizes \"state the charges in state\", but wire-drawer owing to the fact that the needs for company simply to deal of his workmen and the communities around them.\nNaturally, to populate the good reasons of the need to come and work in the areas remotely hostile of Kronosian. They are equipped with medical care, entertainment, and food. The empire of GAStech has 2 thousand cows and 3 thousand pigs in its farms of company, court of the rooms of gymnastics, and offers holidays subsidized in resources of the Black Sea for the principal employees. For executives, it runs a current situation, a medical center marble-striped and of therapy.\nIn addition to all these advantages, there is also the station of GAStech TV, which does not even pretend to be impartial. It is there to serve the will of the company.\nThis seems hardly the image of a modern total company, like the majority of those without ceremony emptied their \"activities of not-core\". There is an argument, however, that the businesses of energy are different from other industries, requiring companies of energy to function in the distinct ways.\nBy working in the distant places without average precedents infrastructure to oil and the gas sites will be always, to a certain extent, of the towns of company. GAStech tries certainly to ensure its employees can move in and out of these places by actuating a private fleet of four planes to transport out of vat its personnel the enormous distances between the sites.\n');
