INSERT INTO `article` VALUES (620, '656.txt', '2014/03/26', 'Everyday News\n', 'Penetration of an expert: prospering like foreign CEO in Kronos \n', 'Everyday News\nPenetration of an expert: prospering like foreign CEO in Kronos \n2014/03/26\n17 of January of 1995\nThe Fluss hank is CEO of GAStech, main industry of Krono by more than 15 years, after its discovery of its immense gas fields near the city of Elodis.\nFluss, has worked with dozens of foreign CEOs on the years. Nevertheless, it has humble principles like prospector of the oil and the gas in Tethys. \nHe spoke to the times on the characteristics of a leader guessed right in Kronos and what foreign CEOs can hope in the market. \nQ:  What can foreign CEOs wait for when it comes to Kronos?\nA: The economic atmosphere has changed from years 80. He is much more hard to be successful today. Foreign necessity of CEOs to play under its expectations. There are no easy triumphs in Kronos. The foreign competition between Kronosian and companies are resistant. It is difficult to gain the hearts and the minds of the population.\nBut there is less difference than people think between the culture of Kronosian and, culture of Tethian of the opinion. The personnel of Kronos works hardly like hardly, she is respectful of her work and has he himself desire for the success. Also they know to appreciate to the efficient communication and a talented leader.\nWhat foreign leader needs to do it is to learn how to communicate the \"way of Kronosian\" and to take time to understand its personnel.\nQ:  Can you elaborate?\nA: There are many cultural differences in communicating. [Considerar] the notes. Foreign CEOs always confused and is frustrated when somebody in Kronos sends a note [] and counts on a simple answer of yes/no. In place they obtain a very long answer that it does not answer its initial question.\nThe people of Kronos do not have taste to take responsibility. They scare it to lose his works and she does not have taste of being forced in saying something that it does not wish a. Foreign necessity of CEOs to take this in consideration and to need to take the time to understand how to communicate.\nThe patience is key. The transparency can be an excellent way to obtain around this. It is an European value that Kronosians is very responsivo a. The imposition of him in a company can make the trip of a foreign CEO in Kronos a much more pleasant experience.\nQ:  Which is the challenges of the pipe a foreign CEO can do in front on arrival in Kronos?\nA: It is sometimes the simplest things that they can be desafiadoras, like obtaining of A to B in a taxi. The power to obtain around is taken easily for granted and not being able to do so it creates a great sense of the insecurity. In Kronos you never are safe if his conductor falls to him dull in the feasible line. This can look like as a small edition but on a daily base is very annoying.\nAnother one is becoming familiar with its equipment and with whom you are working. The often foreign right of the passage of CEOs of the plane and in an office completely of the fellow workers of Kronos. They do not have any idea that is, how they work or how they are described are. This can be confused. \nQ:  Can you give some extremities in how a foreign CEO can prepare yourself?\nA: The first thing that would say is to prepare its family. They can find it difficult to adapt to the new surroundings of work. This can affect personal life. The family and the work who mix themselves are practical very common here. The people of Kronos work in extra hours and socialize with her colleagues. It is very different from Tethys where there is a clear limit between the work and the family.\nForeign CEOs must also make how he is resistant is the competition and how much hard work must be put inside to be successful -- often much more that in its countries of origin. The language is a great edition.\n[But] does not concern you at the most is prepared, the true experience of the work and to live in Kronos it will always surprise to him.\nQ:  How difficult - or easy - is to being a foreign CEO in Kronos?\nA: Generally, I think that being a CEO he is hard. There are many of pressure, the atmosphere is resistant and is difficult to find a balance with its personal life.\nWhen an equipment of hears them to Kronos that a CEO is coming from overseas assumes is a problem. But, cultural they do not have an edition with the foreigners. \nQ:  Hay the situations in which the foreign executive being is really an advantage?\nA: This question really depends on the person and how much they invest to understand the country and the culture. If they do not deliver any attack then to locate he is a net one harms. But in certain negotiations or certain editions such as luxury merchandize, foreign CEOs can be an advantage. They can bring another point of view, facilitate the process.\nThe foreign CEO has better knowledge of an industry and can sometimes bring the access to the overseas markets. This can be true assets.\n');
INSERT INTO `article` VALUES (621, '657.txt', '1993/09/20', 'News Online Today\n', 'UPGRADES NEEDED FOR ABILA\'S DEEP WATER PORT \n', 'News Online Today\nUPGRADES NEEDED FOR ABILA\'S DEEP WATER PORT \n1993/09/20\nABILA, Kronos - As part of the government brokered deal with GAStech International, Abila must make upgrades to their deep water port. Additionally, the Port will need to dredge the port killing two birds with one stone: increasing the depth of the port and providing fill to raise the East Pier.\n');
INSERT INTO `article` VALUES (622, '658.txt', '2001/08/31', 'Homeland Illumination\n', 'POK MEMBERS ARRESTED\n', 'Homeland Illumination\nPOK MEMBERS ARRESTED\nPetrus Gerhard\n31 August 2001\nELODIS, Kronos - Government heavies obstructed the free speech - yet again - of members of the activist group Protectors of Kronos yesterday at a lawful demonstration at the Tiskele Bend fields.  The five POK activists had gathered in front of the gates to GAStech gas drilling operations facility to bring public awareness about the polluted Tiskele River which has caused health problems to the residents of Elodis.\nBystanders report that the demonstration had begun peacefully with the five POK members walking back and forth across the road, chanting \"Remember Juliana!\" and \"No more poison!\"  \nAn eyewitness told the Homeland Illumination that when the gates opened to allow GAStech company vehicles to exit the facility the protesters moved aside.  Witnesses agree that at the same time vehicles with the Government of Kronos seal drove to the gates, apparently planning to enter the facility. \n\"It was all very civil up till then,\" Griffith Mabel, an Elodis resident who had come out to support the POK told the Homeland Illumination.   \"The gates opened, the POK people moved and the trucks drove out.  That\'s when it got weird.  The trucks stopped in the middle of the road for no reason.\"\nAnother eyewitness, Elodis farmer Charley Normand adds, \"Yeah, the POK guys asked the drivers to move nicely, but the GAStech drivers ignored them.  They had their windows down, so it wasn\'t like they couldn\'t hear them.\"\nThe occupants of the government vehicles exited and joined the altercation.  The sequence of events becomes confusing at this point.  Some witnesses state the GAStech drivers instigated arguments with the protestors, and others think the government officials began to strong arm the protesters from the road.\n\"Turns out the people in the government cars were police,\" Mabel tells the Homeland Illumination.  \"They wore uniforms and had badges.\"\nOnlookers tell the Homeland Illumination that the three parties began yelling, and at some point the Kronos police - presumably from Abila-  arrested the five activists and transported them to an Elodis jail.\nDespite repeated requests for an interview, the Homeland Illumination has not been granted access to those arrested.\n');
INSERT INTO `article` VALUES (623, '659.txt', '1999/07/05', 'Worldwise\n', 'Additional taxes by champions of Nespola of minister on oil, formation of gas\n', 'Worldwise\nAdditional taxes by champions of Nespola of minister on oil, formation of gas\n1999/07/05\nABILA, Kronos - the Minister for health Cesare Nespola announced that it would finance an invoice to increase taxes on the development of oil and gas of one 10% additional.  To increase in the taxes on the foreign development of gas and oil is affected specifically with health, the clean projects of water, and medical education for rural sectors.  Minster Nespola was a long time a strong lawyer of health and wellbeing of our citizens, and its support of this measurement is added to a long list of the actions which it undertook on our behalf.  Last year, the Nespola minister created a program of the financial incentives conceived to bring the doctors qualified to practice medicine in Abila.  This program was added above the doctors a dozen and specialists strongly qualified in everywhere in the world to the personnel general in hospital in Abila.\n');
INSERT INTO `article` VALUES (624, '66.txt', '1995/10/12', 'The Guide\n', 'Magnificent opening of the new offices of GAStech\n', 'The Guide\nMagnificent opening of the new offices of GAStech\n1995/10/12\nABILA, Kronos - president Sten Sanjorge Jr of international of GAStech today maintained the magnificent ceremony of the opening for the new GAStech-Kronos settles down headquarters of the building.  Flashing the crystal and steel building provides the ample space of the office for the ones in charge, the geologists, the engineers, and personnel of aid, and the regional facilities of the conference of sports be-of art. Ministrar Sarto, that took care of the celebration, saying, \"this beautiful facility is a monument to the commission of Sanjorge to Kronos and it is due to consider by the citizens as it shows of a prosperous future for all.\"  \n');
INSERT INTO `article` VALUES (625, '660.txt', '2014/01/20', 'The Abila Post\n', 'ON THE SCENE BLOG\n', 'The Abila Post\nON THE SCENE BLOG\nBy Haneson Ngohebo\n20 January 2014\n1532 UPDATE - A GAStech - Kronos employee departing the headquarters building who declined to provide a name said that a couple of unknown people were in the back of the conference room where the GAStech meeting took place this morning. The unknown \"shadowy\" people lurking around the meeting room \"weren\'t GAStech employees\" and were \"dressed in black and seemed to be standing, watching in the background.\"');
INSERT INTO `article` VALUES (626, '661.txt', '2011/05/16', 'The Explainer\n', 'RELATED HALTINGS DRUG IN THE ASCENT\n', 'The Explainer\nRELATED HALTINGS DRUG IN THE ASCENT\n2011/05/16\nABILA, Kronos - a new alarming tendency is sweeping Abila. The police needs a dramatic increase in the related haltings drug that can be bound to the violent groups of the activist. \nThe port of Abila is known to be a point of the transfer for the drugs that come from the Middle East and of Africa that go to the heroin and the hashish of Europe that is to say. Nevertheless, the drug related haltings had continued being flat on the last decade until the recent increase. \nThe preoccupations by the increase of related haltings drug are double: first, the violent groups of the activist such as the protectors of Kronos could use sales of the drug like means to finance their activities; and secondly, with more drugs appearing in the border, the people of Kronos will undergo increasing related editions drug, that is to say attachment and violence.\n');
INSERT INTO `article` VALUES (627, '662.txt', '2012/06/22', 'The Orb\n', 'POK SE POINTS OUT THE CHIEF OF MARTYRED\n', 'The Orb\nPOK SE POINTS OUT THE CHIEF OF MARTYRED\n2012/06/22\nABILA, Kronos - in the chiefs moving one Wednesday of ceremony of the guards of group of activist of Kronos poured the homage on their fallen chief, Elian Karel, which was assassinated on June 19, 2009 while being illegally held in prison of Kronos.\n\"Today we meet to point out Elian Karel to us,\" Silvia Marek said the enthumansiaste, much which delayed the white candles in the honor of Karel.\n\"Elian was constant with a farm of Elodis not 40 minutes from here, in Jeroen and Antaura Karel.  It grew with the spectrum of dead all around him.   Before Elian was 17 several of its members of family and the friends fought the constant disease, including its neighbor 10 years - old man Juliana Vann. \"¬†\nMarek made a pause one moment to allow the cries of \"remember Juliana!\" to fade.\n\"Elian devoted its life to the people of Elodis as well as all the citizens of Kronos, just as his/her father before him.  Elian knew that his would be a difficult voyage.  It had observed his father, Jeroen and the founder of the POK, walk of Henk Bodrogi the way even as it would go.  Elian knew that the course would not be easy, and would leave little time during a personal life.  However it chose to take these measurements in spite of the challenges which it knew that it would face.\"\nThe \"voyage of Elian finished three years ago of today.  But its dream did not die with him.  And it is this vision of healthy and future thrives for all we are here today to honor.\"\nIn afternoon several other loudspeakers paid homage not only to Elian, but all what were victims of the environmental catastrophe caused by avarice and corruption of the public civils servant. \nThe gathering was disturbed only by the presence of aggravation of the police force of Abila in the speed of riot.  The police force agitated much crowd, involving them to have to leave the assembly rather than to be invaded with the sticks and the jet of pepper.\n');
INSERT INTO `article` VALUES (628, '663.txt', '2000/08/16', 'The Abila Post\n', 'TISKELE BEND EXPLOSION AND FIRE\n', 'The Abila Post\nTISKELE BEND EXPLOSION AND FIRE\n16 August 2000\nABILA, Kronos - A spark at the GAStech International-owned well at the Tiskele Bend site ignited methane gas several hundred feet underground, causing a fireball and fire that burned for about an hour is the findings from a dual GAStech - government investigation of the explosion and subsequent fire Sunday morning. \nFour GAStech employees suffered injuries including minor burns and broken bones. In contrast to previous reports there were no deaths and none missing as a result of the incident. No local residents were injured as well and though some residents of Elodis were evacuated from their homes the investigation indicates that the evacuation was unnecessary. \nWhile the official cause of the explosion is still under investigation, the problem may have come from a defect in the wellhead itself. GAStech\'s wellheads are ringed with collars that have set pins running through them. One of the pins may have blown out of the collar, releasing the gas, which then came in contact with a spark.\n');
INSERT INTO `article` VALUES (629, '664.txt', '2012/06/21', 'The Guide\n', 'Ends of the meeting of the anniversary of POK in uproar\n', 'The Guide\nEnds of the meeting of the anniversary of POK in uproar\n2012/06/21\nABILA, Kronos - the members of POK celebrated a great demonstration in Abila yesterday.  It varies dozen of his those in favor carried out seating-ins in front of the building of capitol and se√±or√≠o presidential, whereas others took the streets with their samples and sing.  Protestors distributed the aviators to the present people who alleged that our government is corrupt and \"the rich ones obtain richer in the posterioras parts of the poor men\".  They answered the police called for the Pacific end when seating-ins, but with a prey of rocks and bottles of the crowd.  They forced the violence extended in a true uproar and to the police to use the tear gas, the aerosol of the pepper, the tubes of the water, and beanbags thrown of the guns to control to the crowd.  \nFor the moment in which they had destroyed to the crowds finally dispersed, several buildings of the government, two vehicles of the police were burning, and the streets were left in disorder with sweepings and broken crystal.  Protestors and police damaged several, including an official of heroic police that was stabbed by a driven crazy protestor.  The official, whom she names has retained itself for reasons of the security, is in conditions critics in the general hospital of Abila.\n');
INSERT INTO `article` VALUES (630, '665.txt', '2014/01/20', 'Centrum Sentinel\n', 'VOICES - a blog approximately that what is important to people\n', 'Centrum Sentinel\nVOICES - a blog approximately that what is important to people\n20 January 2014\n1807 - The civil employees of the airport have confirmed that one of jets reserves you has transported a delegation of eight persons from a classified company and that this company was not GAStech.  The civil employees would not confirm the times of departure for the jet, or one destination. 20 gen. 2014');
INSERT INTO `article` VALUES (631, '666.txt', '1993/03/12', 'Kronos Star\n', 'Government Strikes Deal with GAStech International\n', 'Kronos Star\nGovernment Strikes Deal with GAStech International\nDonato Petri\n12 March 1993\nABILA, Kronos - President Araullo today announced the signing of an agreement between his government and the Tethys-based GAStech International for the development of the Tiskele Bend gas fields.  GAStech, under the leadership of visionary Sten Sanjorge Jr., was awarded exclusive rights to drill in the government-owned fields after agreeing to the government\'s request that 50% or more of the workforce be Kronosian citizens.  President Araullo hailed the landmark deal as \"the beginning of a new era for our great country, an era of opportunity and fortune for all.\"  Our sources at the Ministry of Interior tell us that the 50% tax levied on new oil and gas exploration could yield in excess of $1 billion in tax revenue per year.  This will allow the government to make unprecedented investments into infrastructure, health care, and education.\n');
INSERT INTO `article` VALUES (632, '667.txt', '2009/03/13', 'The Explainer\n', 'ARRESTED LEADER OF POK\n', 'The Explainer\nARRESTED LEADER OF POK\n2009/03/13\nABILA, Kronos - Elian Karel, the charismatic leader of the protectors of Kronos, was arrested today in loads of fiscal evasion. Michale Kraft, lawyer of Karel, sent a declaration affirming that the loads made level against their client were \"false\" and that he waited for his client \"would send [of safekeeping of the police] the end of the week.\"\nThe Carman de Adrien of the spokesman of the police responded the declaration by Kraft, indicating, \"I think that Mr. Kraft has underestimated the seriousness of the situation of his client. We have been following its group of fence by a certain hour.\"\nThe last month just, group of Karel was responsible for the violation incident that blocked the entrance to the headquarters of GAStech - of Kronos. President and the CEO Sten Sanjorge, Jr of GAStech condemned the POK like terrorists.\n');
INSERT INTO `article` VALUES (633, '668.txt', '2001/06/15', 'The Truth\n', 'The minister of health dies suddenly\n', 'The Truth\nThe minister of health dies suddenly\n2001/06/15\nABILA, Kronos - it is with large sorrow which we announce the death of minister of health Cesare Nespola.  The minister Nespola, 62, died peacefully in its sleep yesterday of an assumed heart attack.  A continuous champion for the well-being of our people, Nespola was a doctor that had been picked the ministry of health in 1995, by former President lead Araullo.  He was popular enough that president Kapelou preserved him then he its cabinet in 2000, formed.\nShortly after learning the death of Nespola, president Kapelou to that its cousin Vincent Kapelou kondigde as a new minister of its policy of health would serve.  Vincent Kapelou, 28, have Bachelor of science in chemistry and master of science in biochemistry of central university Tethys. \n');
