INSERT INTO `article` VALUES (637, '671.txt', '1996/07/08', 'The Light of Truth\n', 'GASTECH SHIFTS THE HEARTH WITH KRONOS\n', 'The Light of Truth\nGASTECH SHIFTS THE HEARTH WITH KRONOS\n1996/07/08\nCENTRUM, Tethys - international GAStech shifted its hearth of Tethys in the small Mediterranean island of Kronos and the vast gas layers under the ground.\nThe recent expenses of the subsoil water contamination against international GAStech and tightening environmental payments carry out by the interior minister of Tethan, Ivar Blanes, certainly play in the hearth of shift. \nWith slackened lawful environmental with non-existent in Kronos and a friendly local government, the movement of GAStech is smelled inevitable retrospectively. \n');
INSERT INTO `article` VALUES (638, '672.txt', '2000/06/01', 'The Orb\n', 'DOCUMENTARY CARD OF PUBLIC HEALTH Of ELODIS - UPDATE\n', 'The Orb\nDOCUMENTARY CARD OF PUBLIC HEALTH Of ELODIS - UPDATE\n2000/06/01\nELODIS, Kronos - the environmental consequences of acid displacement hyper of substrate (HASR), a technique of drilling discussed took an enormous toll on the health of the residents of Elodis.  An update with health 1998 for all the report/ratio will be announced soon on the municipal Web site of Elodis.\nClimaxes\n* Levels without precedent of toxins were found in supply water, including phenol, acetic anhydride, wire, and ethylene glycol.\n* The incidence of the chronic disease increased more than 89% of the former years\n* The exceptionally high incidence of cancer became thus about this minister of Nespola health appointed a specialist in oncology at the hospital general in Abila\n');
INSERT INTO `article` VALUES (639, '673.txt', '2014/01/20', 'Central Bulletin\n', 'WRAP UP OF EVENTS AT GASTECH \n', 'Central Bulletin\nWRAP UP OF EVENTS AT GASTECH \n2014/01/20\nABILA, Kronos - A long tense day of conflicting reports and confusing information has come to an end. What we know for certain is that 14 GAStech employees are not only missing, but kidnapped as confirmed by a Kronos Government source. At this time it is unclear who the missing are and whether they are citizens of Kronos of Tethys, as many GAStech employees are Tethan. Speculation about the motives of the kidnappers has been rampant due to the recent news of the GAStech Initial Public Offering only a month ago. Edvard Vann, a GAStech - Kronos security guard who was interrogated and released after 6 hours, gave the indication that the Protectors of Kronos were involved or at least suspected as being the perpetrators behind today\'s events. \nA GAStech International senior security executive has been on site to support the investigation aiding the Abila Police Department and Kronos Government officials. Shortly after the morning meeting ended at 10:00, Abila Fire Department trucks responded to reports of a fire at the GAStech office.\n');
