INSERT INTO `article` VALUES (647, '680.txt', '2001/09/02', 'The Wrap\n', 'ARRESTED MEMBERS POK\n', 'The Wrap\nARRESTED MEMBERS POK\n2001/09/02\nELODIS, Kronos - government heavies obstructed the free speech - once again - of members of the guards of the activist group of Kronos yesterday at a legitimate demonstration at the areas of bending Tiskele.  The five activists POK had collected themselves for the poorten to GAStech facility of gas the drill far directions to bring Tiskele public information concerning the polluted river which has caused health problems to the residents of Elodis.\nThe witnesses report that demonstration peacefully started POK with the five members were that alternating concerning the way run, chanting remind Juliana! and no longer vergift!  \nAn eye told which then the poorten which are opened to permit company vehicles to GAStech moved the facility to leave aside protesters.  The witnesses are it once that tezelfdertijd the vehicles with the government of connection floated Kronos to the poorten, apparently of plan are the facility enter. \nIt was going up to then, Griffith Mabel already very civil, a resident Elodis who was from POK come support told.   The opened poorten, people POK moved themselves and the freight carriages dissipated.  That is then the bizar became.  The freight carriages stopped in the middle of the way for no reason.\nAnother eye, Elodis farmer add Charley Normand yes, the kerels POK asked move itself the drivers neatly, but the drivers GAStech ignored them.  They had their windows, so that it was not if she could not hear them.\nThe occupants of the government vehicles left and dovetailed themselves the dispute.  The consecution of events becomes on this point confusing.  Some witnesses explain exhorted arguments GAStech with protestors to the drivers, and others think the government civil servants of strong weapon with protesters of the way started.\nPeople in the government cars prove to be police force were, Mab