INSERT INTO `article` VALUES (648, '681.txt', '1993/02/2', 'Homeland Illumination\n', 'LACK OF DETAILS MARS GOVERNMENT INTENTIONS\n', 'Homeland Illumination\nLACK OF DETAILS MARS GOVERNMENT INTENTIONS\nPetrus Gerhard\n2 February  1993\nABILA, Kronos - In a glitzy press conference late last year President Luis Araullo announced a historic set of tax incentives intended to bring foreign investment to Kronos under the guise creating jobs, providing cheap energy and building infrastructure.  Following the 86-14 vote last month the Minister of the Interior Tomas Sarto lauded the decision as \"landmark\" and \"bettering the people\".\nWe shall see.  The crafters of these revolutionary measures neglected to include a detailed plan about how this windfall would benefit everyday Kronosians.  When the first payment from these foreign company lands in the state coffers, how will these funds be dispersed?\nOne wonders:  Did the 14 who opposed the measure feel the same way?  Were they also wondering exactly how this money would be funneled into education, improvements in roads, utilities and healthcare?\nCalls to the offices of the President were not returned.\n');
INSERT INTO `article` VALUES (649, '682.txt', '2014/01/20', 'The Abila Post\n', 'ON THE SCENE BLOG\n', 'The Abila Post\nON THE SCENE BLOG\nBy Haneson Ngohebo\n20 January 2014\n1235 UPDATE - Rumors abound in regards to the potentially missing GAStech executives. Some suggest that the newly vested executive group skipped the government reception to avoid the press and left to an unknown resort location to celebrate their recent windfall.\nHowever, this rumor does not explain the police presence nor does it explain the fire department\'s search of GAStech headquarters.');
INSERT INTO `article` VALUES (650, '683.txt', '2009/03/12', 'All News Today\n', 'POK LEADER KAREL ARRESTED \n', 'All News Today\nPOK LEADER KAREL ARRESTED \n2009/03/12\nABILA, Kronos √ø¬ø¬ø¬ø¬ø¬ø In another unconscionable move against the citizens of Kronos, earlier today police arrested POK leader Elian Karel on spurious tax evasion charges. \nDemonstrating his trademark humor, Karel lifted his wrists and joked to his supporters as he is led away, √ø¬ø¬ø¬ø¬ø¬øI guess I shouldn√ø¬ø¬ø¬ø¬ø¬øt have sent the President those cases of bottled water for his birthday.√ø¬ø¬ø¬ø¬ø¬ø \nKarel is the leader of the Protectors of Kronos, an alliance of Kronos citizens from Elodis that has demanded the government clean up the contaminated water caused by gas drilling in their community. \n√ø¬ø¬ø¬ø¬ø¬øWe didn√ø¬ø¬ø¬ø¬ø¬øt ask for GAStech to come to our community,√ø¬ø¬ø¬ø¬ø¬ø Karel spoke at a rally a few months ago.  Neither Elodis nor the people of Kronos have received any benefit from the extraordinarily large amount of money that GAStech clears every year.  I ask:  Where is the money going?√ø¬ø¬ø¬ø¬ø¬ø \nThe police representative assured supporters who massed outside the police station that Karel would be treated humanely, but declined to answer questions or allow visitors to see Karel.  He√ø¬ø¬ø¬ø¬ø¬øll probably complain about the jail food at the next POK rally.√ø¬ø¬ø¬ø¬ø¬ø  \nKraft plans to meet with Karel Saturday morning.\n');
INSERT INTO `article` VALUES (651, '684.txt', '2007/03/20', 'Homeland Illumination\n', 'GASTECH TRUCK HITS AUTOMOBILE NEAR ELODIS, FAMILY OF FOUR DEAD \n', 'Homeland Illumination\nGASTECH TRUCK HITS AUTOMOBILE NEAR ELODIS, FAMILY OF FOUR DEAD \nMaha Salo\n20 March 2007\nELODIS, Kronos - A vehicle collision claimed the lives of an Elodis family, including two children Tuesday afternoon.  The family was traveling home from a school program where one of the children had performed in the Spring Program at Elodis Primary School.\nElodis Assistant Police Commissioner Adian Koppolis reported three of the victims died at the scene of the accident.  Marcellus Edris, 33, his wife Valeria, 30, their daughter Celia, 7 died at the scene of the accident.  A son, Carmine, survived the initial collision but died later at an Abila hospital.\nThe unidentified 25-year old driver of the GAStech truck was held overnight in the Elodis city jail, and then released.\nInitial reports from the investigators state the truck driver had illegally entered the intersection where he had failed to halt at a stop sign, while the other vehicle had the right of way.\nCommissioner Koppolis said Elodis police would conduct a full investigation.\n');
