INSERT INTO `article` VALUES (656, '689.txt', '2014/01/21', 'International News\n', 'GAStech\'s Sanjorge Escapes Kidnapping at GAStech HQ \n', 'International News\nGAStech\'s Sanjorge Escapes Kidnapping at GAStech HQ \n2014/01/21\nABILA, Kronos - According to a press conference held at GAStech headquarters in Centrum, Tethys this morning, GAStech\'s President and CEO, Sten Sanjorge Jr. returned safely to Tethys after a reported kidnapping event his company\'s headquarters building in Abila yesterday.  Sanjorge, who had been attending a corporate meeting, was in transit from the GAStech building to the capitol when the kidnapping took place.   \nSanjorge and the four executives from the local GAStech headquarters were to attend a reception being hosted by President Kapelou at the Capitol Building.   \nAt the press conference, the GAStech spokesperson said, \"Our hearts go out to the families of the kidnapped.\n');
INSERT INTO `article` VALUES (657, '69.txt', '1998/03/19', 'Homeland Illumination\n', 'ELODIS, KRONOS:  A TOWN IN NEED, Part One\n', 'Homeland Illumination\nELODIS, KRONOS:  A TOWN IN NEED, Part One\nPetrus Gerhard\n19 March 1998\nThis article is the first installment of a three-part series addressing the growing problem of one community\'s anguish, government malfeasance, and the alarming influence of multinational corporations on the country of Kronos.\nELODIS, Kronos - Nestled in the bend of the Tiskele River, the sun rises over the farming town of Elodis,  chasing away the shadows cloaking nearby Mt. Bouro.  Today, as they have every day for over 250 years, residents will rise to tend the rich floodplain land that provides nourishment for the People of Kronos.\nTwo weeks prior I received an email from an old friend, Pondo Reese, now the editor of the Elodis Weekly Journal, an agriculture paper serving the community around Tiskele Bend. In his email he described a once bountiful region now distressed by contamination, struggling to find solutions to a worsening problem.  I decided to investigate.\n\"We didn\'t make the connection at first,\" Reese told me when I met with him at his office.  \"The gas company had been built a few years back in \'94, and our problems didn\'t start right away.   After a couple of harvests, we saw a decline in the production.   We thought perhaps it was just a hiccup, and things would get better.  Then when the kids started getting sick we took a harder look at what could have changed.\"\nThe change turned out to be GAStech International, an international corporation run by Sten Sanjorge Jr, a business tycoon out of Tethys.\nEstablished in 1961, the GAStech corporation began as a family-owned business providing local trucking services in Tethys.  The two founders - Sten Sanjorge Sr and Hank Fluss - found wildcat drilling to be more lucrative, and thus began a series of environmental disasters and financial scandals that eventually ran Sanjorge Sr into an early grave and drove Fluss into a marginal role in his own company.  With the death of Sanjorge Sr, the son took the helm of GAStech firmly in his grasp and broadened its influence further afield, eventually landing at the doorstep of the small peaceful township of Elodis.\nWith a population of 6500, most residents of Elodis live in one- and two-story houses on small farms.  A smaller number of families live in the township along a main street with two markets, two hardware stores, one gas station and a caf√© where you can buy lunch, pick up your mail and purchase a litre of milk to bring home.  Families have lived in Elodis for generations.\n\"We\'ve made a good living for a long time,\" Reese tells me. \"The population has been steadily increasing.  Crop production has been good.  For the most part, kids haven\'t left for the city as they have in a lot of other rural places.  We have a lot of land that could yet be developed. There was a future for them here.\"\nI asked Reese to help me meet the people whose lives have been impacted by GAStech\'s operations.  He introduced me to a farmer whose family had been here for several generations.  \nI caught up with Henk Bodrogi in town making purchases at the Osvaldo hardware store to repair a broken tractor.  Bodrogi has farmed soybeans his entire life, as did his father and their fathers. I asked him about his life on the farm.\nPart Two will be published April 25, 1998\n');
INSERT INTO `article` VALUES (658, '690.txt', '2007/04/11', 'News Online Today\n', 'TRAFFIC ACCIDENT NEAR ELODIS  \n', 'News Online Today\nTRAFFIC ACCIDENT NEAR ELODIS  \n2007/04/11\nABILA, Kronos - A government investigation has concluded a traffic accident involving a GAStech International vehicle and the vehicle of a family from Elodis resulting in the deaths of the four family members was the result of driver error on the part of the Elodisian driver.\n');
INSERT INTO `article` VALUES (659, '691.txt', '2010/06/22', 'The Explainer\n', 'THE GOVERNMENT RESPONDS TO ANOTHER REDONDO OF PROTESTS \n', 'The Explainer\nTHE GOVERNMENT RESPONDS TO ANOTHER REDONDO OF PROTESTS \n2010/06/22\nABILA, Kronos - the demonstrators aligned with the protectors of the buildings surrounded group by the government of the activist of Kronos (POK) that sang and take to supposed images of his martyrs. The forces of the security of government of Kronos in concert with the police of Abila suppressed the protest with an impressive demonstration of the force.\nBlack dress the authorities that put helmets and gasmasks and brandishing the protectors of the uproar, the ignited bottles of the tear gas as the demonstrators rejected to disperse after several warnings. The group collected proved reluctant to even disperse after the tear gas and of the authorities pressed in the group that protected itself with its protectors and who made pivot their command batons freely.\nAs opposed to overwhelming force, most of the demonstrators fled; nevertheless, a hard group of the base was stopped its earth that underwent the consequences. To the police of the uproar they surrounded to the remaining demonstrators and after the repeated command baton blows many were dragged far under halting. \nWhen the smoke cleared between the flags and the rejected samples and pisoteadas, the blood was clearly visible in the seat.\n');
INSERT INTO `article` VALUES (660, '692.txt', '2014/01/20', 'Kronos Star\n', 'Breaking: Emergency at GAStech Headquarters Building [Updates]\n', 'Kronos Star\nBreaking: Emergency at GAStech Headquarters Building [Updates]\nCato Rossini, Marcella Trapani\n20 January 2014\nAt approximately 10:15 AM this morning, the fire alarm went off at the GAStech headquarters building in downtown Abila.  At the time of the alarm, the media had gathered in front of the building to cover the meeting of GAStech executives, including GAStech President and CEO Sten Sanjorge Jr. and local GAStech executives and their subsequent transition to the presidentially hosted reception at the Capitol Building.');
INSERT INTO `article` VALUES (661, '693.txt', '2014/01/21', 'Kronos Star\n', 'Police Hold News Conference on GAStech Kidnapping\n', 'Kronos Star\nPolice Hold News Conference on GAStech Kidnapping\nMarcella Trapani\n21 January 2014\nABILA, Kronos - The Abila police held a press conference at nine this morning on the kidnapping GAStech headquarters.  Police informed reporters that four of the GAStech employees whose whereabouts were unconfirmed yesterday were found overnight, leaving ten people who are presumed missing.\nPolice spokesman Adrien Carman said Tethyn federal law enforcement agencies are assisting in the investigation.\nThe POK is suspected of conducting the kidnapping, but they have yet to claim credit or release a ransom request.  The POK rhetoric has become increasingly anarchist and their actions more criminal and violent over the past several years.\n');
INSERT INTO `article` VALUES (662, '694.txt', '1998/11/14', 'Who What News\n', 'WELLNESS FOR ALL (WFA) BLASTS GASTECH AND KRONOS GOVT \n', 'Who What News\nWELLNESS FOR ALL (WFA) BLASTS GASTECH AND KRONOS GOVT \n1998/11/14\nABILA, Kronos - The healthy water awareness group, Wellness for All (WFA), has condemned both GAStech International and the Government of Kronos. WFA\'s statement claims widespread groundwater contamination, a lack of adequate safeguards, clean-up demands being ignored and no government oversight.  \nHowever, GAStech International\'s Environmental Safety Advisor Ingmar Casablancas responded to the claims, \"The alleged charges levied against GAStech International are unfounded. GAStech International and the Government of Kronos cooperate tirelessly to ensure a clean, safe, and prosperous work place.\n');
