INSERT INTO `article` VALUES (665, '697.txt', '2014/01/20', 'Homeland Illumination\n', 'VOICES - a blog about what is important to the people\n', 'Homeland Illumination\nVOICES - a blog about what is important to the people\nMaha Salo\n20 January 2014\n1157 - Correspondent Gerhard reports there has been no appearance of the GAStech executives, nor has Sanjorge appeared to speak to the press. 20 Jan 2014');
INSERT INTO `article` VALUES (666, '698.txt', '2012/06/20', 'All News Today\n', 'POK REMEMBERS MARTYRED LEADER \n', 'All News Today\nPOK REMEMBERS MARTYRED LEADER \n2012/06/20\nABILA, Kronos - In a touching ceremony Wednesday leaders of the activist group Protectors of Kronos paid tribute to their fallen leader, Elian Karel, who was murdered on 19 June 2009 while being illegally detained in a Kronos jail. \n\"Today we gather to remember Elian Karel,\" Silvia Marek told the rapt assembly, many of whom held up white candles in Karel\'s honor. \n\"Elian was born on an Elodis farm not 40 minutes from here, to Jeroen and Antaura Karel.   By the time Elian was 17 many of his family members and friends were battling constant illness, including his neighbor 10-year old Juliana Vann.\" \n\"Elian devoted his life to the people of Elodis as well as all citizens of Kronos, as did his father before him.  Elian knew his would be a difficult journey.  He had watched his father, Jeroen and the founder of the POK, Henk Bodrogi walk the very path he would tread.  Elian knew the course would not be easy, and would leave little time for a personal life. \n\"Elian\'s journey ended three years ago today. \nOver the course of the afternoon several other speakers paid tribute to not only Elian, but all who have been victims of the environmental catastrophe brought about by greed and corruption of public officials.  The police agitated many of the crowd, causing them to have to leave the assembly rather than be assailed with batons and pepper spray.\n');
INSERT INTO `article` VALUES (667, '699.txt', '2014/01/20', 'The Abila Post\n', 'ON THE SCENE BLOG\n', 'The Abila Post\nON THE SCENE BLOG\nBy Haneson Ngohebo\n20 January 2014\n1520 UPDATE - A report from the Abila Airport indicates that a private plane departed with eight people around 2:30 PM. The chartered jet was reportedly headed towards Rome, Italy. This report appears to confirm earlier rumors that members of the GAStech leadership simply avoided reporters and the Government reception.\nGAStech employees have begun to exit the building. Hopefully they will shed light on today\'s events.');
INSERT INTO `article` VALUES (668, '7.txt', '2014/01/20', 'News Online Today\n', 'WRAP UP OF EVENTS AT GASTECH \n', 'News Online Today\nWRAP UP OF EVENTS AT GASTECH \n2014/01/20\nABILA, Kronos - A long tense day of conflicting reports and confusing information has come to an end. What we know for certain is that 14 GAStech employees are not only missing, but kidnapped as confirmed by a Kronos Government source. Edvard Vann, a GAStech - Kronos security guard who was interrogated and released after 6 hours, gave the indication that the Protectors of Kronos were involved or at least suspected as being the perpetrators behind today\'s events.\n');
