INSERT INTO `article` VALUES (677, '707.txt', '2001/03/18', 'News Online Today\n', 'Added Taxes on Oil, Gas Development Defeated in General Assembly  \n', 'News Online Today\nAdded Taxes on Oil, Gas Development Defeated in General Assembly  \n2001/03/18\nABILA, Kronos - A motion to increase taxes on oil and gas development by an additional 10% was defeated today in the General Assembly by a vote of 77 to 23.  The proposed tax increase, championed by Minister of Health Cesare Nespola, was to provide specific funding for health care, clean water projects, and health education for rural areas.\n');
