INSERT INTO `article` VALUES (700, '728.txt', '1982/10/02', 'World Source \n', 'Centrum\'s central role in the Tethan Gas Industry  \n', 'World Source \nCentrum\'s central role in the Tethan Gas Industry  \n1982/10/02\nThe world of gas is distant, difficult and far flung. In Tethys a few years ago, I journeyed laboriously to the remote gas fields of Tethys to look at a contentious new energy producing area. \nOne of the sites I visited was a local office of the Sanjorge Gas company, crammed with reinforced work boots and overalls and the chemicals and supplies you need to run a gas operation. \nBut I\'d forgotten about the encounter until I went back to Tethys the other day for the first time since their early years, to reacquaint with the man who created the business, Sten Sanjorge: one man (one of the richest individuals in Tethys) who has lived through the whole story of gas prospecting and prospered mightily from it. \nBut as I went round the capital city of Centrum interviewing people, I soon realised that this was not just a story of new energy. Something very significant has happened to turn Centrum into a global centre of gas industry expertise. It then seemed a pretty impossible dream, turning an island of coal into a place with abundant oil and gas supplies. \nIt seemed to us on the west coast of Scotland that the far flung city of Centrum, Tethys was getting a bit big for its boots, starting to believe in a new fantasy industry. \nBy the early 1970s, a new gas company, GAStech, began its juggernaut-like advances. \nUnder his canny guidance, GAStech evolved into a major supplier of natural gas to the local region, and then much further afield.  You notice them in the constant clutter of helicopters to-ing and fro-ing out to remote areas, and the planes lined up at the city\'s airport to shuttle execs back and forth from the city. But Sanjorge has just been asked to produce a report for the Tethan government recommending the best ways of ensuring that Tethys continues to produce energy for decades to come. \nThe easy-to-get stuff has been produced, so keeping the gas coming will need much investment and more clever new techniques, such as the hyper-acidic substrate removal techniques developed by the company in 1974.  \nSo thanks to clever people such as Sten Sanjorge and the people who work with him, Centrum has achieved what every place where raw materials are discovered longs to do. The city has taken the temporary boon of energy on its doorstep, and turned it into specialized knowledge and intellectual property which may make Centrum a centre of gas expertise long after the gas itself runs out.\n');
INSERT INTO `article` VALUES (701, '729.txt', '1995/03/31', 'The Light of Truth\n', 'TECHNIQUE OF DRILLING PROHIBITED IN TETHYS\n', 'The Light of Truth\nTECHNIQUE OF DRILLING PROHIBITED IN TETHYS\n1995/03/31\nCENTRUM, Tethys - acid displacement hyper international of substrate of GAStech (HASR) was officially prohibited by the government of Tethys due to the high probability of the contamination of water. \nGAStech developed the innovating technique of drilling in 1974 was completely crowned success for the extraction of gas, but the incidences on the environment of the technique are considered unacceptable by the government of Tethys due to the high probability of the contamination of table of water starting from the waste produced during the process of HASR.\nSten Sanjorge, Jr. answered the stating of prohibition, \"as it is. The loss of Tethys will be the profit of another county.\"\n');
INSERT INTO `article` VALUES (702, '73.txt', '2009/06/19', 'Homeland Illumination\n', 'ELIAN KAREL DEAD IN KRONOS JAIL\n', 'Homeland Illumination\nELIAN KAREL DEAD IN KRONOS JAIL\nPetrus Gerhard\n19 June 2009\nABILA, Kronos -Elian Karel, age 28, died Friday while unlawfully incarcerated at the Abila City Prison.  Karel was being held on fraudulent tax evasion charges after his arrest on March 12 earlier this year.\nHis attorney, Michale Kraft made the announcement Friday during a noon press conference.\n\"We don\'t know any details yet.  What I can tell you is that when I left Elian yesterday after meeting with him in the prison he was in excellent health and good spirits.  He was expecting to be released in the next few days and return to his work with the Protectors of Kronos, and was excited to continue the Protectors of Kronos mission to which he dedicated his life.  I can assure you that Elian\'s death will be investigated with all the resources at our disposal and those responsible will be brought to justice.\"\nSupporters of the POK and others began gathering outside the police station as news spread.\n\"I can\'t believe it,\" Kriste Brontes said through her tears, \"We were at the rally in March.  He looked and sounded so good.  He was so optimistic that changes were coming.  Who will be able to lead POK now?\"\nKarel, from Elodis, had been involved with the POK mission since he was young.  He was only a few years older than Juliana Vann, a friend who died in 1998 of toxin poisoning caused by illegal dumping from the Tethyn company GAStech. \nCalls to the President\'s office, the office of the Minister of Justice and the office of the Chief of Police were not immediately returned.\n');
INSERT INTO `article` VALUES (703, '730.txt', '2005/04/08', 'Worldwise\n', 'Traffic of block of protestateurs to the fields of curve of Tiskele\n', 'Worldwise\nTraffic of block of protestateurs to the fields of curve of Tiskele\n2005/04/08\nABILA, Kronos - more than of the dozen protesters POK were menott√©s and taken in the guard by the police force Tuesday to block the access to the fields of curve of Tiskele.  Before the police force made the arrests little time after 9 hours of the morning, the protesters were known as that they violated the law for enfreindre on the property of government, to block the access to the ground of state-owned property, and to prevent the legal commercial traffic. \nThe protesters arrived at the entry at the site of curve of Tiskele towards 5:30 hour of the morning and at the arms locked through the road during approximately three hours, in spite to be invited to leave by the police force.  While the traffic on the road started to support, several drivers of truck started to leave their vehicles and to gather close to the protesters.  Hardenings started to widen while the blockade persisted in the second hour, and the drivers started to shout and curse with the protesters to move out of the road.  To maintain to the order the quickly inside moved leaders and stopped the protesters of POK before the situation could climb with violence.  \n\"We appreciate citizens expressing their opinion, but the medium of a trunk road is not the right forum for a discussion of our national environmental policy. We encourage our interested citizens to follow the democratic process and to come into contact with their representatives of Parliament,\" spokesman Rufus Drymiau of government called in a report/ratio.\n');
INSERT INTO `article` VALUES (704, '731.txt', '1997/04/25', 'The Explainer\n', 'POSSIBLE CONTAMINATION IN ELODIS \n', 'The Explainer\nPOSSIBLE CONTAMINATION IN ELODIS \n1997/04/25\nELODIS, Kronos - near 25 kilometers to the west of Abila they are the small rural municipality of Elodis, located in the river of Tiskele. Rough 20 kilometers of by waters above are the site of the curve of Tiskele worked by GAStech International in governmental earth. The citizens demand the site are contaminating the Earth and the water that makes their patient of people.\nIn a declaration the government of Kronos has denied that the site of the curve of Tiskele is the source of any contamination that insists that ambo the \"natural gas and the process that it perforates they are clean.\" The declaration continued, \"if our people are ill we aid to obtain to them well. We will find the source of its ailments and will do what is required to solve the problem. That one is to have of the government: in order to protect its people.\"\nFor its part, international GAStech is preput to cooperate completely with the government as it has from the beginning of his relation. \n');
INSERT INTO `article` VALUES (705, '732.txt', '1993/09/19', 'Who What News\n', 'UPGRADES NEEDED FOR ABILA\'S DEEP WATER PORT \n', 'Who What News\nUPGRADES NEEDED FOR ABILA\'S DEEP WATER PORT \n1993/09/19\nABILA, Kronos - As part of the government brokered deal with GAStech International, Abila must make upgrades to their deep water port.  \nThe proposed upgrades include raising Abila\'s East Pier in phases, a massive $300 million project that will accommodate new, larger container ships. Additionally, the Port will need to dredge the port killing two birds with one stone: increasing the depth of the port and providing fill to raise the East Pier. \nPort of Abila\'s Director Claudio Morluniau applauded the deal saying that the additional port capacity will open doors for import and export trade.\n');
INSERT INTO `article` VALUES (706, '733.txt', '2014/01/20', 'Homeland Illumination\n', 'VOICES - a blog about what is important to the people\n', 'Homeland Illumination\nVOICES - a blog about what is important to the people\nMaha Salo\n20 January 2014\n1621 - I caught up with another employee exiting the area.  She told me the police were questioning everyone.  I asked her if she\'d seen anything usual.  \"There were some people I didn\'t recognize, but I didn\'t get really close.  I work on the second floor and only saw them through the glass elevator.\"  When asked if they could have been kidnappers, she told me she shouldn\'t say anything else and that the police told them to not talk to anyone. 20 Jan 2014');
INSERT INTO `article` VALUES (707, '734.txt', '2000/08/17', 'Central Bulletin\n', 'TISKELE BEND EXPLOSION AND FIRE \n', 'Central Bulletin\nTISKELE BEND EXPLOSION AND FIRE \n2000/08/17\nABILA, Kronos - A spark at the GAStech International-owned well at the Tiskele Bend site ignited methane gas several hundred feet underground, causing a fireball and fire that burned for about an hour is the findings from a dual GAStech - government investigation of the explosion and subsequent fire Sunday morning.  \nFour GAStech employees suffered injuries including minor burns and broken bones. No local residents were injured as well and though some residents of Elodis were evacuated from their homes the investigation indicates that the evacuation was unnecessary.  \nWhile the official cause of the explosion is still under investigation, the problem may have come from a defect in the wellhead itself. GAStech\'s wellheads are ringed with collars that have set pins running through them.\n');
INSERT INTO `article` VALUES (708, '735.txt', '2009/03/09', 'The Orb\n', 'THE GATHERING OF POK DRAWS THOUSANDS OF DEFENDERS\n', 'The Orb\nTHE GATHERING OF POK DRAWS THOUSANDS OF DEFENDERS\n2009/03/09\nABILA, Kronos - the thousands of protesters carrying of the banners reading \"remember Juliana!\" and singing \"we want the truth!\" gathered in front of Kronos of government of offices Saturday morning. The protesters required an accountancy of the incomes of government then tax tax incentives of the President Araullo\' S which were signed in the law in 1993.\nFrom ten years - old man Juliana Vann died into 1998 of a disease caused by the soiled water of the operations of drilling of GAStech. It became the tearing icon of a movement which received the support of an end of Kronos to the other.\n\"We were promised best work, of new roads, better care of health and a better level the life,\" the aforementioned one 20 years - the old protestator who refused to make employ his name.  \"All which I see are larger manors for the ministers and a hospital who cost the difficulty more than it can make.  We will not accept that!\"\nThe protestator referred to the hospital general of Abila builds in 1997 seemingly with money of the increased income of the foreign gas operations here on Kronos.  The non-profit-making hospital had the difficulty of maintaining its infrastructure, in spite of the sevearl carried out by wide restoration years ago to replace the electric systems and putting balance.\n\"All the contracts were given to the family and the buddies ministers,\" shows 26 years - old man Jon L., who travelled during six hours to attend the gathering of yesterday.  \"What we have need is transparency in our government.  We must know what arrives at any entering money of these alien companies.\nThe Chief Elian Karel of protest addressed the demonstrators to the park of town of Abila.  Karel ensured the control of POK of Henk Bodrogi, whose bad health forced to the bottom of the position.  Karel spoke by eloquence about the beginnings about the countryside about POK like effort about bases for clean water, with the dynamic movement it has become demanding improved transparency and the responsibility for government.\n\"We do not ask anything not very reasonable,\" Karel speaks passion√©ment with its burning listeners.  \"Very that we want is of knowing our taxes are employed.  We know that these companies produce benefit of discs at the expense of Kronos, but we let us not see any the promised improvements of it.  Very that we want is responsibility for those which died because of avarice, the corruption and the negligence of those that they should protect.\"\nCalls to the office of the president were not immediately turned over.\n');
INSERT INTO `article` VALUES (709, '736.txt', '1993/09/19', 'The World\n', 'UPGRADES NEEDED FOR ABILA\'S DEEP WATER PORT\n', 'The World\nUPGRADES NEEDED FOR ABILA\'S DEEP WATER PORT\n19 September 1993\nABILA, Kronos - As part of the government brokered deal with GAStech International, Abila must make upgrades to their deep water port. When gas production ramps up, the Port\'s traffic is expected to increase ten-fold. \nThe proposed upgrades include raising Abila\'s East Pier in phases, a massive $300 million project that will accommodate new, larger container ships. Currently the East Pier is roughly 3 meters above sea level and must be raised to 8 meters. Additionally, the Port will need to dredge the port killing two birds with one stone: increasing the depth of the port and providing fill to raise the East Pier.\nPort of Abila\'s Director Claudio Morluniau applauded the deal saying that the additional port capacity will open doors for import and export trade. \"This deal and the port expansion is the introduction of Kronos to the world!\"\n');
INSERT INTO `article` VALUES (710, '737.txt', '2004/05/29', 'Homeland Illumination\n', 'ELODIS PUBLIC HEALTH FACT SHEET 2004\n', 'Homeland Illumination\nELODIS PUBLIC HEALTH FACT SHEET 2004\nPetrus Gerhard\n29 May 2004\nELODIS, Kronos - The Elodis Community Health Center has published an update to the Wellness for All study performed in 1998.  The mortality rate and incidence of chronic illness increased over 252% from prior years.  The full report will soon be posted on the Elodis municipal website.\n');
INSERT INTO `article` VALUES (711, '738.txt', '2014/01/21', 'Homeland Illumination\n', 'VOICES - a blog about what is important to the people\n', 'Homeland Illumination\nVOICES - a blog about what is important to the people\nMaha Salo\n21 January 2014\n0715 - Welcome to our continuing coverage of the disappearance of several GAStech employees.  What we know:  Police have announced that fourteen GAStech employees disappeared sometime yesterday morning.  Officials from Tethys - likely GAStech corporate officials - arrived late last night in a private jet and went directly to the Abila Police headquarters.  A fire alarm sounded at GAStech-Kronos headquarters yesterday morning at about 10:15.  No fire was identified, nor was it a bomb as some media outlets had reported.  We have no information about exactly who is missing, and are waiting for a new conference.  21 Jan 2014');
INSERT INTO `article` VALUES (712, '739.txt', '2012/02/21', 'World Journal\n', 'The gas and oil industry of Kronos informed that it takes up its \"greater challenge in 20 years\" of due to the bottom grades of exploration.\n', 'World Journal\nThe gas and oil industry of Kronos informed that it takes up its \"greater challenge in 20 years\" of due to the bottom grades of exploration.\n2012/02/21\nThe civils servant of energy of government declared that only 15 wells were drilled last year.\nIt was in spite of the strong levels of the investment, reaching one year last record and supported this year.\nThe structural test drilling was in fall of 26 wells six years ago, only sufficiently to recover a fraction of estimated oil and to poison remaining in the countries oil and of the gas layers.\nThe \"fields of Kronos contain an abundance of oil and the gas to be still found and it is critical find us the means of turning the current state of the exploration around\" - of the Minister for energy Jules Jecovic\nThe annual investigation of activity per Oil and gas Kronos found last year an increase fast in production costs, to the top from 15%.\nThe average cost to extract a barrel from oil was in rise of 27% in only year, to reach K17.\nThe number of fields with the cost by barrel above K30 doubled in the last 12 months.\nIncreasing costs were quoted last week by GAStech, which considers future investments in Norway and North America, rather than the fields of Kronos.\nWith increasing costs, one expects that payments of taxes of production to the treasure of Kronos fall from K3.5bn during 2011-12 in K2bn per current year.\nAfter the fast decline in the production of oil and gas starting from the fields of Kronos these last years, the rate of fall slowed down during 2012 - to the bottom of barrels of 8% with oil .83m per day, or its equivalents of gas.\nTo continue to read the principal history	\nFields \"of Kronos indicated by Jecovic contain an abundance of oil and the gas to be still found and it is critical find us the means of turning the current state of exploration around. The availability and the access of equipment to the capital are the two remarkable principal barriers by our ministry.\"\n');
INSERT INTO `article` VALUES (713, '74.txt', '2012/08/24', 'Athena Speaks\n', 'WHO ARE the PROTESTERS \n', 'Athena Speaks\nWHO ARE the PROTESTERS \n2012/08/24\nABILA, Kronos - with the third birthday of the approach of died of Elan Carol - former member of the guards of Kronos - the question is: who are the protesters? But not only which is they, which and why they protest? \nThe guards of Kronos or POK were founded in 1997 by residents of rural Elodis in accordance with the opinion of now old health for all (WFA), an international group of safety of water. The POK was launched to give the attention to the clean questions of water surrounding Elodis to the government of Kronos and of the world. The POK affirms that the site of international natural gas drilling of curve of GAStech Tiskele is the source from both the contamination of drinking water as well as the destruction of the traditional fields surrounding Elodis. \nIn 1998, WFA carried out test on the water of Elodis finding the levels high of benzene, arsenic of toluene and xylene, barium, chromium, lead and selenium. The test of a following report/ratio released by an attention and pressure on the international government and GAStech brought by WFA to the act. However, with reducing WFA in fragments due to the questions of placement, the requests of the POK were mainly ignored and reduced the value. \nMoreover in 1998, Juliana Vann, one ten years previously healthy - the old maid died of a prolonged disease, which WFA-a placed of the claimed doctors was caused by contamination of water. The government of Kronos officially refuted the complaint quoting the fragmentation of the organization of WFA like obviousness of a dubious source not to make confidence. Without worrying, Juliana was well to the martyrdom of the POK first and employed the image of Juliana on the literature of countryside since. \nThe martyrdom in the second place principal of POK is Elan Carol, which died in 2009 while imprisoned unspecified causes. The POK affirms it was stopped above trumped to the top of the expenses while the government of Kronos it question was a radical activist and violent one occupied in tax avoidance. Carol had been implied POK since its beginning since his/her father, Jeroen Carol, were an original member.  The death of Elan Carol in 2009 was marked for spontaneous examples of protest around Abila. The birthday of its death, June 19, saw protests, demonstrations, riots, and violence additional. \nThe POK evolved/moved of the peaceful protests and the demonstrations requiring the action of government to more violent activities including/understanding riots while they claim that the government made little with nothing by addressing the contamination, the intoxications, and the deaths suffered by their people. In date of 2011, the government of Kronos marked the POK like \"threatens public\".\n');
