INSERT INTO `article` VALUES (716, '742.txt', '2009/02/18', 'International News\n', 'POK Protest at GAStech Headquarters Ends in Arrests \n', 'International News\nPOK Protest at GAStech Headquarters Ends in Arrests \n2009/02/18\nABILA, Kronos - Dozens of protesters attending a Protectors of Kronos (POK) rally in front of the GAStech regional headquarters in Abila were arrested for trespassing this morning.  The POK rally was intended to draw attention to their claims of environmental damage being caused by the development of gas and oil fields around Kronos by foreign corporations like GAStech.  About two hundred people gathered in front of the GAStech building chanting slogans and waving signs that held the visages of people who have allegedly died due to environmental contamination.  Ten of the protestors chained themselves to the doors of the building in an attempt to prevent GAStech employees from going to work. \nPolice spokesman Adrien Carman said, \"We allowed the group some latitude with their rally, but when GAStech complained that the protestors were blocking entrance to their building, we had to take action.  Government spokesman Rufus Drymiau said of today\'s POK rally, \"We have been concerned by a pattern of increasingly aggressive tactics by the Protectors of Kronos for some time now.\n');
INSERT INTO `article` VALUES (717, '743.txt', '2009/03/7', 'Homeland Illumination\n', 'POK RALLY DRAWS THOUSANDS OF SUPPORTERS\n', 'Homeland Illumination\nPOK RALLY DRAWS THOUSANDS OF SUPPORTERS\nPetrus Gerhard\n7 March 2009\nABILA, Kronos - Thousands of protesters carrying banners reading \"Remember Juliana!\" and chanting \"We want truth!\" rallied in front of the Kronos government offices Saturday morning. Protesters were demanding an accounting of the government revenues from then President Araullo\'s tax incentives that were signed into law in 1993.\nTen-year old Juliana Vann died in 1998 from an illness caused by contaminated water from GAStech drilling operations. She has become the heart-rending icon of a movement that has gained support from one end of Kronos to the other.\n\"We were promised better jobs, new roads, better healthcare and a better standard of living,\" said one 20-year old protestor who declined to have her name used.  \"All I see are bigger mansions for the ministers and a hospital that costs more to fix than it can make.  We won\'t accept that!\"\nThe protestor was referring to Abila General Hospital built in 1997 ostensibly with money from the increased revenue from the foreign gas operations here on Kronos.  The non-profit hospital has had difficulty maintaining its infrastructure, despite the extensive restoration performed sevearl years ago to replace the electrical and plumbing systems.\n\"The contracts were all given to family and cronies of the ministers,\" accuses 26-year old Jon L., who traveled six hours to attend yesterday\'s rally.  \"What we need is transparency in our government.  We need to know what happens to all the money coming in from these foreign companies.\nProtest leader Elian Karel addressed the demonstrators at Abila City park.  Karel took over POK leadership from Henk Bodrogi, whose ill health forced him down from the position.  Karel spoke eloquently about the beginnings of the POK campaign as a grassroots effort for clean water, to the dynamic movement it has become demanding improved government transparency and accountability.\n\"We aren\'t asking for anything unreasonable,\" Karel speaks passionately to his ardent listeners.  \"All we want is to know how our taxes are being used.  We know these corporations are generating records profits at the expense of Kronos, but we see none of the promised improvements.  All we want is accountability for those who died because of greed, corruption and disregard of those who they should be protecting.\"\nCalls to the President\'s office were not immediately returned.\n');
INSERT INTO `article` VALUES (718, '744.txt', '2014/01/20', 'Homeland Illumination\n', 'VOICES - a blog about what is important to the people\n', 'Homeland Illumination\nVOICES - a blog about what is important to the people\nMaha Salo\n20 January 2014\n2232 - Homeland Illumination correspondent Petrus Gerhard reports airport officials have confirmed the arrival of a private jet from Tethys.  Several passengers departed into a waiting limousine.  Gerhard followed the limousine, which drove directly to Abila Police Headquarters. 20 Jan 2014');
INSERT INTO `article` VALUES (719, '745.txt', '2009/06/21', 'Central Bulletin\n', 'SPONTANEOUS PROTESTS ERUPT AROUND ABILA \n', 'Central Bulletin\nSPONTANEOUS PROTESTS ERUPT AROUND ABILA \n2009/06/21\nABILA, Kronos - Protests erupted around the Kronos government buildings, downtown, and elsewhere around Abila eventually escalating into riots and violence.  \nThe activists are protesting the death yesterday of Elian Karel, a Protector of Kronos (POK) activist who died in jail after being arrested for tax evasion. However, the protests have turned violent with smashed windows and vandalized shops. \nCountless shop windows smashed in and around Siopa, the downtown shopping area. A general sense of chaos broke out with chanting protesters, fires, and fleeing citizens.  \nA unifying theme of the protesters was the chanted slogans including \"Justice for Elian\" in reference to previously mentioned activist Elian Karel and \"Remember Juliana\", a young girl from Elodis who died in 1998 allegedly from the effects of water contamination. The Protectors of Kronos must resume peaceful means;\n');
INSERT INTO `article` VALUES (720, '746.txt', '2001/06/15', 'News Online Today\n', 'Minister of Health Dies Suddenly \n', 'News Online Today\nMinister of Health Dies Suddenly \n2001/06/15\nABILA, Kronos - It is with great sorrow that we announce the death of Minister of Health Cesare Nespola. \nShortly after hearing of Nespola\'s death, President Kapelou announced that his nephew Vincent Kapelou would serve as his administration\'s new Minister of Health.\n');
INSERT INTO `article` VALUES (721, '747.txt', '2000/10/03', 'The Explainer\n', 'VICTORY OF THE COLLAPSE FOR PRESIDENT KAPELOU\n', 'The Explainer\nVICTORY OF THE COLLAPSE FOR PRESIDENT KAPELOU\n2000/10/03\nABILA, Kronos - the people of Kronos of overwhelming form have chosen new president Dorel Kapelou II. granted defeat Araullo of president Anterior Luis yesterday when the early returns came in fort for Kapelou II. Mark today a new dawn for the people of Kronos and a shining trajectory advanced for the country.\nThe results for the election of the 1 of October are as it follows: Dorel Kapelou II chose with 62% of the vote and the Luis Araullo that hardly received 36% of the vote. A victory resounding for the new chosen president and a clear mandate for the vision of Kapelou for the country.\n');
INSERT INTO `article` VALUES (722, '748.txt', '1993/02/04', 'Daily Pegasus\n', 'DEFICIENCY OF THE INTENTIONS OF THE MARS GOVERNMENT OF THE DETAILS\n', 'Daily Pegasus\nDEFICIENCY OF THE INTENTIONS OF THE MARS GOVERNMENT OF THE DETAILS\n1993/02/04\nABILA, Kronos - in a president glitzy Luis Araullo of the press conference behind schedule announced the last year an historical system of fiscal incentives anticipated to bring the foreign investment to Kronos under way that created works, providing cheap energy and constructing the infrastructure.  After the vote the 86-14 month last the minister of inner the Sarto Takings praised the decision like the \"signal\" and \"to improve people\".\nWe will see.  Crafters of these revolutionary measures neglected to include a detailed plan on how this unexpected gain would benefit daily Kronosians.   When the first payment of these foreign company lands in the boxes of the state, how these bottoms will be dispersed?\nOne is asked:   The 14 who opposed the measurement felt the same way?   Also was asked exactly how this money would be concentrated in the education, improvements in ways, utilities and healthcare?\nThe calls to the offices of the president were not returned.\n');
