INSERT INTO `article` VALUES (724, '75.txt', '2012/06/22', 'International News\n', 'Kapelou Calls POK \"A Gang of Criminals\" \n', 'International News\nKapelou Calls POK \"A Gang of Criminals\" \n2012/06/22\nABILA, Kronos - In a press release today, President Kapelou today called the POK \"a gang of criminals, thugs, and malcontents who have become a pestilence to our peaceful way of life.\"  President Kapelou has called for increased police patrols of the Elodis area and has said that all future POK demonstrations will be \"met with maximum police force.\"\n');
INSERT INTO `article` VALUES (725, '750.txt', '1994/02/17', 'The World\n', 'PROMINENT BUSINESS, CIVIC LEADER DIES AT 65\n', 'The World\nPROMINENT BUSINESS, CIVIC LEADER DIES AT 65\n17 February 1994\nCENTRUM, Tethys - After four years of diminishing health following a major heart attack, Sten Sanjorge, Sr. died early Friday morning. \nSanjorge, Sr., 65, of Centrum, Tethys was President Emeritus of GAStech International having founded the company in 1961. In addition to his role at GAStech International was the chairman of the Centrum Chamber board of directors and member of the Centrum Children\'s Hospital Board of Trustees. \n\"Sten has always been a champion for the children of Tethys,\" said Hospital President Willem Gracias. \"He was a true servant leader and endlessly worked to drive our institution forward. Sten will truly be missed and we ask that everyone keep the Sanjorge family in their thoughts and prayers.\"\nSanjorge, Sr. is survived by his wife Ingrid Sanjorge and his son Sten Sanjorge, Jr.\n\"A great light in this world has been extinguished, yet he still casts a shadow,\" said Sanjorge, Jr. \"I vow to lead our company forward with a renewed vision and dignity that will honor my father\'s life and work.\"\n');
INSERT INTO `article` VALUES (726, '751.txt', '1984/05/3', 'International Times\n', 'Shale gas pioneer plans world\'s first offshore wells in Mediterranean Sea \n', 'International Times\nShale gas pioneer plans world\'s first offshore wells in Mediterranean Sea \n3 May 1984\n<<Deleted Image: Anti-offshore drilling protester.  Exploration has proved a controversial issue in Kronos>>\nContinue reading the main story	\nThe son of the founder of gas firm GAStech is planning a venture to drill in the Mediterranean Sea, the Times has learned.\nSten Sanjorge, Jr. believes there are large volumes of offshore gas that could be extracted.\nSanjorge and GAStech were awarded three licences by the Kronos government last month by the Ministry for Energy and Development and hopes to begin exploration soon.\n\"Certainly offshore gas isn\'t a new concept, but there\'s no reason with the Kronosian history of offshore development that we can\'t develop these resources offshore,\" he told the Times.\nShale gas is extracted using the controversial technique of hyper-acidic substrate removal which involves injecting acidic chemicals shale layers, to break them up and release the natural gas trapped within.\nHyper-acidic substrate removal has produced vast quantities of gas and oil in the West, transforming the energy market. But projects in Europe have been slow to take off, beset with opposition from government and local communities.\nSanjorge says it will be a short time before we know if offshore shale gas can be exploited.\nMany environmentalists believe that hyper-acidic substrate removal can damage marine environments, and oppose the extraction of new fossil fuel resources. But drilling offshore avoids the need for difficult negotiations with local councils, communities and landholders.\nBased on existing geological data, SanJorge believes that a considerable quantity of gas is in place - up to 100 trillion cubic feet, which would be more than GAStech\'s estimates for its onshore resources. There is also the possibility of finding oil.\nGAStech has estimated that the Kronos total offshore shale gas resources could be between five and 10 times the size of the resources available onshore.\n\"We\'re very comfortable that the resource is there and the numbers are absolutely ginormous,\" SanJorge said. \"Is any of that exploitable? That\'s the billion dollar question, and GAStech is wiling to invest in the answer.\"\nThough it has only recently become controversial, hyper-acidic substrate removal has been used on a smaller scale for many years, to improve the flow from conventional oil and gas wells. But using the process on the large numbers of wells needed to extract offshore shale gas commercially has never been done.\nProfessor Oskar Wertz of Tethys University is sceptical about whether offshore shale gas could be a big contributor to European energy in the next decade, but says that it could have potential in the longer term.\n\"GAStech is being optimistic is its estimates of how long it will take to explore offshore shale. It\'s perfectly plausible that in 20, 30 or 40 years, the hyper-acidic substrate removal technology will have so advanced and the way in which we deal with the offshore environment will have so advanced that this could be a really big industry. The task in the next 10 years is to try these things out, see if they work.\" \n');
INSERT INTO `article` VALUES (727, '752.txt', '2014/01/21', 'Worldwise\n', 'Escapes from Sanjorge de GAStech removing at the HQ of GAStech\n', 'Worldwise\nEscapes from Sanjorge de GAStech removing at the HQ of GAStech\n2014/01/21\nABILA, Kronos - according to a press conference was held with the registered offices of GAStech in the centrum, Tethys this morning, president de GAStech and the PRESIDENT, Jr. of Sten Sanjorge turned over without risk to Tethys after brought back to remove the event registered offices of its company building in Abila yesterday.  Sanjorge, which had attended a meeting of the company, was in transit of GAStech building with the capitol when kidnapping took place.  \nSanjorge and the four executives of the registered offices of GAStech of people of the country were to be used a reception accommodated by President Kapelou for the building of capitol.  The reception was given to celebrate the 20th year of the co-operation between the company and our country.  \nTo the press conference, the spokesman of said GAStech, \"our hearts leave to the families removed. We work for a prompt and sure resolution with this crisis.\" \n');
INSERT INTO `article` VALUES (728, '753.txt', '2012/09/08', 'All News Today\n', 'PROTESTS SWELL IN ABILA IN RESPONSE TO CALLS TO ACTION \n', 'All News Today\nPROTESTS SWELL IN ABILA IN RESPONSE TO CALLS TO ACTION \n2012/09/08\nABILA, Kronos - Thousands of people lined the roads on Thursday in a display of antigovernment solidarity. \nAmong the demonstrators was Mestache Vardshvna, 23, from the west coast of Kronos.  \"This is important, so I took time off from work to be a part of this important event.\" \nHe was one of many who wielded their power of free speech to voice their concern with the current lack of government transparency with public monies. \nPosters with colorful images of Elian Karel and Juliana Vann were reminders of the heavy toll already paid by leaders and innocents.  Karel was the prior leader of the Protectors of Kronos before his premature death in 2009.  His death, thought to be a murder by many, prompted annul rallies to bring the message of the Protectors of Kronos to the public.  Juliana Vann died in 1998 of cancer caused by environmental toxins in her drinking water.\n');
INSERT INTO `article` VALUES (729, '754.txt', '2011/06/22', 'The Guide\n', 'The POK demonstrators destroy districto of Siopa\n', 'The Guide\nThe POK demonstrators destroy districto of Siopa\n2011/06/22\nABILA, Kronos - the protectors of the demonstration of Kronos in the streets of districto of Siopa in centric Abila gave rise to numerous incidents of the vandalism and the sacking opportunistic yesterday.  The crowd that the members there are dew painted the new standard of POK in buildings and cars, broke the sacked windows of the store, warehouses, and intimidated innocent present people.  They forced the police to use the tubes of the tear gas and the water to disperse to the group of gamberros.\n');
INSERT INTO `article` VALUES (730, '755.txt', '1993/01/20', 'Worldwise\n', 'The government announces the tax tax incentives for the foreign investment\n', 'Worldwise\nThe government announces the tax tax incentives for the foreign investment\n1993/01/20\nABILA, Kronos - today the Parliament voted 86 to 14 in favor of the package of the President Araullo\' S of the tax tax incentives conceived to delude the foreign investment with our country right. Divided into volumes Sarto, Minister of Interior Department, glorifi√© the voice as \"limiting business of terminal designed to improve the lives of all Kronosians\".  \nThe tax tax incentives specifically aim the companies of development of energy, that the government hopes to delude with the rich person with Kronos, but however little developed, of the gas layers.  The ministry for interior projections prove that the development right of the fields of curve of Tiskele could bring as much of as the 5.000 operations and a billion payment high of output of dollars of development of infrastructure during 20 years to come.    \n');
INSERT INTO `article` VALUES (731, '756.txt', '2007/04/10', 'The Abila Post\n', 'TRAFFIC ACCIDENT NEAR ELODIS \n', 'The Abila Post\nTRAFFIC ACCIDENT NEAR ELODIS \n10 April 2007\nABILA, Kronos - A government investigation has concluded a traffic accident involving a GAStech International vehicle and the vehicle of a family from Elodis resulting in the deaths of the four family members was the result of driver error on the part of the Elodisian driver.\nGovernment spokesman Rufus Drymiau said that the investigation found the deadly accident was triggered when the driver from Elodis crossed over into oncoming traffic. Three passengers - Valeria Edris, Celia Edris, and Marcellus Edris - died at the scene.  \nCarmine Edris, 9, was found wandering around the accident site. He succumbed to his injuries later at the Abila Hospital. \nThe GAStech truck driver received minor injuries and was taken to hospital for observations.\nIn a show of corporate largesse GAStech International vows to donate money to the remaining family members.\n');
INSERT INTO `article` VALUES (732, '757.txt', '2011/07/28', 'News Desk\n', 'THE LABELS POK PUBLIC THREAT OF THE GOVERNMENT \n', 'News Desk\nTHE LABELS POK PUBLIC THREAT OF THE GOVERNMENT \n2011/07/28\nABILA, Kronos - the government Kronos has the guards of Kronos (POK) as a threat to the public ge√´tiketteerdn. In a declaration by government spokesman Rufus Drymiau POK is described as justified public threat opportunistic to attribute to violent demonstrations, vandalism, and conflicts with the police force.\nA shop owner in the district Siopa, which decreased are called, answered to the government which labels POK a public threat: I will be agreed they a public threat. Each time they round they come and then break they windows bring their signs. We try fight, but there are surplus and they steal our things. My matter suffers because of the guards.\nCivil servant Emilio Haber, who the patrols the district Siopa, aforesaid of POK, they the windows break. They throw the rocks. They chant for change and painting things on bldg. They prove themselves to stomme can and arrest we them then and put them in prison they. to belong\n');
INSERT INTO `article` VALUES (733, '758.txt', '1998/01/20', 'The Guide\n', 'Advantages of Kronos of the foreign investment\n', 'The Guide\nAdvantages of Kronos of the foreign investment\n1998/01/20\nABILA, Kronos - it is today the fifth anniversary of the visionary plan of president Araullo to bring the foreign investment to Kronos, an act in negrilla that has harvested the enormous advantages for our country just.  Abila of today is a metropolis that hurries completely of new cars, of the new construction, buildings of offices that flash, and modern conveniences.  The dismantled streets, factories, storefronts tired, and the sad markets of the past go away potholed.  Abila of today is a city of the industry, of a place of the commerce and the investment, of a place of the opportunity and the success.  The prosperity has come to Kronos, and we are all the best ones for him.\nNevertheless, still there are those think incorrect that the prosperity is bad for us.  This people demand that the foreign investment is bad for our country, that is diluting our culture and that is mining our values.  She demands that the foreigners are exploding to us for their own increase and that our government causes that little he watches for the well-being of our people.  It is so militant in her incorrect-directed belief that it has made demands that the foreign companies are poisoning to our children with their technology.  It has even gone as far as to have brought in \"foreign experts\" who the demand \"has our better interests in the heart\" to help to separate its agenda against progress and the prosperity for our people.  Hipocres√≠a to bring in foreigners to say that to open our country to us in the foreigners he is bad for us is absurd and is obvious a sample of the mental disease in which they oppose our modernization. \n');
