INSERT INTO `article` VALUES (736, '760.txt', '2005/04/07', 'Daily Pegasus\n', 'POK PROTESTS THE END IN HALTINGS\n', 'Daily Pegasus\nPOK PROTESTS THE END IN HALTINGS\n2005/04/07\nELODIS, Kronos - to the federal police of Kronos they arrested fifteen members of the protectors of the organization of the activist of Kronos (POK) that followed yesterday a conflict in the doors of the facility of GAStech of the curve of Tiskele.\nThe demonstrators arrived pre-dawn at the arms from lock and traffic from the stop that left and that incorporated of the facility.  Per local time of 8, the traffic had endorsement in both sides of the doors.  Shaking itself, the demonstrators sang well-known songs affluent of the protest, including \"this are our earth\", \"songs of the farmer\" and \"the weavers of our mother country\"\nWhen the federal police began to arrest the POK demonstrators, he moved in a way ordered in the van of the police that waited for, singing the whole time.\n');
INSERT INTO `article` VALUES (737, '761.txt', '2014/01/20', 'Kronos Star\n', 'Breaking: Emergency at GAStech Headquarters Building [Updates]\n', 'Kronos Star\nBreaking: Emergency at GAStech Headquarters Building [Updates]\nCato Rossini, Marcella Trapani\n20 January 2014\nUpdate, 7:00 PM:  The last of the GAStech employees has been allowed to leave the building.  The employee, Edvard Vann, said that the police interviewed him for hours and accused him of involvement in the kidnapping because he shares a family name with several POK members.  Vann, an Abila native, denied being connected to the POK.');
INSERT INTO `article` VALUES (738, '762.txt', '1999/11/14', 'World Source\n', 'Charity Funds Limited\n', 'World Source\nCharity Funds Limited\n1999/11/14\nAid agencies have warned that the monetary and food needs have increased worldwide and that they may not be able to meet basic needs. \nThe UN Office for Coordination of Humanitarian Affairs says that 15 million people remain in need of vital goods and services, because the number and severity of crises has resulted in a lack of \"food, healthcare, and access to livelihoods.\" \nOne new aid group, CARING Singapore has been recently formed In response to the conflict in Kosovo.  CARING Singapore has sent five missions to Kosovo to provide mobile medical care. \nThirteen people were injured on Tuesday in Izmit, Turkey, as people mobbed a government relief convoy, officials said.  Some 20,000 people are feared dead in the two earthquakes that have occurred this year.  CARING Singapore has dispatched relief teams to Turkey.  Wellness for All assisted ad-hoc emergency medical teams during the September earthquake in central Taiwan that measured 7.3 on the Richter scale.  We soon ran out of medicines and funds to support our aid teams and had to return home.\"  While the global press reported over 2500 people were killed and 100,000 buildings were destroyed, local press reported people felt they were being properly cared for and declined relief aid.  \nThe Global Emergency Disaster Organization report their members are doing all they can to get aid through to earthquake victims, but they need a huge injections of funds to do so.   \nJim Cordon, from the disaster relief charity FoodSupport told the times \"I think that the lack of funds are responsible for an increase of attacks on food convoys, consequently deterring a lot of aid agencies from getting in there.\"\n');
