INSERT INTO `article` VALUES (740, '764.txt', '2014/01/19', 'The Abila Post\n', 'MEETING SET FOR TOMORROW MORNING\n', 'The Abila Post\nMEETING SET FOR TOMORROW MORNING\n19 January 2014\nABILA, Kronos - With a meeting set tomorrow at 8 AM, the recent Initial Public Offering, and CEO Sten Sanjorge, Jr. in town reporters will be descending on the GAStech - Kronos headquarters in droves with plenty of questions.\nThe Abila Post will be sending Haneson Ngohebo, writer of the On the Scene Blog, to live blog the event with the hopes of getting Sanjorge, Jr. and his GAStech - Kronos leadership group to comment on the IPO, their recent wind falls, and GAStech\'s plans for Kronos.\n');
INSERT INTO `article` VALUES (741, '765.txt', '2001/03/18', 'Worldwise\n', 'The additional taxes on oil, formation of gas have demolishes the Parliament in general \n', 'Worldwise\nThe additional taxes on oil, formation of gas have demolishes the Parliament in general \n2001/03/18\nABILA, Kronos - a movement to increase taxes on the development of oil and gas of one 10% additional was demolishes today in the General meeting by a voice from 77 to 23.  The increase suggested in taxes, supported by Minister of health Cesare Nespola, was to provide the specific placement for health, the clean projects of water, and medical education for rural sectors.  Ministre Nespola known as of the voice of Parliament, \"I am disappointed by the voice, but the Parliament was concerned that the increase of taxation would discourage the foreign investment in our sector of energy.  It is a retreat with my program to help our rural black suburbs, but I am nothing if not persistent.  My office will send a revised supplementary measure of taxes to the Parliament at the end of this year.  Moreover, I will work with the office of the President Kapelou\' S to restructure the attribution of funds of the current taxes of gas and oil to envisage rural projects of health.\"\n');
INSERT INTO `article` VALUES (742, '766.txt', '2010/06/21', 'News Online Today\n', 'POK Protest at Abila Police Headquarters \n', 'News Online Today\nPOK Protest at Abila Police Headquarters \n2010/06/21\nABILA, Kronos - A Protectors of Kronos demonstration was held in front of Abila police headquarters yesterday morning.  Abila police attempted to gain control of the situation by using bullhorns to call for the peaceful dispersal of the crowd, but the crowd responded to their calls by hurling insults along with a few rocks at the officers.  Police used tear gas to end the gathering, but a handful of die-hard POK members urged the crowd into melee with the officers.\n');
INSERT INTO `article` VALUES (743, '767.txt', '2010/06/21', 'International News\n', 'POK Protest at Abila Police Headquarters \n', 'International News\nPOK Protest at Abila Police Headquarters \n2010/06/21\nABILA, Kronos - A Protectors of Kronos demonstration was held in front of Abila police headquarters yesterday morning.  The POK had gathered in memorialize their former leader, Elian Karel, who died of natural causes in jail last year.  POK supporters carried signs with pictures of Karel and Juliana Vann, chanted slogans, and lit candles.  \nThe peaceful demonstration turned violent when two POK members accosted a man who attempted to enter the building on business.  The POK members hit him with a bottle, which knocked him to the ground and gave him a bloody gash on his forehead.  Abila police attempted to gain control of the situation by using bullhorns to call for the peaceful dispersal of the crowd, but the crowd responded to their calls by hurling insults along with a few rocks at the officers.  Police used tear gas to end the gathering, but a handful of die-hard POK members urged the crowd into melee with the officers.  When the tear gas finally cleared, six POK member were arrested on charges of assault on civil authorities and inciting a crowd to violence.  Marek replaced Elian Karel as the popular figurehead of the POK movement last summer.\n');
INSERT INTO `article` VALUES (744, '768.txt', '1996/03/14', 'International News\n', 'Tiskele Bend Gas Fields Larger Than First Thought \n', 'International News\nTiskele Bend Gas Fields Larger Than First Thought \n1996/03/14\nABILA, Kronos - A press release from the Ministry of Interior today announced that the Tiskele Bend gas fields could be as much as 5 times larger than originally estimated.  When we contacted Minister Sarto\'s office for comment, he said, \"We were astounded by the results of GAStech\'s recent survey of Tiskele Bend.  We have already undertaken several large improvement projects like the port expansion and the new hospital that we would not otherwise have been able to do because of the taxes we are seeing from our foreign investments.  This news almost assures we\'ll be able to reap those same dividends for decades to come!\"  One hopes that those who had been so shortsighted as to oppose his plan have finally come to their senses.\n');
INSERT INTO `article` VALUES (745, '769.txt', '2013/06/21', 'The Wrap\n', 'THE WGO BRING IN A GUN TO A PASVORM?\n', 'The Wrap\nTHE WGO BRING IN A GUN TO A PASVORM?\n2013/06/21\nABILA, Kronos - yesterday, since they have collected each 19 June for the past three years verdedigers of guards of Kronos much requiring same if they have in the past the fourteen years:  an end to the corruption of the Kronos government civil servants and the cleaning turn of the toxic afvalstortplaats which the river Tiskele has become near Elodis. \nThe collection which took place at different trefpunten concerning the city, which for openbaar-bezeten include the house of president Kapelou\'s and for the head bldg. Abila.  The citizens collected hoping their votes by their preferred civil servants are heard. They distributed information on aviators who by local ventures over the life style absurd present between the preferred civil servants of today and which of a couple year is pressed and is given suffered. Posters loved the demonstration systems martyrs POK and chanted for social and economic pariteit, whereas zwart-beklede the members of the police force Abila anonymous lines of shields formed, batons and they weapons which surround the mob.\nOn everyone the opinion the question was:  WHO brings a gun to peacefully present is?  The collection make had been confessed as itself peaceful collecting citizens their bring care to the public conscience.  The most dangerous point in their hands a picture of zoet-onder had been seen eyes dead old little girl of ten years - Juliana Vann which died in 1998, of cancer which is caused by the benzene in its drinking water.  \nWhy did the government feel Kronos the need a police force brutal send plow?\nIn spite of these awkward efforts, as groups of people of who by barricades has slipped and which are moved by the streets to bring their reported to the citizens of Kronos.  The aviators who report of truth and justice to bring became to leave on park banks, in coffee houses and on light Poland.  \nHow can these civil servants can those - hypothetical become on public salaries - second houses, the large boats and the luxeauto\'s they flaunt permit themselves?\n');
INSERT INTO `article` VALUES (746, '77.txt', '2011/06/21', 'All News Today\n', 'A LOOK BACK AT A LIFE CUT TRAGICAL SHORT: ELIAN KAREL \n', 'All News Today\nA LOOK BACK AT A LIFE CUT TRAGICAL SHORT: ELIAN KAREL \n2011/06/21\nABILA, Kronos √ø¬ø¬ø¬ø¬ø¬ø Two years ago yesterday Elian Karel died at age 28 in an Abila jail cell, purportedly of cardiac arrest.  Kraft had reached an agreement with the government that charges would be reduced and the Karel be released pending a trial, but Karel died two days before he was to go free. \nQuestions linger, however, about the manner of Karel√ø¬ø¬ø¬ø¬ø¬øs death.  Requests for information were met with assurances that the police √ø¬ø¬ø¬ø¬ø¬øwhose custody Karel was in at the time of his death √ø¬ø¬ø¬ø¬ø¬ø would do everything possible to perform an exhaustive investigation.  After Karel√ø¬ø¬ø¬ø¬ø¬øs body was cremated and sent to his family in Elodis, the Abila Chief of Police closed the case and has declined to answer questions about Karel√ø¬ø¬ø¬ø¬ø¬øs death stating that √ø¬ø¬ø¬ø¬ø¬øwe are satisfied the death was of natural causes and will no longer be entertaining inquiries.√ø¬ø¬ø¬ø¬ø¬ø \nAs reported at the time of Karel√ø¬ø¬ø¬ø¬ø¬øs death, several people close to the investigation reported that Karel√ø¬ø¬ø¬ø¬ø¬øs body showed signs of blunt force trauma, abrasions and lacerations which were not consistent with the cause of death reported by the police. \nPolice have denied anything unusual happened in Karel√ø¬ø¬ø¬ø¬ø¬øs death and city officials claim the accusations of murder and wrongful death are asserted by POK rabble-rousers attempting to incite instability and violence. \nYesterday on the morning of June 19th, a small group of POK supporters gathered in front of the Abila Police Station, holding photographs of Elian, and of another young martyr, Juliana Vann, the ten-year old girl who died in 1998 from cancer caused by benzene toxins in her drinking water.   \n√ø¬ø¬ø¬ø¬ø¬øBoth of them died because of government lies and corruption,√ø¬ø¬ø¬ø¬ø¬ø one man told me who asked that his name be withheld because of concerns of police retaliation.  √ø¬ø¬ø¬ø¬ø¬øJuliana died because Kronos allowed GAStech to poison our water, and Elian died because he tried to bring Juliana justice.\n');
INSERT INTO `article` VALUES (747, '770.txt', '2010/06/19', 'Homeland Illumination\n', 'IN REMEMBRANCE:  THE DEATH OF ELIAN KAREL, A YEAR LATER\n', 'Homeland Illumination\nIN REMEMBRANCE:  THE DEATH OF ELIAN KAREL, A YEAR LATER\nPetrus Gerhard\n19 June 2010\nABILA, Kronos -One year ago today a young man in search of a brighter future for his countrymen died in a cold, cement prison.  He was attended only by apathetic guards who had been charged with detaining him pending an investigation for tax fraud.  Instead, sometime in the early morning hours of 19 June, Elian Karel died with injuries inexplicable with the official cause of death.\nThe report released by the Abila City Coroner in July 2010 attributed Karel\'s death to sudden cardiac arrest, and the investigation was closed shortly thereafter.  Unnamed sources close to the investigation, however, have provided witness testimony that Karel\'s body showed signs of blunt force trauma, abrasions and lacerations which occurred within hours before his death.\nPolice have denied anything unusual happened in Karel\'s death and city officials claim the accusations of murder and wrongful death are asserted by POK rabble-rousers attempting to incite instability and violence.\nIn the year since Karel\'s death the Protectors of Kronos have continued the mission to demand that the Kronos government implement a policy of transparency in government business, and to hold accountable the foreign companies that have contaminated Kronosian natural resources.\nSupporters continue to mass in public places, determined that their cries for justice be heard.  Now intermixed with chants of \"Remember Juliana!\" one can also hear cries \"Remember Elian!\"\n');
INSERT INTO `article` VALUES (748, '771.txt', '1984/05/04', 'World Journal\n', 'The schist gas pioneer projects the first wells at sea world at sea Mediterranean \n', 'World Journal\nThe schist gas pioneer projects the first wells at sea world at sea Mediterranean \n1984/05/04\n<<Deleted the image: Protester of drilling of Anti-offshore oil rig.  Exploration proved a question discussed in Kronos>>\nTo continue to read the principal history	\nThe son of the founder of the gas company that GAStech projects a company to drill the Mediterranean sea inside, times learned.\nSten Sanjorge, Jr. believes that there are great volumes of gases at sea which could be extracted.\nSanjorge and GAStech were allotted to three licenses by the government of Kronos last month by the ministry for energy and the development and the hopes to begin exploration soon.\n\"The gas certainly at sea is not a new concept, but there is no reason with the history of Kronosian of the development at sea which we cannot develop these resources at sea,\" it said times.\nThe schist gas is extracted by using the technique discussed from hyperacide displacement from substrate which implies to inject acid layers of schist of chemicals, to break them to the top and to release natural gas imprisoned in inside.\nHyperacide displacement of substrate produced vast quantities of gas and oil in the Westerner, transforming the market of energy. But the projects in Europe were slow to take off, attacked with the opposition of the government and the local communities.\nSanjorge indicates that it will be in the short run before we know if the gas at sea schist can be exploited.\nMany ecologists believe that hyperacide displacement of substrate can damage the marine environments, and to the extraction new fossile fuel resources are opposed. But drilling at sea avoids the need for difficult negotiations with the councils, the communities and the holder of piece buildings.\nBased on existing geological data, SanJorge believes that a considerable quantity of gas is in place - to 100 cubic feet trillion, which would be more than the evaluations of GAStech for its earth resources. There is also the possibility of finding oil.\nGAStech estimated that the resources at sea schist gas of total of Kronos could take place between five and 10 moments the size of terrestrial available of resources.\n\"We are who it resource is there and the numbers are absolutely ginormous,\" said very comfortable SanJorge. \"Is there one that exploitable? It is billion question of the dollar, and GAStech wiling to invest in the answer.\"\nAlthough it very recently became discussed, hyperacide displacement of substrate was employed on one on a smaller scale during much of years, to improve the flow of the conventional gas and oil wells. But to employ the process on a great number of wells had to at sea extract gas from schist commercially was never made.\nProfessor Oskar Wertz of university of Tethys is skeptic approximately if the schist gas at sea could be large contributing to European energy in the following decade, but known as which it could have the longer-term potential.\n\"GAStech is optimistic is its evaluations of how long it will take to explore the schist at sea. It is perfectly plausible that in 20, 30 or 40 years, technology hyperacide of displacement of substrate will have thus advanced and the way in which we treat the marine environment will have thus advanced that this could be a really large industry. To give the responsability in 10 years to come is to test these things outside, see whether they function.\" \n');
