INSERT INTO `article` VALUES (750, '773.txt', '2012/04/10', 'Daily Pegasus\n', 'MEETING TO PROGRAM IN SUPPORT OF INCREASING RESPONSIBILITY OF THE GOVERNMENT\n', 'Daily Pegasus\nMEETING TO PROGRAM IN SUPPORT OF INCREASING RESPONSIBILITY OF THE GOVERNMENT\n2012/04/10\nABILA, Kronos - Silvia Marek, leader of the protectors of the social organization of the action of Kronos is repealing the citizens of Kronos to assemble it by a day of the pacific protest morning.  Marek requests that all the citizens assemble at issue it to bring knowledge to the problem of penetrating the political corruption and favoritism in the offices of the government of Kronos.\n\"I am calling for an end to the atrocious corruption, the nepotism and favoritism exhibited by our chosen civil employees.  [The civil employees] need to hear our voice and knowledge that now we demanded the change.\nThe meeting will be held in the park of the city of Elodis at noon.\n');
INSERT INTO `article` VALUES (751, '774.txt', '2011/06/21', 'Worldwise\n', 'Zone of Vandalize Siopa of protesters of POK\n', 'Worldwise\nZone of Vandalize Siopa of protesters of POK\n2011/06/21\nABILA, Kronos - the guards of the demonstration of Kronos in the streets of the zone of Siopa in Abila of the center had like consequence of many incidents of vandalism and opportunist plundering yesterday.  Crowd that the members pulverize painted the new logo of POK on buildings and cars, broke windows of store, stores plundered, and intimidated the innocent spectators.  The police force was forced to use water and teargas guns to disperse the group of hooligans.\n');
INSERT INTO `article` VALUES (752, '775.txt', '2013/10/22', 'World Source \n', 'Multi-Country Task Force Formed \n', 'World Source \nMulti-Country Task Force Formed \n2013/10/22\nInterpol has announced the formation of a new multi-country task force to combat the increasingly wide distribution of the drug methyldimethyl cathinone (MDMC).  Heading the task force is Senior Inspector Robert Loblaw, a veteran officer who led the very successful Tethys Counterdrug Team. \n\"These designer drugs have certain clues as to their origin,\" Loblaw stated in an interview. \nThis particular blend of the drug MDMC, also known by its street names \"cotton candy\", \"spice dreams\" and \"Tulip Blossom\", was found previously only in Asteria but has made its way to the streets of Tethys and other international countries. \nThe Asterian People\'s Army (APA) is a paramilitary organization which has been engaged in terrorist activities funded through its criminal enterprises, which include drug trafficking.  In recent years the APA has sought to build their brand through websites and the publication of a professional, high-quality magazine called \"Arise\". \nSenior Inspector Loblaw says the Tethys public statistics indicate MDMC is a growing problem with the country\'s youth.  \"An increase in mental health problems, including hallucinations and paranoia, accompanied by violent behavior and a marked increase in suicide rates are only a few of the indicators of the usage of this designer drug.\"\n');
INSERT INTO `article` VALUES (753, '776.txt', '2014/01/20', 'Kronos Star\n', 'Breaking: Emergency at GAStech Headquarters Building [Updates]\n', 'Kronos Star\nBreaking: Emergency at GAStech Headquarters Building [Updates]\nCato Rossini, Marcella Trapani\n20 January 2014\nUpdate, 7:35 PM:  Abila police spokesman Adrien Carman said, \"Several GasTech employees appear to be missing. Anyone seeing unusual activity is asked to contact the Abila police.\"  In response to question about whether a kidnapping is suspected, Carman replied, \"The case is under investigation and more information will be released as facts are learned. Please report any unusual activity to the Abila police.\"');
INSERT INTO `article` VALUES (754, '777.txt', '2013/12/16', 'News Online Today\n', 'POK Assault Police in Abila \n', 'News Online Today\nPOK Assault Police in Abila \n2013/12/16\nABILA, Kronos - Police spokesman Adrien Carmen informed the media today that members of the POK assaulted a police patrol in Abila early this morning.  The POK thugs crept up on two patrol officers who were sitting in their vehicle and ambushed the men, bashing the windows of their car and dragging them out of the vehicle into the street.\n');
INSERT INTO `article` VALUES (755, '778.txt', '2001/09/01', 'The Orb\n', 'THE MEMBERS OF POK STOPPED\n', 'The Orb\nTHE MEMBERS OF POK STOPPED\n2001/09/01\nELODIS, Kronos - heavies of government blocked the free speech - once again - members of the guards of group of activist of Kronos yesterday to a legal demonstration with the fields of curve of Tiskele.  The five activists of POK had met in front of the doors with the service of drilling of gas operations of GAStech to bring the public conscience about the polluted river of Tiskele which posed problems of health to the residents of Elodis.\nThe spectators report that the demonstration had started peacefully with the five members of POK going in the two directions through the road, singing \"remember Juliana!\" and \"more poison!\"  \nAn eyewitness said that when the doors opened to make it possible vehicles of company of GAStech to leave the service the protesters moved on side.  The witnesses agree that at the same time the vehicles with the government of the joint of Kronos led to the doors, apparently projecting to write the service. \n\"It was all the very civil one upwards until then,\" Griffith Mabel, a resident of Elodis which had left to support the POK said.   \"The opened doors, the people of POK moved and the trucks drove out.  It is when it obtained strange.  The trucks stopped in the middle of the road for any reason.\"\nAnother eyewitness, farm Charley Normand of Elodis adds, \"ouais, the types of POK asked the drivers to move well, but the drivers of GAStech were unaware of them.  They had their windows downwards, thus it was not as they could not hear them.\"\nThe occupants of the vehicles of government left and joined the argument.  The sequence of operations becomes muddling in this moment.  Some witnesses state the arguments incited by drivers of GAStech with the protestateurs, and others think that the civils servant of government started to make to violence the protesters of the road.\n\"Proves to be the people in the cars of government were police force,\" Mabel says.  \"It carried uniforms and had badges.\"\nThe spectators say that the three parts started to howl, and at a certain point the police force of Kronos - probably of Abila- stopped the five activists and transported to a prison of Elodis.\nIn spite of the requests repeated for an interview, one did not grant access to those stopped.\n');
INSERT INTO `article` VALUES (756, '779.txt', '1998/11/15', 'News Online Today\n', 'POK REPRESENTATIVES MEET WITH KRONOS MINISTER OF HEALTH \n', 'News Online Today\nPOK REPRESENTATIVES MEET WITH KRONOS MINISTER OF HEALTH \n1998/11/15\nABILA, Kronos - Representatives from the social activist group Protectors of Kronos (POK) met earlier this week with Cesare Nespola, Minister of Health to discuss resolutions to the water contamination that has plagued Elodis since the late 1990s.\n');
