INSERT INTO `article` VALUES (758, '780.txt', '2001/06/15', 'Worldwise\n', 'The Minister for health dies suddenly\n', 'Worldwise\nThe Minister for health dies suddenly\n2001/06/15\nABILA, Kronos - it is with great pain that we announce the death of the Minister for health Cesare Nespola.  Nespola minister, 62, peacefully dead in its sleep yesterday of a suspect√©e heart attack.  An tireless champion for the wellbeing of our people, Nespola was a doctor who had been selected to carry out the ministry for health in 1995 by former President Araullo.  It was rather popular that President Kapelou maintained when it formed his box in 2000.\nLittle time after intending to speak about dead about Nespola, President Kapelou announced that its nephew Vincent Kapelou would again serve minister of his administration of health.  Vincent Kapelou, 28, have a bachelor in Science in chemistry and a Master of Science in biochemistry of university of exchange of Tethys. \n');
INSERT INTO `article` VALUES (759, '781.txt', '2005/04/6', 'Kronos Star\n', 'Protestors Block Traffic to Tiskele Bend Fields\n', 'Kronos Star\nProtestors Block Traffic to Tiskele Bend Fields\nMarcella Trapani\n6 April 2005\nABILA, Kronos - More than a dozen POK protesters were handcuffed and taken into custody by police Tuesday for blocking access to the Tiskele Bend fields.  Before police made the arrests shortly after 9 a.m., the protesters were told they were breaking the law for trespassing on government property, blocking access to government-owned land, and impeding lawful commercial traffic. \nThe protesters arrived at the entrance to the Tiskele Bend site about 5:30 a.m. and locked arms across the road for about three hours, despite being asked to leave by police.  As traffic on the road began to back up, several truck drivers began to leave their vehicles and congregate near the protesters.  Tempers began to flare as the blockade persisted into the second hour, and the drivers started shouting and cursing at the protesters to move out of the road.  Police officers quickly moved in and arrested the POK protesters before the situation could escalate to violence.  \n\"We appreciate citizens voicing their opinion, but the middle of a busy road is not the right forum for a discussion of our national environmental policy. We encourage our concerned citizens to follow the democratic process and contact their Assembly representatives,\" government spokesman Rufus Drymiau said in a statement.\n');
INSERT INTO `article` VALUES (760, '782.txt', '1997/04/23', 'The Abila Post\n', 'POSSIBLE CONTAMINATION IN ELODIS \n', 'The Abila Post\nPOSSIBLE CONTAMINATION IN ELODIS \n23 April 1997\nELODIS, Kronos - About 25 km West of Abila is the small rural township of Elodis, situated on the Tiskele River. Roughly 20 km upstream is the Tiskele Bend site operated by GAStech International on government-owned land. Townspeople claim the site is contaminating the land and water making their people sick.\nIn a statement the government of Kronos has denied that the Tiskele Bend site is the source of any contamination insisting that both \"natural gas and the drilling process are clean.\" The statement continued, \"If our people are sick we will help them get well. We will find the source of their ailments and do what is required to solve the problem. That is the duty of government: to protect its people.\"\nFor its part, GAStech International intends to cooperate fully with the government as it has since the beginning of their relationship. \n');
