INSERT INTO `article` VALUES (763, '785.txt', '2012/06/20', 'News Online Today\n', 'POK Anniversary Rally Ends in Riot \n', 'News Online Today\nPOK Anniversary Rally Ends in Riot \n2012/06/20\nABILA, Kronos - POK members held a large demonstration in Abila yesterday.  The violence escalated into a full blown riot and police were forced to use tear gas, pepper spray, water cannons, and beanbags shot from shotguns to control the crowd.  Several protestors and police were injured, including one heroic police officer who was stabbed by a crazed protestor.\n');
