INSERT INTO `article` VALUES (767, '789.txt', '2000/01/15', 'News Online Today\n', 'KRONOS GDP ON THE RISE \n', 'News Online Today\nKRONOS GDP ON THE RISE \n2000/01/15\nABILA, Kronos - The real gross domestic product - the output of goods and services produced by labor and property located in Kronos - increased at an annual rate of 5.4% in the fourth quarter of 1999, according to the advance estimate released by the Bureau of Economics.\n');
INSERT INTO `article` VALUES (768, '79.txt', '1998/05/15', 'News Online Today\n', 'ELODIS, KRONOS: WILL THE GOVERNMENT RESPOND IN TIME?  \n', 'News Online Today\nELODIS, KRONOS: WILL THE GOVERNMENT RESPOND IN TIME?  \nPetrus Gerhard\n1998/05/15\nI\'ve asked him to tell me about the involvement of the government of Kronos in the deeply troubling account of a community\'s struggle for protection from those who should help them the most: their elected officials, against those who would poison their children and the country\'s food.  He called every department that could possibly be associated with our problem:  interior, justice, foreign affairs, health. \nReese then describes months of meetings at which the government officials demanded documents proving their case:  health and crop yield statistics, the scientific test results from Wellness For All, and medical records.\n');
INSERT INTO `article` VALUES (769, '790.txt', '2014/01/20', 'Kronos Star\n', 'Breaking: Emergency at GAStech Headquarters Building [Updates]\n', 'Kronos Star\nBreaking: Emergency at GAStech Headquarters Building [Updates]\nCato Rossini, Marcella Trapani\n20 January 2014\nUpdate, 1:25 PM:  In attempt to find out what is going on, we have called the office of Orhan Strum, the GSAtech Chief Operating Officer.  His administrator answered the phone and informed us that Mr. Strum is unavailable.  We will continue calling GAStech until we reach someone who can inform us on the situation.');
