INSERT INTO `article` VALUES (788, '807.txt', '2009/02/19', 'The Abila Post\n', 'GASTECH HEADQUARTERS BLOCKED BY POK\n', 'The Abila Post\nGASTECH HEADQUARTERS BLOCKED BY POK\n19 February 2009\nABILA, Kronos - A POK rally designed to bring attention to claims of environmental damage have done more damage to their image. The rally outside of GAStech International\'s headquarters resulted in multiple arrests for trespassing.\nAbout two hundred people gathered in front of the GAStech building chanting slogans and waving signs that held the visages of people who have allegedly died due to environmental contamination.  Ten of the protestors chained themselves to the doors of the building in an attempt to prevent GAStech employees from going to work.\nPolice spokesman Adrien Carman said, \"We allowed the group some latitude with their rally, but when GAStech complained that the protestors were blocking entrance to their building, we had to take action.  The last thing we wanted to happen was for a GAStech employee to get hurt by the crowd just because he was trying to go to work.\"\nGovernment officials have expressed concern for the \"pattern of increasingly aggressive tactics by the Protectors of Kronos.\" In response to increased aggression from the POK, additional security will be provided to ensure public safety for all future rallies.\nGAStech officials declined to comment at this time indicating an official statement will be issued on the incident.\n');
INSERT INTO `article` VALUES (789, '808.txt', '2009/02/20', 'Worldwise\n', 'The protest of POK at GAStech sits of the ends in the arrests\n', 'Worldwise\nThe protest of POK at GAStech sits of the ends in the arrests\n2009/02/20\nABILA, Kronos - dozen protesters being present guards of gathering of Kronos (POK) in front of the regional registered offices of GAStech in Abila was stopped for enfreindre this morning.  The gathering of POK was designed to call the attention to their complaints of the environmental damage caused by the development of the oil and gas layers around Kronos by foreign companies like GAStech.  Approximately two hundred people met in front of the signs of slogans and to undulate of song of building of GAStech which held the faces of the people who died allegedly because of the contamination of the environment.  Tens of the protestateurs were connected with the doors of the building in order to try to prevent employees of GAStech from going to work.\nTo maintain order Carman of Adrien of spokesman said, \"us have allowed group certain latitude with their gathering, but when GAStech complained that the protestateurs blocked the entry with their building, we had to act.  The last thing that we wanted to produce to us was so that an employee of GAStech obtains the evil by crowd right because it tried to go to work.\"\nThe POK, once a small political group of activist of the citizens of the area of Elodis, was revitalization under the charismatic control of Elian Karel.  The spokesman Rufus Drymiau of government said gathering of today of POK, \"we were concerned with a model of the increasingly aggressive tactic by the guards of Kronos during a certain time now. In the light of the incident of today, President Kapelou ordered the police force to assure additional protection for the public futures rallys of POK.\"\n');
INSERT INTO `article` VALUES (790, '809.txt', '2013/09/2', 'The World\n', 'SANJORGE JR. TAKING GASTECH INTERNATIONAL PUBLIC\n', 'The World\nSANJORGE JR. TAKING GASTECH INTERNATIONAL PUBLIC\n2 September 2013\nCENTRUM, Tethys - After 52 years of being privately owned, Sten Sanjorge, Jr. is taking the natural gas exploration and production company GAStech International public. \nWith an eye toward becoming even more of a world player in the gas industry, Sanjorge, Jr. is going public to generate working capital for further international expansion and exploration. \nThe company, founded in 1961 by Sten Sanjorge, Sr., said Monday it plans a stock offering that could place its value in the neighborhood of $3.75 billion. The IPO is expected before the end of the year.\n');
INSERT INTO `article` VALUES (791, '81.txt', '2013/02/09', 'World Journal\n', 'Hospital of Abila seeing the surge of the users of drug of originator\n', 'World Journal\nHospital of Abila seeing the surge of the users of drug of originator\n2013/02/09\nThe department of help at the hospital general of Abila in Kronos was flooded in last month by people suffering from the medical complications of drugs of originator such as the \"cotton sugar refinery\" and the synthetic marijuana, a civil servant of hospital known as.\n\"We had at least two cases dozen in last month,\" said Alicia Bianca, director of nurse of the department. \"We are literally overpowered.\"\nBianca indicated that it forever considering this level of activity related to the overdoses of drug in seven years when it controlled the department of help and in 20 years it was a nurse.\nThe authorities in \"cotton sugar refinery\" by Abila could have been a factor in the 54 years death Ralf trail, of which meurtrissent and the naked body was found on February 4 along a road of dead-end. The investigators await reports/ratios of toxicology to determine the cause of its death. Everywhere in the city, several deaths were allotted to the \"sugar refinery cotton\" according to the national center of poison of Kronos.\nThe patients come in the general from Abila from in all the larger area from city, and they include adults and youths, male and female, and all the mediums socio-economic, Bianca known as.\nSgt Antonio Arresta of the department of fire of Abila, a first-responder with the medical calls of help in the city, indicated that its department also saw a transient in the number of people needing treatment for complications for drugs for originator. \"We went from calls zero to a handle of calls\" in last month,\" it said.\nBianca and Arresta known as their efforts to treat people is made more difficult because they often do not know anything about drugs originator which were taken.\n\"You do not know what you obtain when you obtain it,\" in Bianca known as. \"We made act with the patients to enter and out of the order, who are very violent one. They say to us that they had made the cotton sugar refinery or the synthetic marijuana.\"\nBianca says there is little clinical data on the effects of the cotton sugar refinery, because it is an incipient poison. \"There is no study ordered in toxicology,\" it said. The national center of poison gathers anecdotic reports/ratios on overdoses of the hospitals and other suppliers as an element of the efforts to offer the council on the way in which to treat patients.\nDrugs of originator are the chemical compounds synthesized to resemble the active substance in often illegal drugs. The cotton sugar refinery imitates the khat of drug, a stimulant. The manufacturers frequently change the chemical composition and its name of drug of originator into stage of the stay one in front of the authorities, Biance known as. \"It is another manner of selling it,\" it said.\nThe cotton sugar refinery of limit, for example, is a nickname of drug and does not have anything to make with the feast of carnival. Drug was sold under the name of \"spice dreams\" one week and under the name of the \"flower of tulip\" the next one. \nThe government of Kronos placed three of the chemicals used generally in the creation of the cotton sugar refinery on its ordered list of substance, criminalisant their use and possession. Always, the government cannot pure cotton sugar refinery of prohibition because the manufacturers can change the receipt and border the law, Bianca known as. Drugs are sold on line as products \"of therapy of sweet herbs\" and are available above the meter in stores of sector.\n\"We still do not know what obtain with the cotton sugar refinery. The chemical composition changes package with the package,\" Bianca known as.\nA factor for the popularity of the cotton sugar refinery is its at cut price, Bianca known as. She said one gram of costs of cotton sugar refinery about K18 while one gram of cocaine costs K166.\nThe cotton sugar refinery creates the euphorism, or high, with which is equal or larger than than of cocaine but also causes with an accident which is worse, Bianca known as. Often prompt people of the bad effects of the accident with nocer on the cotton sugar refinery at the point where they consume drug during days. \"They beseech it,\" it said.\nAfter repeated the use, drug \"makes fry\" the brain of a person, draining the chemicals which balance its operations. This leads sometimes to the odd behavior and often psychotic who was brought back in the media, such as the case of the naked man in Elodis which was operation found in bottom of the medium of an important road, Bianca known as. \"The seizures and the illusions are incredible,\" it said.\nWhile it is not yet certain which is behind the distribution of this round of drugs of originator, the suspect organized crime of police force continues this great source of income. The popular army of Asterian was traditionally implied traffic of drug in all the area, and them agencies of application examine thoroughly the possible co-operation between the organizations of traffic of drug and the insurgent groups political.\n');
