INSERT INTO `article` VALUES (797, '815.txt', '2009/03/13', 'Worldwise\n', 'The Karel Chief of activist stopped for tax avoidance\n', 'Worldwise\nThe Karel Chief of activist stopped for tax avoidance\n2009/03/13\nABILA, Kronos - the police force of Kronos stopped Elian Karel today on expenses of tax avoidance.  Karel, the chief of the group \"guards of activist of Kronos\", led a meeting with its defenders when it was stopped.  Karel tried to make the light of the situation, but its disciples were clearly worried by the serious one of the expenses levelled against him.  The lawyer of Karel, Michale Kraft, released a report/ratio declaring that the expenses against its customer were false and that it hoped to have released Karel of the guard of police force by the end of the week.  In response to the report/ratio of Kraft, Carman d\' Adrien of spokesman of police force said, \"I think that Mr. Kraft underestimated serious situation of his customer.\"  It is clear that Elian Karel, which professes to have the interests of the people of Kronos in the middle, must explain to us why it refuses to contribute to the wellbeing of its nation.\n');
INSERT INTO `article` VALUES (798, '816.txt', '2012/06/21', 'Worldwise\n', 'Ends of gathering of birthday of POK in the riot\n', 'Worldwise\nEnds of gathering of birthday of POK in the riot\n2012/06/21\nABILA, Kronos - the members of POK held a great demonstration in Abila yesterday.  Several dozen their defenders held central rest-Institute of the statistics in front of the building of capitol and the presidential manor, whereas others took with the streets with their signs and sing.  The protestateurs distribuer√© insects with the spectators who pled that our government is corrupted and \"the rich person become richer on the backs of the poor\".  The claimed police force the peaceful end at the central rest-Institute of the statistics, but was answered with a stopping of the rocks and bottles of crowd.  The violence climbed in a true riot and the police force were forced to use teargas, the pepper jet, the guns of water, and the bean bags drawn from the shotguns to order crowd.  \nBefore finally dispersed crowd, several buildings of government was vandalized, two vehicles of police force were ignited, and the streets carried with the refuse and broken glass.  Several protestateurs and police force were wounded, including a heroic leader of police force which was stabbed by an insane protestator.  The leader, whose name was retained for reasons of safety, is in critical state at the hospital general of Abila.\n');
