INSERT INTO `article` VALUES (800, '818.txt', '2014/01/20', 'News Desk\n', 'ENVELOPE OMHOOG OF EVENTS AT GASTECH\n', 'News Desk\nENVELOPE OMHOOG OF EVENTS AT GASTECH\n2014/01/20\nABILA, Kronos - a long stretched day of contrary is reports and finish confused information. What we for certain know is that 14 employees GAStech not only missing are confirmed, but kidnapped such as those by a source of the government Kronos. On this moment it is unclear who is missing and if they citizens of Kronos van Tethys are, since a lot of employees GAStech Tethan are.\nThere is still speculation concerning which in removal was taken and if President GAStech and CEO Sten Sanjorge Jr. ones the aim was, seen international GAStech has to a declaration to the press still take off. The speculation concerning the aims of the ontvoerders has been attribute ongebreidelde to the recent news of the initial public GAStech which offers only one month suffered.\nOn this moment nobody has required responsibility for removal. Edvard Vann, GAStech - Kronos the security guard which was questioned and after 6 hours was delivered, the indication gave that the guards of Kronos were involved or at least such as are the daders behind the events of today suspected.\nGAStech international higher security staff employee on place the research has been support that the civil servants of the department of the police force and of the government help Abila Kronos.\n20 January the annual collective meeting of GAStech with a reception of the government was to next Kronos. Shortly after the morning meeting who becomes at 10:00 gebe√´indigd, the freight carriages of the department of the fire answered Abila to reports of a fire on the office GAStech.\n');
INSERT INTO `article` VALUES (801, '819.txt', '2012/02/21', 'News Online Today \n', 'Gas Industry Challenged\n', 'News Online Today \nGas Industry Challenged\n2012/02/21\nKronos\' oil and gas industry has warned it faces its \"biggest challenge in 20 years\" due to the low levels of exploration. \n\"Kronos\' fields contain an abundance of oil and gas yet to be found and it is critical we find the means to turn the current state of exploration around\" -Energy Minister Jules Jecovic \nThe annual activity survey by Oil and Gas Kronos found a rapid increase in production costs, up by 15% last year. \nFollowing the rapid decline in oil and gas production from Kronos fields in recent years, the rate of fall slowed during 2012 - down by 8% to .83m barrels of oil per day, or its gas equivalent.\n');
INSERT INTO `article` VALUES (802, '82.txt', '2013/06/30', 'News Online Today\n', 'GOVERNMENT DECLARES POK TO BE TERRORIST GROUP\n', 'News Online Today\nGOVERNMENT DECLARES POK TO BE TERRORIST GROUP\n30 June 2013\nIn an announcement released earlier today by President Kapelou¬ís office, the Protectors of Kronos were declared to be a terrorist group.  The release stated that any further violence or criminal activity will be prosecuted under the homeland security laws as a threat to the citizens of Kronos.\n');
INSERT INTO `article` VALUES (803, '820.txt', '2009/03/12', 'Kronos Star\n', 'Activist Leader Karel Arrested for Tax Evasion\n', 'Kronos Star\nActivist Leader Karel Arrested for Tax Evasion\nMarcella Trapani\n12 March 2009\nABILA, Kronos - Kronos police arrested Elian Karel today on charges of tax evasion.  Karel, the leader of the activist group \"Protectors of Kronos\", was conducting a meeting with his supporters when he was arrested.  Karel tried to make light of the situation, but his followers were clearly concerned about the seriousness of the charges leveled against him.  Karel\'s lawyer, Michale Kraft, released a statement declaring that the charges against his client were false and that he hoped to have Karel released from police custody by week\'s end.  In response to Kraft\'s statement, Police spokesman Adrien Carman said, \"I think Mr. Kraft has underestimated the seriousness of his client\'s situation.\"  It is clear that Elian Karel, who professes to have the interests of the people of Kronos at heart, must explain to us why he refuses to contribute to the welfare of his nation.\n');
INSERT INTO `article` VALUES (804, '821.txt', '1999/07/04', 'International News\n', 'Minister Nespola Champions Added Taxes on Oil, Gas Development \n', 'International News\nMinister Nespola Champions Added Taxes on Oil, Gas Development \n1999/07/04\nABILA, Kronos - Minister of Health Cesare Nespola announced that he would sponsor a bill to increase taxes on oil and gas development by an additional 10%.  The raise in taxes on foreign gas and oil development is earmarked specifically for health care, clean water projects, and health education for rural areas.  Minster Nespola has long been a strong advocate of the health and well-being of our citizens, and his support for this measure adds to a long list of the actions he has undertaken on our behalf.  Last year, Minister Nespola created a program of financial incentives designed to bring qualified physicians to practice medicine in Abila.\n');
INSERT INTO `article` VALUES (805, '822.txt', '2014/01/21', 'The Light of Truth\n', 'RANSOM DEMANDS MADE IN THE KIDNAPPING OF GASTECH\n', 'The Light of Truth\nRANSOM DEMANDS MADE IN THE KIDNAPPING OF GASTECH\n2014/01/21\nABILA, Kronos - the guards of Kronos took not only the responsability for the kidnapping of the international employees of GAStech, but also made a ransom demand of $20M starting from the president and PRESIDENT Sten Sanjorge, Jr.\nAs reported yesterday, one speculated it that Sanjorge, Jr. was the target of kidnapping; however, Sanjorge, Jr. is sure back in Tethys.\nThe group of removal, the guards of Kronos, was founded in 1998 in Elodis, rural black suburbs apart from capital Abila. They had protested for clean water, human rights, and counters the corruption of the government of international Kronos and GAStech. They became more and more violent one with their protests falling in riots, bombardments of fire, vandalism, and plundering. \n');
INSERT INTO `article` VALUES (806, '823.txt', '1998/11/15', 'The Light of Truth\n', 'HEALTH FOR ALL BREATHS (WFA) GASTECH AND GOVERNMENT OF KRONOS\n', 'The Light of Truth\nHEALTH FOR ALL BREATHS (WFA) GASTECH AND GOVERNMENT OF KRONOS\n1998/11/15\nABILA, Kronos - the group in good health of conscience of water, health for all (WFA), condemned international GAStech and the government of Kronos. The report/ratio of WFA claims the widespread subsoil water contamination, a lack of with proportioned safeguards, requests for cleaning being ignored and no inadvertency of government.\nThe government of Kronos, once come into contact, refused to comment on. \nHowever, the international adviser of safety environmental of GAStech Ingmar Casablancas answered the complaints, \"the pled expenses invoicees against international GAStech are nonfounded. International GAStech and the government of Kronos inlassablement cooperate to ensure a clean, sure, and prosperous place of work. We are both devoted to the conservation of the environment.\"\n');
INSERT INTO `article` VALUES (807, '824.txt', '2014/01/21', 'The World\n', 'RANSOM DEMANDS MADE IN GASTECH KIDNAPPING\n', 'The World\nRANSOM DEMANDS MADE IN GASTECH KIDNAPPING\n21 January 2014\nABILA, Kronos - The Protectors of Kronos have not only taken responsibility for the kidnapping of GAStech International employees, but have also made a ransom demand of $20M from the President and CEO Sten Sanjorge, Jr.\nAs reported yesterday, it was speculated that Sanjorge, Jr. was the target of the kidnapping; however, Sanjorge, Jr. is safe back in Tethys.\nThe kidnapping group, The Protectors of Kronos, was founded in 1998 in Elodis, a rural township outside of the capital Abila. They have been protesting for clean water, human rights, and against the corruption of the Government of Kronos and GAStech International. They have become increasingly violent with their protests devolving into riots, fire bombings, vandalism, and looting. \n');
INSERT INTO `article` VALUES (808, '825.txt', '1996/07/08', 'The General Post\n', 'GASTECH CHANGES OF POSITION THE CENTER TO KRONOS\n', 'The General Post\nGASTECH CHANGES OF POSITION THE CENTER TO KRONOS\n1996/07/08\nCENTER, Tethys - international GAStech has changed of position its center of Tethys to the small Mediterranean island of Kronos and to the extensive deposits of the gas underneath the Earth.\nThe recent loads of contamination of the underground water against international GAStech and that tightens environmental regulations lead by the inner minister of Tethan, Ivar Blanes, certainly game in the center that it changes of position. \nWith loose of nonexisting environmental rule to in Kronos and a friendly local government, the movement of GAStech feels inevitable in the retrospecci√≥n. \n');
