INSERT INTO `article` VALUES (813, '83.txt', '2013/12/16', 'The Abila Post\n', 'BRAZEN DAY TIME ASSAULT BY POK\n', 'The Abila Post\nBRAZEN DAY TIME ASSAULT BY POK\n16 December 2013\nABILA, Kronos - The brazen day time assault on two peace officers by the POK is just another violent, terroristic act in a long string of such acts. The two officers were left bloody and beaten, and tied up in the trunk of their vandalized vehicle.\nPolice spokesman Adrien Carman said of the attack, \"Assaulting a police officer and destroying government property are serious crimes. I want to assure the public that these men will be caught and brought to justice soon.\" \nFurther exacerbating the situation, the two criminals defaced the officers\' car by spray painting the POK logo. \nIf they can attack two police officers in broad daylight, who is next?\n');
