INSERT INTO `article` VALUES (816, '832.txt', '2005/04/06', 'The Orb\n', 'POK PROTESTS the END IN the ARRESTS\n', 'The Orb\nPOK PROTESTS the END IN the ARRESTS\n2005/04/06\nELODIS, Kronos - fifteen members of the guards of the organization of activist of Kronos (POK) were stopped by the federal police force of Kronos following yesterday a conflict to the doors of the service of GAStech of curve of Tiskele.\nThe protesters arrived before the paddle at the arms of lock and the traffic of halt therefore and writing service.  In local weather of 8 AM, the traffic had the support on the two sides of the doors.  Balancing, the protesters sang well known songs of protest, including \"this is our ground\", \"songs of the farmer\" and \"the tisserands of our fatherland\"\nWhen the federal police force started to stop the protesters of POK, they moved of a fashion ordered in the van of waiting of police force, singing whole time.\n');
INSERT INTO `article` VALUES (817, '833.txt', '2013/06/21', 'News Online Today\n', 'KAREL DEATH ANNIVERSARY\n', 'News Online Today\nKAREL DEATH ANNIVERSARY\n2013/06/21\nABILA, Kronos - Yesterday, as they have each June 19th for the past three years supporters of Protectors of Kronos rallied demanding much the same as they have in the past fourteen years:  an end to the corruption of the Kronos government officials and the cleanup of the toxic waste dump that has become the Tiskele River near Elodis.  The most dangerous item in their hands was a picture of a sweet-faced ten year dead old girl - Juliana Vann who died in 1998 of cancer caused by the benzene in her drinking water.\n');
INSERT INTO `article` VALUES (818, '834.txt', '2014/01/20', 'The Abila Post\n', 'ON THE SCENE BLOG\n', 'The Abila Post\nON THE SCENE BLOG\nBy Haneson Ngohebo\n20 January 2014\n930 20 January 2014 - This is Haneson Ngohebo here at the GAStech - Kronos headquarters live blogging the annual GAStech International meeting. At roughly 1000 the morning meeting will end and CEO Sten Sanjorge, Jr. and the executive group - Ingrid Barranco, Ada Campo-Corrente, Orhan Strum, and Willem Vasco-Pais - will proceed to a Kronos Government sponsored reception.\nWith the recent Initial Public Offering for GAStech International, the On the Scene Blog will be asking what this means for Abila and the people of Kronos especially in terms of reinvestment in infrastructure and job creation for the people of Kronos.\nAbila Post reporter Sara Tuno will be providing coverage from the Kronos Government reception for the GAStech leadership.');
INSERT INTO `article` VALUES (819, '835.txt', '1992/12/13', 'The General Post\n', 'THE KRONOS GOVERNMENT PLANS TAX BREAKAGE TO ANIMATE THE FOREIGN INVESTMENT\n', 'The General Post\nTHE KRONOS GOVERNMENT PLANS TAX BREAKAGE TO ANIMATE THE FOREIGN INVESTMENT\n1992/12/13\nAVILA, Kronos - the government of Kronos is planning at the moment some of the more abundant breakage of tax of the world for the investments of the gas. This will help to create the \"cheap energy\" that can give to the developing country a competitive advantage and a leg for above in the push of the government modernizing.\nWhereas the countries of the high-rent of Europe and the United States compete with taking advantage of to exist and the potential deposits of the gas, Kronos is gliding to provide incentives such as reduction of corporative and individual tax, preferential tariffs, and derogations of regulations as well as cheap, but of the force of impatient work.\nThe government of Kronos is throwing the plan as that the countries of the high-rent will fight to discover and to operate sources of fossil fuel always-diminution and of the Kronos gain-gains the given situation that becomes needs rent, the infrastructure, and the cheap energy.\nIt looks for companies of the energy to meet to Kronos.\n');
INSERT INTO `article` VALUES (820, '836.txt', '2009/03/12', 'International News\n', 'Activist Leader Karel Arrested for Tax Evasion \n', 'International News\nActivist Leader Karel Arrested for Tax Evasion \n2009/03/12\nABILA, Kronos - Kronos police arrested Elian Karel today on charges of tax evasion.  Karel, the leader of the activist group \"Protectors of Kronos\", was conducting a meeting with his supporters when he was arrested.  Karel\'s lawyer, Michale Kraft, released a statement declaring that the charges against his client were false and that he hoped to have Karel released from police custody by week\'s end.  It is clear that Elian Karel, who professes to have the interests of the people of Kronos at heart, must explain to us why he refuses to contribute to the welfare of his nation.\n');
