INSERT INTO `article` VALUES (834, '89.txt', '2012/06/20', 'International News\n', 'POK Anniversary Rally Ends in Riot \n', 'International News\nPOK Anniversary Rally Ends in Riot \n2012/06/20\nABILA, Kronos - POK members held a large demonstration in Abila yesterday.  Several dozen of their supporters held sit-ins in front of the capitol building and the presidential manor, while others took to the streets with their signs and chants.  Police called for the peaceful end to the sit-ins, but were answered with a barrage of rocks and bottles from the crowd.  The violence escalated into a full blown riot and police were forced to use tear gas, pepper spray, water cannons, and beanbags shot from shotguns to control the crowd.   \nBy the time the crowds finally dispersed, several government buildings had been vandalized, two police vehicles were ablaze, and the streets were littered with trash and broken glass.  Several protestors and police were injured, including one heroic police officer who was stabbed by a crazed protestor.\n');
