INSERT INTO `article` VALUES (840, '94.txt', '2014/01/20', 'Homeland Illumination\n', 'VOICES - a blog about what is important to the people\n', 'Homeland Illumination\nVOICES - a blog about what is important to the people\nMaha Salo\n20 January 2014\n1744 - Media reports are coming in that a number of GAStech employees were kidnapped.  The identity of the passengers on the mystery jet that departed earlier today from the Abila Airport remains unknown. 20 Jan 2014');
INSERT INTO `article` VALUES (841, '95.txt', '2009/06/20', 'News Online Today\n', 'ELIAN KAREL DEAD IN KRONOS JAIL \n', 'News Online Today\nELIAN KAREL DEAD IN KRONOS JAIL \n2009/06/20\nABILA, Kronos -Elian Karel, age 28, died Friday while unlawfully incarcerated at the Abila City Prison.  He was expecting to be released in the next few days and return to his work with the Protectors of Kronos, and was excited to continue the Protectors of Kronos mission to which he dedicated his life.  \nCalls to the President\'s office, the office of the Minister of Justice and the office of the Chief of Police were not immediately returned.\n');
INSERT INTO `article` VALUES (842, '96.txt', '2011/07/28', 'The Truth\n', 'POK Ge√´tiketteerdi a public threat\n', 'The Truth\nPOK Ge√´tiketteerdi a public threat\n2011/07/28\nABILA, Kronos - in a declaration to the press today, government spokesman Rufus Drymiau aforesaid of POK: they are justified a public threat to violent demonstrations, attribute opportunistic vandalism, and conflicts with the police force.  Violence and vandalism a trade mark of itself collecting POK has recently become.  They have thousands of dollars in damage to bldg. and ventures caused, showing have they little care for the benarde situation of people.  President Kapelou will not let their injury uncontested, aforesaid Drymiau continue.  \n');
INSERT INTO `article` VALUES (843, '97.txt', '1995/04/01', 'The General Post\n', 'TECHNIQUE THAT IT PERFORATES PROHIBITED IN TETHYS\n', 'The General Post\nTECHNIQUE THAT IT PERFORATES PROHIBITED IN TETHYS\n1995/04/01\nCENTER, Tethys - the international hyperactive acid retirement of the substratum of GAStech (HASR) has been prohibited officially by the government of Tethys due to the high probability of the contamination of the water. \nGAStech developed the technique that perforated innovator in 1974 absolutely proved guessed right for the extraction of the gas, but the consequences for environment of the technique are judged unacceptable by the government of Tethys due to the high probability of the contamination of the table of the water of the remainders produced during the HASR process.\nSten Sanjorge, Jr responded to will refr√°n of the interdiction, \"so is. The loss of Tethys will be increase of another county.\"\n');
INSERT INTO `article` VALUES (844, '98.txt', '1995/11/22', 'News Online Today\n', 'Araullo Announces New Hospital Construction \n', 'News Online Today\nAraullo Announces New Hospital Construction \n1995/11/22\nABILA, Kronos - President Araullo announced today that his government is planning the construction of a new, modern Abila General Hospital.  The old Abila General Hospital, built in 1930, has outdated health care facilities and has suffered numerous electrical fires in the past decade.  This new hospital is the first of many projects we plan to pursue to help upgrade our standard of living and modernize our lifestyle.\"\n');
INSERT INTO `article` VALUES (845, '99.txt', '2014/01/20', 'Modern Rubicon\n', 'ON SCENE BLOG\n', 'Modern Rubicon\nON SCENE BLOG\n20 January 2014\nMODERNIZATION 1545 - these \"dark\" figures are to the center of that what seems to be a event robbing with the victims who are the direction lacking GAStech. Currently we can only speculate on the people number to be involved. In the confusion from the evacuamento of the construction a conteggio exact of it employs you of GAStech is nearly impossible.');
